        /// <inheritdoc />
        protected override void Up(MigrationBuilder migrationBuilder)
        {
            migrationBuilder.InsertData(
                table: "Mangas",
                columns: new[] { "Id", "Background", "Chapters", "EndDate", "PosterUrl", "Rank", "Score", "StartDate", "Status", "Synopsis", "Title", "TitleEnglish", "TitleJapanese", "TypeId", "Url", "Volumes" },
                values: new object[,]
                {
                    { 1, "Monster won the Grand Prize at the third Tezuka Osamu Cultural Prize in 1999, as well as the 46th Shogakukan Manga Award in the General category in 2000. The series was published in English by VIZ Media under its VIZ Signature imprint from February 21, 2006, to December 16, 2008, and again in 2-in-1 omnibuses under the subtitle The Perfect Edition. The manga was also published in Brazilian Portuguese by Panini Comics from June 2012 to April 2015; in Polish by Hanami from March 28, 2014, to February 1, 2017; in Spain by Planeta Cómic from June 16, 2009, to September 21, 2010; in Argentina by Editorial Ivrea and LARP Editores; and in Turkey by Marmara Çizgi.", 162, new DateTime(2001, 12, 19, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/258224.jpg", 5, 9.16m, new DateTime(1994, 12, 4, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kenzou Tenma, a renowned Japanese neurosurgeon working in post-war Germany, faces a difficult choice: to operate on Johan Liebert, an orphan boy on the verge of death, or on the mayor of Düsseldorf. In the end, Tenma decides to gamble his reputation by saving Johan, effectively leaving the mayor for dead.\n\nAs a consequence of his actions, hospital director Heinemann strips Tenma of his position, and Heinemann's daughter Eva breaks off their engagement. Disgraced and shunned by his colleagues, Tenma loses all hope of a successful career—that is, until the mysterious killing of Heinemann gives him another chance.\n\nNine years later, Tenma is the head of the surgical department and close to becoming the director himself. Although all seems well for him at first, he soon becomes entangled in a chain of gruesome murders that have taken place throughout Germany. The culprit is a monster—the same one that Tenma saved on that fateful day nine years ago.\n\n[Written by MAL Rewrite]", "Monster", "Monster", "MONSTER", 1, "https://myanimelist.net/manga/1/Monster", 18 },
                    { 2, "Berserk won the Excellence Award at the sixth Tezuka Osamu Cultural Prize in 2002. As of September 2023, over 60 million copies of the manga are in circulation. The series has been published in English by Dark Horse Comics since November 4, 2003. It has also been released in Argentina, Brazil, Czech Republic, France, Germany, Greece, Hong Kong, Italy, México, Poland, South Korea, Spain, Taiwan, Thailand, and Turkey. In May 2021, the author Kentaro Miura suddenly died at the age of 54. Chapter 364 of Berserk was published posthumously on September 10, 2021. Miura would often share details about the series' story with his childhood friend and fellow mangaka Kouji Mori. The series resumed on June 24, 2022, with Studio Gaga handling the art and Kouji Mori's supervision.", null, null, "https://cdn.myanimelist.net/images/manga/1/157897.jpg", 1, 9.47m, new DateTime(1989, 8, 24, 17, 0, 0, 0, DateTimeKind.Local), 4, "Guts, a former mercenary now known as the Black Swordsman, is out for revenge. After a tumultuous childhood, he finally finds someone he respects and believes he can trust, only to have everything fall apart when this person takes away everything important to Guts for the purpose of fulfilling his own desires. Now marked for death, Guts becomes condemned to a fate in which he is relentlessly pursued by demonic beings.\n\nSetting out on a dreadful quest riddled with misfortune, Guts, armed with a massive sword and monstrous strength, will let nothing stop him, not even death itself, until he is finally able to take the head of the one who stripped him—and his loved one—of their humanity.\n\n[Written by MAL Rewrite]\n\nIncluded one-shot:\nVolume 14: Berserk: The Prototype", "Berserk", "Berserk", "ベルセルク", 1, "https://myanimelist.net/manga/2/Berserk", null },
                    { 3, "20th Century Boys won the Kodansha Manga Award in the general category in 2001, an Excellence Prize at the Japan Media Arts Festival in 2002, and the Shogakukan Manga Award in the general category in 2003. The series' combined storyline won the Grand Prize at the 37th Japan Cartoonist Awards on May 9, 2008. VIZ Media published the series in English under the VIZ Signature imprint from February 17, 2009 to September 18, 2012. VIZ Media licensed the series in 2005; however, at Urasawa's request, it was rescheduled for release after Monster finished its English publication due to a change in art style over time. It was also published as 2-in-1 omnibus volumes from September 18, 2018 to March 16, 2021. The series has also been published in Brazilian Portuguese by Panini Comics/Planet Manga since September 2012. The series was adapted into a trilogy of live-action films which released in Japan between August 30, 2008 and August 29, 2009.", 249, new DateTime(2006, 4, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/260006.jpg", 16, 8.94m, new DateTime(1999, 9, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "As the 20th century approaches its end, people all over the world are anxious that the world is changing. And probably not for the better.\n\nKenji Endo is a normal convenience store manager who's just trying to get by. But when he learns that one of his old friends going by the name \"Donkey\" has suddenly committed suicide, and that a new cult led by a figure known as \"Friend\" is becoming more notorious, Kenji starts to feel that something isn't right. With a few key clues left behind by his deceased friend, Kenji realizes that this cult is much more than he ever thought it would be—not only is this mysterious organization directly targeting him and his childhood friends, but the whole world also faces a grave danger that only the friends have the key to stop.\n\nKenji's simple life of barely making ends meet is flipped upside down when he reunites with his childhood friends, and together they must figure out the truth of how their past is connected to the cult, as the turn of the century could mean the possible end of the world.\n\n[Written by MAL Rewrite]", "20th Century Boys", "20th Century Boys", "20世紀少年", 1, "https://myanimelist.net/manga/3/20th_Century_Boys", 22 },
                    { 4, "Yokohama Kaidashi Kikou won the Seiun Award for Best Manga in 2007. Three drama CDs were released in 2002. In all three, Alpha is voiced by Hekiru Shiina and Kokone by Akiko Nakagawa, both of whom voiced the same characters in the two OVA series. The series was published in English by Seven Seas Entertainment in five omnibus volumes from August 9, 2022, to August 6, 2024.", 142, new DateTime(2006, 2, 24, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/171813.jpg", 71, 8.65m, new DateTime(1994, 4, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "In a post-apocalyptic world where an environmental disaster led to the eruption of Mt. Fuji and the inundation of Yokohama, the age of humans is in its twilight. Alpha Hatsuseno is an android and the namesake of a small cafe outside Yokohama. As her owner is away on a trip indefinitely, she has been left responsible for running the cafe. Although she rarely gets any customers, Alpha remains outgoing and cheerful.\n\nWhile Alpha awaits her owner's homecoming, she explores the vicinity with her scooter and camera. Throughout her journeys, she meets new people and other androids, making memories along the way.\n\nYokohama Kaidashi Kikou is a beautiful, laid-back story centered around Alpha's daily activities, emphasizing the passing of time in everyday life.\n\n[Written by MAL Rewrite]", "Yokohama Kaidashi Kikou", "Yokohama Kaidashi Kikou", "ヨコハマ買い出し紀行", 1, "https://myanimelist.net/manga/4/Yokohama_Kaidashi_Kikou", 14 },
                    { 7, "Hajime no Ippo won the 15th Kodansha Manga Award in the Shounen category in 1991. As of July 2023, over 100 million copies of the series are in circulation. The series has been published digitally in English as Hajime no Ippo: Fighting Spirit! by Kodansha USA through K Manga.", null, null, "https://cdn.myanimelist.net/images/manga/2/250313.jpg", 53, 8.73m, new DateTime(1989, 9, 26, 17, 0, 0, 0, DateTimeKind.Local), 4, "Makunouchi Ippo is a 16-year-old high school student who helps his mother run the family business. His hefty workload impedes his social life, making him an easy target for bullies. One day, while being beaten up by a group of high school students, Ippo is saved by a boxer named Mamoru Takamura, and is brought to the Kamogawa Boxing Gym.\n\nThis afterschool bullying session turns his life around for the better, as Ippo discovers his latent talent for boxing and decides to practice the sport professionally. However, Mamoru doubts Ippo's determination and assigns him a task deemed impossible to complete; but the resolute Ippo trains tirelessly to fulfill his mission. Along the way, he finds out what it means to attain true strength while making new friends and fighting formidable foes.\n\n[Written by MAL Rewrite]", "Hajime no Ippo", "Hajime no Ippo: Fighting Spirit!", "はじめの一歩", 1, "https://myanimelist.net/manga/7/Hajime_no_Ippo", null },
                    { 8, "Full Moon wo Sagashite was published in English as Full Moon by VIZ Media under its Shojo Beat imprint from July 5, 2005, to October 3, 2006. It was also released in French by Glénat from December 17, 2005, to November 22, 2006; in Spanish by Grupo Editorial Vid from October 26, 2006, to April 19, 2007; and in Brazilian Portuguese by Editora JBC from May 2009 to November 2009.", 35, new DateTime(2004, 4, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/175970.jpg", 702, 8.02m, new DateTime(2001, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "At the tender age of 12, Mitsuki Kouyama has a sarcoma in her throat. Though this rare cancer can be cured by removing her vocal cords, Mitsuki refuses because of her desire to become a pop singer and keep her childhood promise to Eichi Sakurai, her first love who left for America. Unable to both heal and keep her voice, she allows her health to deteriorate, as she accepts her tragic fate.\n\nOne day, while escaping the home of her music-hating grandmother to attend an audition, Mitsuki meets two shinigami, Takuto Kira and Meroko Yui. Realizing that Mitsuki can see them, Takuto and Meroko reveal to her that she will die in a year. Moved by her plight, Takuto allows Mitsuki the chance to pursue her dream by giving her the ability to transform into a healthy sixteen-year-old girl. After being chosen for a contract with Seed Records, Mitsuki makes her debut under the stage name Full Moon and chooses to pursue her dream music career before her life's end.\n\n[Written by MAL Rewrite]\n\n\nIncluded one-shot:\nVolume 2: Ginyuu Meika", "Full Moon wo Sagashite", "Full Moon wo Sagashite", "満月〈フルムーン〉をさがして", 1, "https://myanimelist.net/manga/8/Full_Moon_wo_Sagashite", 7 },
                    { 9, "Tsubasa: RESERVoir CHRoNiCLE is set in the same universe as other CLAMP works, most notably xxxHOLiC. Characters in the series follow Osamu Tezuka's star system principle, in which characters with the same name and design are reused in different settings. The series was published in English by Del Rey Comics from April 27, 2004, to November 23, 2010. Kodansha Comics USA republished the series in 10 omnibus volumes from August 19, 2014, to October 18, 2016. It was also released in Brazilian Portuguese by Editora JBC in 56 volumes from April 2006 to September 2011.", 233, new DateTime(2009, 10, 6, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/272410.jpg", 311, 8.29m, new DateTime(2003, 5, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "Warmhearted Syaoran has always been friends with Sakura—the princess of the Clow Kingdom who holds an extraordinary power capable of changing the world. When a mysterious man attempts to monopolize Sakura's ability, her memories scatter throughout different worlds in the form of feathers. To save Sakura, Syaoran seeks help from the Dimensional Witch and meets two other travelers—Kurogane and Fai D. Flourite.\n\nKurogane, a capable fighter and ninja, has been banished from his homeworld and wishes to return. In contrast, Fai, a magician from Celes, wants to traverse different worlds to avoid his home and past. As the price to cross dimensions, each of the three must sacrifice their most valued possession. For Sakura's sake, Syaoran agrees to give away their relationship as payment to the Dimensional Witch. With firm determination, Syaoran, Kurogane, and Fai begin journeying through numerous worlds to fight against their ill-fated destinies.\n\n[Written by MAL Rewrite]", "Tsubasa: RESERVoir CHRoNiCLE", "Tsubasa: RESERVoir CHRoNiCLE", "ツバサ -RESERVoir CHRoNiCLE-", 1, "https://myanimelist.net/manga/9/Tsubasa__RESERVoir_CHRoNiCLE", 28 },
                    { 10, "xxxHOLiC was published in English by Del Rey Manga from April 27, 2004, to February 21, 2012. Kodansha Comics USA republished the series in omnibus volumes from March 18, 2014, to September 8, 2015, with the final two volumes being 2-in-1 while the rest being 3-in-1. It was also published in Spain by Norma Editorial from July 2004 to October 2011; in Brazilian Portuguese by Editora JBC in 38 volumes from March 2006 to October 2011; and in Mexico by Editorial Kamite from October 27, 2018, to April 19, 2024.", 213, new DateTime(2011, 2, 8, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/217533.jpg", 241, 8.37m, new DateTime(2003, 2, 23, 16, 0, 0, 0, DateTimeKind.Local), 2, "Living alone after his parents passed away, Kimihiro Watanuki is a high school student who can see otherworldly creatures that are attracted to him. His days are plagued by these nuisances, and he wishes to rid himself of this inconvenience. One fateful day, as Kimihiro is being chased by a horde of spirits, his feet bring him into a mysterious store to seek shelter. Here he meets Yuuko Ichihara, the mistress of this supposed store, who claims to be able to grant wishes. Yuuko offers to grant Kimihiro's, as long as he pays an appropriate price.\n\nThus begins Kimihiro's time working in her store to earn the payment necessary for his wish. In Yuuko's employ, he must become further involved with spirits and the supernatural before he can leave that world behind. How will he fare in the inexplicable encounters that await him?\n\n[Written by MAL Rewrite]", "xxxHOLiC", "xxxHOLiC", "xxxHOLiC", 1, "https://myanimelist.net/manga/10/xxxHOLiC", 19 },
                    { 11, "Naruto has sold over 250 million copies worldwide as of 2020, making it the 4th highest-grossing manga series of all time. It was nominated for the 19th Tezuka Osamu Cultural Prize in 2014, and in the same year, Masashi Kishimoto was awarded Rookie of the Year in the media fine arts category by Japan's Agency for Cultural Affairs. The series was published in English by VIZ Media under the Shonen Jump imprint from August 16, 2003, to October 6, 2015. In the last four months of 2007, the campaign titled Naruto Nation was launched, in which three volumes were published each month so that US releases would be closer to Japan's. The same practice was done in February through April of 2009, this time titled Generation Ninja. A 3-in-1 omnibus edition was later released. A box set containing volumes 1 through 27 was released on August 6, 2008, a set containing volumes 28 through 48 on July 7, 2015, and the final box set with volumes 49 through 72 on January 5, 2016. It was also published in Brazilian Portuguese by Panini Comics from May 2007 to June 2015; in German by Carlsen Verlag; and in French and Dutch by Kana. Numerous databooks, artbooks, novels, and fanbooks on the series have been released. Eight summary volumes featuring unaltered color pages, larger dimensions, and exclusive interviews, covering the first part of the series were released between November 7, 2008, and April 10, 2009.", 700, new DateTime(2014, 11, 9, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/249658.jpg", 619, 8.07m, new DateTime(1999, 9, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "Whenever Naruto Uzumaki proclaims that he will someday become the Hokage—a title bestowed upon the best ninja in the Village Hidden in the Leaves—no one takes him seriously. Since birth, Naruto has been shunned and ridiculed by his fellow villagers. But their contempt isn't because Naruto is loud-mouthed, mischievous, or because of his ineptitude in the ninja arts, but because there is a demon inside him. Prior to Naruto's birth, the powerful and deadly Nine-Tailed Fox attacked the village. In order to stop the rampage, the Fourth Hokage sacrificed his life to seal the demon inside the body of the newborn Naruto.\n\nAnd so when he is assigned to Team 7—along with his new teammates Sasuke Uchiha and Sakura Haruno, under the mentorship of veteran ninja Kakashi Hatake—Naruto is forced to work together with other people for the first time in his life. Through undergoing vigorous training and taking on challenging missions, Naruto must learn what it means to work in a team and carve his own route toward becoming a full-fledged ninja recognized by his village.\n\n[Written by MAL Rewrite]", "Naruto", "Naruto", "NARUTO―ナルト―", 1, "https://myanimelist.net/manga/11/Naruto", 72 },
                    { 12, "Bleach has sold over 130 million copies worldwide as of 2022, making it one of the top 20 best selling manga series of all-time; North American sales have also been significant with 1.7 million copies sold in the region. In 2005, the series won the 50th Shogakukan Manga Award in the shounen demographic category. Many adaptations have also been made of the series, with a 2004 television anime series along with four feature length films, numerous video games, spin-off light novels, databooks, and even a musical. The series was published in English by VIZ Media under the Shonen Jump imprint from July 6, 2004 to October 2, 2018, and as omnibus volumes from June 7, 2011 to March 5, 2019; a hardcover collector's edition for volume one was released by VIZ Media on August 5, 2008, a box set of volumes 1-21 was released on September 16, 2008 as well as volumes 22-48 on July 7, 2015, and the final box set containing volumes 49-72 on November 6, 2018. It has also been published in Portuguese (Brazil) by Panini Comics and Planet Manga since July 2007, and in Spanish by Glénat/EDT since June 2006, publishing 51 volumes before the publisher went defunct, and later was republished by Panini Comics from February 2013 to November 2017. Bleach was adapted into a live-action movie on July 20, 2018.", 705, new DateTime(2016, 8, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/180031.jpg", 1028, 7.88m, new DateTime(2001, 8, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "For as long as he can remember, high school student Ichigo Kurosaki has been able to see the spirits of the dead, but that has not stopped him from leading an ordinary life. One day, Ichigo returns home to find an intruder in his room who introduces herself as Rukia Kuchiki, a Soul Reaper tasked with helping souls pass over. Suddenly, the two are jolted from their conversation when a Hollow—an evil spirit known for consuming souls—attacks. As Ichigo makes a brash attempt to stop the Hollow, Rukia steps in and shields him from a counterattack. Injured and unable to keep fighting, Rukia suggests a risky plan—transfer half of her Soul Reaper powers to Ichigo. He accepts and, to Rukia's surprise, ends up absorbing her powers entirely, allowing him to easily dispatch the Hollow.\n\nNow a Soul Reaper himself, Ichigo must take up Rukia's duties of exterminating Hollows and protecting spirits, both living and dead. Along with his friends Orihime Inoue and Yasutora Sado—who later discover spiritual abilities of their own—Ichigo soon learns that the consequences of becoming a Soul Reaper and dealing with the world of spirits are far greater than he ever imagined.\n\n[Written by MAL Rewrite]", "Bleach", "Bleach", "BLEACH", 1, "https://myanimelist.net/manga/12/Bleach", 74 },
                    { 13, "One Piece is the highest-selling manga series of all time, with over 500 million copies in circulation as of 2022. Volume 67 of the series currently holds the record for highest first print run of any manga or book of all time in Japan, with 4.05 million in 2012. The series was a finalist for the Tezuka Osamu Cultural Prize three times in a row from 2000 to 2002. In 2012, it won the 41st Japan Cartoonists Association Award Grand Prize, alongside Kimuchi Yokoyama's Neko Darake. VIZ Media has published One Piece in English under the Shonen Jump imprint since January 2, 2003, and in 3-in-1 omnibus editions since December 1, 2009. VIZ Media has been publishing boxed sets for the manga since November 5, 2013. It has also been simulpub through MANGA Plus. The series has also been published in numerous amounts of languages worldwide including Korean, Malay, Indonesian, Chinese, Thai, Vietnamese, German, French, Italian, Spanish, Portuguese, Swedish, Danish, Norwegian, Finnish, Polish, Turkish, and Russian. The manga has been adapted into a live-action TV series on Netflix since August 31, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/2/253146.jpg", 4, 9.22m, new DateTime(1997, 7, 21, 17, 0, 0, 0, DateTimeKind.Local), 4, "Gol D. Roger, a man referred to as the King of the Pirates, is set to be executed by the World Government. But just before his demise, he confirms the existence of a great treasure, One Piece, located somewhere within the vast ocean known as the Grand Line. Announcing that One Piece can be claimed by anyone worthy enough to reach it, the King of the Pirates is executed and the Great Age of Pirates begins.\n\nTwenty-two years later, a young man by the name of Monkey D. Luffy is ready to embark on his own adventure, searching for One Piece and striving to become the new King of the Pirates. Armed with just a straw hat, a small boat, and an elastic body, he sets out on a fantastic journey to gather his own crew and a worthy ship that will take them across the Grand Line to claim the greatest status on the high seas.\n\n[Written by MAL Rewrite]", "One Piece", "One Piece", "ONE PIECE", 1, "https://myanimelist.net/manga/13/One_Piece", null },
                    { 14, "Rave was published in English by Tokyopop as Rave Master for 32 volumes from February 11, 2003 to February 10, 2009, until their license with Kodansha expired. Del Rey later gained the license and published the final three volumes in a single omnibus on May 24, 2011. Kodansha Comics USA digitally published the entire series in single volumes on October 3, 2017. It was also published in Spanish by Norma Editorial from February 2004 to February 2010.", 298, new DateTime(2005, 7, 26, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/255624.jpg", 1153, 7.84m, new DateTime(1999, 7, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "Fifty years ago, the wielders of the sacred Rave stones fought against an onslaught caused by demon stones called Dark Bring. This war resulted in an explosion known as \"Overdrive\"—a blast so powerful that it sent the Dark Bring into a deep slumber and scattered the pieces of Rave across the world.\n\nIn the present, Haru Glory lives a peaceful life on Garage Island until one day, he catches the creature Plue while fishing. Plue is later recognized by Shiba Roses, an old man who happens to be the original Rave Master. Shiba explains that the Dark Bring has resurfaced, and that to stop it, assembling the scattered parts of Rave is of utmost urgency. However, before Shiba can leave on this mission, he is attacked by a soldier from the evil organization Demon Card, forcing him to transfer the power of Rave to Haru. With the fate of humankind resting on his shoulders, the new Rave Master begins his quest to find the scattered Rave fragments.\n\n[Written by MAL Rewrite]", "Rave", "Rave Master", "RAVE", 1, "https://myanimelist.net/manga/14/Rave", 35 },
                    { 15, "The first 27 volumes of Mahou Sensei Negima! were published in English as Negima! by Del Rey Comics from April 27, 2004, to July 27, 2010. Kodansha Comics USA picked up the license and published volumes 28 through 38 from October 2, 2012, to April 23, 2013, as well as republishing the previous volumes in nine omnibus volumes from June 14, 2011, to February 11, 2014. It was also released in Brazilian Portuguese by Editora JBC in 76 volumes from January 2006 to February 2013.", 355, new DateTime(2012, 3, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/259286.jpg", 937, 7.91m, new DateTime(2003, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Negi Springfield, a 10-year-old wizard who recently graduated from Merdiana Magic Academy in Wales, hopes to achieve two things—to find his missing father, who was once known as the Thousand Master, and to become a Magister Magi, someone who helps the everyday world through magic. To reach his latter goal, he is assigned one last task: to teach English at a middle school in Japan.\n\nMuch to his surprise and dismay, he not only discovers that his homeroom class consists of 31 girls, but also ends up revealing his true identity as a magician to Asuna Kagurazaka, one of his new students. Negi must now negotiate with the girl and face his most difficult challenge yet—to keep his identity a secret as he tackles magical threats both from within and outside of Mahora Academy, all the while keeping a watchful eye out for his lost father.\n\n[Written by MAL Rewrite]", "Mahou Sensei Negima!", "Negima! Magister Negi Magi", "魔法先生ネギま!", 1, "https://myanimelist.net/manga/15/Mahou_Sensei_Negima", 38 },
                    { 16, "Love Hina won the 25th Kodansha Manga Award in the Shounen category in 2001. The series was published in English by Tokyopop from May 21, 2002, to September 16, 2003. Kodansha Comics USA republished the series in 5-in-1 omnibus volumes from October 25, 2011, to March 26, 2013. It was also released in Brazilian Portuguese by Editora JBC in 28 volumes from May 2002 to August 2003.", 120, new DateTime(2001, 10, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/259287.jpg", 1363, 7.78m, new DateTime(1998, 10, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "It is said that if a couple gets into the University of Tokyo together, they will live happily ever after. However, for Keitarou Urashima, UTokyo is a distant dream. After failing the entrance exams twice already, he decides to stay at his grandmother's inn in Tokyo in order to prepare for his third attempt. He is, therefore, surprised when he finds out that not only has his grandmother gone on a long vacation, but the inn has also become the Hinata House, an all-girls dormitory!\n\nUnfortunately for Keitarou, a series of misunderstandings during his first visit leave him with five untrusting tenants. But when Haruka Urashima, his aunt who works at the dorm, brings up that he is supposedly a UTokyo student, the girls' impressions of him quickly change, and they reluctantly allow him to stay. Feeling guilty about the lie, he slowly gets to know his new neighbors: the cute yet violent Naru Narusegawa, the cheeky and opportunistic Mitsune Konno, the soft-spoken Shinobu Maehara, the straight-laced Motoko Aoyama, and the mischievous Kaolla Su.\n\nThus continues the unpopular Keitarou's difficult journey to get into UTokyo, all for the chance to fulfill his childhood promise to the only girl who has ever shown any interest in him and maybe, just maybe, meet her again.\n\n[Written by MAL Rewrite]", "Love Hina", "Love Hina", "ラブひな", 1, "https://myanimelist.net/manga/16/Love_Hina", 14 },
                    { 17, "Kareshi Kanojo no Jijou was published in English as Kare Kano: His and Her Circumstances by TokyoPop from January 21, 2003 to January 9, 2007.", 108, new DateTime(2005, 5, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/267780.jpg", 512, 8.14m, new DateTime(1995, 12, 21, 16, 0, 0, 0, DateTimeKind.Local), 2, "Yukino Miyazawa is the perfect model student. Pretty, kind, good at sports, always at the top of her class. But she's not all that she seems. It's all an act of deception; she is really the self-confessed 'queen of vanity,' and her only goal in life is winning the praise and admiration of everyone around her.\n\nWhen she enters high school, she finally meets her match: Souichirou Arima, a handsome, athletic, popular, and very intelligent young boy. Ever since he stole the top seat in the class from her, Yukino has hated him, and has been plotting on how to take back her former place as the object of all other students' admiration.\n\nWhat she wasn't expecting, however, was that Souichirou, the very boy she hated, would confess his love for her. Or that he would find out about her deception—and use it to blackmail her!\n\nTogether, they discover that they have more in common than they knew, and they slowly begin to bring out each other's inner selves.\n\n(Source: MU)\n\nIncluded one-shots:\nVolume 1: Tora to Chameleon: Yakusoku wa Isshukan (The Tiger and the Chameleon: A Promise for One Week)\nVolume 4: Ashita Mata Mori de Aou ne (Meet Me Again Tomorrow in the Forest)\nVolume 8: Abareru Ousama (The Raging King)", "Kareshi Kanojo no Jijou", "Kare Kano: His and Her Circumstances", "彼氏彼女の事情", 1, "https://myanimelist.net/manga/17/Kareshi_Kanojo_no_Jijou", 21 },
                    { 18, "Kodomo no Omocha won the 22nd Kodansha Manga Award in the Shoujo category in 1998. The series was published in English as Kodocha: Sana's Stage by Tokyopop from June 11, 2002, to November 11, 2003.", 54, new DateTime(1998, 10, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/267715.jpg", 312, 8.29m, new DateTime(1994, 7, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "Sana Kurata, a child actress, faces many problems in her classroom, including a major one - her bullying classmate, Akito Hayama. Sana's outgoing and friendly nature leads her to work towards correcting all of the problems around her. Her 'meddling' irritates Hayama but at the same time captivates him, just as Hayama's gloomy nature irritates Sana and compels her to change him. As these two opposites attract each other, they face many hardships which bring them closer to a mutual understanding.\n\n(Source: ANN)", "Kodomo no Omocha", "Kodocha: Sana's Stage", "こどものおもちゃ", 1, "https://myanimelist.net/manga/18/Kodomo_no_Omocha", 10 },
                    { 19, "The first 28 volumes of GetBackers were published in English by Tokyopop from February 10, 2004, to March 10, 2009, until their license with Kodansha expired.", 344, new DateTime(2007, 2, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/169369.jpg", 2208, 7.61m, new DateTime(1999, 3, 23, 16, 0, 0, 0, DateTimeKind.Local), 2, "Blonde, hip, pragmatic and cool, Ginji Amano has the power to generate currents with his body like an electric eel. Brunette, equally hip, bespectacled and rambunctious, Ban Mido has the mystically mysterious 'Evil Eye,' the power to create illusions in the minds of his foes. Together, they are the GetBackers, the best retrieval team in the world. They can get back anything taken from clients, and their success rate is (almost) 100%! However, first they have to get some clients—and soon—or this spry detective duo will starve on the streets!\n\n(Source: Tokyopop)", "GetBackers", "GetBackers", "GetBackers -奪還屋-", 1, "https://myanimelist.net/manga/19/GetBackers", 39 },
                    { 20, "Hikaru no Go won the 45th Shogakukan Manga Award in the Shounen category in 2000. The series also won the Creative Award at the seventh Tezuka Osamu Cultural Prize in 2003. The series was published in English by VIZ Media under the Shonen Jump imprint from May 19, 2004, to May 3, 2011. It was also released in Brazilian Portuguese by Editora JBC from January 2010 to July 2012.", 198, new DateTime(2003, 7, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/170574.jpg", 540, 8.12m, new DateTime(1998, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), 2, "When Hikaru Shindou discovers an old go board in his grandfather's attic, he is greeted by the spirit of an ancient go master, Fujiwara no Sai. Sai spent his life teaching the techniques of the board game to an emperor during the Heian era, and now in his ghostly state, he is eager to share his passion with the unsuspecting Hikaru. The only problem is that Hikaru is not all that interested in board games. But Sai is not easily dissuaded. Pressured by Sai's unrelenting desire to pursue something he refers to as the \"Divine Move,\" Hikaru begrudgingly consents to playing the game, executing moves as dictated by Sai. But slowly, intrigued by the dedication of his peers, he begins to learn the basics of the game.\n\nAs Hikaru enters into the world of go, guided by his intangible tutor and inspired by his rival, Akira Touya, he cannot help but be drawn into the complex game as he grows determined to prove his own abilities. In a coming-of-age story centering around an ancient board game, Hikaru no Go tells the story of a boy maturing through the pursuit of his newfound passion.\n\n[Written by MAL Rewrite]", "Hikaru no Go", "Hikaru no Go", "ヒカルの碁", 1, "https://myanimelist.net/manga/20/Hikaru_no_Go", 23 },
                    { 21, "Death Note ranked second in the 2006 and 2007 Kono Manga ga Sugoi! for the Male Readers division. It was nominated for the 38th Seiun Award in the Best Comic category in 2007. In the same year, it was also nominated for the 11th Tezuka Osamu Cultural Prize. As of April 2015, over 30 million copies of the manga are in circulation. The manga was published in English by VIZ Media under the Shonen Jump Advanced imprint from October 10, 2005, to July 3, 2007, and again in 2-in-1 omnibus volumes subtitled Black Edition. There have been several more rereleases of the series: a special hardcover edition of the first volume; a complete box set, which included a guidebook titled Death Note 13: How to Read; and a complete omnibus. It was also published in Italian by Panini Comics from October 19, 2006, to September 18, 2008; in Brazilian Portuguese by Editora JBC from June 2007 to June 2008; in German by Tokyopop from September 2006 to March 2009; in French by Kana from January 19, 2007, to October 9, 2008; in Dutch by Kana; in Argentina by LARP Editores from May 20, 2009, to April 2012; and in Spanish by Glénat España from June 30, 2006, to September 30, 2007. The series was adapted into three live-action films, a TV drama series, and a stage musical. It has also inspired other works and copycat crimes outside Japan, leading to various controversies.", 108, new DateTime(2006, 5, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/258245.jpg", 61, 8.69m, new DateTime(2003, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ryuk, a god of death, drops his Death Note into the human world for personal pleasure. In Japan, prodigious high school student Light Yagami stumbles upon it. Inside the notebook, he finds a chilling message: those whose names are written in it shall die. Its nonsensical nature amuses Light; but when he tests its power by writing the name of a criminal in it, they suddenly meet their demise.\n\nRealizing the Death Note's vast potential, Light commences a series of nefarious murders under the pseudonym \"Kira,\" vowing to cleanse the world of corrupt individuals and create a perfect society where crime ceases to exist. However, the police quickly catch on, and they enlist the help of L—a mastermind detective—to uncover the culprit.\n\nDeath Note tells the thrilling tale of Light and L as they clash in a great battle-of-minds, one that will determine the future of the world.\n\n[Written by MAL Rewrite]", "Death Note", "Death Note", "DEATH NOTE", 1, "https://myanimelist.net/manga/21/Death_Note", 12 },
                    { 22, "As of December 2019, over 72 million copies of Rurouni Kenshin: Meiji Kenkaku Romantan are in circulation. The series was published in English as Rurouni Kenshin by VIZ Media under the Shonen Jump imprint from December 23, 2003, to July 5, 2006, and again in 3-in-1 omnibus volumes under the Shonen Jump VIZBIG imprint from January 29, 2008, to March 16, 2010. VIZ Media later rereleased the series in new 3-in-1 omnibus volumes. It was also published in Brazilian Portuguese by Editora JBC as Samurai X in 56 volumes from May 2001 to November 2003.", 259, new DateTime(1999, 9, 20, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/127583.jpg", 123, 8.54m, new DateTime(1994, 4, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "Ten years have passed since the end of Bakumatsu, an era of war that saw the uprising of citizens against the Tokugawa shogunate. The revolutionaries wanted to create a time of peace, and a thriving country free from oppression. The new age of Meiji has come, but peace has not yet been achieved. Swords are banned but people are still murdered in the streets. Orphans of war veterans are left with nowhere to go, while the government seems content to just line their pockets with money.\n\nOne wandering samurai, Kenshin Himura, still works to make sure the values he fought for are worth the lives spent to bring about the new era. Once known as Hitokiri Battousai, he was feared as the most ruthless killer of all the revolutionaries. Now haunted by guilt, Kenshin has sworn never to kill again in atonement for the lives he took, and he may never know peace until killing is a thing of the past.\n\nNow in the 11th year of Meiji, Kenshin stumbles upon Kaoru Kamiya, owner and head instructor of a small dojo being threatened to close its doors. The police force is powerless to stop the string of murders done in the name of her dojo by a man claiming to be the famous Battousai. Kenshin's wanderings pause for now as he joins Kaoru to clear both their names. But how long can he stay before his past catches up to him?\n\n[Written by MAL Rewrite]\n\nIncluded one-shot:\nVolume 28: Meteor Strike", "Rurouni Kenshin: Meiji Kenkaku Romantan", "Rurouni Kenshin: Meiji Swordsman Romantic Story", "るろうに剣心 -明治剣客浪漫譚-", 1, "https://myanimelist.net/manga/22/Rurouni_Kenshin__Meiji_Kenkaku_Romantan", 28 },
                    { 23, "Ranma ½ was published in English by VIZ Media from May 1993 to November 16, 2006. It was VIZ's longest-running manga at the release of its final volume. It was republished in 2-in-1 omnibus volumes in the original right-to-left format by VIZ Media under the Shonen Sunday imprint from March 11, 2014, to March 14, 2017. The series was also partially published in Spanish by Glénat España from December 2011 to June 2013, before the publisher went defunct. Planeta Cómic published the full series in 2-in-1 omnibus volumes from April 28, 2016, to July 24, 2018. The manga was also released in Brazilian Portuguese by Editora JBC from September 2009 to April 2013.", 407, new DateTime(1996, 2, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/156534.jpg", 762, 7.99m, new DateTime(1987, 8, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "Soun Tendou runs the Tendou Martial Arts School accompanied by his three daughters: Akane, Nabiki, and Kasumi. One day, the sisters' lives are turned upside down when their father announces that he has promised one of them to be married to a fellow martial artist's son in hopes of carrying on the family legacy. In addition to their mixed reactions, when the fiancé arrives, the last thing the Tendou family expects is Ranma Saotome and his father, Genma.\n\nRanma has been training in China with his father until an unfortunate accident changed them both. Now, when water touches them, Ranma turns into a girl and Genma into a giant panda. Ranma ½ follows Ranma as he attempts to get along with his newly betrothed, the youngest of the Tendou sisters, Akane. As the two begin to attend the same school, they deal with fellow friends and rivals, all of whom have something to say about their engagement.\n\n[Written by MAL Rewrite]", "Ranma ½", "Ranma 1/2", "らんま½", 1, "https://myanimelist.net/manga/23/Ranma_½", 38 },
                    { 24, "D.Gray-man has been published in English by VIZ Media under the Shonen Jump Advanced imprint since May 2, 2006 and in 3-in-1 omnibus editions since July 2, 2013. It has been also published in Spanish, first the first 23 volumes by Glénat until August 2012, when Shueisha broke the contract with Glénat, and then by Ivrea since July 2013, re-editing the first 23 volumes and simultaneously publishing new volumes; and in Italian by Panini Comics under the Planet Manga imprint since July 20, 2006.", null, null, "https://cdn.myanimelist.net/images/manga/3/240470.jpg", 324, 8.28m, new DateTime(2004, 5, 30, 17, 0, 0, 0, DateTimeKind.Local), 4, "Thousands of years ago, there existed those gifted with the power of God. Their mission: to destroy the ominous evils that lurk in the darkness known as \"Akuma.\" Led by the Milenium Earl, Akuma seek to destroy fragments of \"Innocence,\" the only weapons capable of harming the Earl and his army and bring about the Great Flood from a hundred years ago. \n\nTo prevent this tragedy from happening, the Black Order was formed as an organization dedicated to fighting the Earl. They recruit Exorcists, those with the inherent ability to accomodate Innocence, to fight against the Akuma.\n\nIn the late 19th century, Allen Walker—a white-haired boy armed with Innocence that takes the form of his entire left arm and a cursed eye that can see Akuma—is sent to the Black Order. There, Allen meets various comrades from the Order—the mercurial Yuu Kanda, the kindhearted Lenalee Lee, and the cheerful yet mysterious Lavi. Despite their different personalities, they have one goal in mind: to bring salvation to the souls of Akuma and prevent the Earl from destroying the world.\n\n[Written by MAL Rewrite]", "D.Gray-man", "D.Gray-man", "D.Gray-man", 1, "https://myanimelist.net/manga/24/DGray-man", null },
                    { 25, "Fullmetal Alchemist won the 49th Shogakukan Manga Award in the Shounen category in 2003, along with Yakitate!! Japan. Hiromu Arakawa also won the 15th Tezuka Osamu Cultural Prize in the New Artist Prize category for the series in 2011. In the same year, the manga won the Seiun Award in the Best Comic category. As of July 2021, over 80 million copies of the series have been sold worldwide. The series was published in English by VIZ Media from May 3, 2005, to December 20, 2011, and digitally by Yen Press on April 15, 2014. A 3-in-1 omnibus edition and complete box set, which included the novel Fullmetal Alchemist: Sorezore no Kizuna, were later released by VIZ Media. The manga was also published in Italian by Panini Comic from July 13, 2006, to September 3, 2011; in Polish by Japonica Polonica Fantastica from January 2006 to April 2012; in Brazilian Portuguese by Editora JBC in 54 volumes from February 2007 to April 2011; in Argentina by Editorial Ivrea from December 9, 2016, to March 21, 2019; and in Spain by Norma Editorial.", 116, new DateTime(2010, 9, 10, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/243675.jpg", 8, 9.04m, new DateTime(2001, 7, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "Alchemists are knowledgeable and naturally talented individuals who can manipulate and modify matter due to their art. Yet despite the wide range of possibilities, alchemy is not as all-powerful as most would believe. Human transmutation is strictly forbidden, and whoever attempts it risks severe consequences. Even so, siblings Edward and Alphonse Elric decide to ignore this great taboo and bring their mother back to life. Unfortunately, not only do they fail in resurrecting her, they also pay an extremely high price for their arrogance: Edward loses his left leg and Alphonse his entire body. Furthermore, Edward also gives up his right arm in order to seal his brother's soul into a suit of armor.\n\nYears later, the young alchemists travel across the country looking for the Philosopher's Stone, in the hopes of recovering their old bodies with its power. However, their quest for the fated stone also leads them to unravel far darker secrets than they could ever imagine.\n\n[Written by MAL Rewrite]", "Fullmetal Alchemist", "Fullmetal Alchemist", "鋼の錬金術師", 1, "https://myanimelist.net/manga/25/Fullmetal_Alchemist", 27 },
                    { 26, "As of July 2022, over 84 million copies of Hunter x Hunter have been sold worldwide. The series has been published in English by VIZ Media under the Shonen Jump Advanced imprint since April 5, 2005. It has also been simulpub digitally through MANGA Plus. It has also been released in Brazilian Portuguese by Editora JBC since January 2008; in Spanish by Panini Comics since October 2012; and in Italian by Panini Comics since May 20, 2004. The manga has been serialized irregularly since 2006 due to Yoshihiro Togashi's health problems.", null, null, "https://cdn.myanimelist.net/images/manga/2/253119.jpg", 46, 8.75m, new DateTime(1998, 3, 2, 16, 0, 0, 0, DateTimeKind.Local), 4, "\"Secret treasure hoards, undiscovered wealth... mystical places, unexplored frontiers... 'The mysterious unknown.' There's magic in such words for those captivated by its spell. They are called 'Hunters'!\"\n\nGon Freecss wants to become a Hunter so he can find his father, a man who abandoned him to pursue a life of adventure. But it's not that simple: only one in one hundred thousand can pass the Hunter Exam, and that is just the first obstacle on his journey. During the Hunter Exam, Gon befriends many other potential Hunters, such as the mysterious Killua; the revenge-driven Kurapika; and Leorio, who aims to become a doctor. There's a world of adventure and peril awaiting, and those who embrace it with open arms can become the greatest Hunters of them all!\n\n[Written by MAL Rewrite]", "Hunter x Hunter", "Hunter x Hunter", "HUNTER×HUNTER", 1, "https://myanimelist.net/manga/26/Hunter_x_Hunter", null },
                    { 27, "X is written and illustrated by the four-person team of CLAMP. It is currently incomplete, but CLAMP has stated their intention to one day conclude the series if they can. It started serialization in Kadokawa Shoten's Monthly Asuka shoujo manga magazine in May 1992 and stopped serialization in March 2003. Events depicted in the manga were too similar for comfort to real-life disasters that occurred in Japan, which contributed to the series' halt. Chapters of X have been collected in eighteen and a \"half\" volumes, out of a total twenty-one volumes expected. X has been adapted into various anime that speculate about events that occurred before the manga started or after the point where the manga left off. The series was published in English by VIZ Media as 3-in-1 omnibus volume from November 8, 2011 to August 13, 2013.", 158, new DateTime(2003, 3, 23, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/267781.jpg", 577, 8.1m, new DateTime(1992, 3, 23, 16, 0, 0, 0, DateTimeKind.Local), 3, "Six years ago, Kamui Shirou and siblings Fuuma and Kotori Monou were inseparable childhood friends. After the sudden, gruesome death of the Monou siblings' mother, Kamui was taken away from Tokyo by his own mother. In the years that passed, the two lived peacefully while Kamui strengthened his innate telekinetic abilities. When his mother passes away in 1999, her dying wish prompts him to return to Tokyo to face his \"destiny.\"\n\nWhen Kamui reappears in the city, his attitude has taken a drastic turn, and he displays the growth of his powers through violent confrontations in the streets. Various opponents come after him asking if he is \"Kamui,\" but they seem to be demanding something far more significant than his name. These fighters represent two opposite factions—the Dragons of Heaven and the Dragons of Earth—who each wish to recruit him to their cause. Piecing together clues about the apocalyptic \"promised day,\" Kamui realizes that he holds the fate of the world in his hands. Depending on which group of Dragons he allies himself with, he can either choose to save the world—or end it.\n\n[Written by MAL Rewrite]", "X", "X", "X", 1, "https://myanimelist.net/manga/27/X", 18 },
                    { 36, "Kamikaze Kaitou Jeanne was published in English by CMX Manga from November 1, 2005 to January 24, 2007. After the publisher went defunct, VIZ Media picked up the license and republished the series from March 4, 2014 to November 4, 2014, following the 2013 5-volume reprint in Japan.", 33, new DateTime(2000, 6, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/267790.jpg", 1316, 7.79m, new DateTime(1997, 12, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "It's nearly the end of the century, and one girl has been breaking the news: Kaitou Jeanne, a phantom thief supposedly sent by God, has been stealing paintings all around the city. Her real identity is Maron Kusakabe, a 16-year-old rhythmic gymnastics enthusiast and student at Momokuri Academy— something unknown to all, even her best friend Miyako Toudaiji, who is in charge of the police chase for Jeanne.\n\nHidden inside the paintings Maron steals are demons sent by the demon lord, who plans to weaken God's power by having his minions possess human hearts. Assisted by the minor angel Finn Fish, it is up to Maron as the reincarnation of Jeanne d'Arc to assume her alter ego, hunt down the cursed paintings, and seal the vile demons away. However, the tough job of balancing this duty with her lonesome high school life only proves more challenging when a mysterious new phantom thief makes his appearance—Kaitou Sinbad.\n\n[Written by MAL Rewrite]", "Kamikaze Kaitou Jeanne", "Phantom Thief Jeanne", "神風怪盗ジャンヌ", 1, "https://myanimelist.net/manga/36/Kamikaze_Kaitou_Jeanne", 7 },
                    { 42, "Dragon Ball has become one of the most successful manga series of all time. With over 260 million copies sold worldwide, the series is the fourth best-selling manga of all time as of 2024. It is often credited for the \"Golden Age of Jump,\" where the magazine's circulation was at its highest. The series was serialized in English by VIZ Media in a monthly comic book anthology format from March 1998 to March 2005. The publisher later collected the series into traditional tankoubon volumes from March 12, 2003, to June 6, 2006. To closely follow the English anime localization, the series was split, with volumes 17 through 42 titled Dragon Ball Z and renumbered as volumes 1 through 26. Other releases by VIZ Media include the large format VIZ Big Edition, kanzenban cover-based 3-in-1 edition, and a full-color edition of chapters 195 through 245. The series was also published in Spanish by Planet DeAgostini Cómics; in German and Danish by Carlsen Verlag; and in French and Dutch by Glénat Editions.", 520, new DateTime(1995, 5, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/267793.jpg", 191, 8.43m, new DateTime(1984, 11, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "Bulma, a headstrong 16-year-old girl, is on a quest to find the mythical Dragon Balls—seven scattered magic orbs that grant the finder a single wish. She has but one desire in mind: a perfect boyfriend. On her journey, Bulma stumbles upon Gokuu Son, a powerful orphan who has only ever known one human besides her. Gokuu possesses one of the Dragon Balls, it being a memento from his late grandfather. In exchange for it, Bulma invites Gokuu to be a companion in her travels.\n\nBy Bulma's side, Gokuu discovers a world completely alien to him. Powerful enemies embark on their own pursuits of the Dragon Balls, pushing Gokuu beyond his limits in order to protect Bulma and their growing circle of allies. However, Gokuu has secrets unbeknownst to even himself; the incredible strength within him stems from a mysterious source, one that threatens the many people he grows to hold dear.\n\nAs his prowess in martial arts flourishes, Gokuu attracts stronger opponents whose villainous plans could collapse beneath his might. He undertakes the endless venture of combat training to defend his loved ones and the fate of the planet itself.\n\n[Written by MAL Rewrite]", "Dragon Ball", "Dragon Ball", "ドラゴンボール", 1, "https://myanimelist.net/manga/42/Dragon_Ball", 42 },
                    { 43, "Eyeshield 21 has sold more than 20 million copies in Japan and also has games produced by Konami and Nintendo. The series was published in English by VIZ Media under Shonen Jump Advanced imprint from April 5, 2005 to October 4, 2011 and has been licensed in France, Hong Kong, Indonesia, Italy, Taiwan, and South Korea.", 333, new DateTime(2009, 6, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/165586.jpg", 176, 8.46m, new DateTime(2002, 7, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Timid, diminutive, and frequently the target of bullies, Sena Kobayakawa has just enrolled at Deimon Private High School. When he angers a group of delinquents by refusing to act as their errand boy, he makes an incredibly speedy getaway, an ability he has developed through years of running from his tormentors.\n\nYouichi Hiruma—the demonic captain of the Deimon Devil Bats football team—happens to be nearby, and seeing Sena's \"golden legs\" at work, forcibly recruits him as a running back despite Sena's desire to be team manager instead. Made to don the number 21 jersey and a special helmet to hide his identity as a player, Sena becomes \"Eyeshield 21,\" the team's closely guarded secret weapon. Soon he realizes his love for the sport, and aims to help the Devil Bats reach the Christmas Bowl, the high school football championship.\n\n[Written by MAL Rewrite]", "Eyeshield 21", "Eyeshield 21", "アイシールド21", 1, "https://myanimelist.net/manga/43/Eyeshield_21", 37 },
                    { 44, "Gintama was nominated for Best Manga under the comedy category at the Society for the Promotion of Japanese Animation in 2008. As of December 2023, over 58 million copies of the manga are in circulation. VIZ Media published the first 23 volumes of the series in English as Gin Tama under the Shonen Jump Advanced imprint from July 3, 2007, to August 2, 2011, before it was discontinued. It was also published in German by Tokyopop since December 28, 2006; in French by Kana from March 16, 2007, to March 31, 2023; in Spanish by Glénat, with 16 volumes released from October 2007 to May 2010; and in Italian by Edizioni Star Comics from April 25, 2015, to December 22, 2021.", 709, new DateTime(2019, 6, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/267795.jpg", 81, 8.63m, new DateTime(2003, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), 2, "During the Edo period, Japan is suddenly invaded by alien creatures known as the Amanto. Despite the samurai's attempts to combat the extraterrestrial menace, the Shogun soon realizes that their efforts are futile and decides to surrender. This marks the beginning of an uneasy agreement between the Shogunate and Amanto, one that results in a countrywide sword ban and the disappearance of the samurai spirit.\n\nHowever, there exists one eccentric individual who wields a wooden sword and refuses to let his samurai status die. Now that his kind is no longer needed, Gintoki Sakata performs various odd jobs around town in order to make ends meet. Joined by his self-proclaimed disciple Shinpachi Shimura, the fearsome alien Kagura, and a giant dog named Sadaharu, they run the business known as Yorozuya, often getting caught up in all sorts of crazy and hilarious shenanigans.\n\n[Written by MAL Rewrite]\n\nIncluded one-shots:\nVolume 1: Dandelion\nVolume 2: Shirokuro (Black and White)\nVolume 24: 13\nVolume 38: Bankara-san ga Tooru", "Gintama", "Gin Tama", "銀魂", 1, "https://myanimelist.net/manga/44/Gintama", 77 },
                    { 45, "Ichigo 100% was published in English as Strawberry 100% by VIZ Media under its Shonen Jump Advanced imprint from July 3, 2007, to October 5, 2010, up to the 14th volume. To promote the publication of manga in Germany, the series was released in German as 100% Strawberry by Tokyopop GmbH from April 2006, to August 2009, in collaboration with VIZ Media and Shueisha. The manga was also published in Brazilian Portuguese as 100% Morango by Panini Comics under its Planet Manga imprint from April 2010, to April 2013.", 167, new DateTime(2005, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/259714.jpg", 1504, 7.75m, new DateTime(2002, 2, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "Strawberry panties backdropped against a sunset sky—that was aspiring film director Junpei Manaka's introduction to a mysterious beauty at his middle school. Suspecting the girl is his classmate Aya Toujou, Junpei sets out to get in touch with her to refilm that skirt flip for \"artistic\" reasons. However, when he bumps into her the next day, he sees a girl that looks vastly different from the one in his memories.\n\nJust when Junpei thinks he is back to the drawing board, he runs into the school's darling, Tsukasa Nishino, boldly declaring that she is wearing strawberry panties for the day. Convincing himself that Tsukasa is the girl he has been looking for all along, Junpei starts planning his confession—all for the sake of becoming her boyfriend and filming her panties!\n\n[Written by MAL Rewrite]", "Ichigo 100%", "Strawberry 100%", "いちご100%", 1, "https://myanimelist.net/manga/45/Ichigo_100", 19 },
                    { 47, "The first 16 volumes of Katekyou Hitman Reborn! were published in English as Reborn! by VIZ Media under the Shonen Jump Advanced imprint from October 3, 2006, to July 6, 2010, before release was discontinued. It was also published in Brazilian Portuguese by Panini Comics from February 2013 to February 2017.", 411, new DateTime(2012, 11, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253085.jpg", 576, 8.1m, new DateTime(2004, 5, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "The life of Tsunayoshi \"No-Good Tsuna\" Sawada is a complete wreck. Terrible grades, horrible fitness, and a non-existent social life means he has no reason to attend school, especially after discovering that his crush, Kyouko Sasagawa, is already seeing someone. Unbeknownst to him however, the blood of Giotto, the great Vongola the First, runs through his veins.\n\nEnter home tutor Reborn, an infant who claims to be the world's greatest hitman. Under orders from Vongola the Ninth, Reborn has come to train Tsuna to become a worthy successor to the famous Vongola Famiglia name. Tsuna, however, refuses, and claims that he will never become a mafia boss. How will the world's greatest hitman react to such opposition? Will he force Tsuna to adhere? Or will he use this unwillingness to his advantage? This is a story of a reluctant successor as he takes on the responsibilities of becoming the underworld's next ruling mafia leader, with the help of his friends and a one-of-a-kind home tutor.\n\n[Written by MAL Rewrite]", "Katekyou Hitman Reborn!", "Reborn!", "家庭教師〈かてきょー〉ヒットマンREBORN!", 1, "https://myanimelist.net/manga/47/Katekyou_Hitman_Reborn", 42 },
                    { 49, "Tennis no Oujisama serialized in the Weekly Shounen Jump from July 1999 to March 2008. The series was put on hiatus in July 2006 after the writer, Takeshi Konomi, was injured in an accident; publication resumed in September 2006. The series was published in English as The Prince of Tennis by VIZ Media under the Shonen Jump imprint from April 21, 2004 to July 5, 2011. The manga has received multiple media adaptations. Since the Golden Week of 2003, Marvelous Entertainment has produced a series of musicals that are shown bi-annually, with each musical adapting one arc of the manga storyline. A live adaptation film was released in Japan on May 13, 2006, covering the storyline from when Ryoma arrives in Japan to the match against Hyotei Academy. Three Chinese dramas have been produced. Due to localization, the dramas feature different characters and cultural themes, but the story and characters' portrayal remain similar to the manga. A variety of video games based on the series, mostly tennis games or dating simulators, have been released in Japan across multiple consoles. A half-hour weekly radio show was also produced, featuring over 300 music CDs along with a large range of merchandise.", 382, new DateTime(2008, 3, 2, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/153238.jpg", 1746, 7.69m, new DateTime(1999, 7, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Seishun Academy is home to one of the best middle school tennis teams in all of Japan. Freshman tennis prodigy Ryouma Echizen enrolls in the prestigious institution with his eyes set on claiming a regular position on the Boys' Tennis Team. As the son of legendary tennis player Samurai Nanjirou, Ryouma is sick of living in his shadow and wishes to surpass him someday. He is confident in his skills and has the cocky attitude to match. His teammates, however, are reluctant to accept him into their starting lineup, as he hasn't proven himself worthy of the spot.\n\nSeishun's ultimate goal is to make it to the National Tournament by the end of the year, but they first have to make it through the Kanto Regionals to even qualify for a spot in it. With their new \"super rookie\" on the team, Seishun is ready to take on anything that comes their way. With a varied assortment of rivals and opponents that can threaten their chance at the title, the Seishun team needs to give it their all in order to rise to the top.\n\n[Written by MAL Rewrite]\n\nIncluded one-shot:\nVolume 5: Tennis no Oujisama (pilot)", "Tennis no Oujisama", "The Prince of Tennis", "テニスの王子様", 1, "https://myanimelist.net/manga/49/Tennis_no_Oujisama", 42 },
                    { 108, "Gouhou Drug was published in English as Legal Drug by Tokyopop from October 12, 2004 to June 7, 2005. Dark Horse later gained publishing rights to the series and republished it on September 30, 2014. It has also been published in French as Lawful Drug by Delcourt from November 1, 2003 to June 17, 2004; and in Spanish by Norma Editorial from November 2003 to December 2004.", 18, new DateTime(2003, 7, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/185400.jpg", 4099, 7.36m, new DateTime(2000, 10, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Snow surrounds the 17-year-old Kazahaya Kudou while he fights not to lose consciousness amid the freezing landscape. Luckily, a cold-blooded young man named Rikuo Himura saves him and brings him to his boss, Kakei, owner of Green Drugstore. Out of necessity, Kazahaya agrees to become Kakei's employee.\n\nHowever, Kazahaya's job is not limited to organizing shelves and dealing with customers. Due to his ability to see strange things, Kazahaya is commissioned to complete dangerous assignments in exchange for money. Begrudgingly paired, Kazehaya and Rikuo—who also seems to possess unique powers—must take on these missions while confronting ghosts from the past that are hunting them down.\n\n[Written by MAL Rewrite]", "Gouhou Drug", "Legal Drug", "合法ドラッグ", 1, "https://myanimelist.net/manga/108/Gouhou_Drug", 3 },
                    { 109, "Wish was published in English by Tokyopop from August 27, 2002, to February 11, 2003. After the company was dissolved, Dark Horse Comics gained the publishing rights and republished the series in a complete omnibus volume on January 30, 2019. It was also released in French by Delcourt; in German by Carlsen Comics; in Italian by Edizioni Star Comics; in Polish by Japonica Polonica Fantastica; in Brazilian Portuguese by Editora JBC; and in Spanish by Grupo Editorial Vid and Norma Editorial.", 26, new DateTime(1998, 6, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/157425.jpg", 3556, 7.42m, new DateTime(1995, 10, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Walking home from work one night, Shuuichirou Kudou encounters a child-like being with wings trapped on a tree branch. After he saves the creature, they introduce themselves as Kohaku, an angel from Heaven. Skeptical of the supernatural, Shuuichirou ignores Kohaku and goes back home, dismissing it as a dream.\n\nThe next day, Shuuichirou finds Kohaku in his garden, who has now taken on their true form. They tell him that, for his kindness, they want to grant him any wish. However, Shuuichirou is content with what he has and declines. Kohaku decides that, instead of doing nothing, they will stay with their savior until he desires something only they can deliver.\n\nAlthough Kohaku becomes accustomed to their homely life with Shuuichirou, they cannot remain on Earth for long due to being tormented by Kouryuu—a mischievous devil—and his sidekicks. In addition, Kohaku is on borrowed time to find the missing archangel Hisui and must hurry before they are both banished from Heaven forever.\n\n[Written by MAL Rewrite]", "Wish", "Wish", "Wish", 1, "https://myanimelist.net/manga/109/Wish", 4 },
                    { 133, "Tokyo Babylon was published in English by Tokyopop from May 11, 2004, to May 10, 2005. Dark Horse Comics gained publishing rights to the series after Tokyopop was dissolved and republished the series in two omnibus volumes from March 26, 2013, to July 23, 2013. A new edition titled CLAMP Premium Collection Tokyo Babylon has been published by Yen Press since October 17, 2023. It was also released in Brazilian Portuguese by Editora JBC from June 2005 to December 2005; and in Spanish by Editorial Kamite from September 23, 2016, to April 29, 2017.", 18, new DateTime(1992, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/260527.jpg", 801, 7.97m, new DateTime(1989, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Subaru Sumeragi is the 13th head of his powerful onmyouji clan. Until the time comes when he must succeed his grandmother fully, Subaru is allowed to live in Tokyo with his fraternal twin, Hokuto. While Subaru is kind and shy, Hokuto has exuberance to spare, and her favorite pastime is designing bold matching outfits for the two of them to wear. Her next favorite thing to do is try to set up Subaru with their veterinarian friend Seishirou Sakurazuka who, oddly enough, is always readily available to accompany the Sumeragis throughout the city.\n\nSubaru has to resolve a variety of spiritual conflicts in Tokyo: some are cases formally brought to him by clients, and others are matters in which he decides to involve himself. A selfless teenager, he empathizes with others to the point that their pain may as well be his own. This leaves him vulnerable in a city where nearly everyone makes decisions that only benefit themselves as individuals. Hokuto hopes that if Subaru develops feelings for Seishirou, their relationship will be the one thing that he never gives up for the sake of anyone else. However, is Seishirou the best candidate for her brother's love, or is he hiding sinister secrets?\n\n[Written by MAL Rewrite]", "Tokyo Babylon", "Tokyo Babylon", "東京 BABYLON", 1, "https://myanimelist.net/manga/133/Tokyo_Babylon", 7 },
                    { 160, "School Rumble was published digitally in English by Kodansha USA from July 26, 2016 to August 15, 2017. It had previously had nine volumes published by Tanoshimi in the U.K. from January 4, 2007 to June 5, 2008, and 16 volumes published by Del Rey from February 28, 2006 to June 27, 2010, with volumes 14-16 collected in a single volume.", 345, new DateTime(2008, 7, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/5267.jpg", 802, 7.97m, new DateTime(2002, 10, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "She...is a second-year high school student with a single all-consuming question: Will the boy she likes ever really notice her? He...is the school's most notorious juvenile delinquent and he's suddenly come to a shocking realization: He's got a huge crush, and now he must tell her how he feels. Life-changing obsessions, colossal foul-ups, grand schemes, deep-seated anxieties, and raging hormones—School Rumble portrays high school as it really is: over-the-top comedy!\n\n(Source: Kodansha USA)", "School Rumble", "School Rumble", "スクールランブル", 1, "https://myanimelist.net/manga/160/School_Rumble", 22 },
                    { 173, "Cowboy Bebop was published in English by Tokyopop from April 23, 2002, to August 20, 2002. It was also released in Brazilian Portuguese by Editora JBC in six volumes from June 2004 to July 2004.", 11, new DateTime(2000, 4, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/166652.jpg", 6399, 7.16m, new DateTime(1999, 4, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "Spike, Jet, Faye and Ed—cowboys on the new frontier. Together this band of interplanetary bounty hunters takes on the jobs that anyone in their right mind would turn down. \n\n(Source: Tokyopop)", "Cowboy Bebop", "Cowboy Bebop", "カウボーイビバップ", 1, "https://myanimelist.net/manga/173/Cowboy_Bebop", 3 },
                    { 174, "Shooting Star Bebop: Cowboy Bebop was published in English as Cowboy Bebop: Shooting Star by Tokyopop from April 8, 2003 to June 10, 2003.", 10, new DateTime(1998, 10, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/176770.jpg", 13386, 6.7m, new DateTime(1998, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kai Lucas hires the Bebop crew to find his mischievous doppelganger, but the bounty goes bust and Spike and Jet once again find themselves broke - and hungry. And to add to their woes, Spike ends up mysteriously on the police's most wanted list, either the butt of a joke or the victim of a severe computer glitch. But what's worse, being targeted by every bounty hunter in the solar system, or taking on a kid-genius, a genius puppy and a genus: fatale, species: femme as part of the crew. Well, if Scorpion or the Dragon Head Family doesn't kill them, the extra mouths to feed certainly will.\n\n(Source: Tokyopop)", "Shooting Star Bebop: Cowboy Bebop", "Cowboy Bebop: Shooting Star", "シューティングスタービバップ―カウボーイビバップ", 1, "https://myanimelist.net/manga/174/Shooting_Star_Bebop__Cowboy_Bebop", 2 },
                    { 191, "The first four volumes of Zipang were published in bilingual Japanese-English editions by Kodansha in 2002. Zipang was published in French by Kana from March 4, 2005 to May 7, 2015.", 422, new DateTime(2009, 11, 4, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/209661.jpg", 2309, 7.59m, new DateTime(2000, 7, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the year 200X, a Japanese fleet consisting of 3 vessels leave on a mission to South America. After encountering a storm, the ship JDS Mirai find themselves without their escorts and in 1942, traveling towards the island of Midway to face the American fleet in one of largest battles in naval history. The crew of Mirai must decide whether or not to change the course of history by involving itself in WWII.\n\n(Source: MU)", "Zipang", null, "ジパング", 1, "https://myanimelist.net/manga/191/Zipang", 43 },
                    { 201, "Kidou Keisatsu Patlabor won the 36th Shogakukan Manga Award for shounen manga in 1991. The series was partially published in English as Mobile Police Patlabor by VIZ Media, who published the first two volumes between July 6, 1998 and October 6, 1998, before the license was dropped.", 91, new DateTime(1994, 5, 10, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/194559.jpg", 2282, 7.6m, new DateTime(1988, 3, 22, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the near future, large mecha called Labors are made to assist in various reconstruction projects in major countries around the world that are being threatened by global warming. In Japan, the government has enacted Project Babylon in order to conduct land reclamation. Labors are also being pressed into police and military service aside from civilian use.\n\nHowever, terrorists are now attempting to use labors to make themselves heard, as well as common criminals, thugs and guerrillas. The National Police Agency established the Special Vehicles Division, an all-labor task force to combat the potential use of labors for criminal/terrorist activities.\n\n(Source: MU)", "Kidou Keisatsu Patlabor", "Mobile Police Patlabor", "機動警察パトレイバー", 1, "https://myanimelist.net/manga/201/Kidou_Keisatsu_Patlabor", 22 },
                    { 206, "Nine volumes of Kidou Senshi Gundam 0079 were published in English as Mobile Suit Gundam 0079 by VIZ Media from January 2000 to January 2003.", 72, new DateTime(2004, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/301412.jpg", 5206, 7.26m, new DateTime(1992, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Mobile Suit Gundam 0079 is retelling of the story remembered so well in Japan-of a war occurring on Earth's not-so-far-off future, when humanity's millions living in orbiting space colonies begin to push for their independence from the government of Earth, and new weapon called a \"Mobile suit\" becomes the deciding factor in battle....\n\n(Source: VIZ Media)", "Kidou Senshi Gundam 0079", "Mobile Suit Gundam 0079", "機動戦士ガンダム0079", 1, "https://myanimelist.net/manga/206/Kidou_Senshi_Gundam_0079", 12 },
                    { 214, "Kidou Senshi Gundam: The Origin won the 43rd Seiun Award in the Best Comic category in 2012. The series was partially published in English as Mobile Suit Gundam: The Origin by VIZ Media in 12 volumes from March 6, 2002, to August 17, 2004, before it was canceled. VIZ Media's version does not correspond to the Japanese volumes, and approximately only the first six volumes were translated. Vertical Inc. published the full series based on the 12-volume aizouban reprint from March 26, 2013, to December 15, 2015. It was also published in Spanish by Norma Editorial from November 2005 to July 24, 2015; and in Italian by Edizioni Star Comics from October 1, 2004, to May 24, 2012.", 112, new DateTime(2014, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/151300.jpg", 134, 8.52m, new DateTime(2001, 6, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Zeon ace pilot, Commander Char Aznable, thought he could foil the Federation's plan to build a mobile suit by attacking their research base on colony Side 7. He was wrong. With a prototype already active, the besieged Federation forces strike back using their new weapon, the mobile suit Gundam, with devastating consequences. Amidst the fighting, young electronics wizard Amuro Ray is determined not to let his friends and family die in the crossfire. But what can one boy do to repel a squad of mobile suit-clad invaders?\n\n(Source: VIZ Media)", "Kidou Senshi Gundam: The Origin", "Mobile Suit Gundam: The Origin", "機動戦士ガンダム THE ORIGIN", 1, "https://myanimelist.net/manga/214/Kidou_Senshi_Gundam__The_Origin", 24 },
                    { 345, "", 11, new DateTime(2004, 7, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/184670.jpg", 7857, 7.06m, new DateTime(2003, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "After having finished a job at Research Colony Mendel, a mysterious mobile suit approaches the colony--likely with hostile intent. When Lowe Gear intercepts in the Red Frame, the pilot opens fire... and thus begins another exciting adventure set in the popular Gundam Seed universe! Mobile Suit Gundam SEED X Astray continues where Gundam Seed Astray R left off!\n\n(Source: Tokyopop)", "Kidou Senshi Gundam SEED: X Astray", "Mobile Suit Gundam SEED X Astray", "機動戦士ガンダムSEED Ｘ Astray", 1, "https://myanimelist.net/manga/345/Kidou_Senshi_Gundam_SEED__X_Astray", 2 },
                    { 349, "", 12, new DateTime(1996, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/301296.jpg", 12380, 6.77m, new DateTime(1995, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "After a generation of warfare, the Gundam boys finally secured a peace between Earth and the colonies by helping to defeat the Oz and White Fang armies. Now, out of the rubble, the surviving soldiers are re-emerging and clustering together into new factions. Heero Yuy has become a vigilante pacifist, tracking down weapons stashes and destroying them, while Relena, former Queen of the Earth Sphere, tries to maintain the peace politically. But an unmanned weapons factory has been discovered somewhere near Mars, and now the boys are going to have to dust off their mechs for one more battle to save the tenuous peace. \n\n(Source: Tokyopop)", "Shin Kidou Senki Gundam Wing", "Mobile Suit Gundam Wing", "新機動戦記ガンダムＷ〈ウイング〉", 1, "https://myanimelist.net/manga/349/Shin_Kidou_Senki_Gundam_Wing", 3 },
                    { 351, "Kidou Senshi Gundam SEED was published in English as Mobile Suit Gundam SEED by Del Rey from April 27, 2004 to August 30, 2005.", 25, new DateTime(2004, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/306872.jpg", 12892, 6.73m, new DateTime(2002, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Year 71, Cosmic Era. After the terrible battle of Yakin Due, an uneasy peace rests between the Earth Alliance and the Zaft Empire. But even as Cagalli and Athrun visit Chairman Durandal to cement the tentative cease-fire, Zaft terrorists plot with Neo Roanoke to drag both sides into all-out war. The plan: storm Zaft territory and steal several Gundam Mobile Suits. But that's only the beginning. They're also scheming to engineer a catastrophic event, one designed to drive the Earth down a bloody path. Now the crew of the Minerva must prevent disaster, as everything and everyone-including the love between Athrun and Cagalli-is thrown in mortal danger.\n\n(Source: Del Rey)", "Kidou Senshi Gundam SEED", "Mobile Suit Gundam SEED", "機動戦士ガンダムSEED　", 1, "https://myanimelist.net/manga/351/Kidou_Senshi_Gundam_SEED", 5 },
                    { 375, "Initial D was partially published in English by Tokyopop, who published the first 33 volumes from May 21, 2002 to January 13, 2009. In 2019, Kodansha USA released all 48 volumes in English digitally, and in print as 2-in-1 omnibus volumes since March 19, 2024. The series has also been published in Chinese by Sharp Point Press and in French by Asuka Comics. The manga has received multiple video game adaptations as well as a live-action film based on the events of the story. Released in 2005 in various Asian countries, the film won several awards at the 42nd Golden Horse Awards and the 25th Hong Kong Film Awards in 2005 and 2006 respectively.", 724, new DateTime(2013, 7, 28, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/186990.jpg", 372, 8.24m, new DateTime(1995, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "There is said to be a legendary \"Ghost of Akina\" that holds the fastest time to descend the Akina Pass. No one has ever come close to beating the record, nor has the mysterious driver of the white Toyota AE86 ever revealed themselves. Nowadays, the same AE86 can be seen every morning driving up and down the pass, making trips to a hotel residing at the top of the mountain.\n\nUnlike his classmates and coworkers, Takumi Fujiwara did not like cars. Any conversation about them would remind him of his early morning routine of delivering tofu for his father. He did not see the appeal in street racing and knew nothing about its rules or its culture. However, when tagging along to a nighttime meetup, the appearance of a rival racing team at the Akina Pass compels Takumi to hop behind the wheel of his father's AE86 and race them down the familiar mountain.\n\nThis spur-of-the-moment decision marks the beginning of Takumi's high-octane journey, shifting from his daily deliveries to becoming the greatest drift racer ever. Along the way, he slowly finds and kindles his love for street racing as he comes face-to-face with a plethora of opponents, each ready to take on the renowned Ghost of Akina.\n\n[Written by MAL Rewrite]", "Initial D", "Initial D", "頭文字D", 1, "https://myanimelist.net/manga/375/Initial_D", 48 },
                    { 393, "Kindaichi Shounen no Jikenbo: File Series won the 19th Kodansha Manga Award in the Shounen categpry in 1995. The first 17 volumes of the series were published in English as The Kindaichi Case Files by Tokyopop from June 1, 2003, and May 13, 2008. The manga was adapted into multiple live-action TV series and video games.", 219, new DateTime(1997, 10, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/84823.jpg", 609, 8.08m, new DateTime(1992, 10, 13, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kindaichi (frequently with best-bud, Miyuki) travels to various places where a murder has taken place, typically involving ghosts, curses, myths and folklore of significant events from the distant past, and solves the mystery using ingenious deductions of curious clues and his cool magic.\n\n(Source: Tokyopop)", "Kindaichi Shounen no Jikenbo: File Series", "The Kindaichi Case Files", "金田一少年の事件簿", 1, "https://myanimelist.net/manga/393/Kindaichi_Shounen_no_Jikenbo__File_Series", 27 },
                    { 408, "Kidou Senshi Gundam SEED Destiny was published in English as Mobile Suit Gundam SEED Destiny by Del Ray from June 27, 2006 to July 31, 2007.", 17, new DateTime(2006, 4, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/300562.jpg", 11527, 6.82m, new DateTime(2004, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "C.E. 71: After the terrible battle of Yakin Due, an uneasy peace rests between the Earth Alliance and the Zaft Empire. But even as Cagalli and Athrun visit Chairman Durandal to cement the tentative cease-fire, Zaft terrorists plot with Neo Roanoke to drag both sides into all-out war. The plan: storm Zaft territory and steal several Gundam Mobile Suits. But that’s only the beginning. They’re also scheming to engineer a catastrophic event, one designed to drive the Earth down a bloody path. Now the crew of the Minerva must prevent disaster, as everything and everyone–including the love between Athrun and Cagalli–is thrown in mortal danger.\n\n(Source: Del Rey)", "Kidou Senshi Gundam SEED Destiny", "Mobile Suit Gundam SEED Destiny", "機動戦士ガンダム SEED Destiny", 1, "https://myanimelist.net/manga/408/Kidou_Senshi_Gundam_SEED_Destiny", 4 },
                    { 419, "Nodame Cantabile has been adapted as three different television series: an award-winning live-action drama that aired in 2006, followed by a sequel television special that aired in January 2008, and as an anime series spanning three seasons with the first one broadcast in 2007. In 2014, it received a South Korean drama adaptation titled Cantabile Tomorrow. The series was published in English by Del Rey Manga; in France by Pika; and in Spain by Norma Editorial. Kodansha has taken up the English license, and published the series digitally from July 26, 2016 to June 27, 2017. The last two volumes, titled Nodame Cantabile: Encore Opera-hen, contain a sequel to the main series.", 150, new DateTime(2010, 8, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/153962.jpg", 212, 8.4m, new DateTime(2001, 7, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Shinichi Chiaki, the perfectionist son of a famous pianist, is in his fourth year at Momogaoka College of Music, hoping to achieve his secret dream of being a conductor. His admiration for his father led him to pursue a career in music. As much as he wants to return to Europe, his phobia of flying traps him in Japan where he now lives.\n\nOne night, he passes out, and ends up being taken in by Megumi \"Nodame\" Noda. Upon first glance, Nodame is a talented pianist, but she is also slobbish and eccentric. What's even worse is that she is his neighbor and he ends up forced to work with her. Though it sounds like a recipe for disaster, Chiaki is drawn to this girl who makes him remember the love for music he once held. Just what does the future hold for this musical duo?\n\n[Written by MAL Rewrite]", "Nodame Cantabile", "Nodame Cantabile", "のだめカンタービレ", 1, "https://myanimelist.net/manga/419/Nodame_Cantabile", 25 },
                    { 430, "Suzuka was published in English up to volume 15 by Del Rey from August 29, 2006 to August 31, 2010. Kodansha USA published digitally all 18 volumes of the series from October 11, 2016 to February 21, 2017.", 171, new DateTime(2007, 9, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/184775.jpg", 1114, 7.85m, new DateTime(2004, 2, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "Easygoing and energetic Yamato Akitsuki is ready to start his high school life in Tokyo. Having been invited by his aunt to stay rent-free at her housing complex, he unhesitatingly accepts her offer. But unbeknownst to him, the boarding house is actually an all-girls dormitory.\n\nUpon visiting his new school, Yamato catches sight of a girl training for the high jump. Amazed by her athletic ability and beauty, he yearns to learn more about her. To his fortune, this girl, Suzuka Asahina, lives right next door to him—but all of their encounters thus far has given Suzuka a bad impression of him. In spite of the constant misunderstandings, Yamato still joins the track team with the intent of impressing her and soon discovers he has the potential to become a top hundred-meter sprinter. With friendship, and possibly love on the line, Yamato trains his heart out in order to win over the girl he loves.\n\n[Written by MAL Rewrite]", "Suzuka", "Suzuka", "涼風", 1, "https://myanimelist.net/manga/430/Suzuka", 18 },
                    { 436, "Uzumaki was chosen by the American Library Association (ALA) as one of the Top Ten Great Graphic Novels for Teens in 2009. The series was published in English as Uzumaki: Spiral into Horror by VIZ Media under the VIZ Signature imprint from October 16, 2007, to February 19, 2008, and again as a hardcover omnibus volume. It was also published in Polish by Japonica Polonica Fantastica in May 2011; in Czech by Zoner Press; in Spanish by Planeta Cómic; and in Brazilian Portuguese by Conrad Editora from July 2006 to October 2006.", 19, new DateTime(1999, 8, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/185972.jpg", 472, 8.16m, new DateTime(1998, 1, 11, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the town of Kurouzu-cho, Kirie Goshima lives a fairly normal life with her family. As she walks to the train station one day to meet her boyfriend, Shuuichi Saito, she sees his father staring at a snail shell in an alley. Thinking nothing of it, she mentions the incident to Shuuichi, who says that his father has been acting weird lately. Shuuichi reveals his rising desire to leave the town with Kirie, saying that the town is infected with spirals.\n\nBut his father's obsession with the shape soon proves deadly, beginning a chain of horrific and unexplainable events that causes the residents of Kurouzu-cho to spiral into madness.\n\n[Written by MAL Rewrite]", "Uzumaki", "Uzumaki: Spiral into Horror", "うずまき", 1, "https://myanimelist.net/manga/436/Uzumaki", 3 },
                    { 438, "", 109, new DateTime(1972, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/261098.jpg", 4498, 7.32m, new DateTime(1967, 7, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "International man of mystery and master thief extraordinaire, Lupin III comes from a long line of high stakes bandits, all committed to stealing from the rich and giving to themselves. Fortunately, Lupin tends to avoid robbing society's virtuous and, instead, targets some pretty shady characters.\n\nOf course, he partners with some pretty shady characters as well: Daisuke Jigen is an ex-mafia hitman who carries himself with a somber demeanor, his trademark black fedora tilted forward to hide his eyes. Goemon Ishikawa is a cipher-like swordsman with samurai-ish overtones who mysteriously fades in and out of Lupin's exploits. Fujiko Mine is the object of Lupin's affections, but, since she is a thief herself, the duo's romance more than occasionally clashes with their competition for big scores.\n\nThe global police force, Interpol, and in particular the tenacious Inspector Zenigata, long to capture Lupin and his gang. Zenigata's relationship with the eponymous master thief is a complicated one, characterized by mutual respect laced with utter disdain. The two have even worked together when it's served both their interests, but they understand that when the crisis ends, they must resume their former wariness and animosity toward each other.\n\n(Source: Tokyopop)", "Lupin III", "Lupin the 3rd", "ルパン三世", 1, "https://myanimelist.net/manga/438/Lupin_III", 14 },
                    { 454, "Shin Kidou Senki Gundam Wing: Dual Story - G-Unit was published in English as Mobile Suit Gundam: The Last Outpost by Tokyopop from December 10, 2002 to April 8, 2003.", 13, new DateTime(1998, 2, 13, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/301297.jpg", 9859, 6.93m, new DateTime(1997, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "AC 195. Earth and its surrounding colonies were fighting the bloodiest war mankind had ever known. But on the remote asteroid colony MO-V, life carried on as normal. It wasn't long, however, before OZ agents came to enlist the colony in the battle for independence from Earth rule. Now the once neutral colony not only finds itself lending resources to OZ, but they are under attack by a mysterious group who call themselves the Stardust Knights. When Odel Bernett, the colony's top pilot, is shot down in combat, his younger brother, Odin, must don the experimental new MS, the G-Unit, and fight to defend his home.\n\n(Source: Tokyopop)", "Shin Kidou Senki Gundam Wing: Dual Story - G-Unit", "Mobile Suit Gundam: The Last Outpost", "新機動戦記ガンダムW デュアルストーリー G-UNIT", 1, "https://myanimelist.net/manga/454/Shin_Kidou_Senki_Gundam_Wing__Dual_Story_-_G-Unit", 3 },
                    { 556, "Trinity Blood had twelve volumes published in English by Tokyopop from November 7, 2006 to March 30, 2010, which were republished digitally by VIZ Media from June 24 to December 30, 2014.", 89, new DateTime(2018, 4, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/164661.jpg", 1292, 7.8m, new DateTime(2003, 8, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the distant future, Armageddon has caused the appearance of a second \"Vampire's\" moon. This sparks the beginning of a war between humans and \"Methuselah,\" the vampires that feed on their blood.\n\nEsther Blanchett is an orphan who was raised in the Church of St. Matthias in the city of Istvan. One day, she meets Abel Nightroad, a priest sent to subdue any threats to the Vatican, an organization allied with humanity. Beneath Abel's meek facade hides his real identity as \"The Crusnik\": vampire who preys on the blood of his own kind and the Vatican's greatest weapon.\n\nEsther's peaceful times are cut short when the church is bombed and she is betrayed by her only friend Dietrich. With nowhere else to go, she teams up with Abel and Tres Iqus, a machine disguised as a human, to travel to Rome and look for answers behind the devastation of her home. However, their journey will not be easy, as they will have to battle various obstacles as well as discover the secrets of Abel's past.\n\n[Written by MAL Rewrite]", "Trinity Blood", "Trinity Blood", "トリニティ・ブラッド", 1, "https://myanimelist.net/manga/556/Trinity_Blood", 21 },
                    { 557, "Trinity Blood: Rage Against the Moons was left unfinished due to the death of author Sunao Yoshida. The first four volumes were published in English by Tokyopop from April 10, 2007 to April 27, 2010.", 23, new DateTime(2004, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/209368.jpg", 869, 7.94m, new DateTime(2001, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 1, "The background is in the distant future, a post-apocalyptic world after the destruction brought about by Armageddon. The war between humans (Terran) and vampires (Methuselah) continues, as a struggle between two factions: the Vatican and the New Human Empire.\n\nYet, amidst the bloodshed and violence, many desire a peaceful co-existence between the two species. However, standing between them and this goal is the Rosenkreuz Orden, a group of vampire extremists who manipulate the two sides and pit them against each other. To combat them, the Vatican special operations group \"AX,\" led by Cardinal Caterina, must use everything they have—even a vampire who preys on the blood of other vampires.\n\n(Source: Tokyopop)", "Trinity Blood: Rage Against the Moons", "Trinity Blood: Rage Against the Moons", "トリニティ・ブラッド Rage Against the Moons", 2, "https://myanimelist.net/manga/557/Trinity_Blood__Rage_Against_the_Moons", 6 },
                    { 593, "", 11, new DateTime(2003, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/126203.jpg", 5439, 7.24m, new DateTime(2002, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Whereas the main story of Mobile Suit Gundam SEED focuses on the struggles between the Earth Alliance, ZAFT, and Orb Union, the Astray series is focused on the three MBF-P0x mobile suit prototypes (however mainly on Lowe Guele) and their respective pilots and organizations, who mainly exist on the outskirts of the main SEED storyline. The MBF-P02 Astray Red Frame is piloted by Lowe Guele of the Junk Guild, and the MBF-P03 Astray Blue Frame is piloted by Gai Murakumo of the mercenary group Serpent Tail. The third Astray, MBF-P01 Astray Gold Frame, is piloted by the primary antagonist of the Astray story, Orb nobleman Rondo Ghina Sahaku, and later by his twin sister Rondo Mina Sahaku.", "Kidou Senshi Gundam SEED: Astray", "Mobile Suit Gundam SEED: Astray", "機動戦士ガンダムSEED ASTRAY", 1, "https://myanimelist.net/manga/593/Kidou_Senshi_Gundam_SEED__Astray", 3 },
                    { 594, "Kidou Senshi Gundam SEED: Astray R was published in English as Mobile Suit Gundam SEED Astray R by Tokyopop.", 20, new DateTime(2004, 5, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/300563.jpg", 7105, 7.11m, new DateTime(2002, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "The year is cosmic era 71. Outer space has been taken over by thieves and pirates, and danger lurks throughout the cool, dark depths of the galaxy. Lowe Gear, a brilliant junk-tech mechanic, discovers a top-secret Mobile Suit in the midst of space debris. This mysterious Gundam seems to have been at the top of everyone's shopping list -- and now everybody is after Lowe ! \n\nGundam SEED ASTRAY R is an out-of-this-world sci-fi epic, featuring edgy, never-before-seen stories that are set in the immensely popular Gundam SEED universe. \n\n(Source: Tokyopop)", "Kidou Senshi Gundam SEED: Astray R", "Mobile Suit Gundam SEED Astray R", "機動戦士ガンダムSEED ASTRAY R", 1, "https://myanimelist.net/manga/594/Kidou_Senshi_Gundam_SEED__Astray_R", 4 },
                    { 597, "Negima!? Neo was published in English as Negima!? Neo: Magister Negi Magi by Del Rey from March 24, 2009 to March 22, 2011.", 35, new DateTime(2009, 8, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/156574.jpg", 9985, 6.92m, new DateTime(2006, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Welsh magister magi in training, Negi Springfield (ten), is sent to complete his magical training in Japan. Although he's an English teacher in an all girls academy, his class is quite extraordinary for normal school girls... middle school girls, 32 of them, average age 14!", "Negima!? Neo", "Negima!? Neo: Magister Negi Magi", "ネギま!?neo", 1, "https://myanimelist.net/manga/597/Negima_Neo", 7 },
                    { 598, "In 2009, Fairy Tail won the 33rd Kodansha Manga Award in the Shounen category, the Japan Expo Awards in the same category, and the Society for the Promotion of Japanese Animation's Industry Award for best comedy manga. As of February 2020, over 72 million copies of the manga are in circulation. The first 12 volumes of the series were published in English by Del Rey Comics from March 25, 2008, to September 28, 2010. Kodansha Comics USA picked up the license and released the rest of the series from May 10, 2011, to January 23, 2018. The publisher later released a 5-in-1 omnibus edition subtitled Master's Edition. It was also published in Spanish by Norma Editorial from October 30, 2008, to September 28, 2018; in Italian by Edizioni Star Comics from January 3, 2008, to May 1, 2019; in Brazilian Portuguese by Editora JBC from October 2010 to April 2018; in Polish by Studio JG since April 8, 2016; and in Argentina by Editorial Ivrea since December 30, 2016.", 549, new DateTime(2017, 7, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/198604.jpg", 2557, 7.55m, new DateTime(2006, 8, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the mystical realm of Earth Land, magic exists at the core of everyday life for its inhabitants, from transportation to utilities and everything in between. However, even with all its benefits, magic can also be used for great evil; therefore, to prevent dark forces from upsetting the natural order of things, there exists a system of magical guilds in the Kingdom of Fiore. Under the command of their respective guild masters, these guilds are made up of witches and wizards who take on various job requests to earn fame and fortune. One particular guild stands high above the rest in both strength and spirit, and its name is Fairy Tail.\n\nIn his quest to find his dragon foster father—Igneel—Natsu Dragneel, a fiery and reckless mage, and his partner Happy run into a young celestial mage by the name of Lucy Heartfilia, who reveals that it is her dream to become a full-fledged wizard and join the Fairy Tail guild. After rescuing her from an abduction attempt, Natsu offers her a home in Fairy Tail. Now a member of the guild, Lucy teams up with Natsu and befriends fellow wizards Gray Fullbuster and Erza \"Titania\" Scarlet. Together, this motley crew set out on their many adventures, gaining many faithful allies and deadly foes along the way.\n\n[Written by MAL Rewrite]", "Fairy Tail", "Fairy Tail", "FAIRY TAIL", 1, "https://myanimelist.net/manga/598/Fairy_Tail", 63 },
                    { 642, "Vinland Saga won the Grand Prize in the Manga Division at 13th Japan Media Arts Festival in 2009. It also won the 36th Kodansha Manga Award in the General category in 2012, which mangaka Makoto Yukimura accepted in full viking gear. The series has been published in English by Kodansha Comics USA in 2-in-1 hardcover omnibuses since October 14, 2013. The release includes Makoto Yukimura's Sayonara ga Chikai no de (For Our Farewell Is Near) spread across the first five volumes. It is also published in French by Kurokawa since January 15, 2009; in Brazilian Portuguese by Panini Comics since February 2014; in Spanish by Planeta Cómic since October 21, 2014; and in Polish by Hanami since January 2017. An animated crossover between Vinland Saga and Ponkotsu Quest titled Ponkotsuland Saga was released on October 24, 2015.", null, null, "https://cdn.myanimelist.net/images/manga/2/188925.jpg", 7, 9.08m, new DateTime(2005, 4, 12, 17, 0, 0, 0, DateTimeKind.Local), 4, "Thorfinn, son of one of the Vikings' greatest warriors, is among the finest fighters in the merry band of mercenaries run by the cunning Askeladd, an impressive feat for a person his age. However, Thorfinn is not part of the group for the plunder it entails—instead, for having caused his family great tragedy, the boy has vowed to kill Askeladd in a fair duel. Not yet skilled enough to defeat him, but unable to abandon his vengeance, Thorfinn spends his boyhood with the mercenary crew, honing his skills on the battlefield among the war-loving Danes, where killing is just another pleasure of life.\n\nOne day, when Askeladd receives word that Danish prince Canute has been taken hostage, he hatches an ambitious plot—one that will decide the next King of England and drastically alter the lives of Thorfinn, Canute, and himself. Set in 11th-century Europe, Vinland Saga tells a bloody epic in an era where violence, madness, and injustice are inescapable, providing a paradise for the battle-crazed and utter hell for the rest who live in it.\n\n[Written by MAL Rewrite]", "Vinland Saga", "Vinland Saga", "ヴィンランド・サガ", 1, "https://myanimelist.net/manga/642/Vinland_Saga", null },
                    { 653, "Yakitate!! Japan was published in English by VIZ Media under the Shonen Sunday imprint from September 12, 2006 to April 12, 2011 and in French by Delcourt.", 242, new DateTime(2007, 1, 9, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/28467.jpg", 2512, 7.56m, new DateTime(2002, 3, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "The stakes are high and the competition is fierce, but Kazuma won't let anything prevent him from achieving his nation-changing, freshly baked goal. Relocating to Tokyo, Kazuma seeks to further his studies at Pantasia, a famous bakery chain. But will he rise to the challenge and pass the entrance examination, or will his best intentions fall flat?\n\n(Source: VIZ Media)", "Yakitate!! Japan", "Yakitate!! Japan", "焼きたて!! ジャぱん", 1, "https://myanimelist.net/manga/653/Yakitate_Japan", 26 },
                    { 660, "Versailles no Bara is set during the 1789 French Revolution. It became an instant success with millions of copies sold around the world since its appearance on May 21, 1972. With the rise in Japanese interest in French culture as a result of the series' release, the French government acknowledged the manga's impact in promoting French history and granted Riyoko Ikeda the Legion of Honor on March 11, 2009. In 1983, the first two volumes of the manga were translated into English by Frederik L. Schodt for the purpose of teaching English to Japanese speakers. This version was released in North America by the North American branch of Sanyusha and is the first commercially translated manga to be available in the country. It was published in English as The Rose of Versailles by Udon Entertainment as four omnibus volumes from February 4, 2020, to April 6, 2021. The series was released in French in two volumes by Kana from October 5, 2002, to December 7, 2002; both volumes were reissued on January 7, 2011. The manga was also released in Italian in five volumes by Edizioni BD on December 9, 2020. The series has been adapted into several Takarazuka Revue musicals. These shows led to a large resurgence in the popularity of Japanese revues; it came to be known as the \"Berubara Boom.\" The manga has also received a live-action movie adaptation titled Lady Oscar, which was released in Japan on March 3, 1979.", 82, new DateTime(1973, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/271375.jpg", 254, 8.35m, new DateTime(1972, 5, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Hoping to unite their countries with an alliance, The Empress of Austria arranges for her daughter, the delightful yet spoiled Marie Antoinette, to marry the crown prince of France, Louis XVI. Upon arriving in Versailles, the Austrian princess meets Oscar François de Jarjayes, Captain of the Royal Guards—a seemingly dashing young man—but to Antoinette's astonishment, he is in fact a woman!\n\nThe youngest daughter of a noble family with a prominent lack of a male heir, Oscar was raised as a boy to continue the family's military legacy. Suffocated by the rigid rules associated with her new position and longing for companionship, Antoinette immediately takes a liking to this intriguing young woman and wastes no time befriending her. However, as the childish new queen foolishly abuses her power, Oscar is conflicted between maintaining her loyalty to the royal family and addressing the growing concern of poverty among the common people.\n\nDespite being unjustly burdened by family expectations and forced to deny their identities at the expense of personal happiness, Antoinette and Oscar march on to become key players in the annals of history.\n\n[Written by MAL Rewrite]", "Versailles no Bara", "The Rose of Versailles", "ベルサイユのばら", 1, "https://myanimelist.net/manga/660/Versailles_no_Bara", 10 },
                    { 671, "To LOVE-Ru was published in English by Seven Seas Entertainment under the Ghost Ship imprint in 2-in-1 omnibuses from December 5, 2017 to December 10, 2019. The series was published in Italian by Star Comics from February 20, 2011 to July 22, 2012.", 162, new DateTime(2009, 8, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253546.jpg", 3225, 7.46m, new DateTime(2006, 4, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story of To Love-Ru revolves around Rito Yuuki, a high-school student who cannot confess to the girl of his dreams, Haruna Sairenji. One day when coming home and sulking in the bathtub, a mysterious, nude girl appears out of nowhere. Her name is Lala and she comes from the planet Deviluke...\n\n(Source: Wikipedia)", "To LOVE-Ru", "To Love Ru", "To LOVEる -とらぶる-", 1, "https://myanimelist.net/manga/671/To_LOVE-Ru", 18 },
                    { 676, "InuYasha won the 47th Shogakukan Manga Award in the Shounen category in 2001. The series was published in English by VIZ Media as Inu-Yasha: A Feudal Fairy Tale from July 6, 1998, to January 11, 2011. In this version, the manga was relabeled as InuYasha from volume 12 onwards, and the first 37 volumes were in left-to-right format but all later volumes were printed in traditional Japanese format. It was republished in 3-in-1 omnibuses under the Shonen Sunday VIZBIG imprint from November 10, 2009, to February 11, 2014. It was also released in Spain by Glénat España; and in Brazilian Portuguese by Editora JBC in 112 volumes from August 2002 to July 2009. The first 12 volumes were released in Argentina by LARP Editores before discontinuing publication. The first 23 volumes were released in Polish by Egmont from October 2004 to February 2011; Japonica Polonica Fantastica has republished the series since May 10, 2021.", 558, new DateTime(2008, 6, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/262295.jpg", 1087, 7.86m, new DateTime(1996, 11, 12, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kagome Higurashi's ordinary life comes to an abrupt halt when a demon drags her deep into a well, transporting her five hundred years into the past. In this era, Kagome quickly learns two things: demons walk amongst humans and she has unknowingly brought a dangerous object from her world—a marble-sized sphere known as the Shikon Jewel. This unusual orb brings tremendous power to any demon who has it in their possession, and Kagome is an easy target for anyone determined enough to steal it.\n\nWhile in a fight with a demon, a hasty attempt to fend it off causes Kagome to accidentally shatter the jewel, sending countless pieces of it all over feudal Japan. She soon learns the grave consequences of her actions when she must work with the half-demon Inuyasha to collect all the pieces of the jewel before they fall into the wrong hands.\n\n[Written by MAL Rewrite]", "InuYasha", "InuYasha", "犬夜叉", 1, "https://myanimelist.net/manga/676/InuYasha", 56 },
                    { 698, "Shinseiki Evangelion was initially serialized in Shounen Ace but moved to Young Ace on July 7, 2009. Although it was set to be released just shortly before the anime series began airing, production delays pushed the anime's airing date to 10 months later. The series was published in English as Neon Genesis Evangelion by VIZ Media from December 1998 to May 2003 for seven volumes. The publisher rereleased the manga under the Action imprint from February 25, 2004, to February 10, 2015, and in 3-in-1 omnibus volumes from November 13, 2012, to June 14, 2016. It was also released in Spanish by Norma Editorial from May 2003 to January 2015; in Brazilian Portuguese by Editora JBC from November 2001 to December 2014; and in Italian by Panini Comics from October 18, 2001, to November 22, 2014.", 97, new DateTime(2013, 6, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/145061.jpg", 109, 8.57m, new DateTime(1994, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "In 1999, a meteorite crashed into Antarctica. The impact melted the continental ice mass and drastically raised sea levels, damaging the world's climate and causing the deaths of over half its population. Now in 2015, devastating creatures of unknown origin—referred to as Angels—ravage what remains of the planet.\n\nIn the heavily fortified city of Tokyo-3, 14-year-old Shinji Ikari is destined to halt the Angels' onslaught. Recruited by his father's secret organization, NERV, Shinji is enlisted as a pilot of an Evangelion, a massive bioorganic android created solely to defeat the Angels.\n\nSuddenly with the weight of the world upon his shoulders, Shinji must find the courage and drive to stand up for the future—and himself. But as skirmishes between the Evangelions and Angels become recurrent, the horrifying truth of the world is slowly revealed.\n\n[Written by MAL Rewrite]", "Shinseiki Evangelion", "Neon Genesis Evangelion", "新世紀エヴァンゲリオン", 1, "https://myanimelist.net/manga/698/Shinseiki_Evangelion", 14 },
                    { 703, "Trigun was published in English by Dark Horse Comics in two volumes from October 21, 2003, to January 10, 2004. The publisher later released a complete omnibus volume of the manga.", 22, new DateTime(1997, 1, 21, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/153055.jpg", 1634, 7.72m, new DateTime(1995, 4, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "Much of the damage attributed to \"Vash\" is caused by the activities of bounty hunters who are after the 60,000,000,000$$ (sixty billion \"double dollars\") reward on Vash's head for the destruction of a city called July. Vash does not clearly remember the destruction of July, and only wants \"love and peace,\" as he puts it; though he is a gunfighter of inhuman skill, he uses his weapons only to save lives wherever he can.\n\nAs the series progresses, more is gradually learned about Vash's mysterious history and the history of the human civilization on Gunsmoke, the desert planet the series is set on. The series is often humorous in tone, but at the same time it involves very serious character development and especially in later episodes it becomes quite emotionally intense. Vash is occasionally joined by a priest, Nicholas D. Wolfwood, who is almost as good a gunfighter as Vash himself, and later is targeted by a band of assassins known as the Gung-Ho Guns for reasons which are mysterious at first.\n\nTrigun evolves into a very serious discussion of the nature of morality, posing questions such as: What is the nature of morality? Can we judge different moral codes? If a person is forced to betray their moral code, does that betrayal invalidate that moral code, and can the person still try to live up to that moral code? Can the person find redemption from their wrongs, and if so, how?\n\n(Source: Wikipedia)\n\nIncluded one-shot:\nVolume 2: Trigun (pilot)", "Trigun", "Trigun", "トライガン", 1, "https://myanimelist.net/manga/703/Trigun", 3 },
                    { 704, "Trigun Maximum won the 40th Seiun Award in the Best Comic category in 2009. The series was published in English by Dark Horse Comics from May 26, 2004, to April 8, 2009. The publisher later collected the series in five omnibus volumes.", 102, new DateTime(2007, 3, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/55331.jpg", 346, 8.27m, new DateTime(1997, 9, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "Much of the damage attributed to \"Vash\" is caused by the activities of bounty hunters who are after the 60,000,000,000$$ (sixty billion \"double dollars\") reward on Vash's head for the destruction of a city called July. Vash does not clearly remember the destruction of July, and only wants \"love and peace\", as he puts it; though he is a gunfighter of inhuman skill, he uses his weapons only to save lives wherever he can.\n\nAs the series progresses, more is gradually learned about Vash's mysterious history and the history of the human civilization on Gunsmoke, the desert planet the series is set on. The series is often humorous in tone, but at the same time it involves very serious character development and especially in later episodes it becomes quite emotionally intense. Vash is occasionally joined by a priest, Nicholas D. Wolfwood, who is almost as good a gunfighter as Vash himself, and later is targeted by a band of assassins known as the Gung-Ho Guns for reasons which are mysterious at first.\n\nTrigun evolves into a very serious discussion of the nature of morality, posing questions such as: What is the nature of morality? Can we judge different moral codes? If a person is forced to betray their moral code, does that betrayal invalidate that moral code, and can the person still try to live up to that moral code? Can the person find redemption from their wrongs, and if so, how?\n\n(Source: Wikipedia)", "Trigun Maximum", "Trigun Maximum", "トライガンマキシマム", 1, "https://myanimelist.net/manga/704/Trigun_Maximum", 14 },
                    { 728, "Tetsuwan Atom was published in English as Astro Boy by Dark Horse based on the 23-volume bunkoban reprint from March 27, 2002 to January 28, 2004 and was published in omnibus volumes from September 23, 2015 to April 5, 2017.", 85, new DateTime(1968, 2, 29, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/186337.jpg", 4772, 7.3m, new DateTime(1951, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the distant year 2003, Japan is a technological utopia, and robots are everywhere. One such robot, Tobio, was built by the brilliant Dr. Tenma to replace his dead son. But when it soon becomes apparent that Tobio is an imperfect copy of his departed child, Dr. Tenma throws him out. He is rescued from the scrap heap by the benevolent Professor Ochanomizu, a crusader for robot civil rights. Now the little robot, renamed Astro Boy, is given a mission to defend Japan and the world from all manner of sinister threats. Using his seven super-abilities and 100,000 horsepower worth of strength to battle evil, Astro hopes to set an example to the world of the good which all robots are capable of.", "Tetsuwan Atom", "Astro Boy", "鉄腕アトム", 1, "https://myanimelist.net/manga/728/Tetsuwan_Atom", 21 },
                    { 733, "Kochikame had been the longest-running manga in the history of Weekly Shounen Jump and won the Guinness World Record for \"Most volumes published for a single manga series\". The series had two chapters published in English in the educational publication Mangajin's issues #55 and #56 (May to June 1996).", 1957, new DateTime(2016, 9, 16, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/183577.jpg", 3137, 7.47m, new DateTime(1976, 9, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "The typical Kochikame plot involves Ryou-san coming up with a money-making scheme by inventing a new gadget or capitalizing on a fad, achieving great success, calling on Nakagawa's help as things turn sour, and finally losing it all as the fad runs out of steam or out of control. While the plots are gag-driven, much of the humor comes from the juxtaposition of mundane characters with the bizarrely incongruous (Nakagawa's wealth, Maria's appeal, everyone's lack of actual police work), most of which is never explained or rationalized in the slightest.\n\n(Source: Wikipedia)\n\nIncluded one-shot:\nVolume 105: Robot Santapei", "Kochira Katsushikaku Kameari Kouenmae Hashutsujo", null, "こちら葛飾区亀有公園前派出所", 1, "https://myanimelist.net/manga/733/Kochira_Katsushikaku_Kameari_Kouenmae_Hashutsujo", 200 },
                    { 743, "20th Century Boys and 21st Century Boys' combined storyline won the Grand Prize at the 37th Japan Cartoonist Awards on May 9, 2008. VIZ Media published the manga in English under the VIZ Signature imprint from January 15, 2013, to March 19, 2013, and later as a 2-in-1 omnibus volume. It was also released in Brazilian Portuguese by Planet Manga; in Chinese by Tong Li Publishing Co., Ltd.; in French by Panini Comics; in German by Planet Manga; and in Spanish by Planeta DeAgostini. A complete edition of 21st Century Boys was released on December 28, 2016, in Japan by Shogakukan. It features the entire series in colored pages and a new ending unique to the publication. VIZ Media published the version under the title 21st Century Boys: The Perfect Edition on June 15, 2021.", 16, new DateTime(2007, 7, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/263856.jpg", 195, 8.43m, new DateTime(2006, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "As the conflict between Kenji Endo, his childhood friends, and cult leader \"Friend\" comes to an end, two mysteries remain—Friend's true identity and whether the threat of an \"anti-photon bomb\" before his death was legitimate. Hoping to find an answer, Kenji, alongside the United Nations, decides to use a virtual reality program created from Friend's childhood memories in this conclusion to a long journey that will span dozens of decades.\n\n[Written by MAL Rewrite]", "21st Century Boys", "21st Century Boys", "21世紀少年", 1, "https://myanimelist.net/manga/743/21st_Century_Boys", 2 },
                    { 745, "Celebrating the 50th anniversary of Osamu Tezuka's acclaimed Tetsuwan Atom, seinen mangaka Naoki Urasawa collaborated with Tezuka Productions to create a dark adaptation of The Greatest Robot on Earth story arc. The adaptation shifts the focus from Tezuka's protagonist, Atom, to his supporting character Gesicht in order to better ground the story in realism. Pluto won the ninth Tezuka Osamu Cultural Prize and the Excellence Prize in the Manga Division at the seventh Japan Media Arts Festival in 2005. It also won the 41st Seiun Award for Best Comic in 2010. The series was published in English as Pluto: Urasawa x Tezuka by VIZ Media under the VIZ Signature imprint from February 17, 2009, to April 6, 2010.", 65, new DateTime(2009, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/264496.jpg", 84, 8.62m, new DateTime(2003, 9, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "Famous for his military service in the 39th Asian War, the legendary Swiss robot Montblanc is violently murdered. Humans and robots around the world mourn for the beloved celebrity. Montblanc's popularity only grew in the years following the war, thanks to his dedication to nature conservation and his loving personality.\n\nFellow war veteran and robotic Europol detective Gesicht is sent to investigate Montblanc's tragic demise. In his pursuit, Gesicht uncovers evidence of a mysterious entity known only as \"Pluto.\" He also learns of a conspiratorial plot to dismantle the eight specialized robots from around the world who participated in the war. Racing against time to save those who still remain, Gesicht grapples with his memory, morality, and a world full of hate, desperately attempting to defend the fragile coexistence of man and machine.\n\n[Written by MAL Rewrite]", "Pluto", "Pluto: Urasawa x Tezuka", "PLUTO", 1, "https://myanimelist.net/manga/745/Pluto", 8 },
                    { 760, "Shinseiki Evangelion: Koutetsu no Girlfriend 2nd is based on Gainax's . While the first four volumes are an adaptation of the game, the final two are exclusive stories based on the characters in the game. The series was published in English as Neon Genesis Evangelion: Angelic Days by ADV Manga from May 16, 2006 to August 21, 2007.", 27, new DateTime(2005, 9, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/145059.jpg", 15439, 6.55m, new DateTime(2003, 8, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Enjoying a peaceful life in New-Tokyo 3, high school student Shinji Ikari spends the days with his close-knit group of friends, consisting of his pushy childhood friend Asuka Langley Souryuu; slackers Touji Suzuhara and Kensuke Aida; student president Hikari Horaki; and the eloquent oddity Kaworu Nagisa. However, the arrival of bubbly transfer student Rei Ayanami shakes up the group's status quo, causing a web of love triangles, crushes, and confessions to come bursting forth. Yet the complex state of their relationships becomes the least of their worries when United Nations agency NERV recruits them for experiments shrouded in mystery. As NERV continues to impede on the students' lives, Shinji and his friends are set on an irreversible path, with their angelic days long behind them.\n\nAn alternate retelling of a classic anime series, Shinseiki Evangelion: Koutetsu no Girlfriend 2nd reinvents these characters as normal students in a world vastly different from the one presented in Neon Genesis Evangelion.\n\n[Written by MAL Rewrite]", "Shinseiki Evangelion: Koutetsu no Girlfriend 2nd", "Neon Genesis Evangelion: Angelic Days", "新世紀エヴァンゲリオン 鋼鉄のガールフレンド2nd", 1, "https://myanimelist.net/manga/760/Shinseiki_Evangelion__Koutetsu_no_Girlfriend_2nd", 6 },
                    { 792, "City Hunter was partially published in English by Gutsoon! Entertainment, who published the first five volumes from June 18, 2003 to April 28, 2004. It has been published digitally in English by Coamix through Manga Hot. The series was adapted into a live action movie in 2024.", 193, new DateTime(1991, 11, 18, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/272237.jpg", 541, 8.12m, new DateTime(1985, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ryo Saeba is a \"sweeper\" in the city of Tokyo. His works as a trouble shooter, cleaning the streets of vermin, and helping out desperate people. Sometimes he's a bodyguard, sometimes he's an assassin, whatever Ryo does he does it well. In fact his only flaw is his hormones - he loves the ladies and sometimes turns into an idiot when he's near them. Thankfully he's got people like his partner Kaori Makimura to keep him in check.\n\n(Source: ANN)", "City Hunter", "City Hunter", "シティーハンター", 1, "https://myanimelist.net/manga/792/City_Hunter", 35 },
                    { 793, "Wanted! was published in Italian by Star Comics as One Piece - Wanted! on September 3, 2003.", 5, new DateTime(1996, 9, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/170782.jpg", 4613, 7.31m, new DateTime(1991, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "A collection of short stories drawn by Oda Eiichiro before One Piece became a major hit.\n\n1. Wanted!\n2. Kami kara Mirai no Present (God's Gift for the Future)\n3. Ikki Yakou\n4. Monsters\n5. Romance Dawn", "Wanted!", "Wanted! Eiichiro Oda Before One Piece", "WANTED! 尾田栄一郎短編集", 1, "https://myanimelist.net/manga/793/Wanted", 1 },
                    { 796, "Dr. Slump was awarded the 27th Shogakukan Manga Award for best shounen and shoujo manga in 1981. The series was published in English by VIZ Media from May 3, 2005 to May 5, 2009—this release included some censorship and translation changes. Before this, it had been introduced to the English-speaking readership in the educational publication Mangajin in February 1994, in issues 32 and 33.", 236, new DateTime(1984, 8, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/156408.jpg", 1762, 7.69m, new DateTime(1980, 1, 21, 16, 0, 0, 0, DateTimeKind.Local), 2, "When goofy inventor Senbei Norimaki creates a precocious robot named Arale, his masterpiece turns out to be more than he bargained for!\n\nBasking in the glow of his scientific achievement, Senbei scrambles to get Arale in working order so the rest of Penguin Village won't have reason to suspect she's not really a girl. But first Senbei needs to find her a pair of glasses and some clothes...\n\n(Source: VIZ Media)", "Dr. Slump", "Dr. Slump", "Dr. スランプ", 1, "https://myanimelist.net/manga/796/Dr_Slump", 18 },
                    { 872, "A 17-volume kanzenban version dubbed as JoJonium was published in Japan from December 4, 2013, to March 4, 2015. This edition covered the first three parts of the Jojo no Kimyou na Bouken series and included new cover art which showed redesigns of the characters by Araki Hirohiko. JoJonium's volumes 8-17 cover the third part. JoJo no Kimyou na Bouken Part 3: Stardust Crusaders was published in English by VIZ Media from November 8th, 2005, to December 7th, 2010 under the title JoJo's Bizarre Adventure. It was not labeled as Part 3 until later; this was due to it being the first of the series to be published in English. The publisher has published the series uncensored following the JoJonium format and content from November 1, 2016 to February 5, 2019. It was also published in Italian by Star Comics from March 1995 to March 1997. Several minor changes were made to the English release, apart from changes to several copyrighted stand users names and violence to animals and children being changed, an online group of Muslim protesters halted the release of the manga for a year. This was due to a scene in the OVA where the antagonist, Dio Brando is seen reading pages from the Qu'ran—which was not even present in the manga. Shueisha requested many scenes featuring fighting which involved buildings resembling mosques be redrawn.", 152, new DateTime(1992, 4, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/269909.jpg", 604, 8.09m, new DateTime(1989, 3, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "In 1989, Joseph Joestar arrives in Japan to meet his troubled grandson Joutarou Kuujou at the request of his daughter Holly. Joutarou has locked himself in a jail cell out of fear that an evil spirit is possessing him and that he may cause harm to others. However, Joseph reveals the truth to Joutarou: this \"spirit\" is really a \"Stand,\" a physical manifestation of one's fighting spirit. What's more, Joseph and his companion Mohammed Avdol possess Stands of their own and have learned to control them with ease.\n\nJoseph's arrival comes with another piece of news: an old family enemy has returned from the grave, causing the Stands of the Joestar family to awaken. However, when a Stand manifests within Holly, her inability to cope with it leaves her gravely ill, stirring the men into action.\n\nArmed with the power of Stands, a globe-trotting adventure from Japan to Egypt—where their adversary resides—begins. Meeting an array of nefarious Stand users along the way, as well as new allies, the team leads a crusade to save Holly and put an end to their enemy for good.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 3: Stardust Crusaders", "JoJo's Bizarre Adventure Part 3: Stardust Crusaders", "ジョジョの奇妙な冒険 スターダストクルセイダース", 1, "https://myanimelist.net/manga/872/JoJo_no_Kimyou_na_Bouken_Part_3__Stardust_Crusaders", 16 },
                    { 881, "", 1, null, "https://cdn.myanimelist.net/images/manga/2/310862.jpg", 16445, 6.47m, new DateTime(2006, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "Cross Epoch is a one-shot Japanese manga collaboration by Akira Toriyama and Eiichiro Oda. It is a crossover between their respective manga Dragon Ball and One Piece.", "Cross Epoch", "Cross Epoch", "CROSS EPOCH クロス エポック", 3, "https://myanimelist.net/manga/881/Cross_Epoch", null },
                    { 1009, "Hachimitsu to Clover won the 27th Kodansha Manga Award in shoujo category in 2007. The series started serialization in CUTiE Comic magazine (chapters 1-14), and after suspension of the magazine, moved to Young You (chapters 15-56), and the last 8 chapters were published in Chorus (chapters 57-64). The series was published in English as Honey and Clover by VIZ Media under the Shojo Beat imprint from March 4, 2008 to June 1, 2010.", 71, new DateTime(2006, 7, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/184591.jpg", 349, 8.26m, new DateTime(2000, 4, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "Takemoto lives in a run down student apartment, where his greatest worry is when he'll next be able to afford to eat meat and whether he'll get to class on time. Although he's away from home and living on his own, Takemoto is far from finished growing up. Along with his crazy cast of friends, Morita, Mayama, Yamada, and Hagumi, Takemoto sets out to discover life and his true self.\n\n(Source: VIZ Media)\n\nIncluded one-shots:\nVolume 10: Sora no Kotori, Hoshi no Opera", "Hachimitsu to Clover", "Honey and Clover", "ハチミツとクローバー", 1, "https://myanimelist.net/manga/1009/Hachimitsu_to_Clover", 10 },
                    { 1023, "Koukaku Kidoutai: The Ghost in the Shell was published in Japan as an English-Japanese bilingual edition by Kodansha on September 6, 2002. The series was released in English by Dark Horse Comics into eight comic issues from March 1, 1995, to October 1, 1995, and later into a single volume on December 1, 1995. An uncensored version was published on October 6, 2004. Kodansha Comics USA republished the censored version on October 13, 2009. It was also released in Brazilian Portuguese by Editora JBC in December 2016. A video game based on the series was released on the PlayStation on July 17, 1997, developed by Exact and Production I.G. The manga was also adapted into a Western live-action film that premiered on March 31, 2017.", 11, new DateTime(1991, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/155733.jpg", 820, 7.96m, new DateTime(1989, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "The year is 2029. The world has endured four world wars and ushered in a new age of technological advancement that has largely transformed society as humanity knows it. Cybernetic enhancements, robotic AIs, and cyborgs have now become the norm in a world where humans are more machine than man. However, with this modern change, crime started evolving as well: hackers, corrupt officials, and other opportunists have found ways to sneak into innovative systems for their own personal agendas.\n\nIn Japan, where such crimes run rampant, the government establishes Section 9—a clandestine team of highly trained operatives—to counter these threats. Major Motoko Kusanagi, a woman of impenetrable caliber and bravado, leads Section 9 on its mission to tackle cyberterrorism and ensure that the nation's stability does not falter in the pace of the rapidly progressing future.\n\n[Written by MAL Rewrite]", "Koukaku Kidoutai: The Ghost in the Shell", "The Ghost in the Shell", "攻殻機動隊 THE GHOST IN THE SHELL", 1, "https://myanimelist.net/manga/1023/Koukaku_Kidoutai__The_Ghost_in_the_Shell", 1 },
                    { 1026, "Koukaku Kidoutai 2: Manmachine Interface was originally released in hardcover format in a limited edition box set titled Koukaku Kidoutai SOLID BOX on December 1, 2000. Kodansha later released the standard edition in tankoubon format on June 26, 2001. The SOLID BOX version added over 140 pages of new content and more changes were added to the tankoubon version, such as 24 color pages and large modifications to over 20 pages. However, 200 pages from the original version that ran in Young Magazine were not included in either versions. The series was published in English as The Ghost in the Shell Volume 2: Man-Machine Interface by Dark Horse, initially into 11 comic issues from January 29, 2003 to December 31, 2003 and later into a single volume on January 12, 2005. Kodansha Comics USA picked up the license and republished it on August 10, 2010. The Japanese publisher Kodansha published a bilingual version (in English and Japanese) on March 2011.", 6, null, "https://cdn.myanimelist.net/images/manga/3/421.jpg", 14111, 6.65m, new DateTime(2001, 6, 27, 17, 0, 0, 0, DateTimeKind.Local), 2, "The series follows the mysterious Motoko Aramaki as she runs an investigation into a incident at an organ factory and it's consequences. she's on the run to clean up the mess and save herself in the process Meanwhile the former members of section 9 investigate Motoko to find out who she really is.\n\n(Source: ANN)", "Koukaku Kidoutai 2: Manmachine Interface", "The Ghost in the Shell 2: Man-Machine Interface", "攻殻機動隊2 MANMACHINE INTERFACE", 1, "https://myanimelist.net/manga/1026/Koukaku_Kidoutai_2__Manmachine_Interface", 1 },
                    { 1028, "Koukaku Kidoutai 1.5: Human-Error Processer contains four chapters previously released, but not published in tankoubon format. The original edition released on July 23, 2003, contained a booklet and a CD-ROM featuring the full stories and adding music to the manga scenes, as well as a screensaver. The series was published in English as The Ghost in the Shell 1.5 by Dark Horse Comics, initially as eight individual comic issues from November 1, 2006, to June 6, 2007, and later into a single volume on October 10, 2007. Kodansha Comics USA picked up the license and republished it on September 25, 2012. It was also released in Brazilian Portuguese by Editora JBC on December 19, 2019.", 7, new DateTime(1996, 7, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/175989.jpg", 4614, 7.31m, new DateTime(1990, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ghost in the Shell 1.5: Human-Error Processor presents the \"lost\" Ghost in the Shell stories, created by Shirow Masamune after completing work on the original Ghost in the Shell manga and prior to his tour-de-force, Ghost in the Shell 2: Man-Machine Interface, but never collected until now. Focusing on Section 9 agents in their daily battle against technocrime, Human-Error Processor has all the mind-twisting cybermadness you've come to expect from Ghost in the Shell but set in a more police-procedural context with action and suspense galore.\n\n(Source: Dark Horse Comics)", "Koukaku Kidoutai 1.5: Human-Error Processer", "The Ghost in the Shell 1.5", "攻殻機動隊1.5 HUMAN-ERROR PROCESSER", 1, "https://myanimelist.net/manga/1028/Koukaku_Kidoutai_15__Human-Error_Processer", 1 },
                    { 1045, "As of 2022, over 50 million copies of Saint Seiya are in circulation. The series was published in English by VIZ Media as Knights of the Zodiac from January 21, 2004, to February 2, 2010. It was also published in French by Kana from March 8, 1997, to December 9, 2000; in Italian by Granata Press from July 1, 1992, to June 15, 1994; in Spanish by Panini Comics; in German by Panini Comics; in Brazilian Portuguese by Conrad Editora from November 2000 to January 2004; and in Chinese by Ching Win Publishing Co., Ltd.", 110, new DateTime(1990, 11, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/252107.jpg", 2826, 7.51m, new DateTime(1985, 12, 2, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ages ago, the goddess Athena was served by fighters called Saints who channeled the power of the Cosmos within them. Now a youth named Seiya has trained to become a Saint himself by earning the mystical Cloth of Pegasus. He is joined by other Saints with Cloths of their own to fight for Athena.\n\n(Source: ANN)", "Saint Seiya", "Knights of the Zodiac", "聖闘士星矢", 1, "https://myanimelist.net/manga/1045/Saint_Seiya", 28 },
                    { 1046, "", 87, new DateTime(2013, 6, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/163118.jpg", 5093, 7.27m, new DateTime(2002, 12, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "In ancient times, the Titan Cronos (son of Uranus the sky and Gaia the earth) and his wife Rhea gave birth to six children. Five of them were swallowed by Cronos, and only one was saved, Zeus, hidden from Cronos by Rhea. Upon reaching adulthood, Zeus forces his father to vomit the other five gods. Zeus, along with his brothers and sisters, decide to battle the Titans for control of the universe. Cronos and the other eleven Titans lose the battle and are sent to Tartarus.\n\nThousands of year later, in Greece, the Pope visits the room of the recently reincarnated infant Athena, with a golden dagger. Before he can kill her, the Gold Saint Saggitarius Aiolos saves her, and unmasks the Pope. Aiolos, horrified, flees. The Pope declares him a traitor to the Sanctuary, and has Capricorn Shura murder him. This causes his younger brother, Leo Aiolia, to grow under the shadow of his \"traitor\" brother, suffering from all manner of abuse and scorn. This leaves him with a grudge against the Gold Saints and Sanctuary as a whole, which causes the Pope and most of the Sanctuary to distrust him. To make things worse, the enemies of God Zeus, the Titans, are revived and begin to seek vengeance against him and the Sanctuary. This marks the start of Aiola's story and the battle of the Gold Saints against the Titans.\n\n(Source: Wikipedia)", "Saint Seiya Episode G", null, "聖闘士星矢EPISODE.G", 1, "https://myanimelist.net/manga/1046/Saint_Seiya_Episode_G", 20 },
                    { 1047, "Saint Seiya: The Lost Canvas - Meiou Shinwa was published in Brazilian Portuguese by Editora JBC from August 2007 to February 2012.", 223, new DateTime(2011, 4, 6, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/163126.jpg", 347, 8.27m, new DateTime(2006, 9, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "This manga tells the story of the previous Holy war of the universe of Saint Seiya, taking place in the XVIII century, 250 years before the original manga. The story centers on the relation between Tenma, the Pegasus Saint and his beloved friend, Alone, who would eventually become his greatest enemy, Hades.\n\n(Source: Wikipedia)", "Saint Seiya: The Lost Canvas - Meiou Shinwa", null, "聖闘士星矢 THE LOST CANVAS 冥王神話", 1, "https://myanimelist.net/manga/1047/Saint_Seiya__The_Lost_Canvas_-_Meiou_Shinwa", 25 },
                    { 1057, "Batman: Child of Dreams was published in English by DC Comics, the hardcover edition on March 1, 2003 and the paperback edition on December 1, 2003. Titan Books published the title for the British market, the hardcover edition on May 30, 2003, and the paperback edition on March 1, 2004.", 10, new DateTime(2001, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/23510.jpg", 11341, 6.83m, new DateTime(2000, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "While doing a news story in Gotham City, a documentary team from Tokyo films Batman as he rescues a group of hostages from the villianous Two-Face. The only problem is that Two-Face is still locked up in Arkham Asylum, and the man they captured is dead. Soon, other copies of Batman's famous rogues' gallery begin appearing all over Gotham, and the trail leads to a drug coming from Tokyo.\n\n(Source: Wikipedia)", "Batman: Child of Dreams", "Batman: Child of Dreams", "BATMAN CHILD OF DREAMS", 1, "https://myanimelist.net/manga/1057/Batman__Child_of_Dreams", 2 },
                    { 1061, "Meitantei Conan was awarded the 46th Shogakukan Manga Award in the Shounen category in 2000. It has sold over 270 million copies as of January 2023, making it the third best-selling manga series of all time. The series has been published in English as Case Closed by VIZ Media under the Shonen Sunday imprint since September 7, 2004. The series has been simulpub in English through VIZ Manga since May 9, 2023. It is also published by Shogakukan Asian as Detective Conan, keeping the original Japanese names. Shogakukan Asian has also been publishing Detective Conan Kaito Kid Special Collection, a compilation of cases that feature the character Kaito Kuroba, since July 2017.", null, null, "https://cdn.myanimelist.net/images/manga/1/97267.jpg", 329, 8.28m, new DateTime(1994, 1, 4, 16, 0, 0, 0, DateTimeKind.Local), 4, "Hailed as the savior of the Japanese Police Department, high school detective Shinichi Kudou uses a combination of observational skills, critical thinking, and all-around knowledge to solve cases that leave the police stumped.\n\nOne day, while at an outing with childhood friend Ran Mouri, Shinichi bears witness to a suspicious transaction between two men and is caught. As a result, he is forced to ingest a poison that is supposed to kill him, but unexpectedly shrinks his body to the size of a grade-schooler instead. Now believed to be dead, Shinichi takes up the alias of Conan Edogawa (a compound of the names of the famous mystery authors Arthur Conan Doyle and Ranpo Edogawa) in order to hide his identity and begins his new life as a seven-year-old living with Ran and her private detective father.\n\nMeitantei Conan follows Conan as he continues to solve murder cases, all while slowly working toward exposing the men who shrunk him and eventually restoring his body.\n\n[Written by MAL Rewrite]", "Meitantei Conan", "Case Closed", "名探偵コナン", 1, "https://myanimelist.net/manga/1061/Meitantei_Conan", null },
                    { 1224, "3-gatsu no Lion was nominated for the second Manga Taisho Award in 2009 and won the fourth Manga Taisho Award in 2011. In the same year, it also won the 35th Kodansha Manga Award in the General category, along with Uchuu Kyoudai. In 2014, the series won the 18th Tezuka Osamu Cultural Prize Grand Award. The manga won the Grand Prize in the Manga Division at the 24th Japan Media Arts Festival in 2021. The series has been published in English as March Comes in Like a Lion by Denpa since June 6, 2023. It has also been published in Italian by Panini Comics since February 13, 2011; in Spanish by ECC Ediciones since October 31, 2017; and in Polish by Dango since April 26, 2019. The manga was adapted into a two-part Japanese live-action film that was released on March 18, 2017, and April 22, 2017, respectively.", null, null, "https://cdn.myanimelist.net/images/manga/2/52283.jpg", 27, 8.86m, new DateTime(2007, 7, 12, 17, 0, 0, 0, DateTimeKind.Local), 4, "Rei Kiriyama is an extraordinary shogi player. Among the few elites to have gone professional as a middle school student, he is considered a genius. But what lies behind his prodigious facade is a teenage boy who suffers immense pressure from both his family and from the high expectations from the shogi community. Rei moves out to live a more independent life away from his family, but his unorganized lifestyle and unsociable personality show no signs of improvement.\n\nHowever, in a twist of fate that will prove to be a turning point in his life, Rei encounters the Kawamoto sisters—the motherly Akari, the passionate Hinata, and the energetic Momo—who take great care of him. 3-gatsu no Lion tells the story of Rei as he reshapes his melancholic life and picks up the courage to begin facing the problems he evaded during his past.\n\n[Written by MAL Rewrite]", "3-gatsu no Lion", "March Comes in Like a Lion", "3月のライオン", 1, "https://myanimelist.net/manga/1224/3-gatsu_no_Lion", null },
                    { 1298, "Golgo 13 is the oldest manga still in publication and has the highest volume count for a single series. The series is also the second best-selling manga of all time behind One Piece, having sold over 300 million copies. The series was published in English by VIZ Media under the VIZ Signature imprint and 13 volumes were published from February 21, 2006 to February 19, 2008. These volumes are a compilation of stories picked from the forty-year history of the manga, and each ends with an editorial commentary about Golgo 13 as a cultural phenomenon in Japan. Glénat published the series in French in two compilation books titled Best 13 of Golgo 13. Each book collected 13 stories from the manga's history with the first book being reader's choice (April 26, 2006) and the second being the author's choice (February 13, 2008).", null, null, "https://cdn.myanimelist.net/images/manga/3/157750.jpg", 1992, 7.65m, new DateTime(1968, 11, 28, 16, 0, 0, 0, DateTimeKind.Local), 4, "For four decades, Golgo 13 has been the world's greatest assassin for hire - sometimes to settle a private score, and sometimes to change history!\n\nHis real name and nationality are unknown - but his legend is everywhere. G13 never fails a job, and never sees his clients again...\n\n...unless they try and betray him!", "Golgo 13", "Golgo 13", "ゴルゴ13", 1, "https://myanimelist.net/manga/1298/Golgo_13", null },
                    { 1322, "", 121, new DateTime(2024, 7, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/163134.jpg", 7864, 7.06m, new DateTime(2006, 4, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "In 1990, in Elysium; the five saints Seiya, Hyoga, Shun, Shiryu and Ikki are battling the god Hades. During the battle, Hades starts remembering that he has seen Seiya's face before and comes to the conclusion that he faced him before, and thus the story begins...", "Saint Seiya: Next Dimension - Meiou Shinwa", null, "聖闘士星矢 NEXT DIMENSION 冥王神話", 1, "https://myanimelist.net/manga/1322/Saint_Seiya__Next_Dimension_-_Meiou_Shinwa", 16 },
                    { 1342, "Baccano! won the Dengeki Novel Gold Prize in 2002. Two drama CDs were released; the first was 1931 The Grand Punk Railroad, a retelling of the 2nd and 3rd novels, released on March 31, 2006. The second was Firo Prochainezo witnesses the 53rd death of Pietro Gonzalez, released on October 24, 2007. The series was published in English by Yen Press under the Yen On imprint in hardcover format from May 24, 2016 to May 23, 2023.", null, new DateTime(2016, 8, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/172736.jpg", 140, 8.51m, new DateTime(2003, 2, 9, 16, 0, 0, 0, DateTimeKind.Local), 3, "Aboard the Advenna Avis in 1711, a group of alchemists summon a demon in the hopes of gaining eternal life. The demon gives them an elixir of immortality and the method of ending their existence by \"devouring\" one another. Soon after, one among them begins to devour his companions. Realizing the danger posed by staying together, they scatter across the globe.\n\nCenturies later in 1930's America, a certain federal investigator tries his best to combat the rise of organized crime during Prohibition, send a particularly infuriating terrorist to Alcatraz, and catch an outrageous thief duo. Meanwhile, the transcontinental train, the Flying Pussyfoot, begins its trail of blood across the country.\n\nIn 2002, a small group of the original Advenna Avis alchemists are on a journey to find the rest of their fellow immortals. However, there is one companion they did not expect to meet again.\n\nSeemingly unrelated events, from a sleepy Italian city in the early 1700's to a modern luxury cruise ship traveling across the Pacific, reveal themselves to be far more connected than anyone could imagine...\n\n(Source: Wikipedia, MAL Rewrite)", "Baccano!", "Baccano!", "バッカーノ!", 2, "https://myanimelist.net/manga/1342/Baccano", 22 },
                    { 1348, "On October 6, 2006, Boukenou Beet was put on hiatus due to Koji Inada's illness. Furthermore, with the discontinuation of Shounen Jump (Monthly) on June 6, 2007, it was put on an indefinite hiatus instead. On December 21, 2015, in the combined third and fourth issue of Weekly Shounen Jump, it was announced that the series would resume serialization in the Spring issue of Jump SQ.Crown, which was published on April 16, 2016. Boukenou Beet has been published in English as Beet the Vandel Buster by VIZ Media under the Shonen Jump imprint since October 19, 2004.", null, null, "https://cdn.myanimelist.net/images/manga/2/169816.jpg", 6425, 7.16m, new DateTime(2002, 3, 5, 16, 0, 0, 0, DateTimeKind.Local), 4, "It's the Century of Darkness where monsters known as Vandels rule the world, and the Vandel Busters are the only ones who can fight them. When a group of Busters are killed in battle, they pass on their magic Saiga weapons to Beet, making him the strongest Buster ever. But Beet won't just fight the Vandels—he wants to destroy them and finally end the Century of Darkness.\n\n(Source: VIZ Media)", "Boukenou Beet", "Beet the Vandel Buster", "冒険王ビィト", 1, "https://myanimelist.net/manga/1348/Boukenou_Beet", null },
                    { 1414, "SKET Dance won the 55th Shogakukan Manga Award for best shounen manga in 2009.", 288, new DateTime(2013, 7, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/173959.jpg", 244, 8.37m, new DateTime(2007, 7, 13, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kaimei High School is full of eccentric individuals, students, and teachers alike. Amongst the school's many clubs is the SKET Brigade, officially known as the Living Assistance Club. Comprised of the somewhat idiotic Yuusuke \"Bossun\" Fujisaki, the gallant Hime \"Himeko\" Onizuka, and the silent but surprisingly popular Kazuyoshi \"Switch\" Usui, the SKET Brigade is dedicated to solving various problems on campus. However, the club rarely receives requests, so the members spend most of their time messing around with random, trivial matters. Both hilarious and heartwarming, SKET Dance is a lighthearted comedy following the daily high school lives of an odd trio of friends.\n\n[Written by MAL Rewrite]", "SKET Dance", null, "SKET DANCE", 1, "https://myanimelist.net/manga/1414/SKET_Dance", 32 },
                    { 1442, "", 48, new DateTime(1990, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/197841.jpg", 10604, 6.88m, new DateTime(1973, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "A shocking and violent look at a post apocalyptic future. Many different stories centre around an array of characters dealing with life in this desolate world. All the stories feature a huge man named Jack who is in an ongoing battle with a villain named Slum King.\n\n(Source: ANN)\n\nNote: This is kanzenban version which consists of: 7 volumes (published by Kodansha) and 31 volumes (published by Nihon Bungeisha) merged into 18 volumes.", "Violence Jack", "Violence Jack", "バイオレンスジャック", 1, "https://myanimelist.net/manga/1442/Violence_Jack", 18 },
                    { 1474, "As of March 2017, over 50 million copies of Devilman have been sold worldwide. The series was published in English by Seven Seas Entertainment as two omnibus volumes from May 22, 2018, to November 13, 2018. The manga was also released as five Japanese-English bilingual volumes by Kodansha. It was also published in Brazilian Portuguese by NewPOP Editora as two omnibus volumes from November 23, 2019, to March 26, 2020.", 53, new DateTime(1973, 6, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/1431.jpg", 696, 8.03m, new DateTime(1972, 6, 10, 17, 0, 0, 0, DateTimeKind.Local), 2, "Soft-hearted Akira Fudou has always been somewhat of a pushover. When he reunites with his childhood friend, Ryou Asuka, in a fateful encounter, Ryou reveals to him the terrifying reality of his father's research: demons exist and are planning to claim possession of the earth once again.\n\nEager to help his friend save humanity, Akira agrees to attend Black Sabbath, a party filled with depravity and corruption, to attempt to merge with a demon. A near-death encounter causes him to unify with Amon, a demon feared amongst even his own kind. Together they form Devilman, a combination of Amon's strength and Akira's pure heart.\n\nAfter uniting with Amon, Akira begins to fight against the demons with his newfound power, desperate to stop the downfall of all human civilization.\n\n[Written by MAL Rewrite]", "Devilman", "Devilman", "デビルマン", 1, "https://myanimelist.net/manga/1474/Devilman", 5 },
                    { 1475, "", 65, new DateTime(2000, 7, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/25226.jpg", 17250, 6.38m, new DateTime(1997, 1, 29, 16, 0, 0, 0, DateTimeKind.Local), 2, "Fudo Jun is a school teacher having dreams of uncontrollable urges of violence.  She takes the school tennis team on a trip where they are attacked by demons.  To try and save the girls and herself she ends up unleashing Devilman Lady.", "Devilman Lady", "The Devil Lady", "デビルマン レディー", 1, "https://myanimelist.net/manga/1475/Devilman_Lady", 17 },
                    { 1505, "Bobobo-bo Bo-bobo was published in English by VIZ Media starting with a compilation volume under its Shonen Jump Advanced imprint featuring chapters from volumes 9 and 10, which was released on November 5, 2005. After serialization in the US edition of Shonen Jump began in July 2007, publication of the manga started at volume 11, but were re-labeled as volume 1 from August 5, 2008, to October 5, 2010, for five volumes, ending at volume 15. It was also published in Spanish by Planeta Cómic from November 2007 to May 2011; and in Italian by Planeta DeAgostini Comics from November 9, 2007, to May 8, 2011.", 230, new DateTime(2005, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/274714.jpg", 3211, 7.46m, new DateTime(2001, 2, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the year 300X, Earth is terrorized by the evil Maruhage Empire, which will stop at nothing to rid the entire population of their hair. But now, one afro-wearing man stands his way. He has the ability to communicate with other people's hair and use his own nasal hair to defeat the Maruhage Empire's bald henchmen. His name: Bobobo-bo Bo-bobo.", "Bobobo-bo Bo-bobo", "Bobobo-bo Bo-bobo", "ボボボーボ・ボーボボ", 1, "https://myanimelist.net/manga/1505/Bobobo-bo_Bo-bobo", 21 },
                    { 1512, "Angel Heart was published in English on the website Silent Manga Audition from December 25, 2015 to December 25, 2016. 13 chapters were published before release was halted. The manga was adapted into a live-action TV series in 2015.", 363, new DateTime(2010, 8, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/195179.jpg", 3377, 7.44m, new DateTime(2001, 5, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "A young Taiwanese assassin codenamed \"Glass Heart\" committed suicide by jumping off a building, and her heart was pierced by a metal fence. Miraculously, her life was saved by heart transplantation. During her recovery she began to experience strange dreams, which led her to Japan looking for the donor of her heart, who happens to be Kaori Makimura, former partner of City Hunter.\n\n(Source: MU)", "Angel Heart", null, "エンジェル・ハート", 1, "https://myanimelist.net/manga/1512/Angel_Heart", 33 },
                    { 1517, "A 17-volume kanzenban version dubbed as JoJonium was published in Japan from December 4, 2013, to March 4, 2015. This edition covered the first three parts of the Jojo no Kimyou na Bouken series and included new cover art which showed redesigns of the characters by Araki Hirohiko. JoJonium's first three volumes cover the first part. JoJo no Kimyou na Bouken Part 1: Phantom Blood was published in English by VIZ Media as JoJo's Bizarre Adventure Part 1: Phantom Blood from February 24 to August 4, 2015. These were released in a hardback format featuring the JoJonium artwork and contents. It was also published in Italy by Star Comics from from November 1993 to May 1994, and in Spain by Editorial Ivrea following the JoJonium format from June 30 to September 21, 2017. A beat'em up video game based on the series developed by Namco Bandai Games Inc. was released in Japan on October 26, 2006. JoJo’s Bizarre Adventure has more than 100 million copies in print, making it one of the best-selling manga series in history. Phantom Blood is the first story arc of JoJo’s Bizarre Adventure with Dio.", 44, new DateTime(1987, 10, 12, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/269907.jpg", 4833, 7.29m, new DateTime(1986, 12, 1, 16, 0, 0, 0, DateTimeKind.Local), 2, "While the gold rush takes Europe by storm, a young Jonathan Joestar lives a life of luxury with his father at their estate in Liverpool, England. Jonathan, known by his peers as JoJo, spends his days playing the part of a gentleman and living a carefree life. However, those peaceful days soon came to an end when Dio Brando intrudes upon him. \n\nDio is a young boy from London who is adopted into the Joestar family due to a debt Jonathan's father owed to Dio's father. While Jonathan is receptive towards having a new brother, Dio schemes against the Joestars in order to inherit the fortune. As Dio's schemes get out of hand, Jonathan  is forced to confront him once and for all.\n\nThus begins the story of the Joestar bloodline, as Jonathan matures with and eventually combats his adoptive brother while encountering bizarre new friends and foes.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 1: Phantom Blood", "JoJo's Bizarre Adventure Part 1: Phantom Blood", "ジョジョの奇妙な冒険 ファントムブラッド", 1, "https://myanimelist.net/manga/1517/JoJo_no_Kimyou_na_Bouken_Part_1__Phantom_Blood", 5 },
                    { 1546, "", 8, null, "https://cdn.myanimelist.net/images/manga/5/126995.jpg", 3340, 7.44m, new DateTime(1997, 7, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "A series of short manga stories, revealing important background details about the five young Gundam pilots and Relena Peacecraft. Episode Zero explains such details from the series as the origin of Duo Maxwell's nickname \"Shinigami\" (Grim Reaper/God of Death), Quatre Raberba Winner's link with the Maganac mercenaries, and other elements that would go on to play major roles in the Gundam Wing anime and its sequel, Endless Waltz.\n\nBefore the outbreak of the colony war, forces were at work shaping the future and preparing its players for the final game. As children, each of the Gundam pilots endured hardships that would have broken the will of any normal person. Gundam pilots Duo Maxwell, Heero Yuy, Trowa Barton, Quatre Rabbera Winner and Chang Wufei have endured more pain and difficulties than most people experience in a lifetime. But not even their comrades in arms could have known about the even more tumultuous childhoods as war orphans and other hardships.\n\n(Source: ANN)", "Shin Kidou Senki Gundam Wing: Episode Zero", "Mobile Suit Gundam Wing: Episode Zero", "新機動戦記ガンダムW EPISODE ZERO", 1, "https://myanimelist.net/manga/1546/Shin_Kidou_Senki_Gundam_Wing__Episode_Zero", 1 },
                    { 1551, "", null, new DateTime(1975, 5, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/272716.jpg", 6762, 7.14m, new DateTime(1974, 4, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "The first Getter Robo series chronologically published 15 years before the rest of the manga. Getter Robo pioneered the idea of the combining and transforming robot.\n\nMillions of years ago, the dinosaurs were driven deep underground due to the sudden arrival of \"Getter Rays\" on Earth. After evolving into sentient beings, they grew bitter and vengeful at the humans who replaced them on the surface and began plotting their attack on humanity.\n\nFighting against them is Getter Robo, a machine built by Professor Saotome which uses the mysterious Getter Rays as its power source. Piloting it are three strong-willed young men—the violent martial artist Nagare Ryoma, the psychopathic yet highly intelligent revolutionary Jin Hayato, and the hot-blooded judo master Tomoe Musashi. Each controls one of three specially designed combat jets which can be combined together in different forms to form three different kinds of giant robots: the flying, axe-wielding Getter-1, the quick, drill-wielding Getter-2, and the tough, tank-like Getter-3.", "Getter Robo", null, "ゲッターロボ", 1, "https://myanimelist.net/manga/1551/Getter_Robo", 4 },
                    { 1630, "A 17-volume kanzenban version dubbed as JoJonium was published in Japan from December 4, 2013, to March 4, 2015. This edition covered the first three parts of the Jojo no Kimyou na Bouken series and included new cover art which showed redesigns of the characters. The second part, Sentou Chouryuu, was covered in JoJonium's volumes 4-7. JoJo no Kimyou na Bouken Part 2: Sentou Chouryuu has been published in English by VIZ Media as JoJo's Bizarre Adventure Part 2: Battle Tendency digitally since April 21, 2015, and physically since November 3, in hardback format with the JoJonium format and content used. It was also published in Italy by Star Comics from May 1994 to March 1995.", 69, new DateTime(1989, 3, 13, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/269908.jpg", 518, 8.14m, new DateTime(1987, 10, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "America, 1938. Robert E. O. Speedwagon, his foundation, and Straits venture to Mexico to gather more information about the enigmatic Stone Masks. While excavating the ruins, Speedwagon's men are slaughtered by Strait's sudden betrayal and his lust for power, putting Speedwagon in grave danger.\n\nMeanwhile, at the behest of their ally Speedwagon, Joseph Joestar and his grandmother Erina Pendleton have moved to New York City from London. In this new environment, trouble is always around the corner for the hotheaded man, as cultural differences and stubborn citizens spark frequent fights. However, through the power of his \"Ripple\"—an ability said to be inherited from his grandfather Jonathan Joestar—he defeats foes effortlessly.\n\nOne night at a downtown Italian restaurant, Joseph and Erina are provoked when an enormous man across their table taunts them. A proper gentleman from the same table apologizes and informs the two of a disturbing rumor: Speedwagon has been murdered. With an uncertain future, Joseph's bizarre adventure begins, meeting like-minded yet brawny individuals and unearthing remote mysteries along the way.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 2: Sentou Chouryuu", "JoJo's Bizarre Adventure Part 2: Battle Tendency", "ジョジョの奇妙な冒険 戦闘潮流", 1, "https://myanimelist.net/manga/1630/JoJo_no_Kimyou_na_Bouken_Part_2__Sentou_Chouryuu", 7 },
                    { 1631, "Yaiba won the 38th Shogakukan Manga Award in 1993.", 255, new DateTime(1993, 11, 16, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/9646.jpg", 3301, 7.45m, new DateTime(1988, 8, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "The light-hearted manga is about an adventuring samurai named Kurogane Yaiba who knows how to be a samurai, and little else. Yaiba lives with his father, Kenjurou, in the forest. One day, while Yaiba was eating, a troop of gorillas came to attack. Yaiba and his father escaped and hid inside a box, but they didn't know that the box was full of pineapples and was going to be transported into the city. In the city, Yaiba finds out that he is a legendary warrior and has to fight the evil of a demonic looking high-school student named Takeshi.\n\nThe people that Yaiba meets along his journey to become a true samurai encourage him, train him, or inspire him to greatness, though at heart he is still a child, and his incredible skill with a sword is matched only by his kindness towards his friends. Though, he tends to leap before he looks, and his thick-headedness tends to turn potential allies into enemies, though his friends soon clobber him, and salvage the situation. This unlikely group embarks on a host of incredible adventures where they meet legendary figures from Japanese history, and finally overcome impossible odds, and put everything on the line, to save the entire planet from a threat not of this world.\n\nIt's a story of love, friendship, hard work, and never giving up.\n\n(Source: Wikipedia)", "Yaiba", "Yaiba: Samurai Legend", "YAIBA", 1, "https://myanimelist.net/manga/1631/Yaiba", 24 },
                    { 1639, "Cyborg 009 was partially published in English by Tokyopop, who published the first ten volumes from September 9, 2003 to March 8, 2005.", null, new DateTime(1978, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/273181.jpg", 3593, 7.42m, new DateTime(1964, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "Cyborg 009 is the story of a half-Japanese juvenile delinquent, Shimamura Joe AKA 'Cyborg 009.' 'Black Ghost,' a top-secret organization bent on promoting global warfare, kidnaps Joe along with eight other unwanted members of society from the four corners of the world and turns them into cyborgs. Though the organization intends to turn the group into super-powered killing machines, it's not long before Joe and his new companions rebel against Black Ghost and make their escape with the help of an old scientist.\n\nOnce Joe and friends have freed themselves, Black Ghost sends a series of other cyborgs and giant robots in hot pursuit. Using their new powers and abilities, our heroes stay one step ahead of Black Ghost and its evil machinations, but can they save the world from its diabolical scheme?\n\n(Source: Tokyopop)", "Cyborg 009", "Cyborg 009", "サイボーグ009", 1, "https://myanimelist.net/manga/1639/Cyborg_009", 15 },
                    { 1706, "JoJo no Kimyou na Bouken Part 7: Steel Ball Run was originally presented as an unrelated story to the JoJo series and was serialized in Weekly Shounen Jump magazine as Steel Ball Run from issues #8~47 2004. Serialization then transferred to Ultra Jump magazine from issue May 2005 and the series was officially declared as Part 7 of the JoJo no Kimyou na Bouken series.", 96, new DateTime(2011, 4, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/179882.jpg", 2, 9.31m, new DateTime(2004, 1, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the American Old West, the world's greatest race is about to begin. Thousands line up in San Diego to travel over six thousand kilometers for a chance to win the grand prize of fifty million dollars. With the era of the horse reaching its end, contestants are allowed to use any kind of vehicle they wish. Competitors will have to endure grueling conditions, traveling up to a hundred kilometers a day through uncharted wastelands. The Steel Ball Run is truly a one-of-a-kind event.\n\nThe youthful Johnny Joestar, a crippled former horse racer, has come to San Diego to watch the start of the race. There he encounters Gyro Zeppeli, a racer with two steel balls at his waist instead of a gun. Johnny witnesses Gyro using one of his steel balls to unleash a fantastical power, compelling a man to fire his gun at himself during a duel. In the midst of the action, Johnny happens to touch the steel ball and feels a power surging through his legs, allowing him to stand up for the first time in two years. Vowing to find the secret of the steel balls, Johnny decides to compete in the race, and so begins his bizarre adventure across America on the Steel Ball Run.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 7: Steel Ball Run", "JoJo's Bizarre Adventure Part 7: Steel Ball Run", "ジョジョの奇妙な冒険 Part7 STEEL BALL RUN", 1, "https://myanimelist.net/manga/1706/JoJo_no_Kimyou_na_Bouken_Part_7__Steel_Ball_Run", 24 },
                    { 1804, "", null, null, "https://cdn.myanimelist.net/images/manga/1/164654.jpg", 1323, 7.79m, new DateTime(1987, 5, 26, 17, 0, 0, 0, DateTimeKind.Local), 4, "Kaito Kuroba, a normal teenage student whose father is often absent. When his father dies under mysterious circumstances, he is made aware of his father's secret identity; a famous international criminal known as International Criminal 1412: the Phantom Thief, and that he was murdered by a mysterious organization for refusing to aid them in retrieving the \"Pandora Gem\"; a mystical stone said to shed a \"tear\" during the passing of a particular comet (often called the 'Volley Comet'), the consumption of which bestows immortality. He vows to prevent the organization from gaining immortality, and assumes his father's identity as he begins his quest for the gem. His only clues as to the gem's location are that it glows red under the full moon and that it is a doublet: a gem hidden within a larger gem. Thus, it would have to be a relatively large one with a bizarre history, and always stored in a place that never receives moonlight. He thus researches and steals famous priceless gems with odd histories from incredibly well-defended areas, and always returns them after the very next full moon.\n\n(Source: Wikipedia)", "Magic Kaito", null, "まじっく快斗", 1, "https://myanimelist.net/manga/1804/Magic_Kaito", null },
                    { 1873, "", 10, new DateTime(1995, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/2019.jpg", 16155, 6.49m, new DateTime(1992, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "In early UC.0123, an Anaheim Electronics team doing testing in the Zebra Zone encounters Crossbone Vanguard's elite Dark Tiger force. The ensuing battle also draws the EFF battleship Ajax and remnants of the Neo Zeon army into the conflict.", "Kidou Senshi Gundam: Silhouette Formula 91", null, "機動戦士ガンダム シルエットフォーミュラ91", 1, "https://myanimelist.net/manga/1873/Kidou_Senshi_Gundam__Silhouette_Formula_91", 1 },
                    { 1932, "Cat's Eye has been published digitally in English by Coamix through Manga Hot.", 135, new DateTime(1985, 1, 14, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/175778.jpg", 4878, 7.29m, new DateTime(1981, 6, 15, 17, 0, 0, 0, DateTimeKind.Local), 2, "The protagonists of the series are the three Kisugi sisters—Hitomi, Rui and Ai—who run a café called Cat's Eye. The sisters lead a double life as a trio of highly skilled art thieves, leaving cards with the name \"Cat's Eye\" at the scene of their crimes. They steal works of art (mostly paintings) that belonged to their long-missing father, Heinz (who was a famous art collector during the Nazi regime), in the hopes of him contacting them. Toshio, the police officer investigating this case is the fiancé of Hitomi. He also swears to capture and bring down the Cat's Eye Gang.", "Cat's Eye", "Cat's Eye", "キャッツ・アイ", 1, "https://myanimelist.net/manga/1932/Cats_Eye", 18 },
                    { 1936, "Shin Kidou Senki Gundam Wing: Endless Waltz was published in English as Gundam Wing: Endless Waltz by Tokyopop, first in comic book format, for a total of four issues, published between March and July 2002, and later in standard tankoubon format, August 1, 2002.", 5, new DateTime(1998, 7, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/131547.jpg", 6385, 7.16m, new DateTime(1998, 3, 14, 16, 0, 0, 0, DateTimeKind.Local), 2, "The year is After Colony 195, and the Gundam boys have taken a stand for eternal peace by deciding to destroy their robotic weapons, Gundams. The peace is broken, however, when Mariemaia Khushrenada, who claims to be the daughter of the late Oz leader Treize, kidnaps Relena and declares a war of independence against the United Earth Sphere Nation. Perhaps it's time to pull those Gundam units out of retirement.", "Shin Kidou Senki Gundam Wing: Endless Waltz", "Mobile Suit Gundam Wing: Endless Waltz", "新機動戦記ガンダムW ENDLESS WALTZ", 1, "https://myanimelist.net/manga/1936/Shin_Kidou_Senki_Gundam_Wing__Endless_Waltz", 1 },
                    { 1938, "Shin Kidou Senki Gundam Wing: Battlefield of Pacifists was published in English as Mobile Suit Gundam Wing: Battlefield of Pacifists by Tokyopop.", 5, null, "https://cdn.myanimelist.net/images/manga/1/286575.jpg", 10270, 6.9m, new DateTime(1996, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Summer AC 196, the Earth Sphere Unified Nation begins the long process of disarmament with Relena Darlian leading the preceedings. However, something troubles the Gundam pilots; rumors fly about Vulkanus, an OZ manufacturing plant, full of Mobile Dolls and lost somewhere in space. In the meantime, an organization called the Perfect Peace People is calling for even further measures of disarmament than even Relena herself. The Gundam pilots set out to find and destroy Vulkanus before anyone can get their hands on it and use it for their own purposes.", "Shin Kidou Senki Gundam Wing: Battlefield of Pacifists", "Mobile Suit Gundam Wing: Battlefield of Pacifists", "新機動戦記ガンダムW BATTLEFIELD OF PACIFISTS)", 1, "https://myanimelist.net/manga/1938/Shin_Kidou_Senki_Gundam_Wing__Battlefield_of_Pacifists", 1 },
                    { 1939, "Shin Kidou Senki Gundam Wing: Blind Target was published in English as Mobile Suit Gundam Wing: Blind Targett by VIZ Media.", 5, new DateTime(1998, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/282835.jpg", 8051, 7.05m, new DateTime(1998, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "After the events of Gundam Wing, peace still does not come easily. Small rebel factions slowly gain influence and power, and those that were wronged during the war creep out from the woodworks. Relena, a symbol of peace and a primary political figure in the post-war rebuilding efforts, is kidnapped. The five pilots must once again come together in order to protect their fragile peace while simultaneously wrestling with their own morals and motivations.", "Shin Kidou Senki Gundam Wing: Blind Target", "Mobile Suit Gundam Wing: Blind Target", "新機動戦記ガンダムW BLIND TARGET", 1, "https://myanimelist.net/manga/1939/Shin_Kidou_Senki_Gundam_Wing__Blind_Target", 1 },
                    { 1941, "Shin Kidou Senki Gundam Wing: Ground Zero was published in English as Mobile Suit Gundam Wing: Ground Zero by VIZ Comics from August 2000 to November 2000.", 4, null, "https://cdn.myanimelist.net/images/manga/1/126997.jpg", 9535, 6.95m, new DateTime(1997, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Just when he thought life was returning to normal, Heero Yuy receives a cryptic message from a person claiming to have stolen the Wing Zero and requesting a rendezvous at a remote space station. There he finds the station deserted except for his fellow Gundam pilots all of whom have received similar messages. But only a handful of people are capable of piloting the Wing Zero... As tension and distrust grows, Heero is pitted against his comrades with mind control, assassination, and a loaded gun thrown into the standoff.", "Shin Kidou Senki Gundam Wing: Ground Zero", "Mobile Suit Gundam Wing: Ground Zero", "新機動戦記ガンダムＷ グランド・ゼロ", 1, "https://myanimelist.net/manga/1941/Shin_Kidou_Senki_Gundam_Wing__Ground_Zero", 1 },
                    { 2105, "", 34, new DateTime(2003, 6, 15, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/2295.jpg", 6412, 7.16m, new DateTime(2002, 10, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "How strong are you? In this manga, the hero is an idiotic little boy who has a frightening style of fighting. But he isn't the only fighting monster. Sumeragi Sen will discover people that are stronger than him, and maybe even the limits of his strength.\n\n(Source: MU)", "Ultra Red", null, "Ultra Red [ウルトラレッド]", 1, "https://myanimelist.net/manga/2105/Ultra_Red", 4 },
                    { 2144, "", 63, new DateTime(2018, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/187416.jpg", 5101, 7.27m, new DateTime(2003, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Shuri Otokawa, a girl who can see premonitions of the future, has been trying to hide and suppress her special ability for 18 years. In order to start a new life, she joins the private investigation agency owned by her aunt, trying to use her ability in a beneficial way. However, her ex-boyfriend (and the reason of her hate towards men) Riki Nijihara was accidentally hired by her aunt as well, not to mention his superior performance as a private detective has thwarted her plan to have her aunt fired him. With another male colleague named Youta Kubo who has a crush on her, Shuri has to prove herself professionally worthy as well as dealing her office affairs triangle.\n\n(Source: ANN)\n\nIncluded one-shot:\nVolume 3: Bunkai File", "Honey Bitter", null, "Honey Bitter", 1, "https://myanimelist.net/manga/2144/Honey_Bitter", 14 },
                    { 2333, "Rurouni Kenshin: Yahiko no Sakabatou was published in Brazilian Portuguese by Editora JBC in July 2004.", 1, null, "https://cdn.myanimelist.net/images/manga/2/5666.jpg", 2935, 7.5m, new DateTime(1999, 12, 20, 16, 0, 0, 0, DateTimeKind.Local), 2, "It's been a few years after Kenshin gave Yahiko his sakabato. Kaoru sends Yahiko off to another dojo to look after the master's daughter while he's away. But when Yahiko arrives, the place has been already taken over by extremists and Yahiko is taken hostage as well. Now it's up to him to save the day.", "Rurouni Kenshin: Yahiko no Sakabatou", null, "るろうに剣心 弥彦の逆刃刀", 3, "https://myanimelist.net/manga/2333/Rurouni_Kenshin__Yahiko_no_Sakabatou", null },
                    { 2845, "Kinnikuman won the 30th Shogakukan Manga Award for best children's manga in 1984. In Spain, it was published in Catalan as Musculman by Glénat from November 2006 to June 2008.", null, null, "https://cdn.myanimelist.net/images/manga/2/244752.jpg", 2286, 7.6m, new DateTime(1979, 5, 14, 17, 0, 0, 0, DateTimeKind.Local), 4, "Kinnikuman (a.k.a. Kinniku Suguru) is a cowardly, clumsy, moronic, gyuudon-devouring excuse for a superhero (or Choujin)... who just happens to be the prince of an alien planet. But despite his pathetic appearance, he is very honorable and can become quite powerful when he needs to be. With his sidekick Meat-kun and fellow Choujin's Terryman and Ramenman there to help him, Suguru quests to become the greatest Choujin on the planet. Whether with a combination of tremendous heart and stamina (The Burning Inner Strength) or the \"Power of Friendship,\" Kinnikuman frequently defeats villians 10 times more powerful than him and often causes his enemies to have a change of heart and join him. Though he seems destined to be an idiot forever, slowly but surely Kinnikuman becomes worthy of the title \"Hero.\"\n\nNote: Between volumes 36 and 37 publication there's 22 years gap. From volume 38 onwards starts restarted in 2011 version.", "Kinnikuman", null, "キン肉マン", 1, "https://myanimelist.net/manga/2845/Kinnikuman", null },
                    { 2897, "", 8, new DateTime(2005, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/111781.jpg", 14026, 6.65m, new DateTime(1999, 4, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "Neko Majin is a parody of Dragonball Z by Akira Toriyama. The protagonist Neko Majin fights evil-doers and has a few other Dragonball Z-esque adventures.", "Neko Majin", "Neko Majin", "ネコマジン", 1, "https://myanimelist.net/manga/2897/Neko_Majin", 1 },
                    { 2957, "", 2, null, "https://cdn.myanimelist.net/images/manga/5/175786.jpg", 5573, 7.23m, new DateTime(1998, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "A boy whose parents died in a car crash suddenly remembers that he had an older brother once who went missing years ago.  In an effort to find his only remaining relative, he goes out on a trip to find him, only to find himself at a mysterious mansion where a ghost of his brother's girlfriend haunts them.", "Mizu no Yakata", "The Mansion of Water", "水の館", 1, "https://myanimelist.net/manga/2957/Mizu_no_Yakata", 1 },
                    { 3006, "JoJo no Kimyou na Bouken Part 4: Diamond wa Kudakenai was published in English as JoJo's Bizarre Adventure Part 4: Diamond Is Unbreakable by VIZ Media from May 7, 2019 to May 4, 2021. The series was published in Italian by Star Comics from March 1997 to July 1999. A live-action film adaptation of the series by director Takashi Miike premiered in Japan on August 4, 2017.", 174, new DateTime(1995, 11, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/269910.jpg", 110, 8.57m, new DateTime(1992, 4, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "In 1999, Joutarou Kuujou arrives at the Japanese town of Morioh for two reasons: to meet his illegitimate uncle Jousuke Higashikata and investigate a potentially dangerous Stand user. Only minutes after he arrives does he accomplish his first goal; however, Joutarou finds that Jousuke is not only a much younger high school student, but he possesses a Stand of his own called Crazy Diamond. Not long after their meeting, the two make a startling discovery: someone is using a supernatural bow and arrow to create Stand users around Morioh.\n\nWhen Jousuke witnesses the threat that this poses, he resolves to protect his town and stop the spread of lethal Stand users. Finding both allies and enemies among these users, Jousuke learns just how much one's personal interests and ambitions can be reflected in their Stands, and the resulting harm or virtue it brings. As they continue to investigate, they begin to unearth the shocking history of Morioh, bringing forth hidden dangers and a mystery from years past.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 4: Diamond wa Kudakenai", "JoJo's Bizarre Adventure Part 4: Diamond Is Unbreakable", "ジョジョの奇妙な冒険 ダイヤモンドは砕けない", 1, "https://myanimelist.net/manga/3006/JoJo_no_Kimyou_na_Bouken_Part_4__Diamond_wa_Kudakenai", 18 },
                    { 3008, "JoJo no Kimyou na Bouken Part 5: Ougon no Kaze has been published in English as JoJo's Bizarre Adventure Part 5: Golden Wind by VIZ Media under the Shounen Jump imprint as omnibus volumes from August 3, 2021 to August 22, 2023. It was published in Italian by Star Comics from July 1999 to August 2001. An action-adventure video game developed by Capcom that was based on Ougon no Kaze was released in Japan on July 25, 2002.", 155, new DateTime(1999, 3, 22, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/269912.jpg", 451, 8.18m, new DateTime(1995, 11, 27, 16, 0, 0, 0, DateTimeKind.Local), 2, "Naples, 2001. Giorno Giovanna is a small-time crook with one big dream—to become a \"Gang-Star.\" No ordinary thief, Giorno has a connection to the remarkable Joestar bloodline, and possesses a Stand named Gold Experience. His dream starts to become reality when he meets Bruno Bucciarati, a mobster from the gang Passione and a fellow Stand user himself. Realizing that they share similar ideals, and both disagree with the gang's harmful affairs, Giorno reveals his goal to Bruno: with Bruno's help, he will reform Passione by overthrowing the boss.\n\nAs Giorno becomes a member of Passione, and is inducted into Bruno's squad, he discovers that it is no simple gang; its numbers are teeming with Stand users. Now confronted by other squads of differing loyalties and unpredictable caliber, their goal to change the gang from the inside out will be a tough one. Taking on these adversaries, Giorno attempts to rise through the ranks and inch closer to the boss, a man who is shrouded in mystery. \n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 5: Ougon no Kaze", "JoJo's Bizarre Adventure Part 5: Golden Wind", "ジョジョの奇妙な冒険 黄金の風", 1, "https://myanimelist.net/manga/3008/JoJo_no_Kimyou_na_Bouken_Part_5__Ougon_no_Kaze", 17 },
                    { 3009, "JoJo no Kimyou na Bouken Part 6: Stone Ocean was published in Italian by Star Comics from February 2002 to April 2004. It has been published digitally in English as JoJo's Bizarre Adventure Part 6: Stone Ocean by VIZ Media since January 25, 2022. The volumes have also been published by VIZ Media under the Shonen Jump imprint since November 28, 2023.", 158, new DateTime(2003, 4, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/255379.jpg", 372, 8.24m, new DateTime(1999, 12, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "In Florida, 2011, Jolyne Kuujou sits in a jail cell like her father Joutarou once did; yet this situation is not of her own choice. Framed for a crime she didn't commit, and manipulated into serving a longer sentence, Jolyne is ready to resign to a dire fate as a prisoner of Green Dolphin Street Jail. Though all hope seems lost, a gift from Joutarou ends up awakening her latent abilities, manifesting into her Stand, Stone Free. Now armed with the power to change her fate, Jolyne sets out to find an escape from the stone ocean that holds her.\n\nHowever, Jolyne soon discovers that her incarceration is merely a small part of a grand plot: one that not only takes aim at her family, but has additional far-reaching consequences. What's more, the mastermind is lurking within the very same prison, and is under the protection of a lineup of menacing Stand users. Finding unlikely allies to help her cause, Jolyne sets course to stop their plot, clear her name, and take back her life.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 6: Stone Ocean", "JoJo's Bizarre Adventure Part 6: Stone Ocean", "ジョジョの奇妙な冒険 ストーンオーシャン", 1, "https://myanimelist.net/manga/3009/JoJo_no_Kimyou_na_Bouken_Part_6__Stone_Ocean", 17 },
                    { 3010, "", 30, new DateTime(2003, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/132309.jpg", 12903, 6.73m, new DateTime(2003, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "A more modern version of Tetsuwan Atom.", "Astro Boy: Tetsuwan Atom", null, "ASTRO BOY 鉄腕アトム", 1, "https://myanimelist.net/manga/3010/Astro_Boy__Tetsuwan_Atom", 3 },
                    { 3084, "", 438, new DateTime(2010, 8, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/169091.jpg", 3067, 7.48m, new DateTime(2000, 8, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "Piyohiko has a dream: he wants to be a successful guitar player. Then Jaguar pops up, and forces him to play the recorder, and thus ends Piyohiko's noble dream.\n\nIncluded one-shots:\nVolume 16: Pyuu to Fuku! Jaguar [Masuda Kousuke]\nVolume 20: Poo", "Pyuu to Fuku! Jaguar", null, "ピューと吹く! ジャガー", 1, "https://myanimelist.net/manga/3084/Pyuu_to_Fuku_Jaguar", 20 },
                    { 3087, "", 22, new DateTime(2006, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/246055.jpg", 9698, 6.94m, new DateTime(2004, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Taking place after the end of the war over Newtypes and D.O.M.E. in After War Gundam X, Under The Moonlight tells a new story of a boy, Rick Aller who finds a still-useable Gundam X, and his adventures while tracking down an AWOL friend, Kai, possessing the Gundam Belphagor.", "Kidou Shin Seiki Gundam X: Under the Moonlight", "After War Gundam X: Under the Moonlight", "機動新世紀ガンダムX -UNDER the MOONLIGHT-", 1, "https://myanimelist.net/manga/3087/Kidou_Shin_Seiki_Gundam_X__Under_the_Moonlight", 4 },
                    { 3202, "", null, null, "https://cdn.myanimelist.net/images/manga/5/78721.jpg", 8041, 7.05m, new DateTime(1996, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 4, "Short stories drawn by Aoyama's assistants which do not belong to the main plot.", "Detective Conan Tokubetsu-hen", null, "名探偵コナン特別編", 1, "https://myanimelist.net/manga/3202/Detective_Conan_Tokubetsu-hen", null },
                    { 3378, "Kimi ni Todoke won the 32nd Kodansha Manga Award in the Shoujo category in 2008. In the same year, it was nominated for the first Manga Taisho Award. The series was published in English as Kimi ni Todoke: From Me to You by VIZ Media under the Shojo Beat imprint from August 4, 2009, to December 4, 2018. The manga was adapted into a Japanese live-action film that premiered on September 25, 2010. A live-action TV series produced by Tokyo TV and Netflix was released on March 30, 2023.", 125, new DateTime(2017, 11, 12, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/168283.jpg", 300, 8.3m, new DateTime(2005, 8, 10, 17, 0, 0, 0, DateTimeKind.Local), 2, "Sawako Kuronuma is a 15-year-old student often mistaken for the horrific, vengeful spirit Sadako Yamamura from The Ring. The uncanny resemblance leads to Sawako being called \"Sadako\" instead. Due to her aloof and gloomy appearance, her peers have grown afraid, and they keep their distance from her. But despite such treatment, she harbors an innocent and diligent heart.\n\nGiven her honest desire to make friends, Sawako holds a profound admiration for Shouta Kazehaya, the most popular boy in her class. Through his refreshing personality and smooth interpersonal interactions, Kazehaya naturally draws in people. Wishing to be more like him, Sawako begins to spend more time with Kazehaya. While attempting to turn over a new leaf, Sawako finds herself encouraged to explore new things that she never dared before, with Kazehaya right beside her.\n\n[Written by MAL Rewrite]\n\nIncluded one-shot:\nVolume 22: Mayuge no Kakudo wa 45° de (45° Eyebrows)", "Kimi ni Todoke", "Kimi ni Todoke: From Me to You", "君に届け", 1, "https://myanimelist.net/manga/3378/Kimi_ni_Todoke", 30 },
                    { 3395, "Dominion has been republished as Dominion F in January 27, 1993. The series has been first published in English in 6 issues by Dark Horse Comics in December 1989. Dark Horse later republished Dominion as trade paperback in 1993, 1996, 2000, and 2007.", 4, new DateTime(1985, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/167654.jpg", 12137, 6.78m, new DateTime(1984, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Set in the fictional city of Newport, Japan, in a future in which bacterial air pollution has become so severe that people must wear gas masks when outdoors, the series follows a police squadron that uses tanks.\n\n(Source: Wikipedia)", "Dominion", "Dominion", "DOMINION", 1, "https://myanimelist.net/manga/3395/Dominion", 1 },
                    { 3500, "Shinseiki Evangelion: Ikari Shinji Ikusei Keikaku has been published in English as Neon Genesis Evangelion: The Shinji Ikari Raising Project individually and in 3-in-1 omnibuses by Dark Horse since July 8, 2009 and August 30, 2016 respectively.", 133, new DateTime(2016, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/172079.jpg", 16453, 6.47m, new DateTime(2005, 4, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Stunning, hotheaded Asuka Langley Soryu has been friends with Shinji Ikari since they were little. And she always sort of assumed they'd stay together-until the day the beautiful, brilliant Rei Ayanami showed up in class! When Shinji starts to get curious about Rei, Asuka needs to figure out if she wants to be just friends with Shinji, or something more. But why are so many people keeping an eye on these relationships-people like homeroom teacher Misato, school nurse Ritsuko, and Shinji's mother-NERV's chief scientist, Yui Ikari...?\n\n(Source: Dark Horse)", "Shinseiki Evangelion: Ikari Shinji Ikusei Keikaku", "Neon Genesis Evangelion: The Shinji Ikari Raising Project", "新世紀エヴァンゲリオン 碇シンジ育成計画", 1, "https://myanimelist.net/manga/3500/Shinseiki_Evangelion__Ikari_Shinji_Ikusei_Keikaku", 18 },
                    { 3510, "", 13, new DateTime(1995, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/295665.jpg", 11299, 6.84m, new DateTime(1994, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "Rather than having a war between the colonies and the Earth, a fighting tournament is held. Called the Gundam Fight, it is held once every four years by the United Colonies Federation. Each country would send its own representative, that would pilot a Gundam, and the Gundams would then fight on the Earth until only one is left, and that Gundam's nation will then be able to obtain sovereign rights over all the nations, until another nation wins in the next Gundam Fight. This series is set in Future Century (FC) 60, during the 13th Gundam Fight and it focuses on the Neo Japan Gundam Fighter Domon Kasshu, who is in the fight as much to win as well as fulfill his own mission of tracking down his brother who had stolen a mysterious Gundam; the Devil Gundam from the Neo-Japan government.\n\n(Source: Wikipedia)", "Kidou Butouden G Gundam", "Mobile Fighter G Gundam", "機動武闘伝Gガンダム", 1, "https://myanimelist.net/manga/3510/Kidou_Butouden_G_Gundam", 3 },
                    { 3537, "Yankee-kun to Megane-chan was published in English by Chuang Yi Publishing.", 219, new DateTime(2011, 5, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/222335.jpg", 1381, 7.78m, new DateTime(2006, 10, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, "Hiding in the school toilet, Daichi Shinagawa curses upon the fact that his idle high school life is suddenly interrupted by an annoying presence—the class representative Hana Adachi. Unfortunately for the delinquent, the eccentric Adachi enters the male washroom without hesitation and discovers his hiding spot in a flash. Going on a field trip with his classmates is the least of Shinagawa's concerns, but that is the very thing that Adachi would not give up on. By hook or crook, she insists that everyone in the class attend the trip, including the reluctant Shinagawa. To make matters worse, despite his constant rejection Adachi would keep following Shinagawa even after school has ended.\n\nHowever, after an encounter with a pair of purse snatchers, Shinagawa soon learns that Adachi has an unexpected side to her, and is soon thrust into chaotic school life filled with her inescapable antics. \n\n[Written by MAL Rewrite]", "Yankee-kun to Megane-chan", "Yankee-kun to Megane-chan", "ヤンキー君とメガネちゃん", 1, "https://myanimelist.net/manga/3537/Yankee-kun_to_Megane-chan", 23 },
                    { 3578, "The short story Shikei Shikkouchuu Datsugoku Shinkouchuu was adapted into a live stage play, incorporating elements of Dolce: Die Hard the Cat alongside the original plot. The production was first shown from November 20, 2015 to November 29, 2015 at the Galaxy Theater in Tokyo; it later premiered at other various locations in Japan one month later. Recordings of the show were aired on the satellite television network WOWOW in March 2016. The performance was released on Blu-ray and DVD by Pony Canyon on August 17, 2016.", 7, new DateTime(1998, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/270477.jpg", 3819, 7.39m, new DateTime(1996, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "1. Shikei Shikkouchuu Datsugoku Shinkouchuu (Under Execution, Under Jailbreak)\n2. Dolce: Die Hard The Cat (Dolce, and His Master.)\n3. Kishibe Rohan wa Ugokanai - Episode 16: Zangeshitsu (Thus Spoke Kishibe Rohan. Episode 16: At a Confessional)\n4. Deadman's Q (Deadman's Questions)", "Shikei Shikkouchuu Datsugoku Shinkouchuu", "Under Execution, Under Jailbreak", "死刑執行中脱獄進行中 荒木飛呂彦短編集", 1, "https://myanimelist.net/manga/3578/Shikei_Shikkouchuu_Datsugoku_Shinkouchuu", 1 },
                    { 3645, "Death Note 13: How to Read - Shinsou was published in English as Death Note 13: How to Read by VIZ Media on February 19, 2008.", 2, new DateTime(2005, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/231006.jpg", 5989, 7.2m, new DateTime(2003, 8, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Death Note 13: How to Read - Shinsou is a guidebook which contains the spin-off series Death Note ni Rakugaki 4-koma and the pilot one-shot.", "Death Note 13: How to Read - Shinsou", "Death Note 13: How to Read", "DEATH NOTE 13 HOW TO READ 真相", 1, "https://myanimelist.net/manga/3645/Death_Note_13__How_to_Read_-_Shinsou", null },
                    { 3822, "", 390, new DateTime(1999, 9, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/144081.jpg", 1938, 7.66m, new DateTime(1991, 4, 16, 17, 0, 0, 0, DateTimeKind.Local), 2, "Overdevelopment and crowding in Japan has forced many of its indigenous spirits and ghosts to lose their homes. Due to problems caused by the homeless spirits, a new profession was created, the Ghost Sweeper (GS). Private exorcists for hire; they serve only the highest bidder to survive in the cutthroat corporate world. Among this, the Mikami GS Company, led by Reiko Mikami and her two assistants, the teenage boy Tadao Yokoshima and the ghost girl Okinu, is said to be the best.\n\n(Source: Wikipedia)\n\nIncluded one-shot:\nVolume 1: Gokuraku Mouja (Ghost Sweeping in the Haunted Mansion)", "GS Mikami: Gokuraku Daisakusen!!", null, "GS美神 極楽大作戦!!", 1, "https://myanimelist.net/manga/3822/GS_Mikami__Gokuraku_Daisakusen", 39 },
                    { 3865, "Kidou Senshi Gundam SEED was published in English as Mobile Suit Gundam SEED by Tokyopop.", null, new DateTime(2003, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/296831.jpg", 7594, 7.08m, new DateTime(2002, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The 'neutral' space colony of Heliopolis houses Morgenroete, a top-secret weapons research facility specializing in producing the battleship Archangel and five prototype Gundams for the Earth Alliance Force. ZAFT, the rebel army composed of genetically modified humans known as Coordinators, attacks Heliopolis, stealing four of the five prototypes. Civilian Kira Yamato, a Coordinator raised by Natural parents, stumbles upon the Gundam Strike during the attack. He pilots the mobile suit for the Earth Alliance Force in order to protect his Natural friends and finds himself locked in mortal combat with his childhood best friend, Coordinator Athrun Zala, who is now an ace pilot for ZAFT. Their friendship is not the only thing at stake; the survival of an entire race depends on the outcome of this war. (Source: Tokyopop)", "Kidou Senshi Gundam SEED", "Mobile Suit Gundam SEED", "機動戦士ガンダム・シード", 2, "https://myanimelist.net/manga/3865/Kidou_Senshi_Gundam_SEED", 5 },
                    { 3866, "Kuroshitsuji has been adapted into three anime series—one of which is an original which aired in 2010; multiple OVAs; drama CDs released on August 10, 2007 and November 26, 2008; games; a musical titled Kuroshitsuji: The Most Beautiful DEATH in The World held from May 3 to 23, 2010; and a live-action film on January 18, 2014. The series has been published in English as Black Butler by Yen Press since January 26, 2010 and digitally since April 8, 2014, and has appeared multiple times in New York best selling ranking. It has also been simulpub by Yen Press. It is also published in French by Kana since November 2009, in German by Carlsen Comics, in Italian by Panini Comics, in Polish by Waneko since February 2011, in Spanish by Norma Editorial since November 2011, in Finnish by Punainen jättiläinen since July 2012, and in Brazilian Portuguese by Panini Comics since July 2012. In 2014, it was announced via the official Twitter that Kuroshitsuji has sold more than 20 million copies worldwide.", null, null, "https://cdn.myanimelist.net/images/manga/3/248448.jpg", 207, 8.41m, new DateTime(2006, 9, 15, 17, 0, 0, 0, DateTimeKind.Local), 4, "Tucked away in the English countryside lies the ominous manor of the Phantomhives, a family which has established itself as the cold and ruthless \"Queen's Watchdog\" as well as the head of London's criminal underground. After a tragedy leaves the Earl and his wife dead, many are shocked when their son, a young boy named Ciel, claims his place as the new Earl of the Phantomhive house. At first, many perceive him only as a child surrounded by a few eccentric servants. But they soon begin to realize that it is foolish to meddle with Ciel and his demonic butler Sebastian.\n\nTaking place at the end of the 19th century, Kuroshitsuji follows these two as they face countless mysteries and dangers that plague England and threaten the Queen, uncovering the truth about what really happened to Ciel's parents in the process.\n\n[Written by MAL Rewrite]", "Kuroshitsuji", "Black Butler", "黒執事", 1, "https://myanimelist.net/manga/3866/Kuroshitsuji", null },
                    { 4101, "", 108, new DateTime(2007, 6, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/130983.jpg", 12735, 6.74m, new DateTime(2005, 3, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kitazato Fubuki is always overlooked by his family members; overshadowed by his more talented and famous brothers. He tries to draw attention to himself and usually spends his days fighting, but one day he manages a quadruple and a half jump at the skating rink. Thanks to this remarkable feat, he is showered with attention for the first time in his life...\n\n(Source: MU)", "Blizzard Axel", null, "ブリザードアクセル", 1, "https://myanimelist.net/manga/4101/Blizzard_Axel", 11 },
                    { 4147, "", 49, new DateTime(2003, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/4814.jpg", 10877, 6.86m, new DateTime(2001, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kyosuke Kano has lived under the shadow of his successful brother Seisuke all his life who is a professional soccer player. Tired of being compared and downgraded at, he abandoned playing soccer until a boy from his new high school discovered him and asked him to join their team. Kyosuke joins it and befriends two other first year players named Rodrigo and Sakai with the dream of becoming professional soccer players themselves. \n\n(Source: MU)", "Hungry Heart", null, "ハングリーハート", 1, "https://myanimelist.net/manga/4147/Hungry_Heart", 6 },
                    { 4186, "", 30, new DateTime(2002, 3, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/27584.jpg", 8110, 7.04m, new DateTime(1999, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Several hundred years have passed since the fierce battles using Mobile Suits throughout the universe. After many wars, earthlings forgot how to make developments in their own civilization. Some humans moved to the moon. For a very, very long time, they dreamed about returning to earth. When Planet Earth regained its standard of living to that of the days of the Industrial Revolution, Diana Soler, the Queen of the Moon entered into negotiations with the head of Planet Earth so that the Moon Race could return. She also secretly dispatched a reconnaissance troop to check the environmental and living conditions on Planet Earth. Rolland Seac came to Earth as part of the troop. Almost drowned in a river, he was saved by two beautiful sisters, Kiel and Sosie. After the accident, he started working for a mine, owned by the father of these sisters. He soon gets used to living on Planet Earth. \n\nTwo years pass and the Moon Race who are becoming impatient with the slow negotiations takes action and forcefully tries to return to Earth. Flames engulf the streets. The \"Turned 'A' Gundam\" appears from the White Doll Ruins and Rolland finds himself riding it. He becomes the savior of Planet Earth. Rolland's struggle to avoid war between the Moon and Planet Earth begins.", "Turn A Gundam", null, "∀ガンダム", 1, "https://myanimelist.net/manga/4186/Turn_A_Gundam", 5 },
                    { 4404, "", 20, new DateTime(2009, 5, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/15641.jpg", 5303, 7.25m, new DateTime(2007, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "As Celestial Being begins their anti-war activities, Fereshte begins to move in with the group being led by Chall Acustica, an ex-veteran of Celestial Being who had ended her service as a Gundam Meister after getting scarred in an unknown accident. Under her wing is Fon Spaak, an 18-year old career criminal forced into Fereshte's service by using the GNY-004 Gundam Plutone as part of his \"services\" as a Meister pilot.\n\n(Source: MU)", "Kidou Senshi Gundam 00F", "Mobile Suit Gundam 00F", "機動戦士ガンダム 00F", 1, "https://myanimelist.net/manga/4404/Kidou_Senshi_Gundam_00F", 4 },
                    { 4591, "", 18, new DateTime(2000, 2, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/126927.jpg", 15917, 6.51m, new DateTime(1999, 6, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "Devilman's tribute manga series of original stories by various mangaka.", "Neo Devilman", null, "ネオデビルマン", 1, "https://myanimelist.net/manga/4591/Neo_Devilman", 3 },
                    { 4592, "Amon: Devilman Mokushiroku was published in Italian as Amon - The Dark Side of Devilman by D/Visual from April 14, 2005 to April 4, 2006. The series was later republished by Edizioni BD under the J-POP imprint from April 30, 2014 to December 20, 2014.", 41, new DateTime(2003, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/150864.jpg", 11992, 6.79m, new DateTime(1998, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Fear runs rampant throughout Tokyo with the revelation that demons in fact exist amongst us. Paranoia and the darker side of humanity boils onto the streets as people turn on one another, suspecting that anyone could in fact be a demon hiding in human clothing. Amidst the growing tensions, tragedy strikes Akira causing his mind to snap, retreating into his subconscious, allowing his Devilish alter-ego Amon to break free from Akira's cage of flesh and wreak havoc on both human and demons alike.\n\nAmon: Devilman Mokushiroku is a re-imagining of the last chapters of the original Devilman manga.", "Amon: Devilman Mokushiroku", "Amon: The Darkside of Devilman", "AMONデビルマン黙示録", 1, "https://myanimelist.net/manga/4592/Amon__Devilman_Mokushiroku", 6 },
                    { 4658, "Fullmetal Alchemist was published in English by VIZ Media from October 4, 2005, to October 12, 2021. The novels are published under the subtitles The Land of Sand, The Abducted Alchemist, The Valley of White Petals, Under the Faraway Sky, The Ties that Bind, and A New Beginning. The Land of Sand novel inspired episodes 11, 12, and part of 37 in the 2003 Fullmetal Alchemist TV anime.", 35, new DateTime(2010, 4, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/202288.jpg", 182, 8.45m, new DateTime(2003, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Somewhere between magic, art and science exists a world of alchemy. And into this world travel Edward and Alphonse Elric—two brothers in search of the Philosopher's Stone, the ultimate alchemical treasure!\n\n(Source: VIZ Media)", "Fullmetal Alchemist", "Fullmetal Alchemist", "鋼の錬金術師", 2, "https://myanimelist.net/manga/4658/Fullmetal_Alchemist", 7 },
                    { 4795, "Rurouni Kenshin: Meiji Kenkaku Romantan - Maki no Ichi was published in English as Rurouni Kenshin: Voyage to the Moon World by VIZ Media on October 17, 2006. It was also released in Brazilian Portuguese as Samurai X: Crônicas de Um Samurai na Era Meiji by Editora JBC in October 2006.", 19, null, "https://cdn.myanimelist.net/images/manga/1/5941.jpg", 4245, 7.35m, new DateTime(1996, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kenshin's new life brings him to Tokyo, where he joins the Kamiya Kasshin-ryû dojo to learn the art of \"swords that give life.\" The dojo is peaceful but never boring as Kenshin and his fellow apprentice Yahiko train under the demanding auspices of their kind-hearted instructor, Kamiya Kaoru. But all that changes one afternoon when Tae from the Akabeko restaurant arrives with a pot of beef stew and a plea for help. One of the regulars at the restaurant lost his master's precious book, and he'll be kicked out in the street if he can't recover it. The simple case of a missing book soon becomes a dangerous mystery as Kenshin and his friends are tangled in deep secrets and dark plots!", "Rurouni Kenshin: Meiji Kenkaku Romantan - Maki no Ichi", "Rurouni Kenshin: Voyage to the Moon World", "るろうに剣心 -明治剣客浪漫譚- 巻之一", 2, "https://myanimelist.net/manga/4795/Rurouni_Kenshin__Meiji_Kenkaku_Romantan_-_Maki_no_Ichi", 1 },
                    { 4981, "", 11, new DateTime(2008, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282837.jpg", 20182, null, new DateTime(2007, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Spin-off to Mobile Suit Gundam Seed Destiny The Edge, focusing on the other characters from the series. This manga includes:\n\n\nNeverending Nightmare (Shinn, Lunamaria, Rey)\nThe Lion's Daughter (Cagalli)\nTowards the Certain Future (Rey, Shinn, Lunamaria)\nEnd of the Dream (Meer)\nThe Last Selection (Shinn, Rey)\nSoldier in Eternal Chains (Kira, Cagalli)\nPartner (Yzak, Dearka)\nGoodbye Tomorrow 1 (Shinn)\nGoodbye Tomorrow 2 (Shinn, Rey, Lunamaria)\nGoodbye Tomorrow 3 (Shinn, Lunamaria)\nChildhood's End (Rey) \n\n(Source: MU)", "Kidou Senshi Gundam SEED Destiny: The Edge Desire", null, "機動戦士ガンダムSEED DESTINY THE EDGE Desire", 1, "https://myanimelist.net/manga/4981/Kidou_Senshi_Gundam_SEED_Destiny__The_Edge_Desire", 2 },
                    { 5114, "Romance Dawn refers to two separate manga chapters drawn by mangaka Eiichiro Oda in 1996, culminating in the first chapter of the ongoing series One Piece. The subtitle of the first volume of the series is also called \"Romance Dawn.\" Romance Dawn represents the slow progression of the author's ideas in his desire to create a manga about pirates, whose inspiration was drawn largely from his own childhood interests. While a first-year junior high school student, he began sketching out ideas for a pirate-themed manga in a notebook, in pencil. Years later, as an assistant to Rurouni Kenshin author Nobuhiro Watsuki, he began refining his ideas into what would become Romance Dawn, and later, One Piece. The author made significant alterations to the premise and plot over the course of the three chapters. (Source: One Piece Wiki)", 1, null, "https://cdn.myanimelist.net/images/manga/1/263631.jpg", 7402, 7.09m, new DateTime(1995, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "First of two One Piece prototype one-shots, which was later collected in One Piece Red: Grand Characters data book, published in 2002.", "Romance Dawn", null, "ROMANCE DAWN", 3, "https://myanimelist.net/manga/5114/Romance_Dawn", null },
                    { 5147, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/6428.jpg", 9004, 6.99m, new DateTime(2003, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "The grotesque Millennium Earl is an enemy of all of humanity. His greatest weapons are vile machines known as \"Akuma,\" whose creation is made possible by the human emotions of despair and longing. Those who can purge Akuma from the world are known as Exorcists. One such Exorcist is a girl named Robin, whose odd appearance mismatches her sheepish personality. Long ago, she lost someone important to her, which now serves as her driving motivation.\n\nAfter washing up on the shores of Osaka, Robin comes across a girl named Lenalee, who yearns for the lover she had lost at sea years ago. These feelings of longing catch the attention of the Millennium Earl, who has likely found his next victim...\n\n[Written by MAL Rewrite]", "Zone", "Zone", "ディーグレイマン (ゾーン)", 3, "https://myanimelist.net/manga/5147/Zone", null },
                    { 5177, "", 31, new DateTime(2016, 3, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/179084.jpg", 2305, 7.59m, new DateTime(2006, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Universal Century, 0001. The Prime Minister of the Earth Federation delivers a speech on the space station Laplace, only to be killed when the space station is destroyed.\n\nIt is now the year 0096, three years after the \"Axis Shock\" incident caused by Char Azanble. Banager Links, after meeting a mysterious girl named Audry, is caught in the crossfire when war breaks out between Zeon Remnants and the Earth Federation. Trying to find a way to prevent the colony's complete destruction, he stumbles upon a mysterious all white Mobile Suit, setting off a chain of events that'll change the course of history.", "Kidou Senshi Gundam Unicorn", "Mobile Suit Gundam Unicorn", "機動戦士ガンダムUC〈ユニコーン〉", 2, "https://myanimelist.net/manga/5177/Kidou_Senshi_Gundam_Unicorn", 11 },
                    { 5178, "A spin-off of the landmark anime Neon Genesis Evangelion that reimagines Shinji and his companions as vigilante students who spend their nights patrolling for zombie-like versions of the Angels from the original series. The plot remains mostly true to the source material. Neon Genesis Evangelion: Campus Apocalypse was published in English by Dark Horse from September 14, 2010 to July 5, 2011, and in a complete omnibus on April 26, 2016.", 22, new DateTime(2009, 8, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/30773.jpg", 11598, 6.82m, new DateTime(2007, 8, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "Shinji Ikari yearns for excitement to transform his boring day-to-day life as a student at the NERV Foundation Academy. His wish is granted when he witnesses an explosive battle between two teenagers and an older man with great wings extending from his back. Shinji recognizes these two teenagers as his classmates: his crush Rei Ayanami and new transfer student Kaworu Nagisa.\n\nDuring the encounter, Shinji unwittingly releases a power that appears to vanquish the winged man; in future instances, his power takes the form of a gun-like EVA, a weapon manifested from his will to survive. He learns that the beings his classmates combat are known as Angels, transient forms of consciousness that take possession of human bodies because they lack physical forms of their own. Cooperating with his two classmates—and later joined by foreign transfer student Asuka Langley Souryuu—Shinji agrees to fight against the Angels who plague his town.\n\n[Written by MAL Rewrite]", "Shinseiki Evangelion: Gakuen Datenroku", "Neon Genesis Evangelion: Campus Apocalypse", "新世紀エヴァンゲリオン 学園堕天録", 1, "https://myanimelist.net/manga/5178/Shinseiki_Evangelion__Gakuen_Datenroku", 4 },
                    { 5202, "", 27, new DateTime(1997, 1, 24, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/157503.jpg", 1990, 7.65m, new DateTime(1994, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story takes place 10 years after the end of Gundam F91. The movie's heroes, Seabook Arno and Cecily Fairchild, discover that Crux Dogatie of the Jupiter Energy Fleet is plotting to conquer Earth with the forces of his Jupiter Empire. In response, Cecily takes up her birth name \"Berah Ronah\" and recreates the Crossbone Vanguard, who disguise themselves as pirates attacking the Jupiter Energy Fleet. Seabook, under the alias \"Kinkedo Nau,\" is one of the new Vanguard's top pilots. The other is Zabine Chareux, a veteran of the original Crossbone Vanguard. The main character of Crossbone Gundam is a teenage Newtype named Tobia Arronax, who gets swept up in the war between the Crossbone Vanguard and Jupiter Empire.\n\n(Source: Wikipedia)", "Kidou Senshi Crossbone Gundam", "Mobile Suit Cross Bone Gundam", "機動戦士クロスボーン・ガンダム", 1, "https://myanimelist.net/manga/5202/Kidou_Senshi_Crossbone_Gundam", 6 },
                    { 5203, "", 6, new DateTime(2004, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/111839.jpg", 9383, 6.96m, new DateTime(2002, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "The manga consists of a series of individual stories, centered on the exploits of the Crossbone Vanguard during and three years after the end of the original series, with one exception; the first story is set during the One Year War and deals with Crossbone pilot Umon Samon's youth. The series also features the \"return\" of Grey Stork, the aged future version of Judau Ashta, who previously appeared in Hasegawa's V Gundam Sidestory manga. \n\n(Source: Wikipedia)", "Kidou Senshi Crossbone Gundam: Skull Heart", "Mobile Suit Crossbone Gundam: Skull Heart", "機動戦士クロスボーン・ガンダム スカルハート", 1, "https://myanimelist.net/manga/5203/Kidou_Senshi_Crossbone_Gundam__Skull_Heart", 1 },
                    { 5204, "", 15, new DateTime(2007, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/293736.jpg", 3694, 7.41m, new DateTime(2006, 7, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Taking place shortly after Skull Heart, the series has Tobia and friends meeting Europa, the second wife of original Crossbone villain Crux Dogate, who warns of a revitalized Jupiter Empire invasion. Of particular note is the presence of the F-99 \"Recordbreaker\", a mobile suit based on the Crossbone Gundams, which is chronologically the first mobile suit to use the \"Wings of Light\" made famous by the V2 Gundam.\n\n(Source: Wikipedia)", "Kidou Senshi Crossbone Gundam: Koutetsu no 7-nin", "Mobile Suit Crossbone Gundam: Steel 7", "機動戦士クロスボーンガンダム 鋼鉄の7人", 1, "https://myanimelist.net/manga/5204/Kidou_Senshi_Crossbone_Gundam__Koutetsu_no_7-nin", 3 },
                    { 5206, "", 55, new DateTime(1990, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/268460.jpg", 2811, 7.52m, new DateTime(1989, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "In Hathaway's Flash Hathaway Noa, still haunted by his past actions (not to mention the spirit of deceased Newtype Quess Paraya), joins a terrorist organization called Mafty and adopts the false name \"Mafty Navue Erin.\" The organization Mafty is fighting a terrorist campaign against the Earth Federation government, and they are eventually able to acquire the incredibly powerful prototype Ξ Gundam, which Hathaway becomes the pilot of. Using the Ξ Gundam Mafty attempts to attack a meeting of high-ranking Federation cabinet members in Adelaide, Australia to force them to vote down a provision which would strengthen the Federations already considerable powers.\n\nAs a point to note, this novel focuses on a version of events chronicled in creator Yoshiyuki Tomino's novelized form of Char's Counterattack, rather than his animated movie version, and as such, several discrepancies can be found between the animated work and this novel, making it more of a semi-canonical UC storyline, rather than 100% official canon.\n\n(Source: Wikipedia)", "Kidou Senshi Gundam: Senkou no Hathaway", null, "機動戦士ガンダム 閃光のハサウェイ", 2, "https://myanimelist.net/manga/5206/Kidou_Senshi_Gundam__Senkou_no_Hathaway", 3 },
                    { 5451, "Kinnikuman II-sei was published in English as Ultimate Muscle by VIZ Media under the Shonen Jump Advanced imprint from July 5, 2004 to July 5, 2011.", 300, new DateTime(2003, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/164971.jpg", 3463, 7.43m, new DateTime(1996, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kid Muscle, the son of legendary wrestler King Muscle, rockets to Earth and finds an evil wrestling gang called the dMp tearing the place apart. The punks on the dMp are the weirdest, nastiest, most outlandishly powerful musclebound freaks the galaxy has ever known. Kid Muscle's only hope: form a team that's even wilder. The only possible result is earthshaking, bodyslamming, ultimate-powered action that sends our entire planet sailing over the top rope!\n\n(Source: VIZ Media)", "Kinnikuman II-sei", "Ultimate Muscle: The Kinnikuman Legacy", "キン肉マンⅡ世", 1, "https://myanimelist.net/manga/5451/Kinnikuman_II-sei", 29 },
                    { 5664, "Nurarihyon no Mago was published in English as Nura: Rise of the Yokai Clan by VIZ Media under the Shonen Jump imprint from February 1, 2011, to February 3, 2015. It was also released in Italian as I Signori dei Mostri by Panini Comics from April 25, 2010, to May 31, 2014; and in Brazilian Portuguese as Nura: A Ascensão do Clã das Sombras by Editora JBC from October 2012 to October 2014.", 218, new DateTime(2012, 12, 27, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/157584.jpg", 826, 7.96m, new DateTime(2008, 3, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Rikuo Nura appears to be an ordinary middle school student. Appearances, however, can be deceiving. In reality, the young boy has one-fourth of youkai blood and is the heir to a large clan of youkai led by his grandfather, Nurarihiyon. As a small child, he was told that youkai often perform evil deeds, leading to his reluctance to succeed the Nura Clan and doing whatever he could to avoid his destiny.\n\nDuring the night, Rikuo undergoes a transformation into a fearsome youkai who resembles Nurarihiyon in his prime. Realizing that he can use his power to protect others, he accepts his inheritance, aiming to unite all the youkai factions across Japan and establish his own \"Night Parade of a Hundred Demons.\"\n\n[Written by MAL Rewrite]", "Nurarihyon no Mago", "Nura: Rise of the Yokai Clan", "ぬらりひょんの孫", 1, "https://myanimelist.net/manga/5664/Nurarihyon_no_Mago", 25 },
                    { 5733, "Shin Lupin III had fourteen volumes published in English as Lupin III by Tokyopop from December 10, 2002 to July 6, 2004. Later printings were titled Lupin III: World's Most Wanted, and had fewer volumes printed.", 180, new DateTime(1980, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/268986.jpg", 3351, 7.44m, new DateTime(1977, 6, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Monkey Punch's classic super-spy, Lupin III, returns in an all-new series of action, adventure and intrigue. Join Lupin and his fellow partners-in-crime, Jigen, Goemon, and Fujiko for a whirlwind, thrill-a-minute world tour filled with bombs and bombshells, lovers and liars, high crimes and misdemeanors, and the rest of the unusual suspects that create the lunacy that is Lupin III.\n\n(Source: Tokyopop)", "Shin Lupin III", "Lupin III: World's Most Wanted", "新ルパン三世", 1, "https://myanimelist.net/manga/5733/Shin_Lupin_III", 17 },
                    { 5756, "Batman: Death Mask was first published in English by DC Comics in comic book format, with four issues printed from April 9, 2008 to July 30, 2008. The chapters were collected in one volume, published on October 29, 2008.", 4, new DateTime(2008, 7, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/25321.jpg", 12615, 6.75m, new DateTime(2008, 4, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "Issue 1: There's a new serial killer in Gotham, and he may have ties to the training Bruce Wayne acquired as a young man in Japan. Does the murderer know Bruce Wayne is the Batman \n\nIssue 2: Bruce Wayne must confront his past and examine how the time he spent in Japan as a young man training to become Batman affected him...and whether his experiences then somehow led to the killer now rampaging throughout the underworld in Gotham. \n\nIssue 3: The mystery of the deadly masks is uncovered, as the killer reveals his long-standing deep-rooted connection to the Dark Knight and the time they spent together as students in Japan years ago.\n\nIssue 4: Events come to a head as the Batman must defeat the Oni — but before he can confront it, he must first face his own troubled past. \n\n(Source: DC Comics)", "Batman: Death Mask", "Batman: Death Mask", "バットマン・デスマスク", 1, "https://myanimelist.net/manga/5756/Batman__Death_Mask", 1 },
                    { 5931, "Love Hina was published in English as Love Hina the Novel by Tokyopop in 2006.", 6, new DateTime(2002, 2, 14, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/185606.jpg", 3123, 7.47m, new DateTime(2001, 5, 16, 17, 0, 0, 0, DateTimeKind.Local), 2, "Volume 1: \"Konyoku Genkin\"\nUrashima Keitarou is the only boy living at the Hinata House, an all-girl dorm. Despite the fact that he's kind of a screw-up, the girls are climbing all over each other in an effort to tear his clothes off. But it's not what he thinks! Supposedly somewhere on his body is a map to Hinata's secret treasure!\n\nVolume 2: \"Hitou Kaikin\"\nWhen a crazy robot that looks exactly like Keitarou appears out of the blue at the Hinata House, the tenants of the all-girl dorm band together to fend off the out-of-control \"Mecha-Keitarou.\"", "Love Hina", "Love Hina the Novel", "ラブひな", 2, "https://myanimelist.net/manga/5931/Love_Hina", 2 },
                    { 6028, "Naruto: Shiro no Douji, Keppu no Kijin was published in English as Naruto: Innocent Heart, Demonic Blood by VIZ Media on November 21, 2006.", 19, null, "https://cdn.myanimelist.net/images/manga/3/261705.jpg", 3320, 7.45m, new DateTime(2002, 12, 15, 16, 0, 0, 0, DateTimeKind.Local), 2, "Naruto, a born troublemaker, has the worst grades of anyone at Ninja Academy. But he has big dreams and swears that someday he'll be a respected warrior and the leader of his village! After barely graduating from the academy, Naruto officially becomes a full-fledged ninja and starts accepting assignments. He's thrilled about embarking on his first big job, a bodyguard mission, but his enthusiasm soon turns to panic when his group is ambushed by the powerful, vicious Demon Brothers. Can Naruto triumph over these fearsome foes?", "Naruto: Shiro no Douji, Keppu no Kijin", "Naruto: Innocent Heart, Demonic Blood", "NARUTO -白の童子、血風の鬼人-", 2, "https://myanimelist.net/manga/6028/Naruto__Shiro_no_Douji_Keppu_no_Kijin", 1 },
                    { 6444, null, 1, null, "https://cdn.myanimelist.net/images/manga/1/125935.jpg", 16246, 6.49m, new DateTime(1997, 8, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Naruto", null, "NARUTO-ナルト-", 3, "https://myanimelist.net/manga/6444/Naruto", null },
                    { 6488, "Atomcat was published in English by Digital Manga Publishing on June 25, 2013.", 7, new DateTime(1987, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/8698.jpg", 18587, 6.18m, new DateTime(1986, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "A boy's cat gets turned into a robot like Astro Boy.", "Atomcat", "Atomcat", "アトムキャット", 1, "https://myanimelist.net/manga/6488/Atomcat", 1 },
                    { 6732, "Kidou Senshi Gundam 00 was published in English as Mobile Suit Gundam 00 by Bandai Entertainment from September 23, 2009 to February 10, 2010.", 11, new DateTime(2008, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/185781.jpg", 5971, 7.2m, new DateTime(2007, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "2307 AD. The nations of the world are split into three major power blocs, each striving to further their own prestige and prosperity. Despite the precariousness of the situation, these groups of nations insist on playing a grand zero-sum game. To stand up against the state of the world, a private organization calling themselves Celestial Being declare that they will end all war on Earth...they will be armed with the Mobile weapon Gundam.\n\n(Source: Bandai Entertainment)", "Kidou Senshi Gundam 00", "Mobile Suit Gundam 00", "機動戦士ガンダム00", 1, "https://myanimelist.net/manga/6732/Kidou_Senshi_Gundam_00", 3 },
                    { 6891, "", 15, new DateTime(2008, 10, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/278234.jpg", 15393, 6.55m, new DateTime(2007, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "This series continues the Ken Ishikawa continuity of Getter manga, temporally taking place after Getter Robo Go and before Getter Āḥ. The series features an older Hayato leading a new team of Getter Pilots (and a new Getter) as they defend the earth from large plant-like monsters.\n\n(Source: Wikipedia)", "Getter Robo Hien: The Earth Suicide", null, "ゲッターロボ飛焔 ~THE EARTH SUICIDE~", 1, "https://myanimelist.net/manga/6891/Getter_Robo_Hien__The_Earth_Suicide", 3 },
                    { 7378, "Strobe Edge was published in English by VIZ Media under the Shojo Beat imprint from November 6, 2012 to May 6, 2014. The manga received two drama CD adaptations on August 25 and September 22, 2010, respectively, and a live-action film adaptation that was screened on March 14, 2015. It was also published in Spanish by Ivrea from March 2012 to February 2014.", 43, new DateTime(2010, 8, 10, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/255194.jpg", 823, 7.96m, new DateTime(2007, 6, 12, 17, 0, 0, 0, DateTimeKind.Local), 2, "Through the eyes of Ninako Kinoshita, it seems as if everyone knows what love is. Even when it comes to her own feelings for her childhood friend Daiki Korenaga, it is her friends who attest she is in love. However, a drop of doubt forms in her heart when Ren Ichinose, an attractive idol of the school, accidentally breaks Ninako's phone charm on the train. His earnest promise to compensate for it touches Ninako and she wonders if this is what real love feels like.\n\nLove is like an apple: its outer appearance may look sweet, but its taste can be deceiving. For Ninako, she meets the bitterness of unrequited love as her very first. But as her knowing friends go through different experiences with love, Ninako struggles to understand its complex flavor and fails to notice the way a certain someone looks at only her.\n\n[Written by MAL Rewrite]\n\n\nIncluded one-shot:\nVolume 6: Colorless Dreamer", "Strobe Edge", "Strobe Edge", "ストロボ・エッジ", 1, "https://myanimelist.net/manga/7378/Strobe_Edge", 10 },
                    { 7458, "Death Note Another Note: Los Angeles BB Renzoku Satsujin Jiken was published in English as Death Note Another Note: The Los Angeles BB Murder Cases by VIZ Media on February 19, 2008. It was also released in Brazilian Portuguese by Editora JBC on July 4, 2011; and in Polish by J.P. Fantastica on May 18, 2018.", 7, null, "https://cdn.myanimelist.net/images/manga/1/253578.jpg", 302, 8.3m, new DateTime(2006, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A serial killer terrorizes the streets of Los Angeles. This brilliant psychopath commits seemingly perfect murders, brazenly challenging the police with cryptic riddles. The enigmatic and world-famous detective L has been hired to crack the case. However, to keep himself out of the public eye, L seeks out FBI agent Naomi Misora to carry out the investigation for him.\n\nMisora agrees to aid L's endeavors, but soon finds herself caught up in an intense battle of wits between L and the culprit. Who is this mysterious killer, and why do they leave clues for the LAPD to decipher? Death Note Another Note: Los Angeles BB Renzoku Satsujin Jiken follows Misora on her journey to solve these mysteries and bring the indiscriminate murders to an end once and for all.\n\n[Written by MAL Rewrite]", "Death Note Another Note: Los Angeles BB Renzoku Satsujin Jiken", "Death Note Another Note: The Los Angeles BB Murder Cases", "DEATH NOTE アナザーノート ロサンゼルスBB連続殺人事件", 5, "https://myanimelist.net/manga/7458/Death_Note_Another_Note__Los_Angeles_BB_Renzoku_Satsujin_Jiken", 1 },
                    { 7546, "The first volume of Mach GoGoGo was first published in English as Speed Racer Classics by Now Comics in 1988. It was again released by DC Comics as Speed Racer: The Original Manga in July 2000. Digital Manga Publishing released the full series as Speed Racer: Mach GoGoGo as a 2-in-1 hardcover volume collector's set on April 15, 2008. It was also published in Brazilian Portuguese by NewPOP Editora in July 2009.", 10, new DateTime(1968, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/175843.jpg", 15348, 6.56m, new DateTime(1966, 5, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A teenage race car driver named Speed goes on adventures with his girlfriend, his candy-crazed brother whose best friend is a monkey, and his mysterious brother Racer X (Real Name: Rex). His father, Pops, created the car he races in, the Mach 5.", "Mach GoGoGo", "Speed Racer", "マッハGoGoGo", 1, "https://myanimelist.net/manga/7546/Mach_GoGoGo", 2 },
                    { 7658, "Cutie Honey was published in English by Seven Seas Entertainment in a complete hardcover omnibus on August 28, 2018. It was also released in Brazilian Portuguese by NewPOP Editora as an omnibus volume on May 4, 2020.", 24, new DateTime(1974, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253575.jpg", 19753, 5.45m, new DateTime(1973, 8, 23, 17, 0, 0, 0, DateTimeKind.Local), 2, "Innocent 16-year-old Honey Kisaragi has just transferred to a Catholic school for girls, where she is enamored by everyone around her—including the teachers and her new best friend, Natsuko Aki. Later that night, Honey hears her father, the famous scientist Dr. Kisaragi, calling for help, and on her way over, she discovers that she can magically transform her clothes into various costumes.\n\nBut at home, Honey finds her father dying in the arms of a reporter named Seiji Hayami, who had been interviewing him earlier. From her father's robot, Honey learns that she is, in fact, not human; she is a special android called \"Cutie Honey,\" built with an innovative piece of technology which allows her to shapeshift into seven different forms.\n\nAs the technology inside Honey can convert airborne particles into any and all types of matter, Dr. Kisaragi has been targeted by the organization called Panther Claw—a group of underground female cyborgs who greedily wish to use this technology for their own agenda. Now, Honey must protect her secret identity and avenge her late father by confronting any obstacle that Panther Claw sends her way!\n\n[Written by MAL Rewrite]", "Cutie Honey", "Cutie Honey", "キューティーハニー", 1, "https://myanimelist.net/manga/7658/Cutie_Honey", 2 },
                    { 7666, "", null, new DateTime(1971, 5, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/10482.jpg", 17635, 6.34m, new DateTime(1970, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The great demon Dante, exploiting the weakness of a boy exposed to his demoniac influence in the dreams, is awakened from a thousand years sleep.\n\nThe will of this being, a survivor of an ancient and forgotten civilization, is to wipe out the whole human race. Anyhow nothing is so simple: the motivations of the demon aren't so wicked as one could think and they will combine with the life of the boy which hangs between nightmare and craziness.\n\nIn the meanwhile the satanist will fight against the hierarchy of the church to obtain a justice which is, as it's easy to guess, that of the demon Maou.\n\nThis series didn't have an ending until it's remake in 2002. Nagai took many ideas from Maou Dante into Devilman.\n\n(Source: MU)", "Maou Dante", null, "魔王ダンテ", 1, "https://myanimelist.net/manga/7666/Maou_Dante", 3 },
                    { 7697, "", 10, new DateTime(2008, 5, 10, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/203317.jpg", 15029, 6.58m, new DateTime(2005, 5, 12, 17, 0, 0, 0, DateTimeKind.Local), 2, "This brief resurrection of Go Nagai's Violence Jack character. OK, resurrection may be the wrong word since Jack didn't actually die when Nagai ended the original series in 1990 and he also didn't bite it in the 2001 stand-alone short story DEMONS IN A WAR-TORN land. But you get the idea.\n\n(Source: deadfrog)", "Shin Violence Jack", null, "新バイオレンスジャック", 1, "https://myanimelist.net/manga/7697/Shin_Violence_Jack", 2 },
                    { 7747, "Ushio to Tora was awarded the 37th Shogakukan Manga Award for best shounen manga in 1991.", 313, new DateTime(1996, 10, 8, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/166841.jpg", 1204, 7.83m, new DateTime(1990, 2, 9, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ushio to Tora centers around the travails and battles of Ushio Aotsuki, who is constantly being stalked and aided by a gigantic, supernatural and sometimes invisible tiger-like monster.\n\nUshio's family maintains a Shinto temple in Japan, where ~500 years ago, his samurai ancestor battled that same tiger to a standstill, and eventually trapped him against a rock using a blessed spear called the \"Beast Spear,\" which in addition to its intrinsic formidability as a weapon, can also endow its wielder with the martial ability of the ancestor who originally wielded it.\n\nUshio accidentally unsealed the cave Tora was trapped in. Initially, Ushio refuses to remove the spear pinning Tora down, but Tora's unsealed presence summons various monsters who wish to fight him, and by extension Ushio. Ushio is forced to free Tora, who would like to eat Ushio, but dares not since Ushio keeps the spear close by. The series focuses on their relationship, interspersed with battles against mythological foes, and with Tora's attempts to grapple with modern life.\n\n(Source: Wikipedia)", "Ushio to Tora", "Ushio and Tora", "うしおととら", 1, "https://myanimelist.net/manga/7747/Ushio_to_Tora", 33 },
                    { 7756, "", 50, new DateTime(1972, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/176261.jpg", 20554, null, new DateTime(1968, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The most famous and terrible family of gangsters in the whole world is about to dissolve, once it's revealed the mysterious secret of the third member, Kikunosuke, the most powerful member of the Abashiri. However, the almost pacific life of the Abashiri family gets complicated when Kikunosuke enters in one of the most prestigious elite schools, where instead of learning about art and culture, students must learn the most dangerous techniques for fighting and murdering, at the hands of cruel psychopath teachers. Only a few students manage to survive this hell of a school... but of course, in this occasion, the new student will be most terrible of the Abashiri, and things will no longer will be the same.\n\n(Source: Wikipedia)", "Abashiri Ikka", null, "あばしり一家", 1, "https://myanimelist.net/manga/7756/Abashiri_Ikka", 15 },
                    { 7759, "", 5, new DateTime(1975, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/272710.jpg", 10565, 6.89m, new DateTime(1975, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "After Emperor Gore and the Reptilian empire is defeated, a new enemy, Emperor Burai and his Hyakki empire rises and threatens to take over Earth. Ryoma, Hayato, and newcomer Benkei pilot the new Getter Robo G to save Earth.\n\n(Source: ANN)", "Getter Robo G", "Getter Robo G", "ゲッターロボG", 1, "https://myanimelist.net/manga/7759/Getter_Robo_G", 3 },
                    { 7848, "Koukaku Kidoutai: Stand Alone Complex was published as Ghost in the Shell: Stand Alone Complex by Dark Horse from May 24, 2006 to January 2, 2007.", 45, new DateTime(2005, 2, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/155762.jpg", 1307, 7.8m, new DateTime(2004, 1, 20, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the not-too-distant future of 2032, the frontier dividing humans and machines has been crossed. Crimes comitted by flesh-and-metal cyborgs are investigated by Section 9, an elite counter-terrorist squad run by Chief Aramaki and his cyborg assistant, Major Motoko Kusanagi. Section 9 has faced countless adversaries in the real world and in cyberspace, but none like 'The Awakened.' It is believed that this lethal group of terrorists can take over the minds and bodies of almost anyone. Used as tools to commit crimes against the state, the victims are unaware of who or what is controlling them. When Major Kusanagi captures one of the victims, she hacks into his cyberbrain to learn the ringleader's identity-what she discovers leads her on a journey deep into the heart of cyberspace, a journey that shakes her to the core.\n\n(Source: Dark Horse Comics)", "Koukaku Kidoutai: Stand Alone Complex", "Ghost in the Shell: Stand Alone Complex", "攻殻機動隊STAND ALONE COMPLEX", 2, "https://myanimelist.net/manga/7848/Koukaku_Kidoutai__Stand_Alone_Complex", 3 },
                    { 7887, "Toriko was nominated for the second Manga Taisho Award in 2009. The manga was published in English by VIZ Media under the Shonen Jump imprint from June 1, 2010, to August 7, 2018. It was also released in Brazilian Portuguese by Panini Comics from April 2013 to November 2023; and in Spanish by Planeta Cómic from August 30, 2018, to December 1, 2021.", 396, new DateTime(2016, 11, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/304295.jpg", 2118, 7.63m, new DateTime(2008, 5, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "In a world where the taste and texture of food are an extremely important part of life, a man with superhuman skills is regularly hired by restaurants and the rich as a hunter of precious foods. With the \"help\" of his timid accomplice, inspired by Toriko's greatness to accompany him, he travels to capture the evasive and ferocious animals he needs to create the ultimate dinner course.\n\n[Written by MAL Rewrite]", "Toriko", "Toriko", "トリコ", 1, "https://myanimelist.net/manga/7887/Toriko", 43 },
                    { 8157, "Kamisama Hajimemashita was published in English as Kamisama Kiss by VIZ Media under the Shojo Beat imprint from December 7, 2010 to October 3, 2017. It has also been published in French by Delcourt since June 8, 2011, and in Polish by Studio JG since April 24, 2015.", 154, new DateTime(2016, 5, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/269698.jpg", 124, 8.54m, new DateTime(2008, 2, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "Nanami Momozono is a high schooler who has a lot on her plate. Her father had evaded his enormous gambling debts by escaping town, which resulted in his daughter being evicted by the debt collectors. As Nanami muses about her future, she runs into a man hanging onto a tree to escape a dog. She rescues him and tells him about her current situation, prompting the man to offer her his home. He believes that Nanami is more suited than him to be the \"Master\" of the house, and thus she takes him up on his offer.\n\nUpon arrival, however, Nanami discovers that said house is actually a dilapidated shrine. She is about to double back when a fox familiar and two shrine spirits stop her, mistaking her for their former master Mikage, the land god of the shrine. Upon realization, Tomoe—the fox familiar—leaves the shrine, refusing to serve Nanami. After a series of events leaves Nanami in grave danger, she summons Tomoe and seals a contract with him to earn his subservience. Now a human land god, Nanami must face new daunting tasks, menacing adversaries, and her handsome and hot-headed familiar.\n\n[Written by MAL Rewrite]", "Kamisama Hajimemashita", "Kamisama Kiss", "神様はじめました", 1, "https://myanimelist.net/manga/8157/Kamisama_Hajimemashita", 25 },
                    { 8158, "L Change the WorLd was published in English by VIZ Media on October 20, 2009. It was also released in Brazilian Portuguese by Editora JBC in September 2011.", 38, null, "https://cdn.myanimelist.net/images/manga/3/11590.jpg", 903, 7.93m, new DateTime(2007, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "L Change the WorLd is a sequel to the Death Note movie based on the popular anime. This movie is entirely dedicated to L, and his last 23 days on Earth after having caught Kira. This is a novel version of that movie and contains many events that do not take place in the film.", "L Change the WorLd", null, "L Change the WorLd", 2, "https://myanimelist.net/manga/8158/L_Change_the_WorLd", 1 },
                    { 8300, "Baby Steps won the 38th Kodansha Manga Award for the shounen category in 2014 and was adapted into a live-action TV drama series in 2016. In the final volume of the series, Hikaru Katsuki revealed that the manga's conclusion was decided by the publisher and not by her choice. Baby Steps was published digitally in English through K Manga.", 462, new DateTime(2017, 10, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/202589.jpg", 563, 8.11m, new DateTime(2007, 10, 16, 17, 0, 0, 0, DateTimeKind.Local), 2, "Maruo Eiichirou, a first year honor student, one day decides he's unhappy with the way things are and lacks exercise. He finds a flyer for the Tennis Club and decides check it out. He's instantly captivated by it. With no prior experience and poor physical conditioning, join Eiichirou as he embarks on a tennis journey using his smarts, dedication and work ethic.\n\n(Source: One Manga)", "Baby Steps", "Baby Steps", "ベイビーステップ", 1, "https://myanimelist.net/manga/8300/Baby_Steps", 47 },
                    { 8350, "Dominion C1 Conflict was serialized in Comic Gaia and planned to continue for 4 chapters before the magazine went defunct in 1992. The series is currently considered on hiatus. The series is not considered to be part of the same continuity as the original Dominion stories. Dominion C1 Conflict was published in English as Dominion Conflict One: No More Noise by Dark Horse Comics in March 1997 and later republished in February 2008.", 2, null, "https://cdn.myanimelist.net/images/manga/2/167653.jpg", 11124, 6.85m, new DateTime(1991, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Humor is the only defense against insanity in a world where the crime is so bad that the cops need armored tanks! Such is the world of Leona, ace tank-cop. In her pet tank Bonaparte, she'll either save the city of Newport... or destroy it trying! In No More Noise, Leona recruits some help to catch some slippery crooks—help that's rather crooked itself! The villainous and sexy Puma sisters become duly deputized officers of the law in this latest chapter of Dominion!\n\n(Source: Dark Horse)", "Dominion C1 Conflict", "Dominion Conflict One: No More Noise", "ドミニオンC1コンフリクト", 1, "https://myanimelist.net/manga/8350/Dominion_C1_Conflict", 1 },
                    { 8558, "", 5, new DateTime(1976, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/43589.jpg", 18122, 6.27m, new DateTime(1975, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "A short manga version of the UFO Robo Grendizer anime. Released along the anime series, UFO Robot Grendizer follows the adventures of Duke Fleed, the Prince of Planet Fleed, whom disguised as Daisuke, a farm worker, fights against the forces that destroyed his planet, the Vegan Empire, also the creators of Grendizer that Duke stole to fight them. While not originaly considered part of the Mazinger series, Koji Kabuto and the Mazinger mechas appear in this series, making it sort of a sequel. Grendizer introduced the concept of a transformable Robot and a space Mecha, concepts that were later taken into other mecha series. It was extremely popular in Japan, Canada, France, Italy and the Arab World and has a strong following in those countries even today.\n\n(Source: MU)", "UFO Robo Grendizer", null, "UFOロボグレンディザー", 1, "https://myanimelist.net/manga/8558/UFO_Robo_Grendizer", 1 },
                    { 8571, "", 9, new DateTime(1998, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/157458.jpg", 1455, 7.76m, new DateTime(1995, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Shin Getter Robo is the third Getter Robo series chronologically (taking place after Getter Robo G but before Getter Robo Go).\n\nYears after the original story and in a brief time of peace, Professor Saotome has completed his masterpiece, the Shin Getter Robo, while humanity makes large advancements in space exploration and Getter Rays research. Unfortunately, this progress brings them to the attention of a mysterious and hostile race from across time and space.", "Shin Getter Robo", null, "真ゲッターロボ", 1, "https://myanimelist.net/manga/8571/Shin_Getter_Robo", 2 },
                    { 8772, "", 7, null, "https://cdn.myanimelist.net/images/manga/3/74995.jpg", 17907, 6.3m, new DateTime(2002, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Slight retelling of the 2001-2002 Mazinkaiser OVA series.", "Mazinkaiser", null, "マジンカイザー", 1, "https://myanimelist.net/manga/8772/Mazinkaiser", 1 },
                    { 8773, "", 33, new DateTime(1973, 8, 12, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/187139.jpg", 15032, 6.58m, new DateTime(1972, 10, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "One of the first Super Robot manga and the one that introduced most of the traits of the Mecha genre. Constructed with the Super-Alloy Z, Mazinger was built by Professor Juzo Kabuto as a weapon against the Mechanical Beasts of the evil Dr. Hell. Koji Kabuto, the grandson of Professor Kabuto, becomes the pilot of Mazinger Z when his grandfather is killed, and battles from there on against Dr. Hell and his allies. This is the first series that introduced the concept of a pilot inside a Mecha, which all series from then on have followed.\n\n(Source: MU)", "Mazinger Z", null, "マジンガーZ", 1, "https://myanimelist.net/manga/8773/Mazinger_Z", 5 },
                    { 8782, "", null, new DateTime(2003, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/186145.jpg", 17468, 6.36m, new DateTime(2002, 1, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "This series is a complete remake of the original Maou Dante, with new designs an a story slightly inspired by the 2002 anime. This time, the story spans longer, the character design is different, and all unanswered questions left when the original series was interrupted, are responded. This time, Maou Dante has a proper ending.\n\n(Source: MU)", "Maou Dante (2002)", null, "魔王ダンテ", 1, "https://myanimelist.net/manga/8782/Maou_Dante_2002", 4 },
                    { 8795, "", 503, new DateTime(2017, 3, 28, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/193643.jpg", 3071, 7.48m, new DateTime(2006, 4, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kakeru Aizawa, the manager of an ordinary high school soccer team, believes that he does not have any proficiency in the sport. His brother, Suguru, is a skilled player, even starring as the ace for the Japanese national team. Although they are on good terms, Kakeru secretly envies his brother's soccer skills. Suguru, however, believes that Kakeru still holds some hidden talent and tries to awaken it.\n\nWhen an unexpected tragedy strikes, Kakeru is now forced to play soccer while also reuniting with a childhood crush, and he must finally face the scar that has held him back for so many years.\n\n[Written by MAL Rewrite]", "Area no Kishi", "The Knight in the Area", "エリアの騎士", 1, "https://myanimelist.net/manga/8795/Area_no_Kishi", 57 },
                    { 9114, null, 8, new DateTime(2010, 12, 2, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/12458.jpg", 650, 8.06m, new DateTime(2005, 5, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "D.Gray-man: Reverse", null, "D.Gray-man reverse", 2, "https://myanimelist.net/manga/9114/DGray-man__Reverse", 3 },
                    { 9259, "", 10, new DateTime(2009, 5, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/22036.jpg", 5147, 7.27m, new DateTime(2008, 8, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "A collection of comedic short stories that focus on a single male lead. Many of the characters in these stories look the same as the characters from school rumble, although every short story is very different, and these characters take on a number of very different roles.\n\n(Source: MU)", "School Rumble Z", null, "スクールランブル Z", 1, "https://myanimelist.net/manga/9259/School_Rumble_Z", 1 },
                    { 9271, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/15811.jpg", 3447, 7.43m, new DateTime(1999, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "The \"Kenshin Kaden\" basically refers to the last extra chapter (comes after the end of the manga and after Yahiko no Sakabatou) of Rurouni Kenshin entitled \"Cherry Blossoms in the Spring Time.\"\n\nIt was published in the Kenshin Kaden Artbook.\n\n(Source: The-OrO.com)", "Rurouni Kenshin: Haru ni Sakura", null, "るろうに剣心 春に桜", 3, "https://myanimelist.net/manga/9271/Rurouni_Kenshin__Haru_ni_Sakura", null },
                    { 9273, "", 9, new DateTime(1991, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/65879.jpg", 17953, 6.29m, new DateTime(1990, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Universal Century 0120.\n\nPhantom mobile suits, oh my! Renegade Zeon mobile suits steal the newly developed Gundam F90 during it's testing phase! The Federation Forces give pursuit to Mars where the Oldsmobile Army is about to unleash it's ultimate assault against the Earth! Who will survive?!", "Kidou Senshi Gundam F90", null, "機動戦士ガンダムF90", 1, "https://myanimelist.net/manga/9273/Kidou_Senshi_Gundam_F90", 1 },
                    { 9711, "Bakuman. ranked first in the 2010 Kono Manga ga Sugoi! for the Male Readers division. The series was published in English by VIZ Media under the Shonen Jump imprint from August 3, 2010, to August 6, 2013. The publisher later released the manga in a 20-volume box set. The manga was also published in Spain by Norma Editorial from October 2010 to November 2013; in Brazilian Portuguese by Editora JBC from August 2011 to April 2013; in Russian by Azbooka as 2-in-1 omnibus volumes; in Mexico by Panini Comics from March 11, 2015, to October 5, 2016; in Argentina by Editorial Ivrea from July 20, 2012, to December 7, 2017; and in Polish by Waneko from May 20, 2016, to July 20, 2019. The manga was adapted into a live-action movie released on October 3, 2015.", 176, new DateTime(2012, 4, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/208974.jpg", 248, 8.37m, new DateTime(2008, 8, 10, 17, 0, 0, 0, DateTimeKind.Local), 2, "Despite being a talented artist, middle school student Moritaka Mashiro is unsure about his future, accepting that he will simply lead a normal life. After seeing one of Mashiro's drawings in class, Akito Takagi—an aspiring writer—insists that they write a manga together. But Mashiro is hesitant—his uncle, a mangaka, had died from overworking just a few years prior. However, when Mashiro hears that his crush, Miho Azuki, aims to be a voice actress, he becomes determined to create a manga that can be adapted into an anime for her to star in. Reciprocating Mashiro's feelings, she agrees to get married once they have both achieved their dreams.\n\nBakuman. chronicles Mashiro and Takagi's successes and struggles in their attempts to be serialized in Weekly Shounen Jump and become famous mangakas. Will their gamble pay off, or will they join the countless number of failures?\n\n[Written by MAL Rewrite]", "Bakuman.", "Bakuman。", "BAKUMAN。 バクマン。", 1, "https://myanimelist.net/manga/9711/Bakuman", 20 },
                    { 9726, "Zaregoto Series placed three times in the Kono Light Novel ga Sugoi! from 2005 to 2007, where it ranked second, first, and third, respectively. The first volume of series, Kubikiri Cycle, won the 23rd Mephisto Prize in 2002. The first two volumes were published in English by Del Rey Manga from July 22, 2008, to June 22, 2010. Vertical Inc. published the first three volumes from January 24, 2017, to September 17, 2019.", null, null, "https://cdn.myanimelist.net/images/manga/1/157901.jpg", 74, 8.64m, new DateTime(2002, 2, 4, 16, 0, 0, 0, DateTimeKind.Local), 4, "A dropout from an elite Houston-based program for teens is on a visit to a private island. Its mistress, virtually marooned there, surrounds herself with geniuses, especially of the young and female kind—one of whom ends up headless one fine morning.\n\n(Source: Kodansha USA)", "Zaregoto Series", "Zaregoto", "戯言シリーズ", 2, "https://myanimelist.net/manga/9726/Zaregoto_Series", null },
                    { 9736, "", 12, new DateTime(1985, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/148093.jpg", 20965, null, new DateTime(1985, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The year is Universal Century 0087. Seven years have passed since the end of the One Year War. In its zeal to stamp out any remaining opposition, the Earth Federation has organized the Titans, an elite fighting force. However, the Titans soon get out of hand, committing atrocities on par with the worst the Principality of Zeon had to offer during the war. In response, dissatisfied citizens, former Zeon soldiers, and even members of the Earth Federal Forces form a resistance group known as the Anti-Earth Union Group, or AEUG. As the next war is brewing, a small AEUG group arrives at Side 7 to investigate the new Gundam Mk. II...\n\n(Source: ANN)", "Kidou Senshi Z Gundam", null, "機動戦士Zガンダム", 1, "https://myanimelist.net/manga/9736/Kidou_Senshi_Z_Gundam", 3 },
                    { 9820, "Versailles no Bara Gaiden was published in English as The Rose of Versailles Side Stories: The Great Detective Loulou by Udon Entertainment as the 5th volume of The Rose of Versailles on May 4, 2021.", 10, null, "https://cdn.myanimelist.net/images/manga/2/13142.jpg", 5456, 7.24m, new DateTime(1973, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The Versailles no Bara Gaiden series is a collections of short stories written by Riyoko Ikeda. These stories were published in two separate magazines in 1974 (first publication) after the serialization of the manga Versailles no Bara, and 1984-1985 (second publication).\n\n(Source: Wikipedia)", "Versailles no Bara Gaiden", "The Rose of Versailles Side Stories: The Great Detective Loulou", "ベルサイユのばら外伝", 1, "https://myanimelist.net/manga/9820/Versailles_no_Bara_Gaiden", 2 },
                    { 9889, "Kidou Senshi Gundam was first published in English by Del Ray Books in 1990. Due to a lack of official romanizations, a number of names were translated phonetically (e.g. \"Char\" as \"Sha\", \"Zaku\" as \"Zaks\"). A revised edition, which updated these romanizations, was published in a single omnibus by Stone Bridge Press on April 1, 2004.", 23, new DateTime(1981, 3, 15, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/148121.jpg", 2598, 7.55m, new DateTime(1979, 11, 29, 16, 0, 0, 0, DateTimeKind.Local), 2, "Universal Century 0079: The Principality of Zeon has declared its independence from the Earth Federation, and subsequently launched a massive war of independence, a war which has raged in every continent on earth and in nearly every space colony and lunar settlement. The Zeon have the upper hand through their use of a revolutionary new type of weapon, their humanoid like mobile suits. When a Zeon recon team disobey mission orders and begin attacking Side 7 its citizens stumble across the Federations latest weapon: the Gundam. With the aid of Earth Federation soldiers stationed aboard the MS carrier White Base the newly formed crew of refugees set out to change the course of the One Year War — or die trying.\n\n(Source: Gundam Wikia)", "Kidou Senshi Gundam", "Mobile Suit Gundam", "機動戦士ガンダム", 2, "https://myanimelist.net/manga/9889/Kidou_Senshi_Gundam", 3 },
                    { 9977, "", 12, new DateTime(1982, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/267488.jpg", 7397, 7.09m, new DateTime(1979, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "This is the original manga adaptation of Kidou Senshi Gundam, released during the time the TV series was on the air.", "Kidou Senshi Gundam", null, "機動戦士ガンダム", 1, "https://myanimelist.net/manga/9977/Kidou_Senshi_Gundam", 2 },
                    { 10010, "Beelzebub was published in Italian by Star Comics from June 4, 2011 to October 3, 2015 and has been published in Brazilian Portuguese by Panini Comics/Planet Manga since September 2012.", 250, new DateTime(2015, 3, 12, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/188942.jpg", 526, 8.13m, new DateTime(2009, 2, 22, 16, 0, 0, 0, DateTimeKind.Local), 2, "Ishiyama High—land of the delinquents. No matter how tough you think you are, you don't mess with an Ishi-high student. One of the most infamous students is first year Tatsumi Oga, called \"Demon King\" by those he's defeated. \n\nOne day, while Oga is finishing off a gang that attacked him, he stumbles upon an infant. In a rare moment of kindness, Oga tries to care for the baby. As a result, the child becomes overly attached to him. In a panic, he brings the baby to his best friend Takayuki Furuichi's house. While there, they are attacked by Hildegard, a demon maid who says the baby is actually Kaiser de Emperana Beelzebub IV. She also reveals that he was sent here to destroy humanity, on a whim of his father Beelzebub III, Great Demon Lord of the Demon World. After failing to remove Baby Beel from Oga, she declares that he must raise him, as moving more than 15 meters away will result in instant death for Oga.\n\nWith his delinquent past and unfriendly nature, Oga must deal with the burden of raising a demon baby. Beezelbub follows his story through encounters with demons and dangerous classmates, all while being an unorthodox role model and carer for the young Baby Beel.\n\n[Written by MAL Rewrite]", "Beelzebub", null, "べるぜバブ", 1, "https://myanimelist.net/manga/10010/Beelzebub", 28 },
                    { 10016, "", 139, new DateTime(2020, 10, 11, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/51325.jpg", 2882, 7.51m, new DateTime(1997, 1, 10, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the future, Japan is a wasteland. In the Great Kantou Desert, scattered humans eke out a living in the hot sand. Among them, a short-statured man they call \"Sunabouzu\" makes a living as a bounty hunter. Like a demon of the sand, he seems unbeatable. Yet, like all men, he has a particular weakness for the opposite sex...\n\n(Source: ANN)", "Sunabouzu", "Desert Punk", "砂ぼうず", 1, "https://myanimelist.net/manga/10016/Sunabouzu", 22 },
                    { 10105, "", 182, new DateTime(2012, 6, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/52041.jpg", 21024, null, new DateTime(2008, 8, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "The kindergartener hero Inumaru's chaotic life as he causes lively and funny incidents in this gag manga. Inumaru is just a little strange, with his deep knowledge of celebrity and Shonen Jump gossip, and his stubborn policy of not wearing pants. His teacher Tamako is given the run around everyday! This popular serial is around 9 pages each week, sometimes with just a little color thrown in!!\n\n(Source: MU)", "Inumarudashi", null, "いぬまるだしっ", 1, "https://myanimelist.net/manga/10105/Inumarudashi", 11 },
                    { 10183, "xxxHOLiC: AnotherHOLiC was published in English by Del Rey on October 28, 2008.", 3, null, "https://cdn.myanimelist.net/images/manga/1/268984.jpg", 1545, 7.74m, new DateTime(2006, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Nothing could have thrilled Kimihiro more than stumbling upon the bizarre wish-granting shop of the beautiful but unnerving Yûko Ichihara, who solemnly promises to make the spirits plaguing Kimihiro go away just as soon as her fee–rendered in daily afternoon chores at her shop–is paid in full.\n\nOf course, the thrill wears off as soon as Kimihiro realizes that his payment plan bears a disturbing resemblance to indentured servitude . . . eternal indentured servitude. Still he soldiers on, ready for whatever number of adventures lie ahead. But in Kimihiro’s case, three may not be the charm!\n\nHis first assignment–to procure a pair of fake eyeglasses–is exceptionally pointless, even by Yûko’s standards. Or at least it seems that way, until Kimihiro watches a woman throw herself into traffic. He soon discovers that the doors of bespectacled perception can swing both ways.\n\nNext, when a classmate seeks help solving a mystery involving text messages from the dead, Kimihiro is glad to play Sherlock. But he must turn to Yûko to determine whether the root of the riddle is otherworldly shenanigans, deceit, or murder.\n\nFinally, however ready, willing, and able Kimihiro thinks he is to face the most unusual of circumstances, he still finds himself completely bewildered by the stranger who chases away his darkest spirits, condemns Yûko as a craven charlatan, and offers Kimihiro a way out of his preternatural predicament–and a fortune besides. \n\n(Source: Del Rey)", "xxxHOLiC: AnotherHOLiC", "xxxHOLiC: AnotherHOLiC", "×××HOLiC アナザーホリック ランドルト環エアロゾル", 2, "https://myanimelist.net/manga/10183/xxxHOLiC__AnotherHOLiC", 1 },
                    { 10328, "", null, new DateTime(2009, 10, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282845.jpg", 21080, null, new DateTime(2008, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "A graphic novel serialized in Dengeki Hobby Magazine, featuring events before the main story. Story by Tomohiro Chiba, model conduction by Dengeki Hobby Magazine.\nThe first Volume was released in May, 2008 by Dengeki Hobby.", "Kidou Senshi Gundam 00P", null, "機動戦士ガンダム00P", 2, "https://myanimelist.net/manga/10328/Kidou_Senshi_Gundam_00P", 4 },
                    { 10447, "", 28, new DateTime(1992, 1, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/272711.jpg", 612, 8.08m, new DateTime(1991, 2, 10, 16, 0, 0, 0, DateTimeKind.Local), 2, "Following the disaster at the end of Shin Getter Robo, Hayato Jin has become the new leader of the Saotome Research Institute and Ryoma has retired to the countryside. Robot technology has advanced to the point that most major countries own them, but Getter Rays research is now forbidden and kept secret from the rest of the world. In order to defeat the madman Randou whose base lies the Arctic, a new team of Getter Robo pilots is formed, piloting a new form of Getter Robo which runs on simple plasma energy. Allying with the militaries of various nations, the war with Randou's army begins.\n\nThis series marks the debut of the Shin Getter Robo.", "Getter Robo Go", "Venger Robo", "ゲッターロボ號", 1, "https://myanimelist.net/manga/10447/Getter_Robo_Go", 7 },
                    { 10720, "", 5, new DateTime(2008, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282853.jpg", 21154, null, new DateTime(2008, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Mobile Suit Gundam 00: Aoi Kioku deals with Gundam Meister pilots' memories\n\nThe August issue (on sale on June 26) of Kadokawa Shoten's Monthly Gundam Ace magazine has launched Mobile Suit Gundam 00: Aoi Kioku (Blue Memories), Tarō Shiguma's new manga series based on the Gundam 00 anime television series. \n\nThe magazine summarizes how the manga will deal with the lives of the Gundam Meister pilots by saying, \"The present and the past…fiction and memories…the true selves of the boys will be revealed.\" \n\nThe first installment, \"Memory: 1 Setsuna,\" covers the memories of the main protagonist Setsuna's early childhood. \n\n(Source: ANN)", "Kidou Senshi Gundam 00: Aoi Kioku", null, "機動戦士ガンダム00 蒼い記憶", 1, "https://myanimelist.net/manga/10720/Kidou_Senshi_Gundam_00__Aoi_Kioku", 1 },
                    { 10814, "Baccano! 1931 The Grand Punk Railroad is based on the 2nd and 3rd novels in Ryohgo Narita's light novel series Baccano!", 15, new DateTime(2008, 2, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/84135.jpg", 5429, 7.24m, new DateTime(2006, 12, 26, 16, 0, 0, 0, DateTimeKind.Local), 2, "In 1711, a group of alchemists seeking eternal life gathered on a boat to summon the \"demon\" that held the secret. The demon agreed to give them what they wanted—an elixir of life, the method to create more, and the secret to ending their new-found existence. The following night, alchemists began disappearing, \"eaten\" by one of their own. Realizing the threat being close together posed, they decided to scatter across the world. Centuries later, in Prohibition-era America, the immortals have come together once again, and the \"stupid commotion\" (baccano) starts.", "Baccano! 1931 The Grand Punk Railroad", null, "バッカーノ! 1931 The Grand Punk Railroad", 1, "https://myanimelist.net/manga/10814/Baccano_1931_The_Grand_Punk_Railroad", 2 },
                    { 10820, "Innocence: After the Long Goodbye was published in English as Ghost in the Shell 2: Innocence - After the Long Goodbye by VIZ Media on October 11 2005.", 7, null, "https://cdn.myanimelist.net/images/manga/1/14563.jpg", 4600, 7.32m, new DateTime(2004, 2, 29, 16, 0, 0, 0, DateTimeKind.Local), 2, "Taking place before the movie, Innocence, the novel is told from Batou's perspective and surrounds his search for his dog Gabriel.\n\n(Source: Wikipedia, edited)", "Innocence: After the Long Goodbye", "Ghost in the Shell 2: Innocence - After the Long Goodbye", "イノセンス After the Long Goodbye", 2, "https://myanimelist.net/manga/10820/Innocence__After_the_Long_Goodbye", 1 },
                    { 10968, "", 31, null, "https://cdn.myanimelist.net/images/manga/3/14776.jpg", 1706, 7.7m, new DateTime(2002, 5, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Details the events of the manga from an investigative reporter's point of view.", "Mou Hitotsu no Monster: The Investigative Report", null, "もうひとつのMONSTER -The investigative report-", 2, "https://myanimelist.net/manga/10968/Mou_Hitotsu_no_Monster__The_Investigative_Report", 1 },
                    { 10982, "", 23, new DateTime(2006, 4, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/14793.jpg", 8309, 7.03m, new DateTime(2004, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "It is October, Cosmic Era 71. The Second Battle of Yakin Due has brought about the end of the war between Earth and PLANT. Jess Rabble, a mobile suit pilot, journalist and cameraman, wishes to photograph the truth of the world from a mobile suit's perspective. During an encounter with the Junk Guild, he meets Lowe Gear, who offers him the newly completed Astray Out Frame in order to fulfill his goal. Now, with Lowe's talking computer '8' at his side, Jess ventures off to all corners of the Earth to film the new battles the world faces.\n\n(Source: ANN)", "Kidou Senshi Gundam SEED Destiny Astray", "Mobile Suit Gundam SEED Destiny Astray", "機動戦士ガンダムSEED DESTINY ASTRAY", 1, "https://myanimelist.net/manga/10982/Kidou_Senshi_Gundam_SEED_Destiny_Astray", 4 },
                    { 11153, "", null, null, "https://cdn.myanimelist.net/images/manga/2/109185.jpg", 4789, 7.3m, new DateTime(2008, 11, 3, 16, 0, 0, 0, DateTimeKind.Local), 4, "What exactly do middle and high school tennis players do after classes end for the day? Surprisingly, it's not always playing tennis. From enjoying the seasons to discovering unconventional training techniques, there are more to these enthusiastic athletes outside the sport. In this 4-koma after-school comedy, Ryouma Echizen and his friends stumble upon whimsical situations in which the laughter never stops!\n\n[Written by MAL Rewrite]", "Houkago no Oujisama", null, "放課後の王子様", 1, "https://myanimelist.net/manga/11153/Houkago_no_Oujisama", null },
                    { 11176, "", null, null, "https://cdn.myanimelist.net/images/manga/1/15123.jpg", 1939, 7.66m, new DateTime(2005, 5, 14, 17, 0, 0, 0, DateTimeKind.Local), 4, "Novel 1\nThe Legend of the Buried Treasure of Koshu\nReleased date: May 15, 2005\n\nNovel 2\nMurder Symphony\nReleased date: March 15, 2006\n\nNovel 3\nA Challenge Letter to Shinichi Kudo: Prologue Until Goodbye\nReleased date: October 15, 2006\n\nNovel 4\nShinichi Kudo Returns ~Confrontation with the Black Organization~\nReleased date: December 19, 2007\n\nNovel 5\nThe Witch of Ejinbara\nReleased date: July 11, 2008\n\nNovel 6\nA Challenge Letter to Shinichi Kudo ~The Mystery of the Legendary Bird~\nReleased date: April 16, 2011\n\nNovel 7\nA Challenge Letter to Shinichi Kudo ~Murder in the Court~\nReleased date: September 16, 2011\n\nNovel 8\nA Challenge Letter to Shinichi Kudo ~Love Formula Murder Case~\nReleased date: December 14, 2011\n\nNovel 9\nA Challenge Letter to Shinichi Kudo ~Showdown! Shinichi Kudo vs Heiji Hattori~\nReleased date: April 12, 2012", "Meitantei Conan", "Detective Conan", "小説名探偵コナン", 2, "https://myanimelist.net/manga/11176/Meitantei_Conan", null },
                    { 11210, "", 74, new DateTime(2007, 7, 1, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/275337.jpg", 5117, 7.27m, new DateTime(2005, 12, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "Starting up one year after the finale of the first series, the Maruhage Empire is reformed by former emperor Tsuru Tsurulina III into the Neo-Maruhage Empire, where the Hair Hunts resume and a new generation of powerful Hair Hunt generals are created. Bo-bobo, powering the abilities of his \"Fist of the Nosehair\" into its \"True Theory\" form, rejoins Beauty and the Hajike allies to take on the renewed Maruhage threat.\n\n(Source: ANN)", "Shinsetsu Bobobo-bo Bo-bobo", null, "真説ボボボーボ・ボーボボ", 1, "https://myanimelist.net/manga/11210/Shinsetsu_Bobobo-bo_Bo-bobo", 7 },
                    { 11300, "", 221, new DateTime(2003, 9, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/185984.jpg", 5309, 7.25m, new DateTime(1998, 7, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "The fourth Lupin III manga series.", "Lupin III Y", null, "ルパン三世Y", 1, "https://myanimelist.net/manga/11300/Lupin_III_Y", 20 },
                    { 11330, "Bleach was selected for serialization after the one-shot ranked number one on Weekly Shounen Jump's popularity polls in 2001.", 1, null, "https://cdn.myanimelist.net/images/manga/4/15891.jpg", 13241, 6.71m, new DateTime(2000, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "Since childhood, seeing ghosts has been a part of Ichigo Kurosaki's ordinary life. However, things go awry when he and his spectral attachments get caught in a fight between Soul Reaper Rukia Kuchiki and a Hollow. As Ichigo learns, Soul Reapers are spiritual beings assigned to safely guide the dead to Soul Society, whereas Hollows are corrupt spirits that prey on innocent souls.\n\nThough Rukia manages to defeat her opponent and keep everyone else out of harm, she exhausts her powers in the process. No longer capable of performing her duties, she resorts to forcing Ichigo to become her substitute until she recovers. Despite Rukia's abrasive behavior, Ichigo handles his new routine with ease. But when he is tasked with sending one of his classmates to Soul Society, Ichigo gains a compelling outlook on the afterlife.\n\n[Written by MAL Rewrite]", "Bleach", null, "BLEACH", 3, "https://myanimelist.net/manga/11330/Bleach", null },
                    { 11437, "", 192, new DateTime(2010, 12, 21, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/86495.jpg", 10633, 6.88m, new DateTime(2006, 8, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "The titular Hanagata is a Junior High student who used to be an ace Little League Pitcher until he busted his shoulder. Now, in Junior High, he has decided to focus on his batting. But, the School has been banned from official games, and the baseball club has reluctant members.\n\n(Source: MU)", "Shinyaku \"Kyojin no Hoshi\": Hanagata", null, "新約「巨人の星」花形", 1, "https://myanimelist.net/manga/11437/Shinyaku_Kyojin_no_Hoshi__Hanagata", 22 },
                    { 11561, "", 17, new DateTime(2008, 10, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282856.jpg", 6152, 7.19m, new DateTime(2008, 1, 16, 16, 0, 0, 0, DateTimeKind.Local), 2, "It shares its name with another Gundam 00 manga drawn by Kouzoh Ohmari and published by Kadokawa. The two series essentially follow the plot of the anime, however they vary both in artistic style and in the sequence of events that take place.", "Kidou Senshi Gundam 00", null, "機動戦士ガンダム00", 1, "https://myanimelist.net/manga/11561/Kidou_Senshi_Gundam_00", 4 },
                    { 11652, "Kuroko no Basket ranked sixth place in the 2012 Kono Manga ga Sugoi! for the male readers category. The series was published in English as Kuroko's Basketball by VIZ Media under the Shonen Jump imprint in 2-in-1 omnibuses from August 2, 2016 to December 4, 2018. The series is also published in Spanish by Ivrea España since October 2015 and in Polish by Waneko since December 15, 2014.", 276, new DateTime(2014, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/244299.jpg", 588, 8.1m, new DateTime(2008, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), 2, "Teikou Middle School is famous for its highly renowned basketball team, which produced the famed \"Generation of Miracles\": a team of five prodigies, each with their own unique abilities, considered to be undefeatable by the time they became third years. However, blinded by pride, they split up, entering different high schools upon graduation.\n\nTaiga Kagami, having just returned from America, joins the basketball team at Seirin High School in search of strong team members. There, he finds Tetsuya Kuroko, a seemingly unimpressive player, only for Kagami to find out that Kuroko was the \"Phantom Sixth Man\" of the Generation of Miracles: an invisible player who used his impeccable passing skills to support the team from the shadows. Together, they resolve to defeat the Generation of Miracles and make the Seirin basketball team the best in Japan.\n\n[Written by MAL Rewrite]", "Kuroko no Basket", "Kuroko's Basketball", "黒子のバスケ", 1, "https://myanimelist.net/manga/11652/Kuroko_no_Basket", 30 },
                    { 11926, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/312297.jpg", 18845, 6.11m, new DateTime(2004, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kobayakawa Sena (Eyeshield 21) meets Monkey D Luffy (One Piece), Naruto, Son Goku (Dragon Ball) and Bobobo (Bobobo-bo Bo-bobo) to try and stop the evil Dr. Mashirito (Dr. Slump) in this short adventure that serves as an advertisement for the game with the same name.\n\n(Source: MU)", "Jump Super Stars", null, "ジャンプスーパースターズ", 3, "https://myanimelist.net/manga/11926/Jump_Super_Stars", null },
                    { 11971, "", 12, new DateTime(2007, 3, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/176614.jpg", 9151, 6.98m, new DateTime(2006, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "Follows the adventures of the group sent from the martian colony to the Earth for an unknown purpose.", "Kidou Senshi Gundam SEED C.E.73: Δ Astray", "Mobile Suit Gundam SEED C.E. 73 Delta Astray", "機動戦士ガンダムSEED C.E.73 Δ ASTRAY", 1, "https://myanimelist.net/manga/11971/Kidou_Senshi_Gundam_SEED_CE73__Δ_Astray", 2 },
                    { 12336, "Junketsu no Maria was published in English as Maria The Virgin Witch by Kodansha Comics USA from February 24, 2015 to June 30, 2015.", 25, new DateTime(2013, 7, 4, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/136847.jpg", 9760, 6.94m, new DateTime(2008, 11, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "Maria is a witch living during the Hundred Years' War between England and France. Our young heroine hates war, so to keep the people of the village she protects safe, Maria will use all the power at her disposal to stop the fighting, whether that means conjuring giant dragons or sending her succubus familiar out to mesmerize the warring generals with her charms. But what do the villagers think of her \"help\"? And what will happen if Heaven notices her interference into human affairs? This story has a funny touch with a little history thrown in.\n\n(Source: MU)", "Junketsu no Maria", "Maria the Virgin Witch", "純潔のマリア", 1, "https://myanimelist.net/manga/12336/Junketsu_no_Maria", 3 },
                    { 12709, "", 30, new DateTime(1978, 1, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/159061.jpg", 18652, 6.16m, new DateTime(1974, 8, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kekkou Kamen is about the misadventures of a student named Mayumi Takahashi who attends a boarding school called Toenail of Satan's Spartan Institute of Higher Education that is run by sexual predators. The teachers are constantly looking for ways to torture or humiliate the students, and from this, the teachers derive sexual satisfaction. Takahashi's only protection is from a mysterious figure known as Kekkou Kamen.\n\nKekkou Kamen herself is a mysterious figure who hides the face but not the body! She fights evil with nudity, and nunchucks.\n\n(Source: Wikipedia)", "Kekkou Kamen", null, "けっこう仮面", 1, "https://myanimelist.net/manga/12709/Kekkou_Kamen", 5 },
                    { 12842, "", null, new DateTime(1994, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/258266.jpg", 21605, null, new DateTime(1985, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "This manga tells the story of Napoleon's empire, including the Thermidorian Reaction, the Italian Campaign, the Egyptian Campaign, the Battle of the Nile and the coup of 18 Brumaire, and the French invasion of Russia.\n\n(Source: Wikipedia)", "Eikou no Napoleon", "The Glory of Napoleon", "栄光のナポレオン - エロイカ", 1, "https://myanimelist.net/manga/12842/Eikou_no_Napoleon", 14 },
                    { 12965, "", null, null, "https://cdn.myanimelist.net/images/manga/2/153234.jpg", 4108, 7.36m, new DateTime(2009, 3, 3, 16, 0, 0, 0, DateTimeKind.Local), 4, "Fifty nationally ranked middle school tennis players receive an invitation to join the Japan U-17 training camp—an exclusive tennis camp that was previously open only to high school players. Amongst the recipients is tennis prodigy Ryouma Echizen and his teammates of the Seishun Academy Boys' Tennis Team. In the camp, the middle schoolers come across many strong opponents as they become intertwined with the camp's hierarchy system. They soon find themselves fighting against the high schoolers—and among themselves—for a spot in the camp as well as the top 20. With the U-17 World Cup around the corner, it is a battle to see who will represent Japan on the world stage.\n\nShin Tennis no Oujisama depicts the players' resolute endeavors as their tennis skills continue to reach new heights while also learning the meaning of perseverance and resilience. With countries stronger than Japan awaiting them at the U-17 World Cup, the determined tennis players must find a way to work together and ultimately come out on top.\n\n[Written by MAL Rewrite]", "Shin Tennis no Oujisama", null, "新テニスの王子様", 1, "https://myanimelist.net/manga/12965/Shin_Tennis_no_Oujisama", null },
                    { 13192, "Sazae-san won the eighth Bungeishunjuu Manga Award in 1962.", 6477, new DateTime(1974, 2, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/184043.jpg", 14743, 6.6m, new DateTime(1946, 4, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "Slice of life manga about a woman named Sazae and her family.", "Sazae-san", null, "サザエさん", 1, "https://myanimelist.net/manga/13192/Sazae-san", 45 },
                    { 13420, "", 8, new DateTime(2001, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/18864.jpg", 21775, null, new DateTime(2000, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Universal Century 0083: Zeon Intelligence has identified a prototype Gundam designed for nuclear attack under development by Anaheim Electronics. A former Zeon ace and a small band of Principality soldiers are dispatched to Earth to capture the Gundam as part of Operation Stardust. When the Zeon successfully make off with the prototype the Earth Federation assigns the mobile suit carrier Albion to locate and recover the missing unit.\n\n(Source: Wikipedia)", "Kidou Senshi Gundam 0083: Hoshikuzu no Eiyuu - Operation Stardust", null, "機動戦士ガンダム0083 星屑の英雄 OPERATION STARDUST", 1, "https://myanimelist.net/manga/13420/Kidou_Senshi_Gundam_0083__Hoshikuzu_no_Eiyuu_-_Operation_Stardust", 2 },
                    { 13450, "", 27, new DateTime(2010, 8, 26, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/18909.jpg", 1510, 7.75m, new DateTime(2009, 3, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "A collection of Kuroshitsuji one-shots chapters by various manga artists.", "Kuroshitsuji Anthology Comic: Nijishitsuji", null, "黒執事アンソロジーコミック 虹執事", 1, "https://myanimelist.net/manga/13450/Kuroshitsuji_Anthology_Comic__Nijishitsuji", 2 },
                    { 13492, "Ao no Exorcist has been published in English by VIZ Media under the Shonen Jump Advanced imprint since April 5, 2011. It has also been simulpub through MANGA Plus. The series has been published in French by in Kazé since March 27, 2010, in Italian by Panini Comics under the Planet Manga imprint since June 25, 2011; in German by Kazé since March 8, 2012; in Spanish by NORMA Editorial since 2013; in Portuguese by Devir since 2013 and in Polish by Waneko since September 2013.", null, null, "https://cdn.myanimelist.net/images/manga/2/188810.jpg", 1069, 7.87m, new DateTime(2009, 4, 3, 17, 0, 0, 0, DateTimeKind.Local), 4, "After a fight with his foster father Shirou Fujimoto, Rin Okumura's life is transformed overnight when Rin is revealed to be the son of the demon lord Satan, king of the demonic realm of Gehenna. Soon after, his foster father becomes possessed and dies at the hands of Satan, leaving Rin and his twin brother Yukio alone in the world. Seeking revenge for Fujimoto's death, Rin attends True Cross Academy with Yukio in order to become an exorcist and join the Knights of the True Cross.\n\nRin's new path, however, is filled with many difficulties. While new classes and dealing with his peers are already troublesome enough, he is also forced to conceal his newfound demonic powers and parentage. In addition, plenty of evildoers want to use him for their own ends. One misstep could lead to disaster, as not everyone at True Cross Academy is exactly who they seem to be...\n\n[Written by MAL Rewrite]", "Ao no Exorcist", "Blue Exorcist", "青の祓魔師〈エクソシスト〉", 1, "https://myanimelist.net/manga/13492/Ao_no_Exorcist", null },
                    { 13741, "", 48, new DateTime(2008, 2, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/19920.jpg", 21847, null, new DateTime(2003, 11, 26, 16, 0, 0, 0, DateTimeKind.Local), 2, "Manga adaptation of the photonovel of the same name.\n\n(Source: MU)", "Advance of Z: Titans no Hata no Moto ni", null, "アドバンス・オブ・Z～ティターンズの旗のもとに～", 1, "https://myanimelist.net/manga/13741/Advance_of_Z__Titans_no_Hata_no_Moto_ni", 4 },
                    { 13753, "Shin Devilman was published in English as part of the first volume of Devilman: The Classic Collection by Seven Seas Entertainment on May 22, 2018.", 5, new DateTime(1981, 5, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/286589.jpg", 18946, 6.08m, new DateTime(1979, 5, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "When Akira Fudou tries to save Ryou Asuka from being attacked by the demon Oysnas, they are both mysteriously teleported back in time. Once they pass through what Ryou identifies as a \"Timeslip,\" the duo discovers that demons have been invading the past in an effort to tamper with major historical events. It is Akira and Ryou's job to stop the demons from corrupting key figures in human history before they alter the course of humanity.\n\n[Written by MAL Rewrite]", "Shin Devilman", null, "新デビルマン", 1, "https://myanimelist.net/manga/13753/Shin_Devilman", 1 },
                    { 13787, "", 24, new DateTime(2006, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/245142.jpg", 21851, null, new DateTime(2004, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Retelling of Mobile Suit Gundam SEED Destiny's story from Athrun Zala's point of view.\n\n(Source: MU)", "Kidou Senshi Gundam SEED Destiny: The Edge", null, "機動戦士ガンダムSEED DESTINY THE EDGE", 1, "https://myanimelist.net/manga/13787/Kidou_Senshi_Gundam_SEED_Destiny__The_Edge", 5 },
                    { 13884, "", 8, new DateTime(1988, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/201863.jpg", 10781, 6.87m, new DateTime(1986, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "1-3. Tantei George no Minimini Daisakusen (Detective George's Mini Huge Cases)\n4. Play It Again\n5. Excalibur\n6. Natsu no Santa Claus (Santa Claus of the Summer)\n7. Chotto Mattete (Wait for A Little While)\n8. Sunday 19 Show: Samayoeru Akai Chou (The Wandering Red Butterfly)", "Aoyama Goushou Tanpenshuu", "Gosho Aoyama's Collection of Short Stories", "青山剛昌短編集", 1, "https://myanimelist.net/manga/13884/Aoyama_Goushou_Tanpenshuu", 1 },
                    { 13891, "", 1, null, "https://cdn.myanimelist.net/images/manga/5/24672.jpg", 19085, 6.04m, new DateTime(2009, 2, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, "An 8-page extra published with the 2009 No.11 issue of Weekly Shounen Jump that features a page or 3 from the following series: Hitman Reborn, Bakuman, Eyeshield 21, Sket Dance and To Love-Ru.", "Kakioroshi Manga Bangai-hen: Valentine Special", null, "描き下ろし漫画番外偏 バレンタインスペシャル", 3, "https://myanimelist.net/manga/13891/Kakioroshi_Manga_Bangai-hen__Valentine_Special", null },
                    { 13927, "", 31, new DateTime(2008, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/43451.jpg", 21866, null, new DateTime(2008, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "Meat, trainer to the great Choujin superhero Kinnikuman.He thought his job was done helping his greatest subject become a master Choujin and king of his homeworld. But...what if upon waiting for his next subject,the little trainer was sent to another world...\n\nwhere Kinnikuman has yet to become a great hero yet... and is...female!? Welcome to the world of Kinnikuman Lady!\n\n(Source: MU)", "Kinnikuman Lady", null, "キン肉マンレディー", 1, "https://myanimelist.net/manga/13927/Kinnikuman_Lady", 3 },
                    { 14022, "", null, new DateTime(2009, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/278793.jpg", 2741, 7.53m, new DateTime(2006, 2, 2, 16, 0, 0, 0, DateTimeKind.Local), 2, "Light novel spin-off mainly about school life played by the main series characters. The storyline revolves around class 3-Z's students and their wacky homeroom teacher Ginpachi-sensei.", "Gintama: 3-nen Z-gumi Ginpachi-sensei", null, "銀魂 3年Z組銀八先生", 2, "https://myanimelist.net/manga/14022/Gintama__3-nen_Z-gumi_Ginpachi-sensei", 4 },
                    { 14124, "", 17, new DateTime(1994, 1, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/20140.jpg", 21894, null, new DateTime(1989, 2, 5, 16, 0, 0, 0, DateTimeKind.Local), 2, "This manga is deemed to be one of the works that initiated the \"irrational\" or \"unreasonable\" gag comic genre where the reason of its funniness cannot be explained by logic and traditional sense of humor, which made this title very popular among teens and early twenties at that time. One of the most popular characters that appeared in Uturun desu. was \"the otter,\" Kawauso-kun.\n\n(Source: Wikipedia)", "Utsurun desu.", null, "伝染るんです。", 1, "https://myanimelist.net/manga/14124/Utsurun_desu", 5 },
                    { 14155, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/270791.jpg", 15457, 6.55m, new DateTime(2003, 7, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "About a boy of thirteen years who always tries to be a hero and for various reasons are involved with monsters, ending in his death, but it revived with the help a little thing (one might say that is the predecessor of innocence) and now must fight the Count ancient.\n\n(Source: MU)", "Continue", null, "コンティニュー", 3, "https://myanimelist.net/manga/14155/Continue", null },
                    { 14230, "", 42, new DateTime(1983, 11, 7, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/198355.jpg", 13541, 6.69m, new DateTime(1981, 12, 21, 16, 0, 0, 0, DateTimeKind.Local), 2, "Hakuo Gakuin has hired the Fuuma ninja clan to protect them from rival school Seishikan, who has been injuring all students who refuse to transfer. This is just the start of the Fuuma's adventure as they fight one last battle against their rival clan the Yasha, become involved in a war based around the 10 Sacred Swords, and fight against a rebellion within their own clan.\n\n(Source: ANN)", "Fuuma no Kojirou", null, "風魔の小次郎", 1, "https://myanimelist.net/manga/14230/Fuuma_no_Kojirou", 10 },
                    { 14231, "", 122, new DateTime(1981, 9, 28, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/187140.jpg", 11437, 6.83m, new DateTime(1976, 12, 27, 16, 0, 0, 0, DateTimeKind.Local), 2, "Takane Kiku and Takane Ryuji are the children of a legendary world contender boxer. Kiku, the daughter seems to have inherited her father's boxing sense and tries to teach Ryuji to become a world contender. However, Ryuji hates boxing and gets picked on. After Kiku and Ryuji leave their hometown for Tokyo, Ryuji eventually learns to discover a passion for boxing after an encounter with a boxing prodigy, Kenzaki Jun. This will eventually lead him to learn crazy moves and out of the world opponents to become one of Japan's top junior boxers.\n\n(Source: ANN)", "Ring ni Kakero", null, "リングにかけろ", 1, "https://myanimelist.net/manga/14231/Ring_ni_Kakero", 25 },
                    { 14232, "", 206, new DateTime(2009, 2, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/20286.jpg", 21910, null, new DateTime(2000, 2, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, "At the end of Ring ni Kakero 1, Ryuuji Takane went up against Superstar Jun Kenzaki for the World Title. Now, 17 years later, Rindo Kenzaki, the son Jun Kenzaki and nephew of Ryuuji Takane, lives with Ishimatsu Katori, the \"Kenka Champion\" from Ryuuji and Jun's time. Rindo will meet up with a new generation of boxers to create a new Golden Japan Jr. to take on the world.\n\nSource: ANN", "Ring ni Kakero 2", "Put it all in the Ring 2", "リングにかけろ2", 1, "https://myanimelist.net/manga/14232/Ring_ni_Kakero_2", 26 },
                    { 14368, "", null, null, "https://cdn.myanimelist.net/images/manga/1/22065.jpg", 2473, 7.57m, new DateTime(2006, 4, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, "Horitsuba Private Academy. Early Childhood division, Elementary school Division, Junior high school division, High school division, University, Graduate School. On an enormous campus, these individuals make up a huge, complete city built entirely on private property. Dormitories, Laboratories, movie theaters, hospitals, banks and so on; every possible institution is available in this campus-city, running in perfect order. Over 10,000 people attend school and live here, including, students, staff members, authorized persons, other family members, and the like. Exactly. since Horitsuba Academy is somewhat well-known all over, there are also lots of exchange students from foreign countries...", "Shiritsu Horitsuba Gakuen", null, "私立堀鐔学園", 1, "https://myanimelist.net/manga/14368/Shiritsu_Horitsuba_Gakuen", null },
                    { 14377, "", 43, new DateTime(2012, 10, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/152912.jpg", 2311, 7.59m, new DateTime(2009, 4, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, "A retelling of Mazinger Z separate from the original series, as well the recent anime remake.", "Shin Mazinger Zero", null, "真マジンガーZERO", 1, "https://myanimelist.net/manga/14377/Shin_Mazinger_Zero", 9 },
                    { 14414, "", 13, new DateTime(2012, 12, 13, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/273090.jpg", 5001, 7.28m, new DateTime(2005, 11, 29, 16, 0, 0, 0, DateTimeKind.Local), 2, "A series of 3-page long One Piece omake manga strips drawn by Eiichiro Oda. Their stories tend to parody other genres such as science fiction or fairy tales. Most of them were initially published as bonus content in One Piece Complete Collection between the 2nd Log (2005) and the 20th Log (2012). The anime adapted the five initial chapters in the recap episodes 279–283.\n\nThe Straw Hat Theater concept was created when Oda was given three blank sheets of paper by his editor and told to draw anything.\n\n(Source: One Piece Wiki)", "One Piece: Mugiwara Daigekijou", null, "ONE PIECE 麦わら大劇場", 1, "https://myanimelist.net/manga/14414/One_Piece__Mugiwara_Daigekijou", 1 },
                    { 14674, "", 6, null, "https://cdn.myanimelist.net/images/manga/4/164810.jpg", 7620, 7.08m, new DateTime(1996, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "In this one shot volume Kazuhiro Fujita describes us the past of some characters of his masterpiece Ushio and Tora. In particular he describes the past of Tora, the tiger-monster that follows Ushio.", "Ushio to Tora Gaiden", null, "うしおととら外伝", 1, "https://myanimelist.net/manga/14674/Ushio_to_Tora_Gaiden", 1 },
                    { 14841, "Durarara!! was published in English by Yen Press from January 24, 2012, to October 30, 2012. The series has also been released in Chinese by Kadokawa Taiwan Corporation from April 22, 2011, to November 9, 2011; in German by Egmont Manga from October 5, 2017, to April 4, 2018; in Italian by Edizioni Star Comics from January 14, 2012, to July 14, 2012; and in Polish by Waneko from February 6, 2015, to August 6, 2015.", 22, new DateTime(2011, 4, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/202669.jpg", 1207, 7.83m, new DateTime(2009, 6, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the flashy and restless streets of Tokyo's downtown Ikebukuro district, 15-year-old student Mikado Ryuugamine arrives wide-eyed and ready to inhale the exciting breath of city life. Up until now, his only insight into urban affairs was through an anonymous online group chat, where he found out about Ikebukuro's renowned legend. It says that a headless biker known only as the \"Black Rider\" roams Ikebukuro, executing its own justice against criminals.\n\nBut the district's quirks do not end there; Ikebukuro is swarming with so-called color gangs and their ceaseless conflicts. Among them, a colorless gang known as the Dollars is most noteworthy, as its founder, members, and numbers are all unknown. With odd cliques at every turn and uncanny tales coming to life, humans seem to mix with the supernatural, and Mikado soon dives into the deep sea of Ikebukuro's myths, deceits, and carefully planned out crises—a dangerous world, but possibly one where he belongs.\n\n[Written by MAL Rewrite]", "Durarara!!", "Durarara!!", "デュラララ!!", 1, "https://myanimelist.net/manga/14841/Durarara", 4 },
                    { 14893, "Monogatari Series: First Season was published in English by Vertical Inc: first with Kizumonogatari as Kizumonogatari: Wound Tale on December 15, 2015; Bakemonogatari as Bakemonogatari: Monster Tale in three volumes from December 20, 2016, to April 25, 2017; Nisemonogatari as Nisemonogatari: Fake Tale in two volumes from June 27, 2017, to August 29, 2017; and Nekomonogatari: Kuro as Nekomonogatari (Black): Cat Tale on November 28, 2017. Vertical also released the series in a box set.", 107, new DateTime(2010, 7, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/279887.jpg", 19, 8.91m, new DateTime(2006, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "This is a story, a \"ghostory\" of sorts, about scars that bond, monsters that haunt, and fakes that deceive.\n\nThe story of Koyomi Araragi begins through a fateful encounter with the all-powerful, blonde-haired, \"hot-blooded, iron-blooded, and cold-blooded\" vampire, later introduced as Shinobu Oshino. Their tragic rendezvous results in the end of Araragi's life as a human and his subsequent rebirth as a vampire—a monster. However, this encounter is only the start of his meddlings with the supernatural. Koyomi's noble personality ultimately sees him getting further involved in the lives of others with supernatural afflictions. This is his desperate attempt at returning to a normal human life, in a paranormal world filled with nothing but tragedy, suffering, and inhumanity.\n\n[Written by MAL Rewrite]\n\nThis entry includes the first season of the Monogatari Series.", "Monogatari Series: First Season", null, "〈物語〉シリーズ ファーストシーズン", 2, "https://myanimelist.net/manga/14893/Monogatari_Series__First_Season", 6 },
                    { 14956, "", 100, new DateTime(1987, 7, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/21633.jpg", 6159, 7.19m, new DateTime(1985, 8, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "Harukaze High School's photography club is anything but normal. All the oddballs in the school seem to join. And the craziest one has just arrived...an android built to take over the world! Though he'd rather just have a bowl of rice.\n\n(Source: Batoto)", "Kyuukyoku Choujin R", null, "究極超人あ～る", 1, "https://myanimelist.net/manga/14956/Kyuukyoku_Choujin_R", 9 },
                    { 15018, "", null, null, "https://cdn.myanimelist.net/images/manga/3/40572.jpg", 2290, 7.6m, new DateTime(2005, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 4, "The manga is a parody of the original Mobile Suit Gundam and features most of its characters in 4-koma strips. In addition, there are several \"sub-stories\" featured, including Captain Zaku-san, which features anthropomorphic versions of the mobile suits from Mobile Suit Gundam, and Gundam Sousei, which dramatizes the story of the creation of the Gundam franchise and features Yoshiyuki Tomino as well as other staff and cast members.\n\n(Source: Wikipedia)", "Kidou Senshi Gundam-san", null, "機動戦士ガンダムさん", 1, "https://myanimelist.net/manga/15018/Kidou_Senshi_Gundam-san", null },
                    { 15035, "", 66, new DateTime(2017, 4, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/158619.jpg", 13049, 6.72m, new DateTime(2009, 7, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Shinichirou decides to look for a job in order to pay his rent, and his teacher suggests that he work for someone at their house, doing housekeeping. However, the person who hired him was Sakuya, a girl who is the 37th head of the Shimazu family, and her job is to exorcise and eliminate unwanted creatures. Shinichirou accidentally releases one of the creatures that Sakuya captures and they cooperate to catch it.\n\n(Source: MU)", "Isuca", null, "ISUCA", 1, "https://myanimelist.net/manga/15035/Isuca", 9 },
                    { 15106, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/21992.jpg", 13644, 6.68m, null, 2, "An bonus chapter included with the final volume of Getter Robo Āḥ. Dr. Hell discovers a biomechanical lifeform known as \"Kedora\" in the depths of Bardos Island, and realises that he can use it to fight Mazinger Z. \n\nThe story of this chapter was loosely adapted into the sixteenth episode of Shin Mazinger Shougeki! Z-Hen.", "Mazinger Z : Relic of Terror", null, null, 3, "https://myanimelist.net/manga/15106/Mazinger_Z___Relic_of_Terror", null },
                    { 15148, "", 14, new DateTime(2010, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/282847.jpg", 9906, 6.93m, new DateTime(2009, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A Gundam 00 side story. Planned to replace 00F in Gundam Ace. The story focuses on Innovades and Innovators.", "Kidou Senshi Gundam 00I", null, "機動戦士ガンダム00I", 1, "https://myanimelist.net/manga/15148/Kidou_Senshi_Gundam_00I", 3 },
                    { 15200, "", 13, new DateTime(2020, 8, 6, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/22081.jpg", 22112, null, new DateTime(2003, 10, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "Nagasaki prefecture, in Japan, is a magical kingdom. While the wizards that live there are unable to cross the ocean, and are trapped in Kyuushu, they still pose enough of a threat that Americans dropped the bomb on them during WWII. The residents are worried that this will happen again, especially if the regular humans decide magicians are a threat.\n\nDaughter of the most powerful wizard alive, Mizukura Risuka is ten years old, and living outside Nagasaki, searching for her father and killing evil wizards. Her blood contains spells that control time, and allow her to fast-forward her own life. Her ultimate technique kicks in only when she dies bloodily—her blood will reform into herself at 27, at the height of her powers, for one minute.\n\nHer guide through the world of normal humans is Kugi Kizutaka, also aged ten. Kizutaka is a genius, and a sociopath. He believes the only way for people to be happy is to be ruled by him and views everyone he meets as a potential pawn, or slave. Including Risuka.\n\n(Source: easternstandard.pbworks.com)", "Shin Honkaku Mahou Shoujo Risuka", null, "新本格魔法少女りすか", 5, "https://myanimelist.net/manga/15200/Shin_Honkaku_Mahou_Shoujo_Risuka", 4 },
                    { 15305, "", null, new DateTime(1970, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/203669.jpg", 22138, null, new DateTime(1965, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The story is about Hyuma Hoshi, a promising young baseball pitcher who dreams of becoming a top star like his father Ittetsu Hoshi in the professional Japanese league. His father was once a 3rd baseman until he was injured in World War II and was forced to retire. The boy would join the ever popular Giants team, and soon he realized the difficulty of managing the high expectations. From the grueling training to battling the rival Mitsuru Hanagata on the Hanshin Tigers, he would have to take out his best pitching magic to step up to the challenge.\n\n(Source: Wikipedia)", "Kyojin no Hoshi", null, "巨人の星", 1, "https://myanimelist.net/manga/15305/Kyojin_no_Hoshi", 19 },
                    { 15315, "", null, new DateTime(1978, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/203670.jpg", 22139, null, new DateTime(1975, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Hyuuma Hoshi is now adult and recovered from his injury.\nHe wants to prove he still the best pitcher.", "Shin Kyojin no Hoshi", null, "新巨人の星", 1, "https://myanimelist.net/manga/15315/Shin_Kyojin_no_Hoshi", 11 },
                    { 15359, "", 14, null, "https://cdn.myanimelist.net/images/manga/2/22320.jpg", 3151, 7.47m, new DateTime(2001, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Getter Robo Āḥ is the fifth Getter Robo series chronologically.\n\nTaking place several years after Getter Robo Go, Earth is now a post-apocalyptic world. Hayato, now an aging scientist, has completed Professor Saotome's masterpiece, Getter Robo Āḥ. Piloting it are Ryoma's son Takuma, the human-dinosaur Kamui and the younger brother of Tayel, Baku. Alongside the reformed Dinosaur Empire, they fight the insectoid Andromeda Flow Country attacking from across time and space.", "Getter Robo Āḥ", "Getter Robo Āḥ", "ゲッターロボ アーク", 1, "https://myanimelist.net/manga/15359/Getter_Robo_Āḥ", 3 },
                    { 15530, "", 120, new DateTime(2009, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/264674.jpg", 2527, 7.56m, new DateTime(1986, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "The first story under the title \"Chibi Maruko-chan\" was published in the August 1986 edition of the shoujo manga magazine Ribon. Other semi-autobiographical stories by the author had appeared in Ribon and Ribon Original in 1984 and 1985, and were included in the first \"Chibi Maruko-chan\" tankōbon in 1987. The author first began writing and submitting strips in her final year of senior high school, although Shueisha (the publisher of Ribon and Ribon Original) did not decide to run them until over a year later. The author's intent was to write \"essays in manga form.\" Many stories are inspired by incidents from the author's own life, and some characters are based on her family and friends. The nostalgic, honest and thoughtful tone of the strip led to its becoming popular among a wider audience.\n\n(Source: Wikipedia)", "Chibi Maruko-chan", null, "ちびまる子ちゃん", 1, "https://myanimelist.net/manga/15530/Chibi_Maruko-chan", 15 },
                    { 15691, "", 8, null, "https://cdn.myanimelist.net/images/manga/3/54433.jpg", 15886, 6.51m, new DateTime(2008, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Two manga artists are trying their best to have their work accepted by someone who appears to be their superior. However their latest work has been denied and their superior requests that they should write a manga about a drama where a man protects the peace of the world. The two get together and begin to write a manga about a boy who promises a girl protection!\n\n(Source: Mamo)", "20 Seiki Shounen: Ujiko Ujio Sakuhinshuu", null, "20世紀少年の脇役 ウジコウジオ作品集", 1, "https://myanimelist.net/manga/15691/20_Seiki_Shounen__Ujiko_Ujio_Sakuhinshuu", 1 },
                    { 15918, "", null, null, "https://cdn.myanimelist.net/images/manga/3/23215.jpg", 14051, 6.65m, new DateTime(2001, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Different tales and adventures of the well-known Plue from Hiro Mashima's works.", "Rave: Plue no Inu Nikki", null, "RAVE プルの犬日記", 1, "https://myanimelist.net/manga/15918/Rave__Plue_no_Inu_Nikki", 3 },
                    { 15921, "Mashima-en was published in English as Hiro Mashima's Playground by Kodansha USA as a 2-in-1 omnibus volume on October 30, 2018. It was also released in Brazilian Portuguese by Editora JBC from September 2012 to October 2012.", 8, new DateTime(2003, 10, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/56849.jpg", 11586, 6.82m, new DateTime(1998, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A collection of one-shots by Hiro Mashima.", "Mashima-en", "Hiro Mashima's Playground", "ましまえん", 1, "https://myanimelist.net/manga/15921/Mashima-en", 2 },
                    { 16010, "", null, null, "https://cdn.myanimelist.net/images/manga/1/30641.jpg", 11214, 6.84m, new DateTime(2002, 12, 27, 16, 0, 0, 0, DateTimeKind.Local), 2, "K' (K-Dash) is a four volume doujinshi compilation released by Kodansha containing oneshots by a number of different authors and artists.\n\nThe first two issues contained short stories by published mangaka such as CLAMP and Ikumi Mia (amongst others).\nThe first issue was released in December 2002 at Comiket 63, while the second was released in March 2003 to commemorate the opening of the K-Square store.\n\nThese two issues contained short comedic stories from CLAMP; Tokyo Tower Kankeisha Kakui (characters from Chobits, Rayearth and Cardcaptor Sakura running into each other in the Tokyo Tower) and Murikuri Holic (Watanuki and Yuuko working at the K-Square store while characters from Murikuri look on)\n\nThe third and fourth issues consisted primarily of work from doujinshi artists. \n\nSynopsis: Ephidel/MAL", "K-Dash", "K-Dash", "K'", 6, "https://myanimelist.net/manga/16010/K-Dash", 4 },
                    { 16038, "Toriyama Akira ○-saku Gekijou was published in English as Akira Toriyama's Manga Theater by VIZ Media under the Shounen Jump imprint as a 3-in-1 omnibus volume on December 7, 2021.", 38, new DateTime(1994, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/252072.jpg", 9678, 6.94m, new DateTime(1977, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "3-volume compilation containing many of Toriyama's one-shots.", "Toriyama Akira ○-saku Gekijou", "Akira Toriyama's Manga Theater", "鳥山明○作劇場", 1, "https://myanimelist.net/manga/16038/Toriyama_Akira_○-saku_Gekijou", 3 },
                    { 16088, "", 6, new DateTime(2007, 3, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/36021.jpg", 22304, null, new DateTime(2006, 11, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "In C.E. 73, tensions between Naturals and Coordinators continue to persist, eventually leading to another war between the Earth Alliance and PLANT. Sven Cal Bayan is a Natural pilot of the elite EA squad, the Phantom Pain, and carries out his squad's various anti-Coordinator missions without fail. Selene McGriff is a Coordinator researcher at the neutral Deep Space Survey and Development Organization (DSSD) and a developer of the GSX-401FW Stargazer space exploration mobile suit. Though their backgrounds are completely different, the expanding war will nevertheless force their paths to collide.\n\nIn the manga, the previously uncertain fate of Selene and Sven is revealed.\n\n(Source: ANN)", "Kidou Senshi Gundam SEED C.E.73 Stargazer", null, "機動戦士ガンダムSEED C.E.73 STARGAZER", 1, "https://myanimelist.net/manga/16088/Kidou_Senshi_Gundam_SEED_CE73_Stargazer", 1 },
                    { 16110, "", null, new DateTime(2009, 4, 20, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/178356.jpg", 11141, 6.85m, new DateTime(2009, 3, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "Two strange aliens are terrorizing the home planet of Tarble, Vegeta's younger brother, they have followed him to earth. Read as Goku and his friends try to defeat these aliens at the request of Tarble.", "Dragon Ball: Ossu! Kaettekita Son Gokuu to Nakama-tachi!!", null, "DRAGONBALL オッス!帰ってきた孫悟空と仲間たち!", 1, "https://myanimelist.net/manga/16110/Dragon_Ball__Ossu_Kaettekita_Son_Gokuu_to_Nakama-tachi", 2 },
                    { 16168, "", 12, new DateTime(1986, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/72047.jpg", 22325, null, new DateTime(1986, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "As the continuation of Zeta Gundam, this series once again follows the story of the Anti Earth Union Group (AEUG) battleship Argama after Zeta's final episode. To fight off the Axis Zeon, now called the Neo Zeon, Captain Bright Noa recruits a group of teenage junk collectors led by the loudmouthed but powerful Newtype Judau Ashta to pilot the Argama's mobile suits. Now sporting a line up of the behemoth MSZ-010 Double Zeta Gundam and the returning MSZ-006 Zeta Gundam, RX-178 Gundam Mk-II and Gundam-like MSN-00100 Hyaku Shiki, the group is nicknamed the Gundam Team. As such, this became the first of a number of Gundam series where a team of Gundam mobile suits fight alongside each other regularly. The climax takes place at Side 3 in the Battle of Axis.\n\n(Source: Gundam Wikia)", "Kidou Senshi Gundam ZZ", null, "機動戦士ガンダムZZ", 1, "https://myanimelist.net/manga/16168/Kidou_Senshi_Gundam_ZZ", 3 },
                    { 16456, "", 10, null, "https://cdn.myanimelist.net/images/manga/2/74077.jpg", 22373, null, new DateTime(1990, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The story of Gundam F91 revolves around teenage space colonist Seabook Arno, his girlfriend Cecily Fairchild, and the efforts of the Crossbone Vanguard militia, led by Cecily's grandfather Meitzer Ronah, to establish an aristocracy known as \"Cosmo Babylonia\". In keeping with Gundam tradition, the civilian Seabook is forced by circumstance to pilot the F91 Gundam, coincidentally designed in part by his estranged mother, Dr. Monica Arno.\n\n(Source: Gundam Wikia)", "Kidou Senshi Gundam F91", null, "機動戦士ガンダム F91", 1, "https://myanimelist.net/manga/16456/Kidou_Senshi_Gundam_F91", 1 },
                    { 16532, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/280535.jpg", 4328, 7.34m, new DateTime(2005, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "The original one shot of Nurarihyon no Mago. It was later published in the Nurarihyon no Mago Official Character Data Book \"Youhiroku.\"", "Nurarihyon no Mago", null, "ぬらりひょんの孫", 3, "https://myanimelist.net/manga/16532/Nurarihyon_no_Mago", null },
                    { 16666, "", 36, null, "https://cdn.myanimelist.net/images/manga/3/28095.jpg", 22412, null, new DateTime(2006, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Char Aznable and Lalah Sune demonstrate the meanings of various proverbs.", "Naruhodo☆Kotowaza Gundam-san", null, "なるほど☆ことわざ ガンダムさん", 1, "https://myanimelist.net/manga/16666/Naruhodo☆Kotowaza_Gundam-san", 1 },
                    { 16816, "Durarara!! was published in English by Yen Press under the Yen On imprint from July 21, 2015 to October 1, 2019 and in Polish by Kotori since April 8, 2016.", 89, new DateTime(2014, 1, 9, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/286574.jpg", 288, 8.32m, new DateTime(2004, 4, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Mikado Ryuugamine is a young boy who craves the abnormal and supernatural, but his quiet life in the countryside offers no opportunity for adventure. With some encouragement from a childhood friend, Mikado moves to Ikebukuro, a lively downtown district in Tokyo. However, the naïve boy may be in for a lot more than he bargained for.\n\nIkebukuro is home to a host of strange individuals, such as a monster of a man dressed in a bartender's outfit, a sadist who sells information for fun, and an underground doctor with an odd infatuation. But the most unusual of them all is the legendary \"Black Rider,\" a headless being who silently rides through the night on a pitch-black motorcycle. When Mikado witnesses this urban legend on his first night in the city, his initial excitement triggers a thrilling but deadly sequence of events, affecting numerous others throughout the city.\n\n[Written by MAL Rewrite]", "Durarara!!", "Durarara!!", "デュラララ!!", 2, "https://myanimelist.net/manga/16816/Durarara", 13 },
                    { 16941, "Cutie Honey was published in English as Cutie Honey '90 by Studio Ironcat in comic book format, with 12 issues, 6 to each volume, published from December 1, 1997 to November 1, 1998.", null, new DateTime(1993, 3, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/152788.jpg", 19673, 5.6m, new DateTime(1992, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "30 years after the first series Cutie Honey continues her fight against Sister Jill and Panther Claw.", "Cutie Honey", "Cutie Honey '90", "Cutieハニー", 1, "https://myanimelist.net/manga/16941/Cutie_Honey", 1 },
                    { 16942, "Cutie Honey a Go Go! is an adaptation of the live action Cutie Honey Movie. The series was published in English by Seven Seas Entertainment on March 27, 2018.", 10, new DateTime(2005, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/109593.jpg", 17701, 6.33m, new DateTime(2003, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Tokyo is under seige by the terrorist organization known as Panther Claw, and the beautiful superheroine android known as Cutie Honey appears on the scene to take them on—but fails! For her own protection, Cutie Honey must join forces with government agent Natsuko Aki, and pose as student and teacher at St. Chapel Academy. But there is nowhere to hide from Panther Claw and its leader's evil machinations!\n\n(Source: Seven Seas Entertainment)", "Cutie Honey a Go Go!", "Cutie Honey A Go Go!", "キューティーハニー a GO GO!", 1, "https://myanimelist.net/manga/16942/Cutie_Honey_a_Go_Go", 1 },
                    { 16943, "", 26, new DateTime(1975, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/268817.jpg", 16722, 6.44m, new DateTime(1974, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "Continuation of the successful manga and anime series Mazinger Z, Great Mazinger starts after the defeat of Mazinger Z. Tetsuya Tsurugi is the new protagonist, piloting the powerful Great Mazinger, a creation of the once thought dead Kenzo Kabuto, the father of Koji Kabuto. This time the enemy is the Mycene Empire and its powerful robots.\n\n(Source: MU)", "Great Mazinger", null, "グレートマジンガー", 1, "https://myanimelist.net/manga/16943/Great_Mazinger", 4 },
                    { 17026, "Gallery Fake won the 41st Shogakukan Manga Award for best seinen manga in 1995.", null, null, "https://cdn.myanimelist.net/images/manga/3/187752.jpg", 22530, null, new DateTime(1991, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 4, "On a wharf on Tokyo Bay is a small gallery named Gallery Fake. The owner of the gallery, Fujita Reiji, was once a curator at the Metropolitan Museum of Art in New York. He was a learned curator with remarkable memory, keen aesthetic sense, great skill in restoration of paintings, and knowledge of many languages, so he was called \"the Professor.\" However, because of trouble in the workplace, Fujita was forced to quit the museum. Now he is an art dealer who sells paintings, authentic and fake alike, at extraordinary prices. His motto is, \"One without aesthetic sense can't help being cheated out of his money. And, by being deceived, one may learn to distinguish the real one from the counterfeit.\"\n\nHowever, Fujita is not a villain. He truly appreciates art and the artists who spent their lives to create it. He is not someone who just earns money by selling fake paintings. Sometimes he takes paintings from a wicked politician who considers art only as a means of exchanging bribes. Sometimes he tries to restore destroyed paintings. Readers get to like him for his passion and true love for art. He often touches the lives of those he encounters, and people are attracted to him in spite of himself.\n\n(Source: MU)", "Gallery Fake", null, "ギャラリーフェイク", 1, "https://myanimelist.net/manga/17026/Gallery_Fake", null },
                    { 17111, "", 48, new DateTime(2000, 8, 1, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/25632.jpg", 3893, 7.39m, new DateTime(1997, 6, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "A series of 17 short cases of Kindaichi.", "Kindaichi Shounen no Jikenbo - Short File Series", null, "金田一少年の事件簿 短編集", 1, "https://myanimelist.net/manga/17111/Kindaichi_Shounen_no_Jikenbo_-_Short_File_Series", 6 },
                    { 17149, "", 81, new DateTime(2000, 12, 12, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/183422.jpg", 1412, 7.77m, new DateTime(1998, 1, 13, 16, 0, 0, 0, DateTimeKind.Local), 2, "Seven new Kindaichi cases.\n\nCase / Volume listings can be found under More Info.", "Kindaichi Shounen no Jikenbo: Case Series", null, "金田一少年の事件簿 Caseシリーズ", 1, "https://myanimelist.net/manga/17149/Kindaichi_Shounen_no_Jikenbo__Case_Series", 10 },
                    { 17152, "One Piece: Strong World was published in English by Viz Media as a booklet included in the One Piece Box Set 2: Skypiea to Water Seven on November 4, 2014.", 1, new DateTime(2009, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/25743.jpg", 624, 8.07m, new DateTime(2009, 11, 20, 16, 0, 0, 0, DateTimeKind.Local), 2, "One Piece: Strong World is a special prologue chapter to the 10th One Piece movie, Strong World. This one-shot depicts events 20 years before the current timeline of the manga. The main focus is the relationship between Shiki, the Golden Lion and Roger, the Pirate King. In addition, it shows what other characters were doing 20 years ago.\n\n[Written by MAL Rewrite]", "One Piece: Strong World", null, "ONE PIECE STRONG WORLD", 3, "https://myanimelist.net/manga/17152/One_Piece__Strong_World", null },
                    { 17226, "", 8, null, "https://cdn.myanimelist.net/images/manga/3/25874.jpg", 22554, null, new DateTime(1995, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "This series is the manga version of the movie City Hunter: The Secret Service. Saeba Ryo is assigned to protect the daughter of a foreign country's presidential candidate!", "City Hunter: The Secret Service", null, "シティーハンター　ザ・シークレット・サービス", 1, "https://myanimelist.net/manga/17226/City_Hunter__The_Secret_Service", 2 },
                    { 17288, "", 23, new DateTime(2011, 5, 1, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/26013.jpg", 5570, 7.23m, new DateTime(2007, 3, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "Each novel contains several short stories, many of which were originally serialized in Jump Square; however, each novel also contains at least one new story (the titular story), specially written for the novel.\n\n(Source: Katekyo Wikia)", "Katekyou Hitman Reborn! Secret Bullet", null, "家庭教師〈かてきょー〉ヒットマンREBORN！隠し弾〈シークレット・ブレット〉", 2, "https://myanimelist.net/manga/17288/Katekyou_Hitman_Reborn_Secret_Bullet", 5 },
                    { 18074, "", 69, null, "https://cdn.myanimelist.net/images/manga/2/272713.jpg", 484, 8.16m, null, 2, "A compilation of the long-running Getter Robo series into one continuous story. Includes several new pages and chapters as well as revisions to old material and a newer, more conclusive ending to Getter Robo Āḥ. \n\nGetter Robo (1974)\nGetter Robo G (1975)\nGetter Robo Go (1991)\nShin Getter Robo (1997)\nGetter Robo Āḥ (2001)", "Getter Robo Saga", "Getter Robo Saga", "ゲッターロボ", 1, "https://myanimelist.net/manga/18074/Getter_Robo_Saga", 9 },
                    { 18161, "Katanagatari was published in English as Katanagatari: Sword Tale by Vertical as 3-in-1 omnibus volumes from November 27, 2018 to August 25, 2020.", 55, new DateTime(2007, 12, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/167366.jpg", 357, 8.26m, new DateTime(2007, 1, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, "Long ago the masterful swordsmith Shikizaki Kiki crafted 1000 blades, though his twelve final works, the legendary deviant blades were prime among the rest. All with uniquely defined traits, these swords are among the greatest in Japan.\n\nLeap forward many decades and arrive at an isolated island, where Yasuri Shichika and his older sister Nanami reside.\n\nTogame: A woman with long, white hair and the talent as a strategist begins a quest with Shichika in order to collect the twelve blades. They must face the blade wielders in intense battles while they learn more about themselves and their real goals and wishes.\n\nShichika has yet to realize what he really inherits as a Kyoutoryuu sword...", "Katanagatari", "Katanagatari: Sword Tale", "刀語", 2, "https://myanimelist.net/manga/18161/Katanagatari", 12 },
                    { 18162, "", 54, new DateTime(2010, 3, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/142861.jpg", 3179, 7.46m, new DateTime(2004, 2, 5, 16, 0, 0, 0, DateTimeKind.Local), 2, "Spinning off from his Zaregoto series, these novels feature the Zerozaki family, the only one of the seven killing families not to be actually related to each other. Zerozakis spontaneously emerge every so often from the general populace, and define their family connections by which fully fledge Zerozaki discovers and trains them.\n\n(Source: easternstandard.pbworks)", "Ningen Series", null, "人間シリーズ", 2, "https://myanimelist.net/manga/18162/Ningen_Series", 7 },
                    { 18254, "Kidou Senshi Gundam Unicorn: Bande Dessinee is based on both, the anime series and the novel.", 78, new DateTime(2016, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/187857.jpg", 4982, 7.28m, new DateTime(2010, 1, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Set 3 years after the events of Char's Counterattack, a young man is caught in a deadly conflict between the Earth Federation and Terrorist Organization \"The Sleeved\" as they battle for an object that is said to have changed the course of Human history.", "Kidou Senshi Gundam Unicorn: Bande Dessinee", null, "機動戦士ガンダムUC バンデシネ", 1, "https://myanimelist.net/manga/18254/Kidou_Senshi_Gundam_Unicorn__Bande_Dessinee", 17 },
                    { 18440, "", 18, new DateTime(2010, 4, 15, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/282849.jpg", 47143, null, new DateTime(2009, 2, 22, 16, 0, 0, 0, DateTimeKind.Local), 2, "This manga based on the second season of Gundam 00 is illustrated by Auto Taguchi and follows on from his manga based on the first season.", "Kidou Senshi Gundam 00 Second Season", null, "機動戦士ガンダム00セカンドシーズン", 1, "https://myanimelist.net/manga/18440/Kidou_Senshi_Gundam_00_Second_Season", 4 },
                    { 18654, "", 4, new DateTime(2000, 2, 16, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/28552.jpg", 47207, null, new DateTime(1998, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "A side series of Young Kindaichi's case file.\n\nThis manga consisted of:\n\n   1. \"File 1 The First Case of Young Akechi/Alternative title: Farewell, My Dear Friend\" (FILE1 明智少年最初の事件, \"Fairu Ichi Akechi Shōnen Saisho no Jiken\"?)\n   2. \"File 2 Quartet with Intent to Kill/Alternative title: The Perfect Violinist, Akechi\" (FILE2 殺意の四重奏, \"Fairu Ni Satsui no Karutetto\"?)\n   3. \"File 3 Ghost Swordman Murder Case/Alternative title: The Pride Murder)\" (FILE3 幽霊剣士殺人事件, \"Fairu San Yūrei Kenshi Satsujin Jiken\"?)\n   4. \"Special Story Kengo’s Room\" (スペシャルストーリー 健悟の部屋, \"Supesharu Sutōrī Kengo no Heya\"?)\n\n(Source: wikipedia)", "Akechi Shounen no Karei Naru Jikenbo", null, "明智少年の華麗なる事件簿", 1, "https://myanimelist.net/manga/18654/Akechi_Shounen_no_Karei_Naru_Jikenbo", 1 },
                    { 18668, "", 5, new DateTime(2000, 5, 16, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/61677.jpg", 47210, null, new DateTime(1997, 8, 12, 17, 0, 0, 0, DateTimeKind.Local), 2, "Side story of the Young Kindaichi Case Files. The cases in this series are:\n\n1. \"File 1 Testimony Puzzle/Alternative title: The Murder Train\" (FILE1 証言パズル, \"Fairu Ichi Shōgen Pazuru\"?)\n2. \"File 2 Killing Poker/Alternative title: Unlucky Men in the Rain\" (FILE2　殺人ポーカー, \"Fairu Ni Satsujin Pōkā\"?)\n3. \"File 3 Dead Person's Checkmate/Alternative title: The Great Chess Player, Akechi\" (FILE3 死者のチェックメイト, \"Fairu San Shisha no Chekkumeito\"?)\n4. \"File 4 Ghost Hotel Murder Case/Alternative title: The Encounter\" (FILE 4 幽霊ホテル殺人事件, \"Fairu Yon Yūrei Hoteru Satsujin Jiken\"?)\n5. \"Special Story Supt.Akechi Morning's Pretty Scenery\" (スペシャルストーリー明智警視　優雅なる朝の風景, \"Supesharu Sutōrī Akechi Keishi Yūga Naru Asa no Fūkei\"?)\n\n(Source: wikipedia)", "Akechi Keishi no Yuuga Naru Jikenbo", null, "明智警視の優雅なる事件簿", 1, "https://myanimelist.net/manga/18668/Akechi_Keishi_no_Yuuga_Naru_Jikenbo", 1 },
