                    { 19033, "Kidou Senshi Gundam 00 2nd.Season was published in English as Mobile Suit Gundam 00 2nd Season by Bandai Entertainment from April 21, 2010 to January 26, 2011.", 14, new DateTime(2009, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/185780.jpg", 6713, 7.14m, new DateTime(2008, 10, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Four years have passed since the final battle between Celestial Being and the UN Forces, but Setsuna and the Meisters face a new adversary: the A-Laws! The battle to unite humanity continues!", "Kidou Senshi Gundam 00 2nd.Season", "Mobile Suit Gundam 00 2nd Season", "機動戦士ガンダム00 2nd.season", 1, "https://myanimelist.net/manga/19033/Kidou_Senshi_Gundam_00_2ndSeason", 4 },
                    { 19315, "Inazuma Eleven won the 34th Kodansha Manga Award in the Children category in 2010. It also won the 57th Shogakukan Manga Award in the same category in 2011. The series was published in Brazilian Portuguese as Super Onze by Editora JBC in 34 volumes from October 2013 to April 2015.", 43, new DateTime(2011, 9, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/177907.jpg", 7490, 7.09m, new DateTime(2008, 5, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "Raimon Middle School's soccer club captain, Endou Mamoru is in a pinch—his club is about to be destroyed! Literally! To avert the wrecking ball and disbanding of the club, his team must win against the toughest soccer team in the area—Teikoku. Will Endou and his team meet a crushing defeat or will a mysterious transfer student with a fiery kick save them from disaster?!\n\n(Source: MU)", "Inazuma Eleven", null, "イナズマイレブン", 1, "https://myanimelist.net/manga/19315/Inazuma_Eleven", 10 },
                    { 19423, "Kishibe Rohan Louvre e Iku was the first manga by Japanese mangaka to be displayed at the Louvre Museum. It is also the first full-color manga Hirohiko Araki has ever done. The beginning pages of the manuscript were displayed from January 22, 2009, to April 13, 2009, as a part of the \"Little Design Exhibition: Manga World Showed in Louvre (The Louvre invites the comics).\" It was adapted into a live-action movie in 2023. The manga was later serialized in Japan in the Ultra Jump magazine from April 2010 to June 2010 and released by Shueisha on May 27, 2011. It was published in English as Rohan at the Louvre by NBM Publishing on April 1, 2012. It was also released in Chinese by Dala Publishing Company on December 4, 2018; in French by Futuropolis on April 9, 2010; in Italian by 001 Edizioni on December 8, 2012; and in Brazilian Portuguese by Pipoca & Nanquim on January 31, 2020.", null, null, "https://cdn.myanimelist.net/images/manga/2/175983.jpg", 1727, 7.7m, new DateTime(2010, 4, 28, 17, 0, 0, 0, DateTimeKind.Local), 2, "Professional mangaka Rohan Kishibe has seen the blackest color in the world—and this elusive color is connected to an incident where a French translator, the curator of the Louvre's Far East art section, and two firemen disappeared without a trace.\n\nThree hundred years ago, a Japanese artist named Nizaemon Yamamura discovered the darkest pigment known to mankind. But because he cut down an ancient tree to retrieve it, he was executed. Following his death, it is said that a curse existed on every painting he used the color on, imbuing them with hatred. When Nanase Fujikura recounts the legend to him, Rohan is immediately intrigued and learns that one of Nizaemon's artwork had been saved by a curator, who took it to the Louvre.\n\nTen years later, Rohan heads for Paris to search for it. As he prepares to unearth the ominous painting from the archives, Rohan quickly finds that the curse is far more powerful than he could ever imagine.\n\n[Written by MAL Rewrite]", "Kishibe Rohan Louvre e Iku", "Rohan at the Louvre", "岸辺露伴 ルーヴルへ行く", 1, "https://myanimelist.net/manga/19423/Kishibe_Rohan_Louvre_e_Iku", 1 },
                    { 19619, "", 95, new DateTime(2003, 7, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/194914.jpg", 14745, 6.6m, new DateTime(2001, 8, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "The year is 2005. The police, unable to carry out their work, are asking for help from talented private investigators for the most complex and important work.\n\nAmong these are Seiji Hayami, who, with the help of her assistant Hisashi Hanyuu, will be involved in cases concerning strange apparitions of monstrous beings, which will eventually lead to a confrontation with the Panther Claw terrorist organization/religious sect, who worship the goddess Zora, under the command of the bestial Sister Jill.\n\nDefeating the organization seems impossible, but help is at hand from the android, Cutie Honey. Having seemingly traveled from the 70s to defeat Panther Claw, she resides with Seiko in the form of Hisashi.\n\n(Source: Wikipedia)", "Cutie Honey: Tennyo Densetsu", "Cutie Honey: the Legend of an Angel", "キューティーハニー 天女伝説", 1, "https://myanimelist.net/manga/19619/Cutie_Honey__Tennyo_Densetsu", 9 },
                    { 19870, "", 3, new DateTime(2009, 8, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/171857.jpg", 47463, null, new DateTime(2009, 4, 15, 17, 0, 0, 0, DateTimeKind.Local), 2, "1. Shin Mazinger: Shogeki! H-hen\n2-3. Cutie Honey vs Abashiri Ikka", "Shin Mazinger: Shougeki! H-hen", null, "真マジンガー　衝撃! H編", 1, "https://myanimelist.net/manga/19870/Shin_Mazinger__Shougeki_H-hen", 1 },
                    { 20065, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/31462.jpg", 4678, 7.31m, new DateTime(2006, 8, 27, 17, 0, 0, 0, DateTimeKind.Local), 2, "Tasked with the goal of helping people on their campus, \"Sket-dan'' is a club made up of three disparate individuals: Yuusuke Fujisaki, a somewhat shortsighted yet energetic boy sporting a red cap and a pair of goggles; Hime Onizuka, a tomboyish girl known for her extraordinary strength and extravagant makeup; and Kazuyoshi Usui, the smartest member who only speaks using a speech synthesizer. Despite their self-proclaimed skills, the club scarcely receives any tasks, which has made the members rather pessimistic and disheartened.\n\nOne day, much to the trio's surprise, a high school student named Ichiro Yamanaka visits the Sket-dan with a request. Ichiro elaborates that his girlfriend Nanako Watanabe suddenly broke up with him for seemingly no reason, and he wants to figure out why she is behaving so strangely. Elated about finally receiving a proper request, the trio resolves to assist Ichiro with his predicament. However, as they continue their investigation, the group realizes that the situation may be more complex than they initially thought.\n\n[Written by MAL Rewrite]", "SKET Dance", null, "スケットダンス", 3, "https://myanimelist.net/manga/20065/SKET_Dance", null },
                    { 20221, "", 15, new DateTime(1997, 4, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/31804.jpg", 10709, 6.88m, new DateTime(1996, 10, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "Fifteen years ago, those living in Outer Space went to war with people still on Earth. During the battles of the 7th Space War, it was found that certain human beings had mysterious arcane abilities, powers of the mind to control and forsee. These gifted people were called Newtypes. They were valuable to both sides of the war; the Earth Federation designed the Flash System which allowed a Newtype pilot to control a horde of unmanned MS, called Bit-Mobile Suits.This was an effective weapon, but sacrificed the lives of many Newtypes. \n\nSpace fought back for principal, believing the effect of living in Space heightened every human ability and eventually created the prized power of a Newtype, who was not something to use as a tool for war. But in the end, mankind was its own downfall. During the final battle, the Space Revolution Army (SRA) crashed numerous colonies into the planet Earth, with a devastating effect. \n\nMillions died as a result of the colony drop. Those that were fortunate enough to find refuge in a Shelter were both blessed and cursed; they wouldn't see the sun again for four years. The rest that made it through had to endure and suffer with living on a ruined planet, plagued by an endless winter and an ever-changing, chaotic atmosphere. With that, the war had ended. For now. But everyone who continued to live on was possessed by that tragic war, and the word \"Newtype\"... \n\nThe year is After War 0015, and life on Earth is finally on its way to creating a more perfect world, except for the ruthless mercenaries who use mobile suits to make a living raiding; called Vultures, some of these people are merely chasing money, while others are running from the past. Enter 15 year old Garrod Ran, an orphan of the war. He is a lively and friendly boy who is trying to survive in the wake of the war, living off his daring-do's and knowledge of MS. Because of this, Garrod is hired to rescue a kidnapped girl from a Vulture ship, called the Freeden, and its stoic captain, Jamil Neate. \n\nBut Garrod soon finds out that this job is entirely not what it seems; that the girl, Tiffa Adill, is actually a powerful Newtype, able to dream the future. And when Tiffa shows Garrod the Gundam X, Garrod can do nothing but bear witness to the suddenly changing times. He may learn that people's true intentions run far deeper, and that the Vultures and Captain Jamil Neate are their only hope for surviving the coming age, and the birth of the New Earth Federation. \n\nMust mankind repeat the tragic mistake of the past?", "Kidou Shin Seiki Gundam X", null, "機動新世紀ガンダムＸ", 1, "https://myanimelist.net/manga/20221/Kidou_Shin_Seiki_Gundam_X", 3 },
                    { 20467, "Kidou Senshi Gundam 00 was published in English as Mobile Suit Gundam 00 by Bandai Entertainment from January 13, 2010 to July 1, 2010.", null, new DateTime(2008, 10, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/282855.jpg", 47647, null, new DateTime(2008, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "The year is 2307 A.D. Although fossil fuels have been depleted, humanity has obtained a new source of energy to replace them in the form of a large-scale solar power generation system based on three huge orbital elevators. However, the benefits of this system are available only to a handful of major powers and their allies.\n\nThe three orbital elevators belong to three superpower blocs. These are the Union, led by the United States of America; the Human Reform League, led by China, Russia, and India; and the AEU, led by Europe. These superpower blocs continue to play a grand zero-sum game for the sake of their own prestige and prosperity.\n\nIn this world of never-ending conflict, a private armed organization appears, dedicated to the elimination of war through armed force. Its name is Celestial Being, and it is in possession of \"Gundam\" mobile suits. With these Gundams, it begins armed intervention into all acts of war.\n\nSource: TRSI", "Kidou Senshi Gundam 00", "Mobile Suit Gundam 00", "機動戦士ガンダム00", 2, "https://myanimelist.net/manga/20467/Kidou_Senshi_Gundam_00", 3 },
                    { 20477, "", null, new DateTime(2010, 2, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282848.jpg", 47653, null, new DateTime(2009, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "It is AD 2312 - four years after the battle between Celestial Being and the UN military. \nHaving survived the fight for the moment, they were looking at the future of a unified world... however behind the scenes the independent Earth Federation forces, A-Laws (Arrows) were keeping the peace via brutal repression.\nWith this false peace continuing the distortions of before, it is clear their job is not yet complete. The world requires a force for change - Double 0 Gundam!", "Kidou Senshi Gundam 00 Second Season", null, "機動戦士ガンダム00 セカンドシーズン", 2, "https://myanimelist.net/manga/20477/Kidou_Senshi_Gundam_00_Second_Season", 5 },
                    { 20581, "", 6, null, "https://cdn.myanimelist.net/images/manga/3/290243.jpg", 17813, 6.31m, new DateTime(2004, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "A side-story to Go Nagai's manga \"Devilman\" and \"Amon: The Dark Side of Devilman\". The tale of some teenagers in a rock band who become devilmen and get involved in the war with the demons.", "Devilman Mokushiroku: Strange Days", null, "デビルマン黙示録STRANGE DAYS", 1, "https://myanimelist.net/manga/20581/Devilman_Mokushiroku__Strange_Days", 1 },
                    { 20983, "", 4, null, "https://cdn.myanimelist.net/images/manga/1/275157.jpg", 7990, 7.05m, new DateTime(2008, 12, 1, 16, 0, 0, 0, DateTimeKind.Local), 2, "Maniwagatari takes place 200 years before Katanagatari, when the first Kyoutouryuu head, Yasuri Kazune, met Shikizaki Kiki.", "Maniwagatari", null, "真庭語", 2, "https://myanimelist.net/manga/20983/Maniwagatari", 1 },
                    { 21115, "", null, null, "https://cdn.myanimelist.net/images/manga/1/33875.jpg", 3015, 7.49m, new DateTime(2003, 11, 4, 16, 0, 0, 0, DateTimeKind.Local), 4, "An interlinked series of mystery novels in which each volume is told from the point of view of a different narrator.", "Sekai Series", null, "世界シリーズ", 2, "https://myanimelist.net/manga/21115/Sekai_Series", null },
                    { 21132, "", 41, new DateTime(2006, 5, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/212594.jpg", 2832, 7.51m, new DateTime(2003, 12, 9, 16, 0, 0, 0, DateTimeKind.Local), 2, "Set on a giant, almost finished bridge between Sadogashima and Niigata. Abandoned by the government, the bridge, and the giant man-made floating island at the center, has become a city of criminals and societal drop-outs.\n\nSet in the same world as Durarara, but 15-20 years later.", "Etsusa Oohashi Series", null, "越佐大橋シリーズ", 2, "https://myanimelist.net/manga/21132/Etsusa_Oohashi_Series", 4 },
                    { 21135, "", 7, null, "https://cdn.myanimelist.net/images/manga/1/33939.jpg", 47858, null, new DateTime(2008, 11, 9, 16, 0, 0, 0, DateTimeKind.Local), 2, "A girl with bloody iron pipes, sleepy eyes flickering—just talk.\n\n\"On the Islands, a gunshot echoes today. As usual. People die. As usual. Dogs and more dogs, the dogs, well, kill each other. As usual. The Bosses of the eastern sections, transform. As usual. A fellow murderer, using swords and the eastern sections of the cat, the brother Li Feng, the detective brother, cute guys, clumsy love. As usual. The Island, I'm terribly confused. ...as always. After all, as usual. The island today is As Usual. That's it. So I, as always, the cute child, hug a lot. It's warm. I'm... sleepy\"", "Etsusa Oohashi Gaiden: 5656! Knights' Strange Night", null, "5656（ゴロゴロ）！ Knights' Strange Night", 2, "https://myanimelist.net/manga/21135/Etsusa_Oohashi_Gaiden__5656_Knights_Strange_Night", 1 },
                    { 21274, "Rakko 11-gou was published in English as Otter No. 11 by Viz Media on October 1, 2013, as part of the publisher's Bakuman. complete box set.", 1, null, "https://cdn.myanimelist.net/images/manga/3/34222.jpg", 16819, 6.43m, new DateTime(2010, 8, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "A one-shot depicting chapter 75 of Otters 11, a fictional manga in Bakuman.\n\nOtters 11 is about an otter man trying to change the world. He has a human body and an otter face. His hands turn to rock when he has the urge to fight.", "Rakko 11-gou", "Otter No. 11", "ラッコ11号", 3, "https://myanimelist.net/manga/21274/Rakko_11-gou", null },
                    { 21307, "", 107, new DateTime(2011, 6, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/34312.jpg", 2111, 7.63m, new DateTime(2004, 8, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "A new series of Kindaichi mysteries, beginning with murders that seem to imitate a Vampire Legend...", "Kindaichi Shounen no Jikenbo - Shin Series", "Kindaichi Case Files - New Series", "金田一少年の事件簿 新シリーズ", 1, "https://myanimelist.net/manga/21307/Kindaichi_Shounen_no_Jikenbo_-_Shin_Series", 14 },
                    { 21479, "Author Reki Kawahara wrote the first volume of Sword Art Online in 2002 and intended to submit it for the Dengeki Game Novel Prize, but refrained as he exceeded the page limit. He instead published the series as a web novel. Shortly after his other series Accel World won the Dengeki Novel Grand Prize in 2008, Sword Art Online was published in print. The light novel ranked first in the Kono Light Novel ga Sugoi! for the Best Light Novel category in 2012 and 2013. The series has been published in English by Yen Press under its Yen On imprint since April 22, 2014. It has also been published in Italian by J-POP since October 11, 2014; in Polish by Kotori since November 24, 2014; in Russian by Istari Comics since December 2015; in Spanish by Planeta Cómic since March 1, 2016; and in Brazilian Portuguese by Panini Comics since December 2018.", null, null, "https://cdn.myanimelist.net/images/manga/2/280994.jpg", 840, 7.95m, new DateTime(2009, 4, 9, 17, 0, 0, 0, DateTimeKind.Local), 4, "In the year 2022, gamers rejoice as Sword Art Online-a VRMMORPG (Virtual Reality Massively Multiplayer Online Role Playing Game) like no other-opens its virtual doors, allowing players to take full advantage of the ultimate in gaming technology: NerveGear, a system that allows users to completely immerse themselves in the game world by manipulating their brain waves to create a wholly realistic gaming experience. But when the game goes live, the elation of the players quickly turns to horror as they discover that, for all its amazing features, SAO is missing one of the most basic functions of any MMORPG-a log-out button. Now trapped in the virtual world of Aincrad, their bodies held captive by NerveGear in the real world, users are issued a chilling ultimatum: conquer all one hundred floors of Aincrad to regain your freedom. But in the warped world of SAO, \"game over\" means certain death-both virtual and real...\n\n(Source: Yen Press)", "Sword Art Online", "Sword Art Online", "ソードアート・オンライン", 2, "https://myanimelist.net/manga/21479/Sword_Art_Online", null },
                    { 21587, "", 34, new DateTime(2015, 1, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/114993.jpg", 6179, 7.18m, new DateTime(2010, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "An anthology of Durarara!! by various mangaka.", "Durarara!! Comic Anthology: Duralove!!", null, "デュラララ!!アンソロジーコミック 『デュララブ!!』", 1, "https://myanimelist.net/manga/21587/Durarara_Comic_Anthology__Duralove", 2 },
                    { 21599, "", 54, new DateTime(1988, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/148321.jpg", 47986, null, new DateTime(1982, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "Set in a land where several martial arts styles collide, including (but not limited to) Chinese Kung Fu, Japanese Karate, and South Korean Taekwondo. Yet amongst these Shaolin-trained fighters and men powerful enough to cut the face of a mountain, Victory Ramenman is said to be the strongest of them all. At a young age, he witnessed his father Somenman being murdered by members of the Cobra Gang (who are still running rampant to this day). Found and taken in by the wise old Chen Sou-Mei, Ramenman trains for 12 years under his master and learns the great Essential Battle Dragon (闘龍極意書, To Ryuu Gokui Sho) style of Choujin Martial arts. Now, with his young sidekick Shao-Mai, Ramenman travels the land seeking vengeance for his father, fighting several villains along the way.", "Tatakae!! Ramenman", null, "闘将!!拉麺男", 1, "https://myanimelist.net/manga/21599/Tatakae_Ramenman", 12 },
                    { 21608, "", 43, new DateTime(2007, 3, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/164973.jpg", 47977, null, new DateTime(2001, 5, 20, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kinnikuman II-sei: All Choujin Daishingeki is an alternate retelling of Kinnikuman II-sei series.", "Kinnikuman II-sei: All Choujin Daishingeki", null, "キン肉マンⅡ世～オール超人大進撃～", 1, "https://myanimelist.net/manga/21608/Kinnikuman_II-sei__All_Choujin_Daishingeki", 4 },
                    { 21753, "Shinseiki Evangelion: Ikari Shinji Tantei Nikki was published in English as Neon Genesis Evangelion: The Shinji Ikari Detective Diary by Dark Horse from September 17, 2013 to May 27, 2014.", 9, new DateTime(2010, 11, 23, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/145055.jpg", 16569, 6.45m, new DateTime(2010, 2, 23, 16, 0, 0, 0, DateTimeKind.Local), 2, "When even a tough dude like his school pal Toji is getting menaced by gangsters, a nice guy like Shinji Ikari feels obliged to seek out the local private eye, Ryoji Kaji, and his striking young assistant, Kaworu Nagisa. Somehow, though, Shinji gets drafted into solving the case himself, with Kaworu's help—although Kaworu quickly proves to be a mystery of his own...\n\n(Source: Dark Horse)", "Shinseiki Evangelion: Ikari Shinji Tantei Nikki", "Neon Genesis Evangelion: The Shinji Ikari Detective Diary", "新世紀エヴァンゲリオン 碇シンジ探偵日記", 1, "https://myanimelist.net/manga/21753/Shinseiki_Evangelion__Ikari_Shinji_Tantei_Nikki", 2 },
                    { 21883, "", 1, null, "https://cdn.myanimelist.net/images/manga/5/35733.jpg", 8895, 6.99m, new DateTime(2010, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A short, all colour one-shot of Love Hina, released for celebrate the 300th chapter of \"Negima!\"", "Love Hina: Special Project", null, null, 3, "https://myanimelist.net/manga/21883/Love_Hina__Special_Project", null },
                    { 21907, "Negiho (Ito) Bun was published in English as Negiho: Mahora Little Girls by Kodansha Comics USA on May 7, 2013.", 15, new DateTime(2011, 10, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/172894.jpg", 16872, 6.42m, new DateTime(2010, 9, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "The plot centers around the girls in the class of 3-A, only this time, they're kindergarteners. Their teacher also seems to be Negi, only this time, he's the older one. It looks like Asuna is crushing on her teacher, too!", "Negiho (Ito) Bun", "Negiho: Mahora Little Girls", "ネギほ（幼）文", 1, "https://myanimelist.net/manga/21907/Negiho_Ito_Bun", 1 },
                    { 21911, "", 5, new DateTime(2009, 6, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/282852.jpg", 48071, null, new DateTime(2009, 2, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "The World may be United but the time has come for Celestial Being to begin their interventions again.\nFor all of those who stand up in answer to the call, irreplaceable \"Bonds\" exist.\n\nBonds contains five short stories set throughout the second season, including Soma's transformation into Marie, Sumeragi's return to Celestial Being, and Marina creating her song for Kataron.", "Kidou Senshi Gundam 00: Aoi Kizuna", null, "機動戦士ガンダム00 蒼い絆", 1, "https://myanimelist.net/manga/21911/Kidou_Senshi_Gundam_00__Aoi_Kizuna", 1 },
                    { 22131, "", 13, new DateTime(2011, 9, 1, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/35898.jpg", 4583, 7.32m, new DateTime(2009, 12, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "The novels feature the side stories like Nurarihyon and Youhime's wedding ceremony, a strange encounter between Zen and Kuroumaru, as well as an original tale centering on the youkai who live in Ukiyoe Town and many other stories.", "Nurarihyon no Mago", null, "ぬらりひょんの孫", 2, "https://myanimelist.net/manga/22131/Nurarihyon_no_Mago", 4 },
                    { 22519, "To Love-Ru Darkness was published in English by Seven Seas Entertainment under the Ghost Ship imprint from December 5, 2017 to December 22, 2020. It has also been published in Italian by Star Comics since February 23, 2013.", 100, new DateTime(2017, 3, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/253547.jpg", 1220, 7.82m, new DateTime(2010, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Rito Yuuki remains unsuccessful and indecisive with his love for his crush, Haruna Sairenji, and the alien princess, Lala Satalin Deviluke. Meanwhile, Lala's little sister Momo also falls in love with Rito and works on building a harem for him in hopes of giving herself a place in Rito's love life.\n\nTo do so she enrolls in his school to secretly support all of Rito's love interests and even attempts to find him more, including the recently enrolled alien assassin Konjiki no Yami, also known as  \"Yami,\" who puts off her next bounty because of him. However, Kurosaki Mea, Yami's little sister, intends for Yami to return to being an assassin.\n\nTo LOVE-Ru Darkness continues from the events of To LOVE-Ru with new girls, new foes, and even more lewd moments.\n\n[Written by MAL Rewrite]", "To LOVE-Ru Darkness", "To Love Ru: Darkness", "To LOVEる -とらぶる- ダークネス", 1, "https://myanimelist.net/manga/22519/To_LOVE-Ru_Darkness", 18 },
                    { 22527, "", null, new DateTime(2010, 9, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/36648.jpg", 48239, null, new DateTime(2007, 4, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "A comical, parody spin-off of Ylva, sister of Thorfinn, main character of Vinland Saga.", "Ganso Ylva-chan", null, "元祖ユルヴァちゃん", 1, "https://myanimelist.net/manga/22527/Ganso_Ylva-chan", 3 },
                    { 22744, null, 5, null, "https://cdn.myanimelist.net/images/manga/1/156655.jpg", 4057, 7.37m, new DateTime(2004, 12, 14, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Bleach: Letters From the Other Side", null, "BLEACH letters from the other side", 2, "https://myanimelist.net/manga/22744/Bleach__Letters_From_the_Other_Side", 1 },
                    { 22745, "", 3, null, "https://cdn.myanimelist.net/images/manga/1/250602.jpg", 2630, 7.54m, new DateTime(2006, 10, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "Rukia makes sweets for her brother but upon learning he likes spicy food from Renji, she gives the sweets to other people and enlists Ichigo's help to cook him some spicy curry, the likes of which Rukia ate back in Ichigo's house. However, Unohana intervenes and prevents Rukia from giving the curry to Byakuya, instead asking her to make something that will be gentle on Byakuya's stomach. Rukia finally makes some rice porridge for Byakuya, who is pleased with Rukia's efforts.\n\n(Source: Bleach Wikia)", "Bleach: The Honey Dish Rhapsody", null, "BLEACH the Honey Dish Rhapsody", 2, "https://myanimelist.net/manga/22745/Bleach__The_Honey_Dish_Rhapsody", 1 },
