                    { 23208, "", 39, new DateTime(2014, 7, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/127187.jpg", 9284, 6.97m, new DateTime(2010, 12, 2, 16, 0, 0, 0, DateTimeKind.Local), 2, "Spin-off series that focuses on the strange antics of Team Guy as they work on becoming great ninjas, a job which often requires saving Lee from himself!", "Rock Lee no Seishun Full-Power Ninden", null, "ロック・リーの青春フルパワー忍伝", 1, "https://myanimelist.net/manga/23208/Rock_Lee_no_Seishun_Full-Power_Ninden", 7 },
                    { 23234, "", 309, new DateTime(2010, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/164972.jpg", 7332, 7.1m, new DateTime(2003, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "After the terrible battle against the Demon Seeds peace has been restored and thus Mantarou is wasting his time away sleeping around, like usual... Suddenly he has a weird dream of him fighting a tag match against the Original 'Machine guns' team (Kinnikuman x Terryman tag team)... Even weirder is that the machine guns aren't 60 something, but are instead in their top form at their finest age, as they where when they won the universal tag team championship... Could this weird new vs old dream mean something?\n\nAs he awakes from his afternoon nap, Mantarou realizes that there are some evil beings floating around the sky that call themselves Time Choujins, after sending a weird challenge they just banish in thin air without leaving a trace.\n\n(Source: MU)", "Kinnikuman II-sei: Kyuukyoku no Choujin Tag-hen", null, "キン肉マンⅡ世 究極の超人タッグ編", 1, "https://myanimelist.net/manga/23234/Kinnikuman_II-sei__Kyuukyoku_no_Choujin_Tag-hen", 28 },
