                    { 78717, "", 11, new DateTime(2015, 7, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/161291.jpg", 18069, 6.27m, new DateTime(2014, 9, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story will be a full reboot of Nagai's UFO Robo Grendizer story. When a great fleet of flying saucers invades Earth, it awakens the true power of Daisuke Uryuu (the main lead of UFO Robo Grendizer was named Daisuke Umon).\n\n(Source: ANN)", "Grendizer Giga", null, "グレンダイザー ギガ", 1, "https://myanimelist.net/manga/78717/Grendizer_Giga", 2 },
                    { 78905, null, 1, null, "https://cdn.myanimelist.net/images/manga/2/137493.jpg", 12567, 6.75m, new DateTime(2014, 8, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Love Hina Tokubetsuhen", null, "ラブひな 特別編", 3, "https://myanimelist.net/manga/78905/Love_Hina_Tokubetsuhen", null },
                    { 79133, "Junketsu no Maria: Exhibition was published in English as Maria the Virgin Witch: Exhibition by Kodansha Comics USA on August 25, 2015.", 6, new DateTime(2014, 12, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/147849.jpg", 9306, 6.97m, new DateTime(2014, 7, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "Maria and her friends are back in a collection of stories that offer a glimpse into their past, present, and future. From Viv's journey to France, to a day in the life of Maria and her owl companions, and even a brief peek at the result of Ezekiel's judgment, Maria the Virgin Witch: Exhibition allows fans of the series to enjoy their favorite characters once more with new and untold stories.\n\n(Source: Kodansha Comics USA)", "Junketsu no Maria: Exhibition", "Maria the Virgin Witch: Exhibition", "純潔のマリア exhibition", 1, "https://myanimelist.net/manga/79133/Junketsu_no_Maria__Exhibition", 1 },
                    { 80163, null, 308, new DateTime(2022, 11, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/151837.jpg", 2705, 7.53m, new DateTime(2014, 9, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Let's! Haikyuu!?", null, "れっつ! ハイキュー!?", 1, "https://myanimelist.net/manga/80163/Lets_Haikyuu", 11 },
                    { 80223, "", 16, new DateTime(2018, 2, 4, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/272102.jpg", 5168, 7.26m, new DateTime(2013, 4, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "New installment of Versailles no Bara after 40 years since serialization ended, includes new episodes centered around André, Gerodelle, Fersen, Alain and many more. Each episode tells about events that happened afterward the main story and their unknown pasts that weren't disclosed before.", "Versailles no Bara: Episode-hen", null, "ベルサイユのばら エピソード編", 1, "https://myanimelist.net/manga/80223/Versailles_no_Bara__Episode-hen", 4 },
                    { 80385, "Kono Subarashii Sekai ni Shukufuku wo! has been published in English as KonoSuba: God's Blessing on This Wonderful World! by Yen Press since November 22, 2016. It has also been published in French as Konosuba : Sois Béni Monde Merveilleux! by Meian since June 29, 2020.", null, null, "https://cdn.myanimelist.net/images/manga/1/154542.jpg", 738, 8.01m, new DateTime(2014, 9, 8, 17, 0, 0, 0, DateTimeKind.Local), 4, "Kazuma Satou is a reserved 16-year-old who loses his life in a tragic yet laughable accident. After his untimely death, Kazuma finds himself standing before Aqua—the self-proclaimed water goddess who presents him two with choices: to ascend to heaven or reincarnate in a real fantasy world. Picking the latter, Kazuma gets tasked with defeating the Demon King, an occurring threat in his new world. However, Aqua's provocative attitude strikes a nerve, and in the heat of the moment, Kazuma takes her along.\n\nKazuma and Aqua, now stuck together in another world, embark on a journey. They soon acquire two more companions: Megumin, an archwizard wielding devastating explosion magic; and Lalatina \"Darkness\" Dustiness Ford, a crusader with a worrisome case of masochism. The four of them form an odd party, each member contributing their unique share of power and a peculiar personality. Unfortunately, their adventure soon proves to be challenging and costly, Kazuma's new life may be nothing but a headache.\n\n[Written by MAL Rewrite]", "Kono Subarashii Sekai ni Shukufuku wo!", "KonoSuba: God's Blessing on This Wonderful World!", "この素晴らしい世界に祝福を！", 1, "https://myanimelist.net/manga/80385/Kono_Subarashii_Sekai_ni_Shukufuku_wo", null },
                    { 80435, null, null, new DateTime(2007, 12, 13, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/139119.jpg", 5072, 7.27m, new DateTime(2006, 4, 12, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "School Rumble", null, "スクールランブル", 2, "https://myanimelist.net/manga/80435/School_Rumble", 2 },
                    { 80469, "", 18, new DateTime(2017, 2, 2, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/190626.jpg", 1039, 7.88m, new DateTime(2013, 12, 23, 16, 0, 0, 0, DateTimeKind.Local), 2, "In the Meiji Era of Japan, legend has it that the \"Orochi\"—an evil giant snake spirit—returns every 300 years to wreak havoc. \"Yamainu,\" an elite fighting force, is assembled to subjugate the Orochi upon its reappearance. Presently, the squad has become involved with a secret government department conducting human experimentation using Orochi cells. This pits Yamainu leader Sousei Abeno against brothers Soramaru and Chuutarou Kumou, who stumble upon several dying escapees of the experiments.\n\nSoramaru encounters Ageha, a criminal doctor allied with Tora, a test subject who massacred cell project researchers using abilities granted by compatible Orochi cells. Despite acknowledging their crimes, Soramaru still decides to side with the two fugitives due to his strong opposition to the exploitation of Orochi cells. With Sousei and Soramaru divided over the ethics of creating novel drugs from the essence of their immortal enemy, the only way to settle this matter may be a fight—however, Soramaru has yet to win once against Yamainu's captain.\n\n[Written by MAL Rewrite]", "Donten ni Warau Gaiden", null, "曇天に笑う 外伝", 1, "https://myanimelist.net/manga/80469/Donten_ni_Warau_Gaiden", 3 },
                    { 80473, "", null, new DateTime(2016, 9, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/142963.jpg", 7413, 7.09m, new DateTime(2013, 12, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "Led by Daisuke Aramaki and Motoko Kusanagi, Section 9 deals with such crimes over the entire social spectrum, usually with success. However, when faced with a new A-level hacker nicknamed \"The Laughing Man,\" the team is thrown into a dangerous cat and mouse game, following the hacker's trail as it leaves its mark on Japan.", "Koukaku Kidoutai: Stand Alone Complex - The Laughing Man", null, "攻殻機動隊 STAND ALONE COMPLEX ～The Laughing Man～", 1, "https://myanimelist.net/manga/80473/Koukaku_Kidoutai__Stand_Alone_Complex_-_The_Laughing_Man", 4 },
                    { 80719, "Re:Zero kara Hajimeru Isekai Seikatsu: Dai-2 Shou - Yashiki no Isshuukan-hen adapts the second and third volumes of the light novel series. The manga was published in English as Re:ZERO -Starting Life in Another World-, Chapter 2: A Week at the Mansion by Yen Press from May 23, 2017, to September 18, 2018. It was also released in Polish by Waneko from June 8, 2018, to February 14, 2019.", 31, new DateTime(2017, 10, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/188947.jpg", 736, 8.01m, new DateTime(2014, 10, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "The unaware Subaru Natsuki wakes to see two figures standing in a completely unfamiliar room. The two girls, who turn out to be the sisters Rem and Ram, are immediately teased by Subaru for their synchronistic way of speaking. Before he can go too far, he is interrupted by Emilia—the charming girl he saved at the cost of losing his life thrice using \"Return By Death,\" an ability that allows him to return to a certain \"savepoint\" each time he dies.\n\nEmilia informs him that due to the injury he received while protecting her from Elsa Granhiert, she brought him to the mansion she lives in. There, Subaru meets Roswaal L. Mathers, the clownlike count who owns the residence. While everyone is having breakfast, Subaru requests a reward: to let him be hired as a butler alongside Rem and Ram, which Roswaal quickly grants.\n\nEverything seems to be going well for Subaru. However, after a few days inside the mansion, he mysteriously wakes up at the beginning again, reminding him an awful lot of his ability. Can Subaru unravel the mystery behind his death, or will his spirit break first?\n\n[Written by MAL Rewrite]", "Re:Zero kara Hajimeru Isekai Seikatsu: Dai-2 Shou - Yashiki no Isshuukan-hen", "Re:ZERO -Starting Life in Another World-, Chapter 2: A Week at the Mansion", "Re：ゼロから始める異世界生活 第二章 屋敷の一週間編", 1, "https://myanimelist.net/manga/80719/Re_Zero_kara_Hajimeru_Isekai_Seikatsu__Dai-2_Shou_-_Yashiki_no_Isshuukan-hen", 5 },
                    { 80843, "Gundam: G no Reconguista is based on original TV anime series of the same title.", null, null, "https://cdn.myanimelist.net/images/manga/2/148969.jpg", 45486, null, new DateTime(2014, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, "The Universal Century, with its history of colonization and wars, passes into posterity, and time flows on.\n\nMankind enters a new age of seemingly endless peace and prosperity called the \"Regild Century.\"\n\nThe year is R.C. 1014. The Capital Tower, an orbital elevator, connects earth and space. Due to its role in supplying Earth's power by transferring Photon Batteries from space, it is worshiped with a religious fervor. Bellri Zenam, a cadet in the Capital Guard formed to protect Capital Tower, is participating in his first non-simulated exercise when he is attacked by the powerful but unaffiliated \"G-Self\" mobile suit. He manages to capture the G-Self while piloting a \"Recten\" maintenance mobile suit. However, seeing the G-Self's pilot, a young space pirate named Aida Rayhunton, stirs something within him, as does the G-Self which he was sure he'd never seen before. Why does the G-Self accept Bellri as a pilot?\n\nAida's mission to attack Capital Tower. Bellri's destiny as a chosen pilot of the G-Self. The truth which will shake the Regild Century.\n\nIt was all the beginning of the Reconguista.\n\n(Source: Gundam.info)", "Gundam: G no Reconguista", "Gundam: Reconguista in G", "ガンダム Gのレコンギスタ", 1, "https://myanimelist.net/manga/80843/Gundam__G_no_Reconguista", null },
                    { 80909, "Tokyo Ghoul won the Excellence Award in the 113th Manga Grand Prix.", 1, null, "https://cdn.myanimelist.net/images/manga/1/140109.jpg", 9022, 6.99m, new DateTime(2011, 3, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "The prototype of the series prior to its serialization.", "Tokyo Ghoul", null, "東京喰種－トーキョーグール－", 3, "https://myanimelist.net/manga/80909/Tokyo_Ghoul", null },
                    { 81117, "Tokyo Ghoul:re was the 10th best-selling manga series in Japan in 2015 with an estimated sales of 3,758,541 copies sold. The series was published in English by VIZ Media from October 17, 2017 to April 21, 2020. It is also published in Spanish by Norma Editorial since June 23, 2016; in German by Kazé since September 1, 2016; in Polish by Waneko since August 14, 2017; and in Portuguese by Panini Editorial since December 15, 2017.", 181, new DateTime(2018, 7, 4, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/145997.jpg", 318, 8.29m, new DateTime(2014, 10, 15, 17, 0, 0, 0, DateTimeKind.Local), 2, "Two years have passed since the CCG's raid on Anteiku. Although the atmosphere in Tokyo has changed drastically due to the increased influence of the CCG, ghouls continue to pose a problem as they have begun taking caution, especially the terrorist organization Aogiri Tree, who acknowledge the CCG's growing threat to their existence.\n\nThe creation of a special team, known as the Quinx Squad, may provide the CCG with the push they need to exterminate Tokyo's unwanted residents. As humans who have undergone surgery in order to make use of the special abilities of ghouls, they participate in operations to eradicate the dangerous creatures. The leader of this group, Haise Sasaki, is a half-ghoul, half-human who has been trained by famed special class investigator, Kishou Arima. However, there's more to this young man than meets the eye, as unknown memories claw at his mind, slowly reminding him of the person he used to be.\n\n[Written by MAL Rewrite]", "Tokyo Ghoul:re", "Tokyo Ghoul:re", "東京喰種-トーキョーグール-:re", 1, "https://myanimelist.net/manga/81117/Tokyo_Ghoul_re", 16 },
                    { 81151, "Psycho-Pass 2 was published in French by Kana and in Italian by Planet Manga.", 27, new DateTime(2017, 2, 2, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/190624.jpg", 4069, 7.37m, new DateTime(2014, 11, 4, 16, 0, 0, 0, DateTimeKind.Local), 2, "With the conclusion of the Makishima case, Shinya Kougami is a wanted fugitive, Nobuchika Ginoza has become a potential criminal, and two Enforcers are gone. The Ministry of Welfare's Public Safety Bureau is desperately in need of new personnel, leading the organization to bring in 17-year-old novice Inspector Mika Shimotsuki to join Inspector Akane Tsunemori's Division 01.\n\nWhile Tsunemori now questions and even challenges the Sibyl System, Shimotsuki unconditionally believes in its judgment. However, her first case urges her to see the opposite: a new criminal emerges, an individual who has the power to lower one's Psycho-Pass enough for the System to overlook them as convicts and even humans.\n\nWhen a felon with hard evidence against him walks free with a clear Psycho-Pass, immediate action becomes imperative. Now Inspectors and Enforcers must work together to decipher an unsettling message left behind and trace the guilty criminal who, in the eyes of the System, does not exist.\n\n[Written by MAL Rewrite]", "Psycho-Pass 2", null, "PSYCHO-PASS 2", 1, "https://myanimelist.net/manga/81151/Psycho-Pass_2", 5 },
                    { 81153, "", 23, new DateTime(2017, 2, 19, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/155882.jpg", 8268, 7.03m, new DateTime(2014, 10, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the prestigious Psycho-Pass Academy, one club enforces justice across the school's premises: Public Safety Bureau (PSB). The club operates in the name of the Sibyl System—the teachers' watchful eyes—to keep the school safe from vandalism. To this end, they utilize guns called Denominators that measure one's Delinquency Coefficient, the likelihood to turn delinquent.\n\nAkane Tsunemori is a freshman who finds her way into PSB. There, she meets two upperclassmen: Nobuchika Ginoza, who takes his job seriously; and Shinya Kougami, Nobuchika's \"dog\" and a potential delinquent eradicating wrongdoers. Allying herself with this unconventional Disciplinary Committee, Tsunemori begins her ridiculous high school days as she investigates anything that could disrupt the precious peace.\n\n[Written by MAL Rewrite]", "Gakuen Psycho-Pass", null, "学園さいこぱす", 1, "https://myanimelist.net/manga/81153/Gakuen_Psycho-Pass", 3 },
                    { 81157, "", 6, null, "https://cdn.myanimelist.net/images/manga/1/140943.jpg", 45542, null, new DateTime(2014, 8, 28, 17, 0, 0, 0, DateTimeKind.Local), 2, "Novel that focuses on Kagari Shuusei.", "Psycho-Pass Legend: Tsuisekisha Kagari Shuusei", null, "PSYCHO-PASS LEGEND 追跡者 縢秀星", 2, "https://myanimelist.net/manga/81157/Psycho-Pass_Legend__Tsuisekisha_Kagari_Shuusei", 1 },
                    { 81485, "", 29, new DateTime(2015, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/140991.jpg", 6271, 7.17m, new DateTime(2013, 7, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "The miniature yet equally troublesome versions of Ikebukuro's residents run amok. However, instead of engaging in deadly schemes, everyone is gathering to organize a laid-back summer festival! Ikebukuro's strongest man is running a chocolate banana stand, the feared Black Rider dresses in a cute yukata, and even the infamous information broker is unknowingly helping everything go smoothly. It seems that as they shrank, so did their problems, and the busy world of gangs and the supernatural finally gets a well-deserved break.\n\n[Written by MAL Rewrite]", "Minidura", null, "みにでゅら", 1, "https://myanimelist.net/manga/81485/Minidura", 4 },
                    { 81551, "Durarara!! Relay is an adaptation of Kadokawa Games' PlayStation Vita game, released on January 29, 2015.", 12, new DateTime(2015, 11, 20, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/160115.jpg", 6114, 7.19m, new DateTime(2014, 10, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "It has been almost a year since Mikado Ryuugamine moved to Ikebukuro, and the city seems stagnant. He recalls Izaya Orihara's words: even the most eventful city like Tokyo will eventually feel monotonous. However, when Mikado's old friend Miyoshi Yoshimune returns to Raira Academy, life picks up its restless pace once more.\n\nMeanwhile, during the calm, Shizuo Heiwajima wishes more control over his anger outbursts. His boss, Tom Tanaka, suggests they go see the new popular movie starring Shizuo's brother Kasuka, the film which has brought overwhelming popularity to the attaché cases everyone now seems to be carrying. But despite the apparent peace, Ikebukuro's anonymous online chat—now joined by Yoshimune—talks about an unsettling development: attaché case thefts are on the rise and odd tornadoes are hitting Ikebukuro—yet no one can understand why.\n\n[Written by MAL Rewrite]", "Durarara!! Relay", null, "デュラララ!! Relay", 1, "https://myanimelist.net/manga/81551/Durarara_Relay", 2 },
                    { 81575, "", 8, new DateTime(2014, 6, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/141177.jpg", 7224, 7.11m, new DateTime(2004, 3, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "1. Nanatsu no Taizai (The Seven Deadly Sins)\n2-3. Mayoe Kohitsuji-tachi!\n4. Cowgirl Tai Sora Tobu Enban\n5. Blizzard Axel\n6-7. Memory of Moon\n8. Mujihi na Country Girl", "Nanatsu no Tanpen", "The Seven Stories", "七つの短編 鈴木央短編集", 1, "https://myanimelist.net/manga/81575/Nanatsu_no_Tanpen", 1 },
                    { 81611, "", null, null, "https://cdn.myanimelist.net/images/manga/1/141221.jpg", 45582, null, new DateTime(2014, 10, 10, 17, 0, 0, 0, DateTimeKind.Local), 4, "An anthology of Aldnoah.Zero by various mangaka.", "Aldnoah.Zero Anthology Comic", null, "ALDNOAH.ZERO アンソロジーコミック", 1, "https://myanimelist.net/manga/81611/AldnoahZero_Anthology_Comic", null },
                    { 81667, "Overlord was published in English by Yen Press from June 28, 2016, to October 15, 2024. The series has also been released in Italian by J-POP since May 18, 2016; and in Spanish by ECC Ediciones since October 31, 2017.", null, new DateTime(2023, 5, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/161407.jpg", 817, 7.97m, new DateTime(2014, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Momonga is an average salaryman who spends his free time playing Yggdrasil, a DMMO-RPG (Dive Massively Multiplayer Online Role-Playing Game) well-known across Japan for its immense world and limitless customization. Unfortunately, all good things come to an end, and Yggdrasil's servers shut down in the year 2138. Wanting to witness the game’s final hours, Momonga, the leader of the guild Ainz Ooal Gown, logs in for the last time and heads toward the guild’s headquarters.\n\nAfter reminiscing about his comrades and adventures, Momonga prepares for the server to automatically log him out as the clock strikes midnight. However, he is not forcefully booted out of the game. Instead, he finds himself in a new world—now trapped in the body of his avatar and where non-player characters are aware of their feelings.\n\nLeft with no other options, Momonga takes on the name of his guild in hopes that other players would recognize Ainz Ooal Gown. Determined to make sense of the bizarre situation, Momonga embarks on a journey to unravel the mysteries hidden in this uncharted world.\n\n[Written by MAL Rewrite]", "Overlord", "Overlord", "オーバーロード", 1, "https://myanimelist.net/manga/81667/Overlord", 19 },
                    { 81669, "Overlord has been published in English by Yen Press under the Yen On imprint in hardcover format since May 24, 2016. It has also been released in Polish by Kotori since October 17, 2016; in French by Ofelbe since May 11, 2017; in Spanish by Panini Comics since December 2018; and in Brazilian Portuguese by JBC since June 10, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/1/160558.jpg", 85, 8.62m, new DateTime(2012, 7, 29, 17, 0, 0, 0, DateTimeKind.Local), 4, "Yggdrasil is a virtual reality game renowned for the freedom it offers its players. After a simple tutorial, players are left to explore the world and can customize anything and everything, from their classes to their weapons. However, in the year 2138, the game sees its final hours as its servers shut down at midnight.\n\nMomonga, a devoted player of Yggdrasil, decides to spend the game's last hours inside his guild, Ainz Ooal Gown. Strangely, at the stroke of midnight, the game does not log him out. Instead, Momonga finds himself transported to another world, one that is seemingly identical to that of Yggdrasil. Facing an already abnormal situation, he discovers that the NPCs have gained sentience.\n\nTrapped in his avatar's skeletal body and desperate to uncover the cause of his predicament and find other players like him, Momonga sets out to take control of the new world with the help of his loyal subjects.\n\n[Written by MAL Rewrite]", "Overlord", "Overlord", "オーバーロード", 2, "https://myanimelist.net/manga/81669/Overlord", null },
                    { 82283, "", 7, new DateTime(2012, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/142469.jpg", 45674, null, new DateTime(2011, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A cyber battle sci-fi. In 2022, the technology of quantum computing has greatly advanced and many people have transfered their mind into the cyber space.\n\nRemu's sister, Shiki, skipped grades and entered a high school in the academic city \"Okinotori-island Mega Float City (OMFC)\" when she was 14. One day, Shiki confessed to her brother via Skype that she was talking to him directly from the cyber space and her real body had been kept in a water tank filled with a culture medium. It's called \"Body pool\" and Shiki connected to the network by nanomachines implanted in her brain.\n\nRemu was surprised but he accepted her decision until an accident called \"Early Rupture\" happened. The network server got overloaded and users' minds were lost in cyber space leaving soulless living bodies in the Body Pools. In order to bring Shiki's mind back, Remu visits her apartment in OMFC and there meets Shiki escaped from the hospital. But the girl tells him that she is not Shiki and she happens to haven taken over Shiki's body.\n\nWhen Remu tries to figure out the situation, a violent attack strikes the apartment.", "Arve Rezzle: Kikaijikake no Yousei-tachi", null, "アルヴ・レズル ―機械仕掛けの妖精たち―", 2, "https://myanimelist.net/manga/82283/Arve_Rezzle__Kikaijikake_no_Yousei-tachi", 1 },
                    { 82285, "", 8, new DateTime(2013, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/142465.jpg", 45677, null, new DateTime(2012, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "A cyber battle sci-fi. In 2022, the technology of quantum computing has greatly advanced and many people have transfered their mind into the cyber space.\n\nRemu's sister, Shiki, skipped grades and entered a high school in the academic city \"Okinotori-island Mega Float City (OMFC)\" when she was 14. One day, Shiki confessed to her brother via Skype that she was talking to him directly from the cyber space and her real body had been kept in a water tank filled with a culture medium. It's called \"Body pool\" and Shiki connected to the network by nanomachines implanted in her brain.\n\nRemu was surprised but he accepted her decision until an accident called \"Early Rupture\" happened. The network server got overloaded and users' minds were lost in cyber space leaving soulless living bodies in the Body Pools. In order to bring Shiki's mind back, Remu visits her apartment in OMFC and there meets Shiki escaped from the hospital. But the girl tells him that she is not Shiki and she happens to haven taken over Shiki's body.\n\nWhen Remu tries to figure out the situation, a violent attack strikes the apartment.", "Arve Rezzle: Kikaijikake no Yousei-tachi", null, "アルヴ・レズル ―機械仕掛けの妖精たち―", 1, "https://myanimelist.net/manga/82285/Arve_Rezzle__Kikaijikake_no_Yousei-tachi", 1 },
                    { 82289, null, 13, new DateTime(2013, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/142467.jpg", 45679, null, new DateTime(2012, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Unknown Arve: Kindan no Yousei-tachi", null, "アンノウン・アルヴ ―禁断の妖精たち―", 2, "https://myanimelist.net/manga/82289/Unknown_Arve__Kindan_no_Yousei-tachi", 1 },
                    { 82795, "Sword Art Online Alternative: Gun Gale Online has been published in English by Yen Press under the Yen On imprint since June 26, 2018.", null, null, "https://cdn.myanimelist.net/images/manga/2/180432.jpg", 2247, 7.6m, new DateTime(2014, 12, 9, 16, 0, 0, 0, DateTimeKind.Local), 4, "A brand-new battlefield awaits!\n\nKaren Kohiruimaki is a college student who stands at an imposing six feet. While her complex about her height makes it hard for her to make friends in the real world, the VRMMO Gun Gale Online changes everything. Now equipped with her ideal \"mini\" avatar and clad in a pink battle suit, Karen is ready to shoot up the world of GGO as Llenn! Before long, she meets the beautiful Pitohui, and the two rare female players become fast friends. Little does Llenn know that this friendship is the key to her entry in the first-ever Squad Jam, a team-based battle royale that echoes the famous Bullet of Bullets tournament...\n\n(Source: Yen Press)", "Sword Art Online Alternative: Gun Gale Online", "Sword Art Online Alternative: Gun Gale Online", "ソードアート・オンライン オルタナティブ ガンゲイル・オンライン", 2, "https://myanimelist.net/manga/82795/Sword_Art_Online_Alternative__Gun_Gale_Online", null },
                    { 82801, "Tony Takezaki no Evangelion was published in English as Tony Takezaki's Neon Genesis Evangelion by Dark Horse on June 9, 2015.", 36, new DateTime(2011, 9, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/143805.jpg", 8228, 7.04m, new DateTime(2010, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Neon Genesis Evangelion's official parody manga.", "Tony Takezaki no Evangelion", "Tony Takezaki's Neon Genesis Evangelion", "トニーたけざきのエヴァンゲリオン", 1, "https://myanimelist.net/manga/82801/Tony_Takezaki_no_Evangelion", 1 },
                    { 83187, "Magical Pâtissière Kosaki-chan!! has been published in Spanish by Ivrea beginning since December 2015.", 43, new DateTime(2016, 9, 21, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/157716.jpg", 11957, 6.8m, new DateTime(2014, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kosaki, Chitoge and Marika are bestowed upon powers of a magical girl who shall preserve peace in the world with Kosaki serving as their leader.\n\n(Source: Nisekoi WIkia)", "Magical Pâtissière Kosaki-chan!!", null, "マジカルパティシエ小咲ちゃん!!", 1, "https://myanimelist.net/manga/83187/Magical_Pâtissière_Kosaki-chan", 4 },
                    { 83257, "The Last: Naruto the Movie was published in Spanish by Planeta Cómic on July 2, 2019.", 5, null, "https://cdn.myanimelist.net/images/manga/1/144797.jpg", 1067, 7.87m, new DateTime(2014, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), 2, "The moon is beginning to fall, and at the rate it's going, it is doomed to fall on the Earth. The countdown for the survival of the planet begins. Among the havoc, Hinata's younger sister Hanabi is captured by the mysterious enemy, Toneri Ootsutsuki. Naruto must overcome great danger on a mission to save Hanabi and the world along with Hinata, Sai, Shikamaru, and Sakura in their final story.\n\n(Source: ANN)", "The Last: Naruto the Movie", null, "THE LAST -NARUTO THE MOVIE-", 2, "https://myanimelist.net/manga/83257/The_Last__Naruto_the_Movie", 1 },
                    { 83411, "Atom: The Beginning has been published in English by Titan Comics under the Titan Manga imprint since October 11, 2022. The series has been published in Spanish by Milky Way Ediciones since April 27, 2017.", null, null, "https://cdn.myanimelist.net/images/manga/3/157917.jpg", 3046, 7.48m, new DateTime(2014, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 4, "The prequel to one of the most influential mangas of all time: Astro Boy by Osamu Tezuka!\n\nA sci-fi manga about the turbulent lives of two robotics engineering students and their latest revolutionary project: the unassuming yet insanely strong A106, or \"Six.\"\n\nAtom: The Beginning blazes its own trail, as well as speaking to fans of the iconic Astro Boy and Osamu Tezuka. It's story full of hear and humor for fans of action-packed science fiction, robots, and manga.\n\n(Source: Titan Comics)", "Atom: The Beginning", "Atom: The Beginning", "アトム ザ・ビギニング", 1, "https://myanimelist.net/manga/83411/Atom__The_Beginning", null },
                    { 83729, "", 14, new DateTime(2015, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/145365.jpg", 45863, null, new DateTime(2014, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), 2, "Around the same time Slaine and Trillram went down to New Awara where Inaho and the others were, up at Sapporo, Hokkaido, twin Martian Knights sisters who pilot a Kataphrakt unit from the Vers Empire were landing in the town where the twin siblings Mizuki and Haruya Mikage live...", "Aldnoah.Zero Gaiden: Twin Gemini", null, "ALDNOAH.ZERO外伝 TWIN GEMINI", 1, "https://myanimelist.net/manga/83729/AldnoahZero_Gaiden__Twin_Gemini", 4 },
                    { 83807, "", 10, new DateTime(2016, 3, 2, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/163711.jpg", 1123, 7.85m, new DateTime(2014, 12, 26, 16, 0, 0, 0, DateTimeKind.Local), 2, "The college basketball team Strky, comprised of familiar faces from past Interhigh tournaments, is ready to face off against the Jabberwock, a popular American street basketball team that has just arrived in Japan. But what they believe will be a friendly match against a foreign team turns into a devastating loss, and afterwards, the Jabberwock's captain Nash Gold Jr. comments that the people of Japan are equivalent to monkeys and should stop pretending to play basketball.\n\nAngered by this insult, Kagetora Aida proposes a rematch with a different Japanese team, to which Nash accepts, believing the outcome will be the exact same. For the revenge match, Kagetora assembles the Vorpal Swords, consisting of the Generation of Miracles alongside Tetsuya Kuroko and Taiga Kagami—the only team that stands a chance in teaching the Jabberwock a lesson.\n\n[Written by MAL Rewrite]", "Kuroko no Basket: Extra Game", null, "黒子のバスケ EXTRA GAME", 1, "https://myanimelist.net/manga/83807/Kuroko_no_Basket__Extra_Game", 2 },
                    { 84427, null, null, null, "https://cdn.myanimelist.net/images/manga/1/146237.jpg", 8162, 7.04m, new DateTime(2014, 12, 16, 16, 0, 0, 0, DateTimeKind.Local), 4, null, "Nanatsu no Taizai Gaiden", null, "小説 七つの大罪 ―外伝―", 2, "https://myanimelist.net/manga/84427/Nanatsu_no_Taizai_Gaiden", null },
                    { 85033, "", 33, new DateTime(2003, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/147401.jpg", 46011, null, new DateTime(2003, 3, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "An anthology of Kidou Senshi Gundam by various mangaka.", "Kidou Senshi Gundam: The Anthology", null, "機動戦士ガンダム THE ANTHOLOGY", 1, "https://myanimelist.net/manga/85033/Kidou_Senshi_Gundam__The_Anthology", 2 },
                    { 85391, "", null, new DateTime(1986, 2, 18, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/148097.jpg", 46048, null, new DateTime(1985, 2, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "The year is Universal Century 0087. Seven years have passed since the end of the One Year War. In its zeal to stamp out any remaining opposition, the Earth Federation has organized the Titans, an elite fighting force. However, the Titans soon get out of hand, committing atrocities on par with the worst the Principality of Zeon had to offer during the war. In response, dissatisfied citizens, former Zeon soldiers, and even members of the Earth Federal Forces form a resistance group known as the Anti-Earth Union Group, or AEUG. As the next war is brewing, a small AEUG group arrives at Side 7 to investigate the new Gundam Mk. II...\n\n(Source: ANN)", "Kidou Senshi Zeta Gundam", null, "機動戦士Ｚ〈ゼータ〉ガンダム", 2, "https://myanimelist.net/manga/85391/Kidou_Senshi_Zeta_Gundam", 5 },
                    { 85393, "", null, new DateTime(1986, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/148101.jpg", 46049, null, new DateTime(1986, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "As the continuation of Zeta Gundam, this series once again follows the story of the Anti Earth Union Group (AEUG) battleship Argama after Zeta's final episode. To fight off the Axis Zeon, now called the Neo Zeon, Captain Bright Noa recruits a group of teenage junk collectors led by the loudmouthed but powerful Newtype Judau Ashta to pilot the Argama's mobile suits. Now sporting a line up of the behemoth MSZ-010 Double Zeta Gundam and the returning MSZ-006 Zeta Gundam, RX-178 Gundam Mk-II and Gundam-like MSN-00100 Hyaku Shiki, the group is nicknamed the Gundam Team. As such, this became the first of a number of Gundam series where a team of Gundam mobile suits fight alongside each other regularly. The climax takes place at Side 3 in the Battle of Axis.\n\n(Source: Gundam Wikia)", "Kidou Senshi Gundam ZZ", "Mobile Suit Gundam ZZ", "機動戦士ガンダムZZ", 2, "https://myanimelist.net/manga/85393/Kidou_Senshi_Gundam_ZZ", 2 },
                    { 85707, "Durarara!! RE;Dollars-hen has been published in English as Durarara!! Re;Dollars Arc by Yen Press since June 5, 2018.", null, null, "https://cdn.myanimelist.net/images/manga/3/160114.jpg", 3200, 7.46m, new DateTime(2014, 11, 17, 16, 0, 0, 0, DateTimeKind.Local), 4, "Known for his short temper, Shizuo Heiwajima sends a whole biker gang from Saitama to the hospital. Their leader, the strong and handsome womanizer Chikage Rokujou, comes to Ikebukuro to settle the score. However, Shizuo is not his only target; he and his gang intend to also take revenge on the Dollars, who have apparently been wreaking havoc in Saitama.\n\nWhile Masaomi Kida is gone, Mikado Ryuugamine runs into an unusual problem. His new junior, Aoba Kuronuma, effortlessly finds out about the Dollars' leader and insists on befriending Mikado. Although Mikado tries to distance himself from the Dollars following the advice of an anonymous user—who he assumes is Kida—their online chat's newest member shares unsettling stories of the gang being violent, which makes it difficult to ignore.\n\nMeanwhile, Celty Sturluson goes on a job for yakuza member Haruya Shiki. In her absence, Shizuo is attacked by a young girl who refuses to explain the reason behind it. As Shinra Kishitani tries to help, a mysterious Russian pair shows up with but one goal: to kidnap the strange girl.\n\n[Written by MAL Rewrite]", "Durarara!! RE;Dollars-hen", "Durarara!! Re;Dollars Arc", "デュラララ!! RE；ダラーズ編", 1, "https://myanimelist.net/manga/85707/Durarara_RE_Dollars-hen", null },
                    { 85781, "Dungeon Meshi ranked first and sixth in the 2016 and 2017 Kono Manga ga Sugoi! for the Male Readers division, respectively. The manga was also nominated for the Manga Taisho Award for four consecutive years from 2016 to 2019. The series was published in English as Delicious in Dungeon by Yen Press from May 23, 2017, to July 23, 2024. It was also released in Italian by J-POP from February 1, 2017, to April 24, 2024; in Spanish by Milky Way Ediciones since February 27, 2017; and in French by Casterman since May 17, 2017.", 102, new DateTime(2023, 9, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/148949.jpg", 51, 8.74m, new DateTime(2014, 2, 14, 16, 0, 0, 0, DateTimeKind.Local), 2, "After the Golden Kingdom is sunk underground by an insane magician, its king emerges, promising all of his treasure to any who defeat the magician, before crumbling to dust. Guilds are spurred on by this promise, traversing the labyrinthine dungeon in search of the magician. Laios Touden, the leader of one such guild, encounters a dragon that wipes out his party and devours his sister, Falin. Despite having lost the entirety of their supplies and belongings, Laios along with Marcille Donato, an elven healer, and Chilchuck Tims, a halfling thief, immediately reenter the dungeon, determined to save Falin.\n\nTime being of the essence, Laios suggests the taboo of eating the monsters of the dungeon as a means of gathering supplies. Upon the preparation of their first meal in the dungeon, they are stopped by an on-looking dwarf named Senshi. An enthusiast of monster cooking, he helps them prepare their monster ingredients for safe consumption. After learning of Laios' circumstances, Senshi expresses his desire to cook a dragon and joins their guild, thus beginning their food-filled foray into the dungeon together.\n\n[Written by MAL Rewrite]", "Dungeon Meshi", "Delicious in Dungeon", "ダンジョン飯", 1, "https://myanimelist.net/manga/85781/Dungeon_Meshi", 14 },
                    { 85884, "Mahou Shoujo Madoka★Magica: Homura Revenge! was published in English as Puella Magi Madoka Magica: Homura's Revenge! by Yen Press from July 21, 2015, to October 27, 2015. It was also released in Brazilian Portuguese by NewPOP Editora from June 10, 2022, to July 31, 2022.", 9, new DateTime(2013, 10, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/149731.jpg", 4445, 7.33m, new DateTime(2012, 6, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "Failing to prevail in the destined battle against Walpurgis Night, Homura Akemi uses her power to go back to a time before Madoka Kaname becomes a magical girl. Despite being prepared to endure the events once more, Homura is met with a surprising development: Madoka can remember everything from the previous timeline!\n\nKnowing what to expect in the coming weeks, Madoka and Homura resolve to save their friends and change their unfortunate fate. However, the two are not the only ones armed with new tactics—the apathetic Kyuubey reveals that it too has retained its memories. To stay on track with their plans, the girls must thwart the Incubator's schemes or risk losing their only chance at a promising future.\n\n[Written by MAL Rewrite]", "Mahou Shoujo Madoka★Magica: Homura Revenge!", "Puella Magi Madoka★Magica: Homura's Revenge", "魔法少女まどか★マギカ ほむらリベンジ!", 1, "https://myanimelist.net/manga/85884/Mahou_Shoujo_Madoka★Magica__Homura_Revenge", 2 },
                    { 85900, "Kuroko no Basuke: Replace Plus was published in Italian by Edizioni Star Comics.", 66, new DateTime(2018, 4, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/157861.jpg", 2249, 7.6m, new DateTime(2015, 1, 26, 16, 0, 0, 0, DateTimeKind.Local), 2, "The \"Generation of Miracles\" is a name given to a team of five middle school basketball prodigies who led Teikou Middle School to win three consecutive championship titles. Underneath all of the prestige, they are middle school students with middle school problems at the end of the day. From managing their crushes to planning the perfect summer vacation, these prodigies find themselves in typical age-appropriate situations in the company of amusing friends and teammates.\n\nAdapted from the light novels of the same series, Kuroko no Basuke: Replace Plus follows the antics of Tetsuya Kuroko and the Generation of Miracles before they went their separate ways. Intermixed with the hilarity are anecdotes from their high school teammates, who also end up in strangely hilarious situations outside the court.\n\n[Written by MAL Rewrite]", "Kuroko no Basket: Replace Plus", null, "黒子のバスケ Replace PLUS", 1, "https://myanimelist.net/manga/85900/Kuroko_no_Basket__Replace_Plus", 10 },
                    { 85924, "", null, new DateTime(2020, 3, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/159421.jpg", 14744, 6.6m, new DateTime(2014, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "Set in 2025, a roboticist named Fudou Yuuki joins a project involving a large mural depicting humanity's true past as well as the ancient but advanced technology found in Antarctica.\n\n(Source: Devilman Wikia)", "Devilman Saga", null, "デビルマンサーガ", 1, "https://myanimelist.net/manga/85924/Devilman_Saga", 13 },
                    { 85931, "", null, null, "https://cdn.myanimelist.net/images/manga/2/149193.jpg", 46141, null, new DateTime(2010, 7, 12, 17, 0, 0, 0, DateTimeKind.Local), 4, "A gag comic about gals! Follow the daily lives of the gal Ayu, Juria, and Ayu's no-good cheating boyfriend, Hide-kun.\n\nIncluded one-shot:\nVolume 3: Gal Japon x Osomatsu-san Collaboration!", "Gal Japon", null, "ギャルジャポン", 1, "https://myanimelist.net/manga/85931/Gal_Japon", null },
                    { 86129, "The first three novels of the Naruto Hiden Series were published in English by VIZ Media from November 3, 2015, to May 3, 2016. It was also released in Polish by J.P. Fantastica from July 27, 2016, to February 14, 2019.", 49, new DateTime(2015, 7, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/175457.jpg", 1564, 7.73m, new DateTime(2015, 2, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "A series of Naruto novels. Naruto's allies and enemies take center stage in these fast-paced adventures, which each volume focusing on a particular clanmate, ally, team...or villain.\n\n1. Kakashi Hiden: Hyouten no Ikazuchi (Kakashi Secret Legend: Lightning in the Frozen Sky) [Higashiyama Akira]\n2. Shikamaru Hiden: Yami no Shijima ni Ukabu Kumo [Yano Takashi]\n3. Sakura Hiden: Shiren, Harukaze ni Nosete [Hinata Shou]\n4. Konohagakure Hiden: Shuugen Biyori [Oosaki Tomohito]\n5. Gaara Hiden: Sajin Gensou [Ukyo Kodachi]\n6. Akatsuki Hiden: Sakimidareru Aku no Hana [Shin Towada]", "Naruto Hiden Series", null, "NARUTO秘伝シリーズ", 2, "https://myanimelist.net/manga/86129/Naruto_Hiden_Series", 6 },
                    { 86228, null, null, null, "https://cdn.myanimelist.net/images/manga/3/273575.jpg", 46247, null, new DateTime(1986, 7, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Kotobuki Gorou Show", "The Kotobuki Goro Show", "寿五郎ショウ", 1, "https://myanimelist.net/manga/86228/Kotobuki_Gorou_Show", 1 },
                    { 86232, "", 2, new DateTime(2016, 8, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/151903.jpg", 6018, 7.2m, new DateTime(2015, 2, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "Special chapters of Tsubasa: WoRLD CHRoNiCLE - Nirai Kanai-hen published to celebrate release of the 1st and 3rd volume, respectively.", "Tsubasa: WoRLD CHRoNiCLE - Niraikanai-hen Shucchouban", null, "ツバサ WoRLD CHRoNiCLE ニライカナイ編 出張版", 1, "https://myanimelist.net/manga/86232/Tsubasa__WoRLD_CHRoNiCLE_-_Niraikanai-hen_Shucchouban", null },
                    { 86336, null, 19, new DateTime(2018, 1, 8, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/150092.jpg", 3553, 7.42m, new DateTime(2014, 11, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Trinity Seven: 7-nin no Mashotsukai The Novel", null, "トリニティセブン 7人の魔書使い The Novel", 2, "https://myanimelist.net/manga/86336/Trinity_Seven__7-nin_no_Mashotsukai_The_Novel", 3 },
                    { 86353, null, 32, new DateTime(2017, 6, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/191811.jpg", 4613, 7.31m, new DateTime(2015, 2, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Saenai Heroine no Sodatekata: Girls Side", null, "冴えない彼女〈ヒロイン〉の育てかた Girls Side", 2, "https://myanimelist.net/manga/86353/Saenai_Heroine_no_Sodatekata__Girls_Side", 3 },
                    { 86367, "", null, new DateTime(2015, 3, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/150094.jpg", 46284, null, new DateTime(2015, 1, 18, 16, 0, 0, 0, DateTimeKind.Local), 2, "Some time ago, the asteroid Kumaria exploded in the depths of space.\n\nThe resulting fragments became a meteor shower that rained down on Earth, and for some reason, bears all over the world rose up and attacked humanity! In \"Man vs. Bear,\" the bears ate the humans and the humans shot the bears, resulting in a seemingly unending battle and a cycle of hatred. In the end, a giant \"Wall of Extinction\" was erected between the humans and bears and a state of mutual nonaggression came to pass...\n\nThe human world.\n\nOne morning, Arashigaoka Academy students Kureha Tsubaki and Sumika Izumino were by themselves and saw the \"Yuri Flower\" that bloomed in a flower bed. The two are friends as well as lovers. The flower bed is an important place to the two. At that moment, the Bear Alarms ring out! The bears are invading the human world, and humans are being attacked! Are they really those bears? One mystery invokes yet another mystery, one after another.\n\nThe curtain rises magnificently on Yuri Kuma Arashi!\n\n(Source: ANN)", "Yuri Kuma Arashi", null, "ユリ熊嵐", 2, "https://myanimelist.net/manga/86367/Yuri_Kuma_Arashi", 2 },
                    { 86414, null, 1, null, "https://cdn.myanimelist.net/images/manga/3/150492.jpg", 17949, 6.29m, new DateTime(2015, 2, 9, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Magazine Boys' Valentine!", null, "マガジンボーイズバレンタイン!", 3, "https://myanimelist.net/manga/86414/Magazine_Boys_Valentine", null },
                    { 86670, "", 7, new DateTime(2015, 12, 22, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/150485.jpg", 4368, 7.34m, new DateTime(2013, 10, 28, 17, 0, 0, 0, DateTimeKind.Local), 2, "Short stories included in the Monogatari Series Heroine Books.\n\n1. Ehon: Maigo no Katatsumuri (Picture Book: Lost Snail)\n2. Douwa: Utsukushi Hime (Beautiful Princess)\n3. Hitagi Throwing\n4. Rouka God\n5. Karen Brushing\n6. Tsukihi Brushing\n7. Yotsugi Stress", "Monogatari Series Heroine Hon", null, "アニメ＜物語＞シリーズヒロイン本", 2, "https://myanimelist.net/manga/86670/Monogatari_Series_Heroine_Hon", null },
                    { 86671, "", 3, new DateTime(2015, 4, 20, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/154240.jpg", 14968, 6.59m, new DateTime(2015, 2, 20, 16, 0, 0, 0, DateTimeKind.Local), 2, "Short adaptation of the movie with the same name.\n\nAn Earth where peace has arrived. However, remnants of Freeza's army arrive on the planet. Their goal is to revive Freeza with the dragon balls. Their dastardly wish is granted, the \"F\" that plans its revenge against the Saiyans is revived...!\n\n(Source: MAL)", "Dragon Ball Z: Fukkatsu no \"F\"", null, "ドラゴンボールZ 復活の「F」", 1, "https://myanimelist.net/manga/86671/Dragon_Ball_Z__Fukkatsu_no_F", null },
                    { 86769, "Kusuriya no Hitorigoto has been published digitally in English as The Apothecary Diaries by J-Novel Club since February 14, 2021, and in print by Square Enix since May 14, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/2/176943.jpg", 54, 8.72m, new DateTime(2014, 8, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "In the East is a land ruled by an emperor, whose consorts and serving women live in a sprawling complex known as the hougong, the rear palace. Maomao, an unassuming girl raised in an unassuming town by her apothecary father, never imagined the rear palace would have anything to do with her—until she was kidnapped and sold into service there.\n\nThough she looks ordinary, Maomao has a quick wit, a sharp mind, and an extensive knowledge of medicine. That's her secret, until she encounters a resident of the palace at least as perceptive as she is: the head eunuch, Jinshi. He sees through Maomao's façade and makes her a lady-in-waiting to none other than the Emperor's favorite consort... so she can taste the lady's food for poison!\n\nAt her lady's side, Maomao starts to learn about everything that goes on in the rear palace—not all of it seemly. Can she ever lead a quiet life, or will her powers of deduction and insatiable curiosity bring her ever more adventures, and ever more dangers?\n\n(Source: J-Novel Club)", "Kusuriya no Hitorigoto", "The Apothecary Diaries", "薬屋のひとりごと", 2, "https://myanimelist.net/manga/86769/Kusuriya_no_Hitorigoto", null },
                    { 86844, "", 9, new DateTime(2007, 12, 25, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/291821.jpg", 46405, null, new DateTime(2007, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "The year is U.C. 0088. A lone Neo Zeon ship approaches the Side 1 colony Brigadoon. Commander Vearn Fixeth of the stationed troops is on guard, but the captain of the Indra, Phaeton Rah Algis, shows no intention of fighting. Phaeton enters into negotiations with Brigadoon's government to purchase the colony with a large sum of money, however during the process, the Federation Forces begin an armed occupation of the colony under the pretext they're hiding remnant Titans. Phaeton manages to negotiate with them and gets them to leave the colony, much to the delight of the citizens, thus successfully making them Neo Zeon supporters. The purpose, however, of the Federation's attack is to rescue the lover of a senior Federation official which Phaeton was holding hostage. However, Phaeton has other ambitions… ambitions to \"catch the sun\"…\n\n(Source: zeonic-republic.net)", "Kidou Senshi Gundam ZZ Gaiden: Zeon no Genyou", "Mobile Suit Gundam ZZ Side Story: Mirage of Zeon", "機動戦士ガンダムΖΖ外伝 ジオンの幻陽", 1, "https://myanimelist.net/manga/86844/Kidou_Senshi_Gundam_ZZ_Gaiden__Zeon_no_Genyou", 2 },
                    { 86972, "", 34, new DateTime(2021, 2, 1, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/165199.jpg", 5011, 7.28m, new DateTime(2014, 12, 4, 16, 0, 0, 0, DateTimeKind.Local), 2, "Spin-off of One Piece, which takes place post-timeskip, showing the cast in SD/chibi form and features their hilarious antics around various islands while out in the sea.", "One Piece Party", null, "ONE PIECE PARTY", 1, "https://myanimelist.net/manga/86972/One_Piece_Party", 7 },
                    { 87195, "Nanatsu no Taizai: Bangai-henshuu \"Genzai\" was published in English as The Seven Deadly Sins: Original Sins Short Story Collection by Kodansha USA on October 26, 2021.", 6, new DateTime(2015, 3, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/279475.jpg", 3127, 7.47m, new DateTime(2011, 11, 21, 16, 0, 0, 0, DateTimeKind.Local), 2, "1-3. Edinburgh no Kyuuketsuki (The Vampire of Edinburgh)\n4. Kiken na Otsukai♥ (A Dangerous Mission♥)\n5. Character Ninki Touhyou Kekka Happyou Manga (Character Popularity Poll Official Results Manga)\n6. Nanatsu no Taizai (\"The Seven Deadly Sins\" - Pilot Story)", "Nanatsu no Taizai: Bangai-henshuu \"Genzai\"", "The Seven Deadly Sins: Original Sins Short Story Collection", "七つの大罪 番外編集 ＜原罪＞", 1, "https://myanimelist.net/manga/87195/Nanatsu_no_Taizai__Bangai-henshuu_Genzai", 1 },
                    { 87375, null, null, null, "https://cdn.myanimelist.net/images/manga/2/152737.jpg", 883, 7.94m, new DateTime(2011, 9, 16, 17, 0, 0, 0, DateTimeKind.Local), 4, null, "High School DxD DX", null, "ハイスクールD×D DX", 2, "https://myanimelist.net/manga/87375/High_School_DxD_DX", null },
                    { 87518, "", null, null, "https://cdn.myanimelist.net/images/manga/2/152085.jpg", 46659, null, new DateTime(2014, 4, 2, 17, 0, 0, 0, DateTimeKind.Local), 4, "\"Overkilled Red\" Aikawa Jun. The story of \"Humanity's Strongest Contractor\" is now being told.", "Saikyou Series", null, "最強シリーズ", 2, "https://myanimelist.net/manga/87518/Saikyou_Series", null },
                    { 87623, "", null, null, "https://cdn.myanimelist.net/images/manga/1/152443.jpg", 8590, 7.01m, new DateTime(2011, 5, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "Special doujinshi released in support of victims of the 2011 Tohoku Earthquake. Contains a \"comics side,\" featuring several short stories from various manga artists (122 pages), and an \"illustration side,\" with full color illustrations (30 pages). As a charity product, all the profit was donated to Japanese Red Cross.", "Pray for Japan", null, "東日本大震災チャリティ同人誌「pray for Japan」", 6, "https://myanimelist.net/manga/87623/Pray_for_Japan", 1 },
                    { 87678, "", 8, null, "https://cdn.myanimelist.net/images/manga/3/162274.jpg", 7941, 7.06m, new DateTime(2015, 8, 13, 17, 0, 0, 0, DateTimeKind.Local), 2, "Nanase Haruka is a sixth-grade elementary school student who loves connecting with the water and feeling the water as he swims, and he attends a local swim club together with his childhood best friend Tachibana Makoto and Hazuki Nagisa, one year younger than the both of them. Then, one winter's day as graduation draws near, Matsuoka Rin transfers into Haruka and the others' school from another swim club. Through swimming, Haruka strengthens his bonds with Makoto and Nagisa, as well as with Rin; at which point Rin, with his passion for the medley relay, suggests they form a team together and enter a tournament...\n\n(Source: September Scanlations)", "High☆Speed!", null, "ハイ☆スピード!", 1, "https://myanimelist.net/manga/87678/High☆Speed", 2 },
                    { 87714, "", 6, null, "https://cdn.myanimelist.net/images/manga/2/152723.jpg", 5020, 7.28m, new DateTime(2012, 11, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "The novel follows Uchiha Sasuke as he journeys to the Howling Wolf Village, where Itachi's eye medicine was produced.", "Naruto Jinraiden: Okami no Naku Hi", null, "NARUTO-ナルト- 迅雷伝 狼の哭く日", 2, "https://myanimelist.net/manga/87714/Naruto_Jinraiden__Okami_no_Naku_Hi", 1 },
                    { 87720, null, 3, new DateTime(2014, 12, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/152728.jpg", 13516, 6.69m, new DateTime(2014, 10, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Absolute Duo: Tea Party", null, "アブソリュート・デュオ TEA PARTY", 1, "https://myanimelist.net/manga/87720/Absolute_Duo__Tea_Party", 1 },
                    { 87725, "", null, new DateTime(1984, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/285506.jpg", 18066, 6.28m, new DateTime(1984, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Young sports enthusiast, Yamato Hino hears voices calling out to him and during a thunderstorm, he is brought to a parallel world. In this world is the Kingdom Mu, under attack by the evil Dorado of the Empire of Dinosaurs. Yamato was summoned from the prayers of queen Aila Mu to pilot a statue known as the God Mazinger. Joining the Mu army's ranks, Yamato fights against Dorado and his army.\n\n(Source: Mazinger Wikia)", "God Mazinger", null, "ゴッドマジンガー", 1, "https://myanimelist.net/manga/87725/God_Mazinger", 4 },
                    { 87835, "", 1, null, "https://cdn.myanimelist.net/images/manga/4/152778.jpg", 19373, 5.88m, new DateTime(2012, 6, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Go Nagai's classic sexy heroine Cutey Honey has returned!", "Honey VS", null, "ハニーVS", 3, "https://myanimelist.net/manga/87835/Honey_VS", null },
                    { 87866, "Naruto Gaiden: Nanadaime Hokage to Akairo no Hanatsuzuki was published in English as Naruto: The Seventh Hokage and the Scarlet Spring by VIZ Media under the Shonen Jump imprint on January 5, 2016; in Polish by J.P Fantastica on March 18, 2016; and in Brazilian Portuguese by Panini Comics/Planet Manga in October 2016.", 10, new DateTime(2015, 7, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/161762.jpg", 6441, 7.16m, new DateTime(2015, 4, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "The sun has set on Naruto Uzumaki's youth and is rising on the children of the next generation. One of these kids is Sarada Uchiha, daughter of Naruto's best friends Sasuke Uchiha and Sakura Haruno. Sharing a strong likeness with her father, Sarada has always wondered why she doesn't have any of her mother's features. When she discovers a photograph featuring Sasuke's old comrade Karin, Sarada is shocked to discover that she bears more of a resemblance to this strange woman than she does to her mother.\n\nWhen Sasuke returns to the village with news of a massive impending threat, Naruto obeys his duty as the Seventh Hokage and accompanies his old friend on an investigative mission. Unbeknownst to them both, Sarada and her friend Chouchou Akimichi pursue them, intent on solving the mystery of Sarada's parentage.\n\n[Written by MAL Rewrite]", "Naruto Gaiden: Nanadaime Hokage to Akairo no Hanatsuzuki", "Naruto: The Seventh Hokage and the Scarlet Spring", "NARUTO外伝 七代目火影と緋色の花つ月", 1, "https://myanimelist.net/manga/87866/Naruto_Gaiden__Nanadaime_Hokage_to_Akairo_no_Hanatsuzuki", 1 },
                    { 88032, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/158913.jpg", 19219, 5.98m, new DateTime(2015, 3, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Special collaboration between Shounen Magazine series.", "Magazine Ohanami!!", null, "マガジンOHANAMI!!", 3, "https://myanimelist.net/manga/88032/Magazine_Ohanami", null },
                    { 88100, "Batman was republished by Shogakukan as a BOX set on October 28, 2013 under \"Batman: The BatManga Jiro Kuwata Edition\" title. The series was published in English as Bat-Manga! by Pantheon in trade paperback on October 28, 2008. This edition contained an exclusive interview with the creator of the original manga, Jiro Kuwata and pictures of vintage Batman toys. In July 2014, DC Comics started to release the entire manga in English through ComiXology as a Digital First series.", 53, new DateTime(1967, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/153405.jpg", 15924, 6.51m, new DateTime(1966, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "In 1966, the Batman TV series starring Adam West prompted a Batman craze in Japan. In response to this, the shounen magazine Shounen King and its publisher Shonen Gahosha licensed the rights to make their own Batman stories, with the full consent of the original Batman publisher, DC Comics.\n\n(Source: Wikipedia)", "Batman", "Bat-Manga!", "バットマン", 1, "https://myanimelist.net/manga/88100/Batman", 3 },
                    { 88233, "", 40, new DateTime(1996, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/153769.jpg", 12572, 6.75m, new DateTime(1993, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "A full color sequel of Dr. Slump.", "Chotto Kaettekita Dr. Slump", null, "ちょっとだけかえってきたDr.スランプ", 1, "https://myanimelist.net/manga/88233/Chotto_Kaettekita_Dr_Slump", 4 },
                    { 88478, "", null, null, "https://cdn.myanimelist.net/images/manga/4/155107.jpg", 46909, null, new DateTime(2015, 4, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Novel that focuses on Kougami Shinya.", "Psycho-Pass Legend: Shikkoukan Kougami Shinya - Utopia Hound", null, "PSYCHO-PASS LEGEND 執行官 狡噛慎也 理想郷の猟犬〈ユートピア・ハウンド〉", 2, "https://myanimelist.net/manga/88478/Psycho-Pass_Legend__Shikkoukan_Kougami_Shinya_-_Utopia_Hound", 1 },
                    { 88589, null, 31, new DateTime(2016, 8, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/154511.jpg", 46931, null, new DateTime(2014, 5, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Akechi Keibu no Jikenbo", "The Akechi Files", "明智警部の事件簿", 1, "https://myanimelist.net/manga/88589/Akechi_Keibu_no_Jikenbo", 5 },
                    { 88679, "", 4, null, "https://cdn.myanimelist.net/images/manga/2/154677.jpg", 4839, 7.29m, new DateTime(2015, 2, 19, 16, 0, 0, 0, DateTimeKind.Local), 2, "Collection of four short stories related to the Kurama-yama arc.\n\nFirst narrated by Jirou, tells of his relationship with Suirou and his first encounter with the thunder beast. The second, narrated by Suirou, is about his relationship with Kurama (Shinjurou) and the events that led to his injury. The third is about Nanami trying to figure out whether or not Tomoe really said he liked her at the end of the Kurama-Yama arc. And the last one is about Botanmaru befriending a small tenma.", "Kamisama Hajimemashita: Kurama-yama Yawa", null, "神様はじめました 鞍馬山夜話", 2, "https://myanimelist.net/manga/88679/Kamisama_Hajimemashita__Kurama-yama_Yawa", 1 },
                    { 88923, "Arifureta Shokugyou de Sekai Saikyou began as a web novel on Shousetsuka ni Narou on November 7, 2013. Overlap has released a revised and illustrated version of the series since June 25, 2015 under its Overlap Bunko label. The series was published digitally in English as Arifureta: From Commonplace to World's Strongest by J-Novel Club from May 6, 2017 to March 24, 2023, and in print by Seven Seas Entertainment under the Airship imprint from February 6, 2018 to October 24, 2023.", 92, new DateTime(2022, 9, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/159433.jpg", 1850, 7.68m, new DateTime(2015, 6, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Seventeen-year-old Hajime Nagumo is your average, everyday otaku. However, his simple life of pulling all-nighters and sleeping in school is suddenly turned upside down when he, along with the rest of his class, is summoned to a fantasy world! They're treated like heroes and tasked with the duty of saving the human race from utter extinction. But what should have been any otaku's wet dream quickly turns into Hajime's nightmare. While the rest of his class are blessed with godlike powers, Hajime's job, Synergist, only has a single transmutation skill. Ridiculed and bullied by his classmates for being weak, he soon finds himself in despair. Will he be able to survive in this dangerous world of monsters and demons with only a glorified blacksmith's level of strength?\n\n(Source: J-Novel Club)", "Arifureta Shokugyou de Sekai Saikyou", "Arifureta: From Commonplace to World's Strongest", "ありふれた職業で世界最強", 2, "https://myanimelist.net/manga/88923/Arifureta_Shokugyou_de_Sekai_Saikyou", 13 },
                    { 88930, "Youjo Senki has been published in English as The Saga of Tanya the Evil by Yen Press under the Yen On imprint since December 19, 2017.", null, null, "https://cdn.myanimelist.net/images/manga/2/155214.jpg", 217, 8.4m, new DateTime(2013, 10, 30, 17, 0, 0, 0, DateTimeKind.Local), 4, "Tanya Degurechaff is a soldier who has the appearance of an innocent young girl. But behind her cute facade lies the soul of a ruthless salaryman who challenged \"Being X\"—the self-proclaimed God who reincarnated the man into an industrial world of magic. By doing this, Being X hopes to prove that, if the situation were dire enough, even a non-believer like this man would pray for God's help.\n\nOpposing Being X's desires to make her suffer, Tanya enlists in the military with the hope of living a peaceful life. She manages to impress the higher-ups with her aptitude for war, swiftly rising through the ranks. However, her country soon participates in the ongoing world war, quickly crushing her dream. In an attempt to return to her calm she starts using any merciless means to obliterate her opponents. Thus begins the saga of Tanya the Evil and the Empire as they seek world domination.\n\n[Written by MAL Rewrite]", "Youjo Senki", "The Saga of Tanya the Evil", "幼女戦記", 2, "https://myanimelist.net/manga/88930/Youjo_Senki", null },
                    { 89357, "Youkoso Jitsuryoku Shijou Shugi no Kyoushitsu e was published digitally in English as Classroom of the Elite by Seven Seas Entertainment from February 7, 2019 to May 12, 2022, and in print from May 7, 2019 to June 28, 2022.", 110, new DateTime(2019, 9, 24, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/177958.jpg", 35, 8.82m, new DateTime(2015, 5, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Receiving funding from the government to nurture the next generation's hopefuls, Tokyo Metropolitan Advanced Nurturing High School brings together the brightest youth of Japan onto a single campus. At this seemingly perfect institution, the reserved Kiyotaka Ayanokouji arrives as an incoming member of class 1-D, where he befriends one of his classmates, the antisocial Suzune Horikita.\n\nAt first, his peers revel in the academy's leisurely lifestyle, taking advantage of all of its state-of-the-art facilities. Soon enough, however, the facade of Tokyo Metropolitan Advanced Nurturing High School gives way to its true nature—only the top scoring classes can fully utilize the school's offerings, and Class D is the furthest from such a status. Standing at the bottom of the hierarchy, Class D houses all of the school's \"worst\" students.\n\nFollowing this rude awakening, Ayanokouji, Horikita, and the rest of Class D must overcome their differences and clash against other classes in order to climb to the coveted position of Class A by any means necessary.\n\n[Written by MAL Rewrite]", "Youkoso Jitsuryoku Shijou Shugi no Kyoushitsu e", "Classroom of the Elite", "ようこそ実力至上主義の教室へ", 2, "https://myanimelist.net/manga/89357/Youkoso_Jitsuryoku_Shijou_Shugi_no_Kyoushitsu_e", 14 },
                    { 89364, "", 9, new DateTime(2013, 10, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/157878.jpg", 14948, 6.59m, new DateTime(2012, 6, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "Showcasing delicious sweets and a colorful atmosphere, Café Grief Seed welcomes a variety of patrons through its doors. On a whim, Madoka Kaname and her friend Sayaka Miki visit the restaurant after seeing it being featured in a magazine. They quickly befriend the three employees of the establishment and eventually become interested in working at the café.\n\nSeizing the opportunity, the apathetic store manager Kyuubey extends a job offer to Madoka and Sayaka, believing that their hiring will improve workplace efficiency. However, when waitress Homura Akemi eavesdrops on the cat-like creature, she learns that Kyuubey has ulterior motives behind the contract. Regretful of having made the wrong decision herself, Homura is determined to prevent Madoka from being deceived by the battlefield that is customer service!\n\n[Written by MAL Rewrite]", "Café☆Griefseed e Youkoso!", "Welcome to Cafe Griefseed!", "カフェ☆グリーフシードへようこそ!", 1, "https://myanimelist.net/manga/89364/Café☆Griefseed_e_Youkoso", 1 },
                    { 89365, null, null, new DateTime(2016, 6, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/157041.jpg", 36356, null, new DateTime(2012, 12, 9, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Fuwatto Madoka", null, "ふわっとまどか", 1, "https://myanimelist.net/manga/89365/Fuwatto_Madoka", 3 },
                    { 89366, "", null, new DateTime(2016, 6, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/157043.jpg", 36357, null, new DateTime(2013, 10, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "A 4-koma about the Kaname family.", "Kaname-ke", null, "かなめけ", 1, "https://myanimelist.net/manga/89366/Kaname-ke", 2 },
                    { 89610, "", null, new DateTime(2004, 5, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/157127.jpg", 36418, null, new DateTime(2003, 8, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Set thirty years after the original Kekkou Kamen, Spartan Institute of Higher Education is back to its old tricks under the reign of the son of Toenail of Satan. There a new Kekkou Kamen appears.", "Kekkou Kamen P", null, "けっこう仮面P", 1, "https://myanimelist.net/manga/89610/Kekkou_Kamen_P", 2 },
                    { 89734, "Dragon Ball Super has been published in English by VIZ Media under the Shonen Jump imprint since May 2, 2017. It has also been simulpub through MANGA Plus. The series has also been published in French by Glénat since April 5, 2017; in Italian by Edizioni Star Comics since April 26, 2017; in German by Carlsen Manga since May 2, 2017; and in Spanish by Planeta Cómic in comic issues since March 2017 and in volumes since October 17, 2017.", null, null, "https://cdn.myanimelist.net/images/manga/2/176933.jpg", 4699, 7.31m, new DateTime(2015, 6, 19, 17, 0, 0, 0, DateTimeKind.Local), 4, "Having defeated Boo, Goku is starting to get bored with his life on Earth. His wife, Chi-chi, wants him to get a job, but all he wants to do is train and fight stronger enemies. Elsewhere in the universe, the God of Destruction, Beerus, and his attendant Whis are traveling from planet to planet in search of food and entertainment. After blowing up some hapless victims, Beerus is reminded of a man from his dreams with the moniker \"Super Saiyan God,\" or something like that... The God of Destruction sets his sights on Earth to track down this mysterious man! Maybe this will give Goku something to do?\n\n(Source: VIZ Media)", "Dragon Ball Super", "Dragon Ball Super", "ドラゴンボール超〈スーパー〉", 1, "https://myanimelist.net/manga/89734/Dragon_Ball_Super", null },
                    { 89768, "Kono Subarashii Sekai ni Shukufuku wo! Spin-off: Kono Subarashii Sekai ni Bakuen wo! has been published in English as Konosuba: An Explosion on This Wonderful World! by Yen Press under the Yen On imprint since December 24, 2019.", 30, new DateTime(2019, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/156944.jpg", 587, 8.1m, new DateTime(2014, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "My name is...\n\nOne year before a certain useless goddess and NEET extraordinaire hit the scene, Megumin, the \"Greatest Genius of the Crimson Magic Clan,\" is hard at work. Ever since a life-changing encounter in her youth, the young wizard has dedicated her every waking moment to the pursuit of the ultimate offensive magic, Explosion! (Well...every moment not spent hustling food from her self-proclaimed rival.) And while the big sister's away, the little one will play. On a routine trip into the woods, Megumin's little sister, Komekko, finds a strange black kitten. Little does she know that this cat plays a key role in unsealing a Dark God's tomb...\n\n(Source: Yen Press)", "Kono Subarashii Sekai ni Shukufuku wo! Spin-off: Kono Subarashii Sekai ni Bakuen wo!", "Konosuba: An Explosion on This Wonderful World!", "この素晴らしい世界に祝福を！スピンオフ この素晴らしい世界に爆焔を！", 2, "https://myanimelist.net/manga/89768/Kono_Subarashii_Sekai_ni_Shukufuku_wo_Spin-off__Kono_Subarashii_Sekai_ni_Bakuen_wo", 5 },
                    { 89960, "Re:Zero kara Hajimeru Isekai Seikatsu: Dai-3 Shou - Truth of Zero adapts volumes four through nine of the light novel series. The manga was published in English as Re:ZERO -Starting Life in Another World-, Chapter 3: Truth of Zero by Yen Press from October 31, 2017, to December 15, 2020. It was also released in Polish by Waneko from April 26, 2019, to January 12, 2021.", 55, new DateTime(2019, 9, 26, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/188948.jpg", 575, 8.1m, new DateTime(2015, 5, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "The Royal Capital, the city of Lugunica, has been in disarray ever since losing its king. Now without a figurehead, the royal family collapses, and the government must immediately hold an election to decide on his successor. Subaru Natsuki, who unknowingly saved the insignia that made Emilia a Royal Election candidate, accompanies her to an important meeting.\n\nWhile in the capital, Emilia insists that Subaru stay behind and repose following the demon beast attack, despite the fact he would do anything besides that. However, when Subaru sees Emilia being ill-treated by both the citizens and her fellow candidates, will he be able to keep his promise to the one he loves most?\n\n[Written by MAL Rewrite]", "Re:Zero kara Hajimeru Isekai Seikatsu: Dai-3 Shou - Truth of Zero", "Re:ZERO -Starting Life in Another World-, Chapter 3: Truth of Zero", "Re：ゼロから始める異世界生活 第三章 Truth of Zero", 1, "https://myanimelist.net/manga/89960/Re_Zero_kara_Hajimeru_Isekai_Seikatsu__Dai-3_Shou_-_Truth_of_Zero", 11 },
                    { 90016, "", 27, new DateTime(2016, 6, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/172442.jpg", 36515, null, new DateTime(2012, 6, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "Upon escaping into a parallel world, Homura Akemi discovers that she has become a kindergarten student! The differences do not stop there: at Mitakihara Kindergarten, Mami Tomoe is a teacher; Madoka Kaname is another kindergarten student; and Kyuubey is the principal of the school. Despite the bizarre changes in this world, Homura believes this is a rare opportunity to finally make intimate memories with her close friend. But with frequent unexpected signs threatening to lead her astray, Homura must continue her duty to protect Madoka from becoming a magical girl—all while in the body of a five-year-old!\n\n[Written by MAL Rewrite]", "Mitakihara Youchien Mahou-gumi", null, "みたきはら幼稚園まほう組", 1, "https://myanimelist.net/manga/90016/Mitakihara_Youchien_Mahou-gumi", 3 },
                    { 90065, "Keibu Zenigata concluded with the suspension of the Lupin Sansei Official Magazine, following the 50th anniversary of Lupin III.", 45, new DateTime(2017, 12, 7, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/172507.jpg", 36522, null, new DateTime(2010, 10, 27, 17, 0, 0, 0, DateTimeKind.Local), 2, "Lupin III spin-off about Kouichi Zenigata.", "Keibu Zenigata", "Captain Zenigata", "警部銭形", 1, "https://myanimelist.net/manga/90065/Keibu_Zenigata", 12 },
                    { 90117, "Tsuki ga Michibiku Isekai Douchuu has been published digitally in English as Tsukimichi: Moonlit Fantasy by AlphaPolis through Alpha Manga. The volumes have also been published digitally by AlphaPolis since July 28, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/2/183227.jpg", 1354, 7.78m, new DateTime(2015, 6, 9, 17, 0, 0, 0, DateTimeKind.Local), 4, "High school student Misumi Makoto is called into a fantasy world by the god Tsukuyomi, in order to be a hero. However, powerful others in this world aren't as thrilled to have him there, and they kick him to the edge of the world just as Tsukuyomi declares that he must leave Makoto to find his own way. Now it's up to Makoto to find his own way!\n\n(Source: MangaHelpers)", "Tsuki ga Michibiku Isekai Douchuu", "Tsukimichi: Moonlit Fantasy", "月が導く異世界道中", 1, "https://myanimelist.net/manga/90117/Tsuki_ga_Michibiku_Isekai_Douchuu", null },
                    { 90118, "Tsuki ga Michibiku Isekai Douchuu has been published digitally in English as Tsukimichi: Moonlit Fantasy by Hanashi Media since March 30, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/3/158263.jpg", 819, 7.96m, new DateTime(2013, 5, 27, 17, 0, 0, 0, DateTimeKind.Local), 4, "High school student Misumi Makoto is called to a fantasy world by the god Tsukuyomi in order to become a hero. However, powerful others in this world aren't as thrilled to have him there, and they kick him to the edge of the world just as Tsukuyomi declares that he must leave Makoto to find his own way. Now it's up to Makoto to find his own way!\n\n(Source: MangaHelpers)", "Tsuki ga Michibiku Isekai Douchuu", "Tsukimichi: Moonlit Fantasy", "月が導く異世界道中", 2, "https://myanimelist.net/manga/90118/Tsuki_ga_Michibiku_Isekai_Douchuu", null },
                    { 90180, "", 18, new DateTime(2015, 6, 4, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/159411.jpg", 8189, 7.04m, new DateTime(2014, 11, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "4-koma spin-off of the Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka series.", "DanMachi 4-koma: Somosomo Dungeon ni Moguru no ga Machigai de wa Nai Darou ka", null, "ダンまち4コマ そもそもダンジョンにもぐるのが間違いではないだろうか", 1, "https://myanimelist.net/manga/90180/DanMachi_4-koma__Somosomo_Dungeon_ni_Moguru_no_ga_Machigai_de_wa_Nai_Darou_ka", 1 },
                    { 90309, "Mahou Shoujo Madoka★Magica: Majuu-hen was published in English as Puella Magi Madoka Magica: Wraith Arc by Yen Press from November 23, 2021, to June 21, 2022. It has also been published in Turkish as Büyücü Kız Madoka Magica: Hayaletlerin Ayaklanışı by Komik Şeyler since June 2022.", 9, new DateTime(2016, 10, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/260579.jpg", 1481, 7.75m, new DateTime(2015, 6, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Invisible to humans, wraiths are beings that feed on human emotions and cause chaos wherever they go. Magical girls must use the power they have gained in exchange for having one wish granted to protect humans from these wraiths. A group of magical girls in Mitakihara have been giving their all to keep the town safe, but two of their members, Sayaka Miki and Kyouko Sakura, cannot seem to get along. Their leader, Mami Tomoe, hopes that they can work together in time, but worries that their quarrels will begin to affect their magical girl duties.\n\nJoining this group of magical girls is Homura Akemi, who has recently transferred to Mitakihara Middle School. But Homura knows more about magical girls than she lets on, as well as the truth behind the current state of their world.\n\n[Written by MAL Rewrite]", "Mahou Shoujo Madoka★Magica: Majuu-hen", "Puella Magi Madoka Magica: Wraith Arc", "魔法少女まどか★マギカ [魔獣編]", 1, "https://myanimelist.net/manga/90309/Mahou_Shoujo_Madoka★Magica__Majuu-hen", 3 },
                    { 90322, "", 4, null, "https://cdn.myanimelist.net/images/manga/1/158910.jpg", 4700, 7.31m, new DateTime(2012, 9, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "Four short stories which appeared in the Nisemonogatari: Anime Complete Guidebook.\n\n1. Hitagi Neck\n2. Karen Arm-leg\n3. Tsukihi Eternal\n4. Shinobu House", "Nisemonogatari Short Stories", null, "偽物語アニメコンプリートガイドブック", 2, "https://myanimelist.net/manga/90322/Nisemonogatari_Short_Stories", null },
                    { 90324, "", 8, new DateTime(2014, 5, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/158927.jpg", 5505, 7.24m, new DateTime(2014, 4, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Special booklets bundled with the first press release of the 1st and 2nd Blu-ray and DVD volumes of Onimonogatari anime. They contain short advertisement manuscripts published in Yomiuri Shinbum along with short kakioroshi.\n\nVolume 1\n1. Tsubasa Board\n2. Mayoi Castle\n3. Shinobu Science\n4. Suruga Palace\n\nVolume 2\n1. Nadeko Mirror\n2. Hitagi Salamander\n3. Yotsugi Future\n4. Ougi Travel", "Monogatari Series: Second Season - Shinbun Koukoku Zenshuu", null, "〈物語〉シリーズ セカンドシーズン新聞広告全集", 2, "https://myanimelist.net/manga/90324/Monogatari_Series__Second_Season_-_Shinbun_Koukoku_Zenshuu", 2 },
                    { 90408, "", 8, new DateTime(1993, 10, 19, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/158628.jpg", 36648, null, new DateTime(1990, 10, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the future, advanced robotics has created heavy robots (\"labors\") for use in a variety of functions: construction, fire-fighting, military, and more. However, though the robots are only machines, their operators are also only human—and humans sometimes turn to crime. Since a heavy labor unit can be a dangerous weapon, the police of the future are set to fight fire with fire, using advanced patrol labor units, \"patlabors.\" This is the story of the Second Special Vehicles Division, a motley crew of patlabor policemen and women doing their best to fight crime and live a normal life.\n\n(Source: ANN)", "Kidou Keisatsu Patlabor", null, "機動警察パトレイバー", 2, "https://myanimelist.net/manga/90408/Kidou_Keisatsu_Patlabor", 5 },
                    { 90531, "Naruto Shinden Series was published in English by VIZ Media from November 1, 2016 to March 7, 2017.", 11, new DateTime(2015, 11, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/190847.jpg", 276, 8.33m, new DateTime(2015, 9, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story will focus on the brothers who have eyes that see through to the truth and who live on the threshold of hope and despair. Itachi's past and Sasuke's future will be made clear.", "Naruto Shinden Series", "Naruto: Itachi's Story", "NARUTO -ナルト- 真伝シリーズ", 2, "https://myanimelist.net/manga/90531/Naruto_Shinden_Series", 3 },
                    { 90585, "", 40, new DateTime(2013, 4, 16, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/286587.jpg", 4925, 7.29m, new DateTime(2012, 3, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "A murder case for the 20th anniversary for the manga of Kindaichi.", "Kindaichi Shounen no Jikenbo: 20-shuunen Kinen Series", "Kindaichi Shounen no Jikenbo: 20th Anniversary Commemoration Series", "金田一少年の事件簿 20周年記念シリーズ", 1, "https://myanimelist.net/manga/90585/Kindaichi_Shounen_no_Jikenbo__20-shuunen_Kinen_Series", 5 },
                    { 90687, "[Shinyaku] Mahou Shoujo Oriko★Magica: Sadness Prayer has been published in English as [New Testament] Puella Magi Oriko Magica: Sadness Prayer by Yen Press from November 22, 2016 to September 18, 2018.", 24, new DateTime(2017, 8, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/159418.jpg", 11048, 6.85m, new DateTime(2013, 11, 7, 16, 0, 0, 0, DateTimeKind.Local), 2, "Enduring the fallout of her father's political scandal and his following suicide, Oriko Mikuni makes a desperate wish to Kyuubey: to discover her purpose in life. With the \"gift\" of foresight as a magical girl, Oriko learns that only further despair awaits her, culminating in the destruction of Mitakihara City. To effectively prevent this unfortunate outcome, the fate of a familiar girl must be changed.\n\nThis revelation serves as the foundation for Oriko's new goal to battle \"witches\" and bring unwavering peace to the world. However, as Oriko sets her plans in motion, ongoing affairs begin to interfere, presenting unexpected challenges along the way. Having already faced many hardships, Oriko is resolved to overcome such obstacles and strive toward a better future—even if it means sacrificing the lives of others.\n\n[Written by MAL Rewrite]", "[Shinyaku] Mahou Shoujo Oriko★Magica: Sadness Prayer", "[New Testament] Puella Magi Oriko Magica: Sadness Prayer", "［新約］魔法少女おりこ★マギカ～sadness prayer～", 1, "https://myanimelist.net/manga/90687/Shinyaku_Mahou_Shoujo_Oriko★Magica__Sadness_Prayer", 4 },
                    { 90757, "", 14, null, "https://cdn.myanimelist.net/images/manga/1/159298.jpg", 4471, 7.33m, new DateTime(2008, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Kenji was born in 1960. At that time, Japan was running toward the future. In the time of the economic growth, Japanese children saw a lot of cultural movement. Some are gone, some remain. \"20th century boys\" this based on that chaos. Kentaro Takekuma, who was born in the same year as Kenji, is going to reexamine the culture of that period.\n\nThis is the best guidebook to understand the background of 20th Century Boys.", "20 Seiki Shounen Tanteidan", "20th Century Detective Boys", "20世紀少年探偵団", 1, "https://myanimelist.net/manga/90757/20_Seiki_Shounen_Tanteidan", 1 },
                    { 90870, "", null, new DateTime(2016, 10, 7, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/278721.jpg", 3587, 7.42m, new DateTime(2015, 7, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Durarara!! spin-off series that takes place after the original, starring Orihara Izaya as the main character.\n\nAn man shows up in a town far from Tokyo. All he does is facilitate the flow of information, and nudge people on the back. He is an informant; that is what this man boasts of himself. Whether or not the title is appropriate for what he does, one thing is certain: he has the power to obtain a great volume of information. He is not an ally of justice, but neither is he an abettor of villainy. He is simply unwaveringly honest to his own desires.\n\n\"Humans.\" Earnestly, he loves every one of the assortment this word encapsulates. He merely loves. Even if it causes the object of his love to break. Because this informant can equally even love broken humans.\n\n(Source: popsiclete blog)", "Orihara Izaya to Series", null, "折原臨也と シリーズ", 2, "https://myanimelist.net/manga/90870/Orihara_Izaya_to_Series", 2 },
                    { 90883, "", 17, new DateTime(1982, 1, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/159913.jpg", 36765, null, new DateTime(1980, 12, 5, 16, 0, 0, 0, DateTimeKind.Local), 2, "In order to help her father solve mysterious crimes, the student Susumi Fuji takes the identity of Maboroshi Panty.", "Maboroshi Panty", null, "まぼろしパンティー", 1, "https://myanimelist.net/manga/90883/Maboroshi_Panty", 3 },
                    { 90884, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/160084.jpg", 36766, null, new DateTime(2011, 6, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "Taking place many years after the original manga where a new Kekkou Kamen, whose secret identity is a new teacher in a new school owned by the remaining factions of the Toenail of Satan.", "The Excellent: Kekkou Kamen Gaiden", null, "THE エクセレント～けっこう仮面外伝～", 3, "https://myanimelist.net/manga/90884/The_Excellent__Kekkou_Kamen_Gaiden", null },
                    { 90885, null, 1, null, "https://cdn.myanimelist.net/images/manga/2/159916.jpg", 36767, null, new DateTime(2013, 1, 15, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Mazinger Z Tai Kekkou Kamen", null, "マジンガーZ対けっこう仮面", 3, "https://myanimelist.net/manga/90885/Mazinger_Z_Tai_Kekkou_Kamen", null },
                    { 90908, "", 13, new DateTime(2015, 8, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/162056.jpg", 36776, null, new DateTime(2014, 9, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "The second part of Fuwari! Don Patch, a spin-off of Bobobo-bo Bo-Bobo starring Don Patch.", "Honnori! Don Patch", null, "ほんのり!どんぱっち", 1, "https://myanimelist.net/manga/90908/Honnori_Don_Patch", 1 },
                    { 90993, "", 19, new DateTime(2017, 3, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/167490.jpg", 2990, 7.49m, new DateTime(2015, 8, 5, 17, 0, 0, 0, DateTimeKind.Local), 2, "Twenty-five-year-old Kakushidate Yakusuke suffers from the fate of constantly stumbling into various crime scenes and ending up being the main suspect.\n\nHis last resort: Okitegami Kyouko the \"Quickest Detective.\" However, Kyouko suffers from a strange case of amnesia; whenever she falls asleep, she forgets everything that happened the previous day, making her solve the mysteries within one day.", "Okitegami Kyouko no Bibouroku", "The Memorandum of Kyoko Okitegami", "掟上今日子の備忘録", 1, "https://myanimelist.net/manga/90993/Okitegami_Kyouko_no_Bibouroku", 5 },
                    { 91037, "Enen no Shouboutai was published in English as Fire Force by Kodansha Comics USA from November 8, 2016 to October 3, 2023, and as omnibus volumes since August 27, 2024. The series has also been published in Italian by Panini Comics under the Planet Manga imprint since May 5, 2017, in French by Kana since May 19, 2017, in Spanish by Norma Editorial since June 23, 2017, and in Polish by Waneko since December 12, 2019.", 305, new DateTime(2022, 2, 21, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/178996.jpg", 1475, 7.75m, new DateTime(2015, 9, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Still reeling from the childhood trauma of losing his family to a blaze, Shinra Kusakabe endures both the blessing and curse of being a third-generation pyrokinetic: a person gifted with the ability to freely control fire.\n\nMeanwhile, the Infernals—first-generation pyrokinetics who spontaneously combust into flaming, demonic creatures—ravage the streets of Tokyo. After he is recognized for his abilities, Shinra joins Special Fire Force Company 8, one of many fire brigades developed to combat these Infernals.\n\nAlthough working with the Fire Force seems to have fulfilled a calling, Shinra learns that becoming a hero is not as easy as it seems. Infernal sightings are worsening across the country, and his own fellow brigadiers struggle to unite against these threats. To make matters worse, Shinra's past returns to haunt him after he confronts a mysterious cult. As he endeavors to reach the truth, Shinra soon finds himself in the middle of a conspiracy that aims to engulf the world in flames.\n\n[Written by MAL Rewrite]", "Enen no Shouboutai", "Fire Force", "炎炎ノ消防隊", 1, "https://myanimelist.net/manga/91037/Enen_no_Shouboutai", 34 },
                    { 91209, "", 21, null, "https://cdn.myanimelist.net/images/manga/2/160222.jpg", 1108, 7.85m, new DateTime(2013, 7, 7, 17, 0, 0, 0, DateTimeKind.Local), 2, "Novel of the second Gintama movie, written by Oosaki Tomohito, the same author of Ginpachi-sensei.\n\nWhat would have happened if the Shiroyasha never existed?\n\nEdo is thrown to chaos by a mysterious cause. Sakata Gintoki, now lives in a world where the future has changed, without him. What has happened to the Yorozuya?\n\nGintoki, who is now a ghost of the past, must once again carry the burden in order to save his friends. He must finish the biggest job ever, which may be the final job of Yorozuya.", "Gekijouban Gintama: Kanketsu-hen - Yorozuya yo Eien Nare", null, "劇場版 銀魂 完結篇 万事屋よ永遠なれ", 2, "https://myanimelist.net/manga/91209/Gekijouban_Gintama__Kanketsu-hen_-_Yorozuya_yo_Eien_Nare", 1 },
                    { 91443, "", null, new DateTime(1997, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/160508.jpg", 36870, null, new DateTime(1996, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "It is the year After Colony 195, and war between the Space Colonies and Earth has begun. To give the colonies an edge, they send 5 young soldiers, trained to perfection, to earth in the most powerful of Mobile Suits-Gundams. With their arrival, the tide of the war changes as they battle against the Earth forces and the Colonies of their origin.\n\n(Source: ANN)", "Shin Kidou Senki Gundam Wing", null, "新機動戦記ガンダムＷ〈ウイング〉", 2, "https://myanimelist.net/manga/91443/Shin_Kidou_Senki_Gundam_Wing", 5 },
                    { 91444, "", null, null, "https://cdn.myanimelist.net/images/manga/3/160509.jpg", 36871, null, new DateTime(2007, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, "After Colony 196\n\nOne year has passed since the war between Earth and its colonies ended. Heero, Duo, Trowa and Quatre bid farewell to their Gundams and jettison them to the sun. Relena Darlian is now the deputy minister of the Earth Sphere Unified Nation. But as the Gundam pilots are adjusting to the peace on Earth, Relena is kidnapped and a new threat appears, led by Marimeia Khushrenada—daughter of the late dictator Treize Khushrenada and heir to the Barton Foundation. To make matters more complicated, Gundam Nataku pilot Wufei has sided with this faction. The Gundam pilots must recover their mobile suits and once again engage in battle before Marimeia's forces succeed on their bid for global domination.\n\n(Source: ANN)", "Shin Kidou Senki Gundam Wing: Endless Waltz", null, "新機動戦記ガンダムＷ〈ウイング〉 Endless Waltz", 2, "https://myanimelist.net/manga/91444/Shin_Kidou_Senki_Gundam_Wing__Endless_Waltz", 2 },
                    { 91562, "", 12, new DateTime(2016, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/160919.jpg", 12538, 6.76m, new DateTime(2015, 2, 11, 16, 0, 0, 0, DateTimeKind.Local), 2, "Seeking for revenge, Count Saazbaum, a Martian, attacked the Earth. Later on, the war between the Terrans and Martians ended with Earth's Terrans gaining the victory. However, nineteen months later, the battle between them continues. Martians still continues to invade the Earth and the Terrans to protect it.\n\n(Source: ANN)", "Aldnoah.Zero 2nd Season", null, "ALDNOAH.ZERO 2nd Season", 1, "https://myanimelist.net/manga/91562/AldnoahZero_2nd_Season", 5 },
                    { 91706, "", null, new DateTime(2012, 10, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/161284.jpg", 36913, null, new DateTime(2012, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "In A.G. 101 (the 101st year of the Advanced Generation calendar) a mysterious entity known only as \"UE\", or \"unknown enemy\", attacks and destroys the space colony Angel. This brutal attack becomes infamous as the \"The Day the Angel Fell\", and marks the beginning of humanity's war for survival. \n\nThe series begins in A.G. 108 when the UE attack the space colony Ovan, where Flit Asuno lives with his mother. Flit's mother is killed by the UE, and in her belongings (in an object called a \"AGE Device\") he discovers the blueprints for a powerful weapon from the past - the ancient messiah named \"Gundam.\" \n\nFrom these blueprints, Flit spends the next several years studying engineering at an Earth Federation base on the Nora space colony and designing the AGE-1 Gundam. Seven years later, in A.G. 115, Flit completes the Gundam, just as the UE attack Nora. Flit and his lineage's battle piloting the AGE-1 to protect mankind is about to begin. \n\n(Source: GoodAnime.net)", "Kidou Senshi Gundam AGE", "Mobile Suit Gundam AGE", "機動戦士ガンダムＡＧＥ", 2, "https://myanimelist.net/manga/91706/Kidou_Senshi_Gundam_AGE", 5 },
                    { 91734, "", null, new DateTime(1997, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/161336.jpg", 36921, null, new DateTime(1995, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "In the Year FC 60, much of mankind inhabits space colonies which orbit the Earth. Dominance over the colonies is decided once every four years by a large tournament in which each nation sends a single representative to fight the others with a giant robot called a Gundam. Domon Kashuu is selected to represent Neo-Japan in one of these tournaments, but he fights less to ensure his nation's victory than to find his brother, who has been blamed for the deaths of Domon's parents and the disappearance of a very dangerous weapon, the Dark Gundam or Devil Gundam.\n\n(Source: ANN)", "Kidou Butouden G Gundam", null, "機動武闘伝Gガンダム", 2, "https://myanimelist.net/manga/91734/Kidou_Butouden_G_Gundam", 3 },
                    { 91971, "Fairy Tail Gaiden was published in English by Kodansha Comics USA from December 6, 2016, to October 23, 2018. It was also released in Brazilian Portuguese by Editora JBC from December 8, 2017, to April 20, 2018; and in Spanish by Norma Editorial from March 23, 2018, to October 31, 2018.", 52, new DateTime(2016, 9, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/171669.jpg", 6079, 7.19m, new DateTime(2015, 7, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "Fairy Tail Gaiden is a trilogy detailing the adventures of Sting and Rogue, Gajeel and Levy, and Laxus and the Thunder Tribe in separate volumes.\n\n1. Kengami no Souryuu (Twin Dragons of Sabertooth)\n2. Rhodonite\n3. Raigo Issen (Lightning Gods)", "Fairy Tail Gaiden", null, "FAIRY TAIL外伝", 1, "https://myanimelist.net/manga/91971/Fairy_Tail_Gaiden", 3 },
                    { 92131, "", 7, null, "https://cdn.myanimelist.net/images/manga/1/164766.jpg", 3498, 7.43m, new DateTime(2015, 8, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Boruto is the son of the 7th Hokage Naruto who completely rejects his father. Behind this, he has feelings of wanting to surpass Naruto, who is respected as a hero. He ends up meeting his father's friend Sasuke, and requests to become... his apprentice!? The curtain on the story of the new generation written by Masashi Kishimoto rises!\n\n(Source: ANN)", "Boruto: Naruto the Movie", null, "BORUTO -NARUTO THE MOVIE-", 2, "https://myanimelist.net/manga/92131/Boruto__Naruto_the_Movie", 1 },
                    { 92203, "Baccano! was simultaneously published in English by Yen Press on the same day as the Japanese release. It was published in print from January 30, 2018 to May 22, 2018.", 22, new DateTime(2017, 1, 5, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/172600.jpg", 2983, 7.49m, new DateTime(2015, 10, 15, 17, 0, 0, 0, DateTimeKind.Local), 2, "Aboard the Advenna Avis in 1711, a group of alchemists summon a demon in the hopes of gaining eternal life. The demon gives them an elixir of immortality and the method of ending their existence by \"devouring\" one another. Soon after, one among them begins to devour his companions. Realizing the danger posed by staying together, they scatter across the globe.\n\nCenturies later in 1930's America, a certain federal investigator tries his best to combat the rise of organized crime during Prohibition, send a particularly infuriating terrorist to Alcatraz, and catch an outrageous thief duo. Meanwhile, the transcontinental train, the Flying Pussyfoot, begins its trail of blood across the country.\n\nIn 2002, a small group of the original Advenna Avis alchemists are on a journey to find the rest of their fellow immortals. However, there is one companion they did not expect to meet again.\n\nSeemingly unrelated events, from a sleepy Italian city in the early 1700's to a modern luxury cruise ship traveling across the Pacific, reveal themselves to be far more connected than anyone could imagine...\n\n(Source: Wikipedia, MAL Rewrite)", "Baccano!", "Baccano!", "BACCANO!", 1, "https://myanimelist.net/manga/92203/Baccano", 3 },
                    { 92286, "Special one-shot included in the Naruto: Hiden - Zai no Sho - Official Movie Book (NARUTO 秘伝・在の書 オフィシャルムービーBOOK) guidebook, which was distributed exclusively at the screening of the movie.", 1, null, "https://cdn.myanimelist.net/images/manga/2/171855.jpg", 7826, 7.06m, new DateTime(2015, 8, 6, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story shows Naruto Uzumaki's Hokage inauguration day.", "Boruto: Naruto the Movie Tokubetsu Bangai-hen - Naruto ga Hokage ni Natta Hi", null, "BORUTO -NARUTO THE MOVIE- 特別番外編 ナルトが火影になった日", 3, "https://myanimelist.net/manga/92286/Boruto__Naruto_the_Movie_Tokubetsu_Bangai-hen_-_Naruto_ga_Hokage_ni_Natta_Hi", null },
                    { 92299, "While Chapter 83 of Berserk, \"Shinen no Kami (2),\" was initially released in Issue 14 of the 1996 Young Animal magazine, it was omitted from the Volume 13 release of Berserk at the author's request (he felt that the chapter gave away too much information too early in the story), making the magazine issue a collector's item.", 1, null, "https://cdn.myanimelist.net/images/manga/1/162254.jpg", 153, 8.49m, new DateTime(1996, 7, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "When Griffith realizes that he will no longer be able to actualize his dream in his debilitated state, he wishes upon his Crimson Behelit as a final resort. Doing so triggers the \"Eclipse\"—a ritual in which the invoker sacrifices something of significance in exchange for great power. Griffith ultimately chooses to offer his legion of devoted followers, the Band of the Hawk.\n\nSubsequently, Griffith transcends to the Abyss where he faces an enormous entity akin to God. The being introduces itself as the Idea of Evil. Coveted into existence by humanity's collective subconsciousness, it has gone on to manipulate the lives of humans throughout all world events.\n\nAs Griffith now exists as a part of the human consciousness, present in the Abyss, the Idea of Evil eerily declares \"Your desire is my desire... May your actions bring pain or salvation to mankind. Do as you will, Chosen One.\" With that, Griffith harvests the pain of his comrades to transform into his ideal self.\n\n[Written by MAL Rewrite]", "Berserk: Shinen no Kami 2", null, "ベルセルク 深淵の神②", 3, "https://myanimelist.net/manga/92299/Berserk__Shinen_no_Kami_2", null },
                    { 92625, "Sword Art Online Alternative: Gun Gale Online was published in English by Yen Press from November 14, 2017 to January 25, 2022.", 20, new DateTime(2021, 1, 26, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/184352.jpg", 5062, 7.27m, new DateTime(2015, 10, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story follows Karen Kohiruimaki, a 183-centimeter-tall (6-foot-tall) college student who's insecure about her height, and is bad at dealing with people in the real world. She enters the world of Gun Gale Online with her avatar, Ren, who is less than 150 centimeters (5 feet) tall and wears all pink. She meets a beautiful, brown-skinned female player who goes by Pitohui. They hit it off, but one day Pitohui pressures her to participate in \"Squad Jam,\" a team battle royale variation of the Bullet of Bullets tournament.\n\n(Source: ANN)", "Sword Art Online Alternative: Gun Gale Online", "Sword Art Online Alternative: Gun Gale Online", "ソードアート・オンライン オルタナティブ ガンゲイル・オンライン", 1, "https://myanimelist.net/manga/92625/Sword_Art_Online_Alternative__Gun_Gale_Online", 4 },
                    { 92826, null, 12, null, "https://cdn.myanimelist.net/images/manga/1/163494.jpg", 10394, 6.9m, new DateTime(2015, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Shinmai Maou no Testament: Light!", "The Testament of Sister New Devil", "新妹魔王の契約者〈テスタメント〉 LIGHT!", 2, "https://myanimelist.net/manga/92826/Shinmai_Maou_no_Testament__Light", 1 },
                    { 92833, "", 30, new DateTime(2007, 6, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/4/163524.jpg", 37265, null, new DateTime(2004, 5, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Based on the Toei anime version of the 70's, crossover with Devilman, Mazinger Z, Great Mazinger, Grendizer, and Cutie Honey.", "Dynamic Heroes", null, "ダイナミックヒーローズ", 1, "https://myanimelist.net/manga/92833/Dynamic_Heroes", 4 },
                    { 92838, "", 5, new DateTime(2011, 12, 18, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/171859.jpg", 37267, null, new DateTime(2011, 8, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "Crossover manga beteen Maou Dante and Getter Robo G.", "Maou Dante Tai Getter Robo G", "Demon Lord Dante vs. Getter Robo G", "魔王ダンテ対ゲッターロボG", 1, "https://myanimelist.net/manga/92838/Maou_Dante_Tai_Getter_Robo_G", 1 },
                    { 92839, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/163529.jpg", 17322, 6.37m, new DateTime(1998, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "Crossover one-shot between Mazinkaiser and Shin Getter Robo. It was included in Immortal Super Robot Encyclopedia (不滅のスーパーロボット大全).\n\nThe manga begins with the Mazinger Z and Great Mazinger fighting against an alien machine after the Diana A and Venus A have been taken down.\n\n(Source: Mazinger Wikia)", "Mazinkaiser Tai Shin Getter Robo", null, "マジンカイザー対真ゲッターロボ", 3, "https://myanimelist.net/manga/92839/Mazinkaiser_Tai_Shin_Getter_Robo", null },
                    { 92905, "The chapters were released to commemorate the theatrical opening of the live-action Bakuman. film. They were collected in the artbook Eiga Bakuman. Obata Takeshi Illustration Works (映画バクマン。 小畑健イラストワークス) which was published on October 2, 2015.", 2, new DateTime(2015, 9, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/164254.jpg", 3721, 7.41m, new DateTime(2015, 9, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "While most kids his age like to play around for fun, 13-year-old Akito Takagi is determined to find his ambition in life. Manga has been his sole source of inspiration since he was a child; he always engages in reading manga when he takes a break from studying. Within school, Takagi never misses a beat, ranking first in every exam he has taken. However, this does not stop him from constantly worrying about his future, and, despite his indifference, he hopes that he can finally find a true friend he can share his destiny with.\n\nSubsequently, spurred by his love for manga, Takagi resolves himself into becoming a manga author. But before he can begin pursuing his dream, he must overcome one problem—to find an artist who would be willing to make manga with him.\n\n[Written by MAL Rewrite]", "Bakuman. Bangai-hen", null, "バクマン。 番外編", 1, "https://myanimelist.net/manga/92905/Bakuman_Bangai-hen", null },
                    { 92906, "", null, null, "https://cdn.myanimelist.net/images/manga/3/164984.jpg", 37292, null, new DateTime(2015, 10, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "Perfect Crime Party is about three elementary school children who decide to form a Perfect Crime Club, performing seamless acts of crime. At the beginning of the series, their crimes are as simple as putting a dirty tray on the desk of a boy that already took returned his tray without being caught, or switching seemingly identical items. The plot follows the group's efforts to commit perfect crimes within their school.\n\n(Source: Bakuman Wikia)", "PCP: Kotou no Kodomotachi", null, "PCP-完全犯罪党- 孤島の子供たち", 2, "https://myanimelist.net/manga/92906/PCP__Kotou_no_Kodomotachi", 1 },
                    { 93027, null, null, null, "https://cdn.myanimelist.net/images/manga/3/165948.jpg", 5346, 7.25m, new DateTime(2015, 9, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Bakuman.", null, "バクマン。", 2, "https://myanimelist.net/manga/93027/Bakuman", 1 },
                    { 93088, "Getter Robo Devolution: Uchuu Saigo no 3-punkan is a full remake of the original Getter Robo series. The series was published in English as Getter Robo Devolution by Seven Seas Entertainment from June 26, 2018 to October 20, 2020.", 38, new DateTime(2019, 6, 11, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/286719.jpg", 11193, 6.84m, new DateTime(2015, 9, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "They call them Devolved—strange alien creatures that attack our world through distortions in space. Tragedy has always haunted Ryouma, and when his high school comes under alien attack, he figures it's just the latest chapter in a long history of suffering. Yet beneath the monster's deadly glare, a strange professor steps forth with an offer of power. Ryouma is touched by the Getter Rays, a mysterious cosmic force that grants the power to pilot the ultimate fighting machine: Getter Robo!\n\n(Source: Seven Seas Entertainment)", "Getter Robo Devolution: Uchuu Saigo no 3-punkan", "Getter Robo Devolution", "ゲッターロボ DEVOLUTION ～宇宙最後の3分間～", 1, "https://myanimelist.net/manga/93088/Getter_Robo_Devolution__Uchuu_Saigo_no_3-punkan", 5 },
                    { 93097, "", 155, new DateTime(2017, 1, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/181555.jpg", 152, 8.5m, new DateTime(2015, 10, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "Oddities have existed throughout history, with some tales of them dating back to 600 years ago. Stories about vampires, a monkey's paw, shikigami, wanderers in the mountain mist, murderous felines, mermaids, wolves, golems, and, most terrifying of all, humans, have been collected by so-called \"oddity specialists.\" The purpose of these specialists is to combat, regulate, and, most importantly, solve the many mysteries behind the circumstances these oddities create.\n\nMonogatari Series: Off Season follows eight protagonists—some specialists, some oddities themselves—as they interact with the world of aberrations, often landing themselves in dangerous situations due to their own mischievous doings.\n\n[Written by MAL Rewrite]", "Monogatari Series: Off Season", null, "〈物語〉シリーズ オフシーズン", 2, "https://myanimelist.net/manga/93097/Monogatari_Series__Off_Season", 4 },
                    { 93234, "", 44, new DateTime(2019, 6, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/180909.jpg", 1980, 7.65m, new DateTime(2015, 12, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "Manga adaptation of the 4th arc of the Mahouka Koukou no Rettousei series.", "Mahouka Koukou no Rettousei: Raihousha-hen", null, "魔法科高校の劣等生 来訪者編", 1, "https://myanimelist.net/manga/93234/Mahouka_Koukou_no_Rettousei__Raihousha-hen", 7 },
                    { 93314, "Seirei Gensouki has been published digitally in English as Seirei Gensouki: Spirit Chronicles by J-Novel Club since August 29, 2018, and in print since March 2, 2021.", null, null, "https://cdn.myanimelist.net/images/manga/3/164868.jpg", 1890, 7.67m, new DateTime(2015, 9, 30, 17, 0, 0, 0, DateTimeKind.Local), 4, "Meet Rio: a callous orphaned boy living in the slums. At only 7-years-old, he realizes he's actually the reincarnation of Haruto Amakawa, a Japanese university student with a tragic past. While still reeling from this shocking epiphany, Rio also comes to learn that he possesses extremely potent magical abilities and uses his new powers to solve the kidnapping case of a little girl. His good deed is acknowledged, and he's rewarded by being enrolled into... a prestigious academy for noble children...?\n\n(Source: J-Novel Club)", "Seirei Gensouki", "Seirei Gensouki: Spirit Chronicles", "精霊幻想記", 2, "https://myanimelist.net/manga/93314/Seirei_Gensouki", null },
                    { 93326, "", 8, new DateTime(2003, 1, 24, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/164881.jpg", 37434, null, new DateTime(2002, 3, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "Omnibus of stories by various light novel authors centered on \"One Year War.\"", "Gundam Novels: Senkou to Natta Senshi-tachi", null, "ガンダムNOVELS―閃光となった戦士たち―", 2, "https://myanimelist.net/manga/93326/Gundam_Novels__Senkou_to_Natta_Senshi-tachi", 1 },
                    { 93353, "", 33, new DateTime(2019, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/186156.jpg", 6869, 7.13m, new DateTime(2015, 10, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "The world needs heroes. Kunugigaoka Magical Academy has a distinguished track record of turning out the greatest heroes in the kingdom. As a result, the students are held to extremely high standards. When a group of students consistently fails to live up to these expectations, they find themselves the target of ridicule, contempt, and discrimination in the \"E\" or End-Class.\"\n\nBefore they can give up, suddenly the Demon King appears before the class. He explains that their quirky hidden abilities, which seem to be the cause of their failure, are actually a sign that they are all special individuals. The archenemy of humanity also announces that he will act as Class-E's homeroom teacher with the sole purpose of nurturing them into heroes capable of killing him.\n\nUnder the supervision of this unkillable teacher, Koro-sensei, and the captain of the Royal Knights, Tadaomi Karasuma, Class-E embarks upon the ultimate quest. Against the opposition of their enemies—such as the Five Virtuosos, the Pope, and various monsters—the students must learn how to kill their teacher, the Big Bad, himself.\n\n[Written by MAL Rewrite]", "Koro-sensei Q!", null, "殺せんせーQ!", 1, "https://myanimelist.net/manga/93353/Koro-sensei_Q", 5 },
                    { 93408, "", 13, new DateTime(2016, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/173952.jpg", 2900, 7.5m, new DateTime(2015, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "300 years after the Calamity War's end.\n\nThe powers which ruled the Earth Sphere have been overthrown, giving way to new rulers of a new world, exhausted of battle. Meanwhile, far away on Mars, the sparks which threaten to ignite a new war have been struck...\n\nOur protagonist Mikazuki Augus, a member of the private security firm Chryse Guard Security (CGS), takes on a mission as bodyguard of Kudelia Aina Bernstein, a young girl who agitates for Chryse's independence from Earth. However, when the elite Gjallarhorn unit, charged with suppressing revolutionaries, raids CGS, its higher-ups deliberately use Mikazuki and the other boys as a decoy to cover their own retreat. Orga Itsuka, leader of the boys' squad, takes this abandonment by the adults as motivation to launch a full-fledged coup d'état. With orders from Orga to hold back Gjallarhorn, Mikazuki sorties in Calamity War-era scrap that CGS had been using as a generator—the Gundam Barbatos...\n\n(Source: Gundam.info)", "Kidou Senshi Gundam: Tekketsu no Orphans", "Mobile Suit Gundam: Iron-Blooded Orphans", "機動戦士ガンダム 鉄血のオルフェンズ", 1, "https://myanimelist.net/manga/93408/Kidou_Senshi_Gundam__Tekketsu_no_Orphans", 3 },
                    { 93595, "", 2, new DateTime(2002, 3, 11, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/165452.jpg", 4549, 7.32m, new DateTime(2002, 3, 4, 16, 0, 0, 0, DateTimeKind.Local), 2, "Original two-part pilot one-shot for Eyeshield 21. It was later collected in the official databook published on October 4, 2005.", "Eyeshield 21", null, "アイシールド21", 1, "https://myanimelist.net/manga/93595/Eyeshield_21", null },
                    { 93691, "", 5, new DateTime(2015, 12, 27, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/173360.jpg", 11428, 6.83m, new DateTime(2015, 9, 2, 17, 0, 0, 0, DateTimeKind.Local), 2, "The protagonist who longs to be a magic user... meets a certain man!?", "Little Witch Academia: Tsukiyo no Oukan", null, "リトルウィッチアカデミア 月夜の王冠", 1, "https://myanimelist.net/manga/93691/Little_Witch_Academia__Tsukiyo_no_Oukan", 1 },
                    { 93692, "", 5, new DateTime(2015, 11, 18, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/172298.jpg", 10346, 6.9m, new DateTime(2013, 8, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "In her admiration of Shiny Chariot, a famous witch renowned for her unorthodox yet enchanting spells, Kagari Akko, an ordinary girl, joined Witch Academia in the hope of someday becoming as spectacular as Shiny Chariot. She is determined to become a graduate of Witch Academy and make her dream come true despite not being from a lineage with witchcraft and wizardry.\n\nThe story takes places when Akko, along with her two best friends, Lotte Yansson and Sucy Manbavaran, take their first lessons to become witches; however, Akko is furious when she finds out that Shiny Chariot is not as popular in the world of the witches as she had thought.", "Little Witch Academia", null, "リトルウィッチアカデミア", 1, "https://myanimelist.net/manga/93692/Little_Witch_Academia", 1 },
                    { 93698, "", 14, new DateTime(2016, 12, 8, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/175690.jpg", 5961, 7.2m, new DateTime(2015, 11, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, "A spin-off of Trinity Seven: 7-nin no Mashotsukai focused on Levi Kazama.", "Trinity Seven: Levi Ninden", null, "トリニティセブン レヴィ忍伝", 1, "https://myanimelist.net/manga/93698/Trinity_Seven__Levi_Ninden", 3 },
                    { 93820, "Lupin III (2015) is based on original TV anime series of the same title, which itself is based on Monkey Punch's manga series Lupin III.", 21, new DateTime(2016, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/171362.jpg", 37598, null, new DateTime(2015, 10, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "The first chapter portrays the wedding between Lupin and Rebecca as seen in the anime's first episode.", "Lupin III (2015)", "Lupin the Third Italiano", "ルパン三世", 1, "https://myanimelist.net/manga/93820/Lupin_III_2015", 4 },
                    { 93831, "", 28, new DateTime(2015, 10, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/167202.jpg", 37599, null, new DateTime(2013, 7, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "The main crew of White Base from Kidou Senshi Gundam, including the 19-year-old Bright, the good-looking office lady Sayla, and moody teenager Amuro lead peaceful, slow-paced lives in the same apartment building.", "Apartment of Gundam", null, "アパートメント・オブ・ガンダム", 1, "https://myanimelist.net/manga/93831/Apartment_of_Gundam", 4 },
                    { 93912, "Gundam Build Fighters is based on original TV anime series of the same title.", 18, new DateTime(2015, 10, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/172282.jpg", 31934, null, new DateTime(2015, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "The story is set in the near future when GunPla Battles, competitions that pit Gundam plastic models against each other, have become popular worldwide in the \"Second GunPla Boom.\" Sei Iori, a first-year middle-school student and the only son of a model shop owner, is talented at building GunPla, but inexperienced in the GunPla Battles. He encounters a mysterious boy named Reiji, who happens to be an accomplished Gundam Fighter. Together, they strive for the GunPla Battle world championships.\n\n(Source: ANN)", "Gundam Build Fighters", null, "ガンダムビルドファイターズ", 2, "https://myanimelist.net/manga/93912/Gundam_Build_Fighters", 2 },
                    { 93979, "", 76, new DateTime(2017, 10, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/180367.jpg", 13693, 6.68m, new DateTime(2015, 11, 27, 16, 0, 0, 0, DateTimeKind.Local), 2, "The manga imagines what would happen if the setting of Nanatsu no Taizai was instead of a live-action TV drama production. In the manga, Meliodas is an actor who plays the role of a child genius. The manga will show the bad habits of the actors during filming and their everyday lives.\n\n(Source: ANN)", "Nanatsu no Taizai Production", null, "七つの大罪プロダクション", 1, "https://myanimelist.net/manga/93979/Nanatsu_no_Taizai_Production", 4 },
                    { 93982, null, 60, new DateTime(2016, 12, 1, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/166546.jpg", 37633, null, new DateTime(2011, 12, 2, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Gourmet Gakuen Toriko", null, "グルメ学園トリコ", 1, "https://myanimelist.net/manga/93982/Gourmet_Gakuen_Toriko", 9 },
                    { 94175, "", null, null, "https://cdn.myanimelist.net/images/manga/1/170721.jpg", 2044, 7.64m, new DateTime(2014, 10, 14, 17, 0, 0, 0, DateTimeKind.Local), 4, "Twenty-five-year-old Kakushidate Yakusuke suffers from the fate of constantly stumbling into various crime scenes and ending up being the main suspect.\n\nHis last resort: Okitegami Kyouko the \"Quickest Detective.\" However, Kyouko suffers from a strange case of amnesia; whenever she falls asleep, she forgets everything that happened the previous day, making her solve the mysteries within one day.", "Boukyaku Tantei Series", null, "忘却探偵シリーズ", 2, "https://myanimelist.net/manga/94175/Boukyaku_Tantei_Series", null },
                    { 94392, "", null, new DateTime(2016, 7, 26, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/167393.jpg", 37776, null, new DateTime(2015, 2, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "A series of side stories that were bundled with the first press release of all 18 Blu-ray/DVD volumes of the 2nd season of the anime.", "Durarara!! 18 Shiryaku", null, "デュラララ!! 十八史略", 2, "https://myanimelist.net/manga/94392/Durarara_18_Shiryaku", 18 },
                    { 94533, "One Piece: Taose! Kaizoku Ganzack is based on the OVA of the same title, which was the animation debut of the One Piece series.", null, null, "https://cdn.myanimelist.net/images/manga/2/178412.jpg", 13160, 6.72m, new DateTime(1999, 6, 2, 17, 0, 0, 0, DateTimeKind.Local), 2, "While Luffy and his crew of Zoro and Nami are starving on their small boat, they are attacked by a large monster. Nami is taken away, while Luffy and Zoro wash up on shore. There they meet a young girl, Medaka, and learn of the sad history of the island. The evil Pirate Ganzack has taken away all the men in the village and enslaved them, including Medaka's father. Now Luffy, Zoro, and Medaka must infiltrate Ganzack's base in order to rescue the villagers and Nami.\n\n(Source: ANN)", "One Piece: Taose! Kaizoku Ganzack", null, "ONE PIECE 倒せ!海賊ギャンザック", 2, "https://myanimelist.net/manga/94533/One_Piece__Taose_Kaizoku_Ganzack", 1 },
                    { 94534, "", null, null, "https://cdn.myanimelist.net/images/manga/3/270719.jpg", 7712, 7.07m, new DateTime(2000, 7, 16, 17, 0, 0, 0, DateTimeKind.Local), 2, "One Piece: Loguetown Arc is a novelization of Eiichiro Oda's intended story elements for the Loguetown Arc, later used in the anime as a filler.\n\n(Source: One Piece Wikia)", "One Piece: Loguetown-hen", null, "ONE PIECE ローグタウン編", 2, "https://myanimelist.net/manga/94534/One_Piece__Loguetown-hen", 1 },
