                    { 94838, "Lupin Kozou was left unfinished after Shounen Action ceased publication in August 1976.", 18, new DateTime(1976, 8, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/220679.jpg", 37943, null, new DateTime(1975, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 2, "Spin-off about Lupin's son.", "Lupin Kozou", null, "ルパン小僧", 1, "https://myanimelist.net/manga/94838/Lupin_Kozou", 2 },
                    { 94856, "", 1, null, "https://cdn.myanimelist.net/images/manga/2/168889.jpg", 8170, 7.04m, new DateTime(2015, 12, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "Special xxxHOLiC story inspired by Shikao Suga's song Anata Hitori dake Shiawase ni Naru Koto wa Yurusarenai no yo, from the album \"THE LAST\" released on January 20, 2016.", "xxxHOLiC Tokubetsu-hen", null, "『xxxHOLiC』特別編 inspired by スガシカオ『あなたひとりだけ 幸せになることは 許されないのよ』", 3, "https://myanimelist.net/manga/94856/xxxHOLiC_Tokubetsu-hen", null },
