                    { 133343, "", 8, new DateTime(2019, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/252959.jpg", 26940, null, new DateTime(2019, 5, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, "Manga adaptation of the twenty-second Meitantei Conan movie.", "Meitantei Conan: Zero no Shikkounin", "Detective Conan the Movie: Zero the Enforcer", "名探偵コナン ゼロの執行人", 1, "https://myanimelist.net/manga/133343/Meitantei_Conan__Zero_no_Shikkounin", 2 },
                    { 133352, "Gimai Seikatsu has been published in English as Days with My Stepsister by Yen Press under the Yen On imprint since October 24, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/2/240697.jpg", 438, 8.19m, new DateTime(2021, 1, 24, 16, 0, 0, 0, DateTimeKind.Local), 4, "When his father remarries, Yuuta Asamura winds up sharing a roof with a brand-new stepsister, who is also the hottest girl in his grade! But Yuuta and his new sister, Saki Ayase, have no delusions—they both carry trauma from their parents' difficult divorces, and they agree to keep a respectful distance. As it turns out, however, the two have a lot in common, and slowly, cautiously, they grow closer. But is the emotion blooming between them simple admiration, familial love, or something more?\n\n(Source: Yen Press)", "Gimai Seikatsu", "Days with My Stepsister", "義妹生活", 2, "https://myanimelist.net/manga/133352/Gimai_Seikatsu", null },
                    { 133498, "", 1, null, "https://cdn.myanimelist.net/images/manga/1/240819.jpg", 8820, 7m, new DateTime(2019, 8, 28, 17, 0, 0, 0, DateTimeKind.Local), 2, "Garaku, a city where murders occur frequently. A young man involved with the yakuza saw an old man resting with a katana on a bench.", "Garaku", null, "骸区", 3, "https://myanimelist.net/manga/133498/Garaku", null },
                    { 133521, "", null, null, "https://cdn.myanimelist.net/images/manga/1/246667.jpg", 26970, null, new DateTime(2020, 12, 18, 16, 0, 0, 0, DateTimeKind.Local), 4, "A high school student suffers an accident and wakes up in Elysion in the world of the dead. In search of answers, he meets Hades, the god of the underworld.\n\n(Source: MangaDex, edited)", "Saint Seiya: Meiou Iden - Dark Wing", "Saint Seiya: Another Story of Hades - \"Dark Wing\"", "聖闘士星矢 冥王異伝 ダークウィング", 1, "https://myanimelist.net/manga/133521/Saint_Seiya__Meiou_Iden_-_Dark_Wing", null },
                    { 133542, "", 15, new DateTime(2022, 2, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/245708.jpg", 15437, 6.55m, new DateTime(2020, 4, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "The Prison Planet was only the beginning of Fu's experiments... Based on the experimental data collected at the Prison Planet, Fu finally begins his real experiment! What is Fu's real goal, and what is his real power? Goku and companions from Dark Demon Realm Mission and Universe Mission appear! An experiment involving the whole universe and space-time!\n\n(Source: Dragon Ball Wiki)", "Super Dragon Ball Heroes: Big Bang Mission!!!", null, "スーパードラゴンボールヒーローズ ビッグバンミッション!!!", 1, "https://myanimelist.net/manga/133542/Super_Dragon_Ball_Heroes__Big_Bang_Mission", 3 },
                    { 133638, "", null, null, "https://cdn.myanimelist.net/images/manga/1/241177.jpg", 26993, null, new DateTime(2019, 3, 14, 17, 0, 0, 0, DateTimeKind.Local), 4, "The Ultraman franchise and Osomatsu-san both share a common theme of six brothers, naturally leading them to unite. Set in the world of Osomatsu-san's fictional “Akatsuka Ward” in the city of Tokyo, what lengths will the Ultra-Matsu brothers go to protect their peaceful lives as NEETs?\n\n(Source: LINE, translated)", "Ulmatsu-san", null, "ウル松さん", 1, "https://myanimelist.net/manga/133638/Ulmatsu-san", null },
                    { 133787, null, 18, new DateTime(2017, 4, 27, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/262146.jpg", 27028, null, new DateTime(2016, 8, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Kono Subarashii Sekai ni Shukufuku wo! Kappore!", null, "この素晴らしい世界に祝福を！かっぽれ！", 1, "https://myanimelist.net/manga/133787/Kono_Subarashii_Sekai_ni_Shukufuku_wo_Kappore", 2 },
                    { 133788, null, 16, new DateTime(2020, 1, 23, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/249780.jpg", 27029, null, new DateTime(2018, 1, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Kono Subarashii Sekai ni Shukufuku wo! Extra: Ano Orokamono ni mo Kyakkou wo!", null, "この素晴らしい世界に祝福を！エクストラ あの愚か者にも脚光を！", 1, "https://myanimelist.net/manga/133788/Kono_Subarashii_Sekai_ni_Shukufuku_wo_Extra__Ano_Orokamono_ni_mo_Kyakkou_wo", 2 },
                    { 134341, "Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san began as a web novel on Shousetsuka ni Narou on May 6, 2020. Kadokawa has released a revised and illustrated version of the series since February 27, 2021, under its Kadokawa Sneaker Bunko label. The series ranked ninth in the 2022 Kono Light Novel ga Sugoi! for the Light Novel division. The series has been published in English as Alya Sometimes Hides Her Feelings in Russian by Yen Press under the Yen On imprint since November 22, 2022. To celebrate the release of the second volume, the light novel's female protagonist Alisa debuted as a virtual Youtuber on July 29, 2021, being the first official announcement of its kind in light novel history.", null, null, "https://cdn.myanimelist.net/images/manga/3/241840.jpg", 437, 8.19m, new DateTime(2021, 2, 26, 16, 0, 0, 0, DateTimeKind.Local), 4, "Smart, refined, and strikingly gorgeous, half-Russian half-Japanese Alisa Mikhailovna Kujou is considered the idol of her school. With her long silver hair, mesmerizing blue eyes, and exceptionally fair skin, she has captured the hearts of countless male students while being highly admired by all others. Even so, due to her seemingly unapproachable persona, everyone remains wary around the near-flawless girl.\n\nOne of the few exceptions is Alisa's benchmate Masachika Kuze, a relatively average boy who spends his days watching anime and playing gacha games. Despite his nonchalant demeanor, Masachika is the sole student to receive Alisa's attention. Unable to be fully honest, Alisa is frequently harsh on Masachika and only expresses her affection in Russian. Unbeknownst to her, however, Masachika actually understands the language yet simply pretends otherwise for his own amusement.\n\nAs the odd pair continues to exchange witty and playful remarks, their relationship gradually grows more romantic and delightful—and Alisa might finally learn to freely convey her true feelings.\n\n[Written by MAL Rewrite]", "Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san", "Alya Sometimes Hides Her Feelings in Russian", "時々ボソッとロシア語でデレる隣のアーリャさん", 2, "https://myanimelist.net/manga/134341/Tokidoki_Bosotto_Russia-go_de_Dereru_Tonari_no_Alya-san", null },
