                    { 134557, null, 6, null, "https://cdn.myanimelist.net/images/manga/3/248841.jpg", 27147, null, new DateTime(2019, 9, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Jigokuraku: Utakata no Yume", null, "地獄楽 うたかたの夢", 2, "https://myanimelist.net/manga/134557/Jigokuraku__Utakata_no_Yume", 1 },
                    { 134732, "", 2, null, "https://cdn.myanimelist.net/images/manga/3/309554.jpg", 27182, null, new DateTime(2018, 8, 17, 17, 0, 0, 0, DateTimeKind.Local), 2, "A booklet of side stories distributed to those who watched Nanatsu no Taizai: Tenkuu no Torawarebito in theaters.", "Nanatsu no Taizai: Tenkuu no Torawarebito", null, "七つの大罪 天空の囚われ人", 1, "https://myanimelist.net/manga/134732/Nanatsu_no_Taizai__Tenkuu_no_Torawarebito", 1 },
                    { 134946, "Tensei Kizoku, Kantei Skill de Nariagaru: Jakushou Ryouchi wo Uketsuida node, Yuushuu na Jinzai wo Fuyashiteitara, Saikyou Ryouchi ni Natteta has been published in English by Kodansha USA under the Vertical imprint since March 14, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/1/242653.jpg", 12273, 6.77m, new DateTime(2020, 7, 1, 17, 0, 0, 0, DateTimeKind.Local), 4, "An ordinary salaryman dies one day and is reborn as Ars Louvent, the son of a noble. Although he isn't talented in magic or swordplay, he does have one skill that no one else possesses: Appraisal. Using this ability, Ars can determine a person's current strength, how much potential they hold, and where their talents rest.\n\nThis skill is especially useful in the present situation of the country. The government is corrupt, revolts occur more often than not, and nobles far and wide are strengthening their fortifications in preparation for an all-out war. With this in mind, Ars realizes he too must prepare by gathering talented people.\n\nA persecuted foreigner unparalleled with the sword, a slave with an unknown talent for magic, and a timid boy with an unquenchable thirst for knowledge—such talents lend Ars their support as he aims to create the most powerful territory.\n\n[Written by MAL Rewrite]", "Tensei Kizoku, Kantei Skill de Nariagaru: Jakushou Ryouchi wo Uketsuida node, Yuushuu na Jinzai wo Fuyashiteitara, Saikyou Ryouchi ni Natteta", "As a Reincarnated Aristocrat, I'll Use My Appraisal Skill to Rise in the World", "転生貴族、鑑定スキルで成り上がる～弱小領地を受け継いだので、優秀な人材を増やしていたら、最強領地になってた～", 2, "https://myanimelist.net/manga/134946/Tensei_Kizoku_Kantei_Skill_de_Nariagaru__Jakushou_Ryouchi_wo_Uketsuida_node_Yuushuu_na_Jinzai_wo_Fuyashiteitara_Saikyou_Ryouchi_ni_Natteta", null },
                    { 135181, "", 14, new DateTime(2018, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/246206.jpg", 27237, null, new DateTime(2017, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "The prequel manga is based on the \"Sengo no Sensou\" (The Postwar War) short story that appears in the 11th volume of Harutoshi Fukui's original Mobile Suit Gundam UC novels. The story centers on the Neo Zeon remnants' hijacking of the Sinanju Stein mobile suit.\n\n(Source: Anime News Network)", "Kidou Senshi Gundam Unicorn: Bande Dessinee - Episode:0", null, "機動戦士ガンダムUC バンデシネ Episode:0", 1, "https://myanimelist.net/manga/135181/Kidou_Senshi_Gundam_Unicorn__Bande_Dessinee_-_Episode_0", 3 },
                    { 135242, "", 6, new DateTime(2019, 8, 4, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/242940.jpg", 27247, null, new DateTime(2019, 4, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "Frederica Hanashiro from the Ministry of Foreign Affairs visits the Public Safety Bureau with the intent to make an offer to Teppei Sugou, one of the current Division 01 Enforcers. Since Sugou was once an ace pilot in the National Defense Army, Frederica gives him the opportunity to clear his status as a latent criminal and rejoin the military.\n\nAs he considers the offer, Sugou recalls his days in the army. While carrying out a mission, Sugou's First Guardian drone was ordered to drop supplies and abandon a ground unit—including his commanding officer, Itsuki Ootomo. All of the members in the group were proclaimed missing, but it was evident that they marched to their deaths.\n\nHowever, three months later, during a massacre at the Ministry of Defense, the security cameras caught none other than Ootomo at the scene. Now considered a suspect in aiding a terrorist attack, Sugou works together with Inspector Risa Aoyanagi and Enforcer Tomomi Masaoka to get to the bottom of the case.\n\n[Written by MAL Rewrite]", "Psycho-Pass: Sinners of the System Case.2 - First Guardian", null, "PSYCHO-PASS サイコパス Sinners of the System 「Case.2 First Guardian」", 1, "https://myanimelist.net/manga/135242/Psycho-Pass__Sinners_of_the_System_Case2_-_First_Guardian", 1 },
                    { 135262, null, null, null, "https://cdn.myanimelist.net/images/manga/2/243510.jpg", 27249, null, new DateTime(2014, 4, 27, 17, 0, 0, 0, DateTimeKind.Local), 4, null, "Mahouka Koukou no Rettousei: Yonkoma-hen", null, "魔法科高校の劣等生 よんこま編", 1, "https://myanimelist.net/manga/135262/Mahouka_Koukou_no_Rettousei__Yonkoma-hen", null },
                    { 135455, "Shikanoko Nokonoko Koshitantan has been published in English as My Deer Friend Nokotan by Seven Seas Entertainment since March 15, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/2/243191.jpg", 3347, 7.44m, new DateTime(2019, 11, 14, 16, 0, 0, 0, DateTimeKind.Local), 4, "No one knows Torako used to be a delinquent. All of her classmates only know her as the perfect student. But everything changes when Nokotan, a transfer student with antlers, enters her life. Antlers aren't the only thing strange about Nokotan. Her deer nose can sniff out Torako's secret past! Whether it's at school or the zoo, chaos follows this doe-eyed girl's every step. Torako has so many questions! Is Nokotan a deer, a girl, or something in-between?\n\n(Source: Seven Seas Entertainment)", "Shikanoko Nokonoko Koshitantan", "My Deer Friend Nokotan", "しかのこのこのここしたんたん", 1, "https://myanimelist.net/manga/135455/Shikanoko_Nokonoko_Koshitantan", null },
                    { 135496, "Dandadan ranked fourth in the 2022 Kono Manga ga Sugoi! for the Male Readers division. The manga was nominated for the 15th Manga Taisho Award in 2022 and ranked seventh in the final ranking. The series has been simulpub digitally in English through MANGA Plus. The volumes have been published in English by VIZ Media under the Shonen Jump imprint since October 11, 2022. It has also been released in Italian by J-POP since September 21, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/2/248746.jpg", 222, 8.39m, new DateTime(2021, 4, 5, 17, 0, 0, 0, DateTimeKind.Local), 4, "After being aggressively rejected, Momo Ayase finds herself sulking when she stumbles across a boy being bullied. Saved by her rash kindness, the occult-obsessed boy attempts to speak to her about supernatural interests he believes they share. Rejecting his claims, Ayase proclaimed that she instead is a believer in ghosts, starting an argument between the two over which is real.\n\nIn a bet to determine who is correct, the two decide to separately visit locations associated with both the occult and the supernatural—Ayase visiting the former and the boy visiting the latter. When the two reach their respective places, it turns out that neither was wrong and that both the occult and ghosts do exist.\n\nThis marks the beginning of Ayase and the boy's adventure, as they attempt to fix the surreal, supernatural, and occult elements around them to return to a normal life.\n\n[Written by MAL Rewrite]", "Dandadan", "Dandadan", "ダンダダン", 1, "https://myanimelist.net/manga/135496/Dandadan", null },
                    { 135545, "Ao no Hako is published digitally as an English simulpub as Blue Box through MANGA Plus service. The volumes have been published by VIZ Media under the Shonen Jump imprint since November 1, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/2/248748.jpg", 477, 8.16m, new DateTime(2021, 4, 11, 17, 0, 0, 0, DateTimeKind.Local), 4, "Taiki Inomata, a third-year student in junior high, attends Eimei Academy, an integrated school with a major sports program. Having joined the high school badminton team, Taiki tries to attend open practice as early as possible. But no matter how early he goes, he always arrives second in the gymnasium. The person one step ahead of him is Chinatsu Kano, a first-year student in senior high and Taiki's crush.\n\nChinatsu is the rising star of the basketball team, and the gap between her and Taiki could not be greater. Although Taiki is a decent badminton player, his popularity is nowhere near Chinatsu's, making it even less likely for his feelings to be reciprocated. However, in a strange twist of fate, she ends up living in Taiki's house!\n\nWanting to become a worthy match for Chinatsu, Taiki pursues the same dream as his crush: to partake in the Nationals. Taiki starts training harder than ever before, all for the sake of building a strong relationship with his new housemate.\n\n[Written by MAL Rewrite]", "Ao no Hako", "Blue Box", "アオのハコ", 1, "https://myanimelist.net/manga/135545/Ao_no_Hako", null },
                    { 135567, "", 32, new DateTime(2024, 2, 8, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/249233.jpg", 6172, 7.18m, new DateTime(2021, 4, 8, 17, 0, 0, 0, DateTimeKind.Local), 2, "Nagasaki prefecture, in Japan, is a magical kingdom. While the wizards that live there are unable to cross the ocean, and are trapped in Kyuushu, they still pose enough of a threat that Americans dropped the bomb on them during WWII. The residents are worried that this will happen again, especially if the regular humans decide magicians are a threat.\n\nDaughter of the most powerful wizard alive, Mizukura Risuka is ten years old, and living outside Nagasaki, searching for her father and killing evil wizards. Her blood contains spells that control time, and allow her to fast-forward her own life. Her ultimate technique kicks in only when she dies bloodily—her blood will reform into herself at 27, at the height of her powers, for one minute.\n\nHer guide through the world of normal humans is Kugi Kizutaka, also aged ten. Kizutaka is a genius, and a sociopath. He believes the only way for people to be happy is to be ruled by him and views everyone he meets as a potential pawn, or slave. Including Risuka.\n\n(Source: easternstandard.pbworks.com)", "Shin Honkaku Mahou Shoujo Risuka", null, "新本格魔法少女りすか", 1, "https://myanimelist.net/manga/135567/Shin_Honkaku_Mahou_Shoujo_Risuka", 7 },
                    { 135698, null, 11, new DateTime(2021, 5, 5, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/243481.jpg", 27315, null, new DateTime(2020, 5, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Sengoku Gridman", null, "戦国グリッドマン", 1, "https://myanimelist.net/manga/135698/Sengoku_Gridman", 3 },
                    { 135740, "", 26, new DateTime(2022, 3, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/246065.jpg", 4894, 7.29m, new DateTime(2019, 12, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "The manga will adapt volume 16 of the original novel series.", "Mahouka Koukou no Rettousei: Yotsuba Keishou-hen", null, "魔法科高校の劣等生 四葉継承編", 1, "https://myanimelist.net/manga/135740/Mahouka_Koukou_no_Rettousei__Yotsuba_Keishou-hen", 3 },
                    { 135741, "", null, null, "https://cdn.myanimelist.net/images/manga/2/246068.jpg", 27320, null, new DateTime(2020, 3, 17, 17, 0, 0, 0, DateTimeKind.Local), 4, "The arc follows volumes 17-19 of the original novel series.", "Mahouka Koukou no Rettousei: Shizoku Kaigi-hen", null, "魔法科高校の劣等生 師族会議編", 1, "https://myanimelist.net/manga/135741/Mahouka_Koukou_no_Rettousei__Shizoku_Kaigi-hen", null },
                    { 135742, "", 18, new DateTime(2022, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/249830.jpg", 27321, null, new DateTime(2021, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "The arc follows volume 20 of the light novel.", "Mahouka Koukou no Rettousei: Nankai Soujou-hen", null, "魔法科高校の劣等生 南海騒擾編", 1, "https://myanimelist.net/manga/135742/Mahouka_Koukou_no_Rettousei__Nankai_Soujou-hen", 3 },
                    { 135743, null, null, null, "https://cdn.myanimelist.net/images/manga/2/261711.jpg", 27322, null, new DateTime(2021, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), 4, null, "Mahouka Koukou no Yuutousei: 2nd Season", null, "魔法科高校の優等生 2nd Season", 1, "https://myanimelist.net/manga/135743/Mahouka_Koukou_no_Yuutousei__2nd_Season", null },
                    { 135893, "Sword Art Online: Progressive - Ougonritsu no Canon was published in English as Sword Art Online Progressive Canon of the Golden Rule by Yen Press from March 19, 2024 to July 30, 2024.", 10, new DateTime(2022, 4, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253327.jpg", 7572, 7.08m, new DateTime(2021, 3, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "Asuna and Kirito have made it to Aincrad's sixth floor, where in the town of Stachion they find something very odd—puzzles everywhere they look. New mysteries and complex riddles await, many of which can't be solved with a sword... Fighting against the odds, the two will have to put their heads together if they want to make it out alive. But as they focus their attention on confronting the challenges ahead, will they be ready for the sinister forces that lie in wait?\n\n(Source: Yen Press)", "Sword Art Online: Progressive - Ougonritsu no Canon", "Sword Art Online Progressive Canon of the Golden Rule", "ソードアート・オンライン プログレッシブ 黄金律のカノン", 1, "https://myanimelist.net/manga/135893/Sword_Art_Online__Progressive_-_Ougonritsu_no_Canon", 2 },
                    { 136106, "", null, new DateTime(2017, 1, 30, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/271166.jpg", 27372, null, new DateTime(2015, 3, 5, 16, 0, 0, 0, DateTimeKind.Local), 2, "Psycho-Pass Genesis tells the secret story of the creation of Sibyl System through an incident in which the young Tomomi Masaoka was involved.", "Psycho-Pass Genesis", null, "PSYCHO-PASS GENESIS", 5, "https://myanimelist.net/manga/136106/Psycho-Pass_Genesis", 4 },
                    { 136660, "Spy x Family: Kazoku no Shouzou was published in English as Spy x Family: Family Portrait by VIZ Media under the Shonen Jump imprint on December 26, 2023.", 5, null, "https://cdn.myanimelist.net/images/manga/3/248768.jpg", 963, 7.91m, new DateTime(2021, 7, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "In this book of Spy x Family original prose stories, Anya attempts to make friends with her target Damian during an Eden Academy camping trip, Yuri spends his day off babysitting his niece, and Franky seeks Loid's help in winning the heart of a blind opera singer. Then, when the family sits for a portrait painting, Yor is terrified that her secret identity will be blown. And in the final story, the family is scrutinized by a pair of unseen observers... There's never been a family quite like this one!\n\n(Source: VIZ Media)", "Spy x Family: Kazoku no Shouzou", "Spy x Family: Family Portrait", "SPY×FAMILY 家族の肖像", 2, "https://myanimelist.net/manga/136660/Spy_x_Family__Kazoku_no_Shouzou", 1 },
                    { 136856, "Gimai Seikatsu has been published in English as Days with My Stepsister by Yen Press since October 22, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/1/259020.jpg", 4466, 7.33m, new DateTime(2021, 7, 15, 17, 0, 0, 0, DateTimeKind.Local), 4, "After his father's remarriage, Yuuta Asamura ends up getting a new stepsister, coincidentally the number one beauty of the school year, Saki Ayase. Having learned important values when it comes to relationships between men and women through the previous ones of their parents, they promise each other not to be too close, not to be too opposing, and to merely keep a vague and comfortable distance.\n\nOn one hand, Saki, who has worked in solitude for the sake of her family, doesn't know how to properly rely on others, whereas Yuuta is unsure of how to really treat her. Standing on fairly equal ground, these two slowly learn the comfortable sensation of living together.\n\nTheir relationship slowly evolves from being strangers the more the days pass. This is a story that may lead to love someday.\n\n(Source: Kadokawa, translated)", "Gimai Seikatsu", "Days with My Stepsister", "義妹生活", 1, "https://myanimelist.net/manga/136856/Gimai_Seikatsu", null },
                    { 137242, "", 1, null, "https://cdn.myanimelist.net/images/manga/2/266837.jpg", 12177, 6.78m, new DateTime(2021, 2, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "A short promotional one-shot for the light novel of the same title.", "Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san", null, "時々ボソッとロシア語でデレる隣のアーリャさん", 3, "https://myanimelist.net/manga/137242/Tokidoki_Bosotto_Russia-go_de_Dereru_Tonari_no_Alya-san", null },
                    { 137358, null, 7, new DateTime(2013, 7, 9, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/282229.jpg", 27517, null, new DateTime(2013, 2, 8, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Kidou Senshi Gundam Unicorn: Niji ni Norenakatta Otoko", "Mobile Suit Gundam Unicorn: Bright Noah Story", "機動戦士ガンダムUC〈ユニコーン〉 虹にのれなかった男", 1, "https://myanimelist.net/manga/137358/Kidou_Senshi_Gundam_Unicorn__Niji_ni_Norenakatta_Otoko", 1 },
                    { 137939, "Chi.: Chikyuu no Undou ni Tsuite won the Grand Prize at the 26th Tezuka Osamu Cultural Prize awards in 2022. In the same year, it was nominated for the 15th Manga Taisho Award and the 46th Kodansha Manga Awards in the General category. It ranked second in the 2022 Kono Manga ga Sugoi! for the Male Readers Division. In 2023, the manga won Best Comic at the 54th Seiun Awards. The series has been published in English as Orb: On the Movements of the Earth by Seven Seas Entertainment as 2-in-1 omnibus volumes since November 21, 2023. It was also released in Italian by Dynit as Il Movimento della Terra from January 20, 2023, to March 22, 2024.", 62, new DateTime(2022, 4, 17, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/246956.jpg", 1046, 7.87m, new DateTime(2020, 9, 13, 17, 0, 0, 0, DateTimeKind.Local), 2, "In fifteenth-century Europe, heretics are being burned at the stake. Rafal, a brilliant young man, is expected to enter university at an early age and study the era's most important field, theology. But Rafal values Reason above all else, which leads him both to the shocking conclusion that the Earth orbits the Sun, and into the hands of the Inquisition!\n\nA decade later, two members of the Watch Guild, the dour young Oczy and the cynical Gras, find a hidden stone chest that details the secrets of the universe Rafal left behind. Dare they try to change their own stars by selling the heretical texts, or would that only lead to the stake and the fire?\n\n(Source: Seven Seas Entertainment)", "Chi.: Chikyuu no Undou ni Tsuite", "Orb: On the Movements of the Earth", "チ。―地球の運動について―", 1, "https://myanimelist.net/manga/137939/Chi__Chikyuu_no_Undou_ni_Tsuite", 8 },
                    { 137967, "", 1, null, "https://cdn.myanimelist.net/images/manga/2/268109.jpg", 9705, 6.94m, new DateTime(2021, 6, 11, 17, 0, 0, 0, DateTimeKind.Local), 2, "A prequel manga that takes place 120 minutes before Evangelion: 3.0 You Can (Not) Redo which was included in Eva-Extra-Extra, a booklet distributed at the theatrical release of Evangelion: 3.0+1.01 Thrice Upon a Time.", "Evangelion: 3.0 (-120min.)", null, "EVANGELION: 3.0 (-120min.)", 3, "https://myanimelist.net/manga/137967/Evangelion__30_-120min", null },
                    { 137982, "Senpai wa Otokonoko is based on the web manga Otokonoko ga Kouhai ni Kokuhaku sareru Hanashi (おとこのこが後輩に告白される話), released on the author's Twitter and pixiv accounts from July 3, 2019, to July 24, 2019. The series was published digitally in English as Senpai Is an Otokonoko by Webtoon Entertainment from March 9, 2023, to February 8, 2024. Webtoon Entertainment also released the series in French from March 28, 2022, to February 5, 2024; and in German since May 28, 2022.", 100, new DateTime(2021, 12, 29, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/252739.jpg", 1254, 7.81m, new DateTime(2019, 12, 6, 16, 0, 0, 0, DateTimeKind.Local), 2, "Makoto Hanaoka, a womanly second-year student, easily attracts other people's attention. First-year student Saki Aoi is no exception, and she falls in love with Makoto at first sight. Having a vibrant and vigorous personality, she does not hesitate to confess her feelings to her senior. However, Makoto differs significantly from the person Saki perceives: Makoto is not a girl, but rather a cross-dressing boy!\n\nAfter revealing his well-known secret to Saki, Makoto expects her to be disgusted. Surprisingly, she is instead captivated by this revelation. Nonetheless, he still rejects her, but Saki's determination does not stop her from declaring that she will become his first love. With Saki and his childhood friend at his side, Makoto's world brightens, giving him strength amid his struggle between his interests and the expectations placed on him.\n\n[Written by MAL Rewrite]", "Senpai wa Otokonoko", "Senpai Is an Otokonoko: My Crossdressing Classmate", "先輩はおとこのこ", 1, "https://myanimelist.net/manga/137982/Senpai_wa_Otokonoko", null },
                    { 138078, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/254428.jpg", 11822, 6.8m, new DateTime(2020, 8, 4, 17, 0, 0, 0, DateTimeKind.Local), 2, "A side story focusing on Lancelot, Ban and Elaine's son.", "Nanatsu no Taizai: Hajimari wo Sasou Ame no Mori", null, "七つの大罪 はじまりを誘う雨の森", 3, "https://myanimelist.net/manga/138078/Nanatsu_no_Taizai__Hajimari_wo_Sasou_Ame_no_Mori", null },
                    { 138269, "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Familia Chronicle - Episode Freya was published in English as Is It Wrong to Try to Pick Up Girls in a Dungeon? Familia Chronicle: Episode Freya by Yen Press under its Yen On imprint on October 27, 2020.", null, null, "https://cdn.myanimelist.net/images/manga/3/263264.jpg", 5876, 7.21m, new DateTime(2019, 12, 11, 16, 0, 0, 0, DateTimeKind.Local), 2, "The search for love is on!\n\nA fey mood strikes Freya, sparking a new quest to find her Odr, the one destined to stand forever by her side. Naturally, her followers are against it. They remember all too well the disaster that her last adventure turned out to be. Unfortunately for them, such a minor setback has never been enough to stop the goddess of beauty from following wherever her heart leads-which, this time, happens to be the sandy dunes of Kaios. Freya is eager to spread her wings to see what discoveries this new land has to offer, even as her familia frantically searches for her, no matter the cost...!\n\n(Source: Yen Press)", "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Familia Chronicle - Episode Freya", "Is It Wrong to Try to Pick Up Girls in a Dungeon? Familia Chronicle: Episode Freya", "ダンジョンに出会いを求めるのは間違っているだろうか ファミリアクロニクル episodeフレイヤ", 2, "https://myanimelist.net/manga/138269/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka__Familia_Chronicle_-_Episode_Freya", 1 },
                    { 138481, "Make Heroine ga Oosugiru! won the Gagaga Award at the 15th Shogakukan Light Novel Award in 2021 under the title Ore wa Hyottoshite, Saishuuwa de Make Heroine no Yokoni Iru Pottode no Mob Chara nano Darou ka (俺はひょっとして、最終話で負けヒロインの横にいるポッと出のモブキャラなのだろうか). The series has been published in English as Too Many Losing Heroines! by Seven Seas Entertainment under the Airship imprint since August 13, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/2/248592.jpg", 466, 8.17m, new DateTime(2021, 7, 20, 17, 0, 0, 0, DateTimeKind.Local), 4, "Plain, boring, and friendless Kazuhiko Nukumizu has witnessed something completely baffling: popular girl Anna Yanami was friend-zoned by her childhood friend and crush! In fact, all the popular girls around him are getting similarly rejected by the boys they like. Without realizing it, Kazuhiko becomes entangled in the relationship drama where all the leading heroines are losing out on love! Can he keep their spirits up and help them find happiness?\n\n(Source: Seven Seas Entertainment)", "Make Heroine ga Oosugiru!", "Too Many Losing Heroines!", "負けヒロインが多すぎる！", 2, "https://myanimelist.net/manga/138481/Make_Heroine_ga_Oosugiru", null },
                    { 138915, "Maou 2099 won the Grand Prize at the 33rd Fantasia Award in 2020 under the title Ken to Maou no Cyberpunk (剣と魔王のサイバーパンク). The series has been published in English as Demon Lord 2099 by Yen Press under the Yen On imprint since March 15, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/3/248745.jpg", 33999, null, new DateTime(2021, 1, 19, 16, 0, 0, 0, DateTimeKind.Local), 4, "​The cyberpunk metropolis Shinjuku—a massive city-state bedecked with neon signs, towering skyscrapers, and the latest cutting-edge technology. It is here, in year 2099 of the Fused Era, where the legendary Demon Lord Veltol has his second coming five centuries in the making. But this landscape is nothing like the one he conquered all those years ago, for the fusion of magic and engineering has elevated civilization to dazzling, unprecedented heights. Veltol may have been reduced to a historical footnote, but make no mistake...this brave new world will be his for the taking!\n\n(Source: Yen Press)", "Maou 2099", "Demon Lord 2099", "魔王2099", 2, "https://myanimelist.net/manga/138915/Maou_2099", null },
                    { 139018, "An English translation of Kidou Senshi Gundam SEED Eclipse has been streamed as a motion comic on the GUNDAM.INFO YouTube channel since July 26, 2021.", null, null, "https://cdn.myanimelist.net/images/manga/1/256392.jpg", 27790, null, new DateTime(2021, 7, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, "C.E.72 was a unique era which would later be called the \"two blank years.\" Some also call it \"the time of peace on thin ice,\" and others call it \"the break before the oncoming frenzy.\" This is the story of an interval. A story that takes place between two large wars in which members of a hollow unit known as ODR risked their lives.\n\n(Source: GUNDAM.INFO)", "Kidou Senshi Gundam SEED Eclipse", "Mobile Suit Gundam SEED Eclipse", "機動戦士ガンダムSEED ECLIPSE", 1, "https://myanimelist.net/manga/139018/Kidou_Senshi_Gundam_SEED_Eclipse", null },
                    { 139066, "", 13, new DateTime(2020, 8, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/256632.jpg", 34031, null, new DateTime(2018, 8, 2, 17, 0, 0, 0, DateTimeKind.Local), 2, "The era of e-sports has arrived, where anyone can compete and enjoy gaming tournaments! Kenzou, a gamer who loves the fighting game Dragon Ball FighterZ, enters the e-sport world and is prepared to challenge everyone with only his intuition and fists!\n\n(Source: Shueisha, translated)", "DeSpo FighterZ", null, "DeスポファイターZ", 1, "https://myanimelist.net/manga/139066/DeSpo_FighterZ", 2 },
                    { 139152, "Bleach: Gokui Meimei-hen was published digitally in English as Bleach: Special One-shot through MANGA Plus.", 1, null, "https://cdn.myanimelist.net/images/manga/2/252464.jpg", 1106, 7.85m, new DateTime(2021, 8, 9, 17, 0, 0, 0, DateTimeKind.Local), 2, "Over a decade after the Thousand-Year Blood War, Ichigo Kurosaki lives a peaceful life with his wife Orihime Inoue and their son Kazui. Utilizing the fledgling Soul Reaper powers inherited from his father, Kazui assists those burdened by the deceased much like Ichigo did as a teenager.\n\nOne day, Ichigo receives an unexpected call from his married Soul Reaper allies Renji Abarai and Rukia Kuchiki. The couple invites him to take part in the \"Konso Reisai\"—a ceremony in which a Hollow, an evil spirit from the human world, is sacrificed to honor a Soul Reaper captain who died exactly 12 years prior.\n\nUnbeknownst to Ichigo and his friends, something sinister looms over the Konso Reisai. As Renji meets up with Ichigo to honor the dead, the two are interrupted by the return of an old enemy they never thought they'd meet again.\n\n[Written by MAL Rewrite]", "Bleach: Gokui Meimei-hen", "Bleach: Special One-shot", "BLEACH 獄頤鳴鳴〈ごくいめいめい〉篇", 3, "https://myanimelist.net/manga/139152/Bleach__Gokui_Meimei-hen", null },
                    { 139629, "JoJo no Kimyou na Bouken Part 9: The JoJoLands ranked 15th in the 2024 Kono Manga ga Sugoi! for the Male Readers division.", null, null, "https://cdn.myanimelist.net/images/manga/1/286969.jpg", 268, 8.34m, new DateTime(2023, 2, 16, 16, 0, 0, 0, DateTimeKind.Local), 4, "On the Hawaiian Islands, siblings Dragona and Jodio Joestar commit petty crimes to provide aid for their ailing mother Barbara Ann. Under the orders of Meryl May Qi, both a crime lord and their high school principal, the siblings work alongside fellow teenagers Usagi Alohaoe and Paco Laburantes. Together, the gang engages in outright robbery, fraudulent activity, and other schemes to rip off unsuspecting tourists and civilians.\n\nFifteen-year-old Jodio admires his older brother's strong sense of identity and his mother's incredible work ethic, but there is a darkness within him, one characterized by violent outbursts that he carries out with a cold stoicism. Diagnosed as a sociopath, Jodio is quick to brutalize those who threaten his loved ones. His one objective is to make money by any means necessary, both to support his family and to become filthy rich in his own right.\n\nOn one particular heist, the gang robs manga artist Rohan Kishibe of a seemingly ordinary lava rock. However, they soon find that the rock draws any object of high value that it touches to its wielder, no matter the distance or bizarre chain of circumstances it takes to get there. With this new power in hand, Jodio and his allies set out to become wealthier than they ever dreamed possible.\n\n[Written by MAL Rewrite]", "JoJo no Kimyou na Bouken Part 9: The JoJoLands", "JoJo's Bizarre Adventure Part 9: The JoJoLands", "ジョジョの奇妙な冒険 Part9 The JOJOLands", 1, "https://myanimelist.net/manga/139629/JoJo_no_Kimyou_na_Bouken_Part_9__The_JoJoLands", null },
                    { 139665, "Magia Record: Mahou Shoujo Madoka☆Magica Gaiden - Another Story has been published in English as Magia Record: Puella Magi Madoka Magica Another Story by Yen Press since September 6, 2022.", null, null, "https://cdn.myanimelist.net/images/manga/3/249364.jpg", 27878, null, new DateTime(2019, 3, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "With fewer witches cropping up in Mitakihara and the surrounding area, many magical girls are embracing their chance to enjoy a break from the hunt—but not Mami Tomoe! Mami wants to know why witch numbers are declining in every city save one. In Kamihama City, the witch population is greater and stronger than ever, not to mention there's a mysterious magical presence unlike anything Mami has encountered before...!\n\n(Source: Yen Press)", "Magia Record: Mahou Shoujo Madoka☆Magica Gaiden - Another Story", "Magia Record: Puella Magi Madoka Magica Another Story", "マギアレコード 魔法少女まどか☆マギカ外伝 アナザーストーリー", 1, "https://myanimelist.net/manga/139665/Magia_Record__Mahou_Shoujo_Madoka☆Magica_Gaiden_-_Another_Story", null },
                    { 139761, "Ore wa Subete wo \"Parry\" suru: Gyaku Kanchigai no Sekai Saikyou wa Boukensha no Yume wo Miru has been published digitally in English as I Parry Everything: What Do You Mean I'm the Strongest? I'm Not Even an Adventurer Yet! by J-Novel Club since March 29, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/3/249442.jpg", 15971, 6.51m, new DateTime(2020, 9, 29, 17, 0, 0, 0, DateTimeKind.Local), 4, "Ever since he was a young boy, Noor has wanted to be like the adventurers in his father's stories—dragon-slayers, curse-breakers, heroes who always save the day. But as everyone knows, to be an adventurer, you've gotta have the right skills! Unfortunately for Noor, his \"Parry\" is bottom-of-the-barrel useless, his prospects are nonexistent, and everybody he knows is telling him to throw in the towel. Faced with this harsh reality, he figures there's only one thing to do: make up for it with effort! An intense, solitary training regimen ought to do it. If one year won't cut it, he'll train for five! If not five, ten! Now facing the tail end of his twenties with no new skills to show for his labors, Noor sets out to become an adventurer anyway, determined to try one last time to make his dream come true. He might be clueless when it comes to adventuring, but he's no stranger to hard work! Now, if only he can figure out why everyone keeps looking at him like that...\n\n(Source: J-Novel Club)", "Ore wa Subete wo \"Parry\" suru: Gyaku Kanchigai no Sekai Saikyou wa Boukensha no Yume wo Miru", "I Parry Everything: What Do You Mean I'm the Strongest? I'm Not Even an Adventurer Yet!", "俺は全てを【パリイ】する～逆勘違いの世界最強は冒険者の夢をみる～", 1, "https://myanimelist.net/manga/139761/Ore_wa_Subete_wo_Parry_suru__Gyaku_Kanchigai_no_Sekai_Saikyou_wa_Boukensha_no_Yume_wo_Miru", null },
                    { 139972, "One Piece: Vivi no Bouken is part of the One Piece Comic Cover Project. The one-shot was simulpub in English as One Piece: Vivi's Adventure through MANGA Plus service.", 1, null, "https://cdn.myanimelist.net/images/manga/2/249763.jpg", 4059, 7.37m, new DateTime(2021, 8, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "A remake of chapter 216 of One Piece, drawn by Naoshi Komi.", "One Piece: Vivi no Bouken", "One Piece: Vivi's Adventure", "ONE PIECE ビビの冒険", 3, "https://myanimelist.net/manga/139972/One_Piece__Vivi_no_Bouken", null },
                    { 140150, "Chainsaw Man: Buddy Stories was published in English by VIZ Media under the Shonen Jump imprint on July 25, 2023.", 4, null, "https://cdn.myanimelist.net/images/manga/3/252140.jpg", 1292, 7.8m, new DateTime(2021, 11, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Power lives out her favorite anime by becoming a genius detective—or so she wants her \"audience\" to believe! Denji is along for the ride as her assistant for an investigation into disappearances at a mountain hotel. Other stories center on Quanxi and Kishibe's relationship nine years after they met, Himeno and Aki's first assignment together, and Denji, Power, and Aki's dream trip to Enoshima.\n\n(Source: VIZ Media)", "Chainsaw Man: Buddy Stories", "Chainsaw Man: Buddy Stories", "チェンソーマン　バディ・ストーリーズ", 2, "https://myanimelist.net/manga/140150/Chainsaw_Man__Buddy_Stories", 1 },
                    { 140245, "", null, null, "https://cdn.myanimelist.net/images/manga/3/255482.jpg", 27962, null, new DateTime(2021, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, "After stealing a rare gold coin from a country that doesn't exist, Lupin finds himself transported to another world.", "Lupin III: Neighbor World Princess", null, "ルパン三世 異世界の姫君〈ネイバーワールドプリンセス〉", 1, "https://myanimelist.net/manga/140245/Lupin_III__Neighbor_World_Princess", null },
                    { 140247, "", 1, null, "https://cdn.myanimelist.net/images/manga/3/294298.jpg", 27964, null, new DateTime(2010, 1, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "A short epilogue included in the To LOVE-Ru Gashuu: Love Color! artbook.", "To LOVE-Ru: Sorekara...", null, "To LOVEる -とらぶる- それから…", 3, "https://myanimelist.net/manga/140247/To_LOVE-Ru__Sorekara", null },
                    { 140256, "Kimetsu Gakuen! has been published in English as Demon Slayer: Kimetsu Academy by VIZ Media under the Shonen Jump imprint since December 12, 2023.", 36, new DateTime(2024, 3, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253850.jpg", 5271, 7.26m, new DateTime(2021, 8, 3, 17, 0, 0, 0, DateTimeKind.Local), 2, "Zenitsu is late for class, and the only thing between him and Giyu's bamboo sword is one good excuse. Next, when Inosuke, Murata, and Zenitsu fail their midterm, they must endure the harshest math lesson of their lives. Then there's Uzui's explosive art class, Nezuko's first cavity, and Rengoku's forbidden pizza!\n\n(Source: VIZ Media)", "Kimetsu Gakuen!", "Demon Slayer: Kimetsu Academy", "キメツ学園!", 1, "https://myanimelist.net/manga/140256/Kimetsu_Gakuen", 6 },
                    { 140901, "Iden Ehon Zoushi: Hanyou no Yashahime has been published in English as Yashahime: Princess Half-Demon by VIZ Media under the Shonen Sunday imprint since June 21, 2022. The series has also been simulpub through VIZ Manga.", null, null, "https://cdn.myanimelist.net/images/manga/1/263333.jpg", 5030, 7.28m, new DateTime(2021, 9, 24, 17, 0, 0, 0, DateTimeKind.Local), 4, "Can the three teenage daughters of demon dog half-brothers Inuyasha and Sesshomaru save their parents, themselves, and both realms from the menace of the seven mystical Rainbow Pearls?\n\nLiving in the present day isn't easy for Sesshomaru's daughter Towa. She can't remember where she came from, must conceal her mysterious powers, and is either worshipped or feared by girls she just wants to be friends with. But she has no way of returning to her own time until one day...a demon attacks and she is transported to feudal-era Japan.\n\nThere Towa, her twin sister Setsuma, and her cousin Moroha—Inuyasha's daughter—have a mission bestowed upon them by the mystical Tree of Ages. With only vague memories of their past to guide them, the three young women set out to find their parents, heal a rift in time, and fulfill their royal destiny...\n\n(Source: VIZ Media)", "Iden Ehon Zoushi: Hanyou no Yashahime", "Yashahime: Princess Half-Demon", "～異伝・絵本草子～ 半妖の夜叉姫", 1, "https://myanimelist.net/manga/140901/Iden_Ehon_Zoushi__Hanyou_no_Yashahime", null },
                    { 141272, "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Familia Chronicle - Episode Freya has been published in English as Is It Wrong to Try to Pick Up Girls in a Dungeon? Familia Chronicle Episode Freya by Yen Press since April 18, 2023.", 20, new DateTime(2023, 11, 16, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/263265.jpg", 28084, null, new DateTime(2020, 10, 1, 17, 0, 0, 0, DateTimeKind.Local), 2, "The search for love is on! A fey mood strikes Freya, sparking a new quest to find her Odr, the one destined to stand forever by her side. Naturally, her followers are against it. They remember all too well the disaster that her last adventure turned out to be. Unfortunately for them, such a minor setback has never been enough to stop the goddess of beauty from following wherever her heart leads-which, this time, happens to be the sandy dunes of Kaios. Freya is eager to spread her wings to see what discoveries this new land has to offer, even as her familia frantically searches for her, no matter the cost...!\n\n(Source: Yen Press)", "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Familia Chronicle - Episode Freya", "Is It Wrong to Try to Pick Up Girls in a Dungeon? Familia Chronicle Episode Freya", "ダンジョンに出会いを求めるのは間違っているだろうか ファミリアクロニクル episodeフレイヤ", 1, "https://myanimelist.net/manga/141272/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka__Familia_Chronicle_-_Episode_Freya", 5 },
                    { 141501, "", 5, new DateTime(2019, 8, 8, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/251912.jpg", 2684, 7.53m, new DateTime(2018, 10, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "One Piece Novel: Law tells the story of Trafalgar Law right after leaving the Donquixote Pirates.", "One Piece Novel: Law", null, "ONE PIECE novel LAW", 2, "https://myanimelist.net/manga/141501/One_Piece_Novel__Law", 1 },
                    { 141511, "", null, null, "https://cdn.myanimelist.net/images/manga/1/251914.jpg", 37307, null, new DateTime(2019, 12, 12, 16, 0, 0, 0, DateTimeKind.Local), 4, "Collection of stories, focusing on the female characters of One Piece.", "One Piece Novel: Heroines", "One Piece: Heroines", "One Piece novel HEROINES", 2, "https://myanimelist.net/manga/141511/One_Piece_Novel__Heroines", null },
                    { 141885, null, null, null, "https://cdn.myanimelist.net/images/manga/1/256565.jpg", 28167, null, new DateTime(2021, 4, 22, 17, 0, 0, 0, DateTimeKind.Local), 4, null, "Darkness Heels: Lili", null, "DARKNESS HEELS ―Lili―", 1, "https://myanimelist.net/manga/141885/Darkness_Heels__Lili", null },
                    { 141953, "Sword Art Online Re:Aincrad has been published in English by Yen Press since May 21, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/1/259042.jpg", 34411, null, new DateTime(2021, 10, 26, 17, 0, 0, 0, DateTimeKind.Local), 4, "Die in the game, and you die in real life. This is Sword Art Online, the latest VRMMORPG, and upon the game's launch, ten thousand players realize they're trapped in this virtual world with no escape...unless they can make their way through Aincrad, a massive floating castle with dangers lurking on each of its one hundred floors. Enter Kirito, a swordsman and former beta tester for the game who has the knowledge and skills to rise to the top, and the rapier-wielding Asuna, whose fated meeting with Kirito will change their lives forever. Join these two warriors on their journey to freedom in this expanded retelling of the original Aincrad arc!\n\n(Source: Yen Press)", "Sword Art Online Re:Aincrad", "Sword Art Online Re:Aincrad", "ソードアート・オンライン Re:Aincrad", 1, "https://myanimelist.net/manga/141953/Sword_Art_Online_Re_Aincrad", null },
                    { 141959, "Fullmetal Alchemist 4-koma was published in English as Fullmetal Alchemist: The Complete Four-Panel Comics by VIZ Media on March 12, 2019.", 4, new DateTime(2014, 10, 28, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/311662.jpg", 31130, null, new DateTime(2002, 1, 21, 16, 0, 0, 0, DateTimeKind.Local), 2, "This complete collection offers the beloved four-panel comic strips from the graphic novel series and bonus strips from the anime DVDs of Fullmetal Alchemist and Fullmetal Alchemist: Brotherhood, as well as rare strips from Japan! \n\n(Source: VIZ Media)", "Fullmetal Alchemist 4-koma", "Fullmetal Alchemist: The Complete Four-Panel Comics", "鋼の錬金術師4コマ", 1, "https://myanimelist.net/manga/141959/Fullmetal_Alchemist_4-koma", 1 },
                    { 142246, "", null, null, "https://cdn.myanimelist.net/images/manga/2/263020.jpg", 964, 7.91m, new DateTime(2021, 12, 24, 16, 0, 0, 0, DateTimeKind.Local), 4, "Students of the prestigious Tokyo Metropolitan Advanced Nurturing High School are given remarkable freedom—if they can win, barter, or save enough points to work their way up the ranks! Kiyotaka Ayanokouji started at the bottom in the scorned Class D, where he met Suzune Horikita, who was determined to rise up the ladder to Class A. Who can beat the system in a school where cutthroat competition is the name of the game? The second year of this intense school drama begins now!\n\n(Source: Seven Seas Entertainment)", "Youkoso Jitsuryoku Shijou Shugi no Kyoushitsu e: 2-nensei-hen", "Welcome to the Classroom of the Second-year", "ようこそ実力至上主義の教室へ ２年生編", 1, "https://myanimelist.net/manga/142246/Youkoso_Jitsuryoku_Shijou_Shugi_no_Kyoushitsu_e__2-nensei-hen", null },
                    { 142475, "", null, null, "https://cdn.myanimelist.net/images/manga/1/270960.jpg", 28239, null, new DateTime(2017, 7, 18, 17, 0, 0, 0, DateTimeKind.Local), 4, "Kishibe Rohan Tanpen Shousetsushuu is an anthology of short stories written by various authors and based on the Kishibe Rohan wa Ugokanai series.", "Kishibe Rohan Tanpen Shousetsushuu", null, "岸辺露伴 短編小説集", 2, "https://myanimelist.net/manga/142475/Kishibe_Rohan_Tanpen_Shousetsushuu", null },
                    { 142551, "", 16, new DateTime(2023, 5, 18, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/5/261865.jpg", 2580, 7.55m, new DateTime(2021, 12, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "Hol Horse accepts a request from an elderly woman to find her lost parrot, who was trained by the owner of Pet Shop, he finds himself trekking across half the globe to the Japanese city of Morioh.\n\nIn Morioh, Hol Horse quickly runs into Josuke Higashikata. Will the two become friends or foes? Then, what new enemy with grotesque stand powers lurks in Morioh? And will Hol Horse and Dio's other former followers ever truly be free from his influence?\n\n(Source: VIZ Media)", "JoJo no Kimyou na Bouken: Crazy Diamond no Akuryou-teki Shitsuren", "JoJo's Bizarre Adventure: Shining Diamond's Demonic Heartbreak", "ジョジョの奇妙な冒険 クレイジー・D〈ダイヤモンド〉の悪霊的失恋", 1, "https://myanimelist.net/manga/142551/JoJo_no_Kimyou_na_Bouken__Crazy_Diamond_no_Akuryou-teki_Shitsuren", 3 },
                    { 142552, "", 1, null, "https://cdn.myanimelist.net/images/manga/2/253442.jpg", 19043, 6.05m, new DateTime(2021, 12, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "On an otherwise ordinary day in Green Dolphin Street Prison, Jolyne Kuujou—alongside Hermes Costello and Foo Fighters—witnesses a female prisoner kneeling before another, begging to draw something for her. The woman seems delirious; she claims that she cannot sleep without the drawing and that not having it causes her to pull her own hair out.\n\nThe artist, a woman named Fujiko, soon approaches Jolyne and offers to draw her in a shunga piece—a type of erotic artwork. Though disinterested in the offer, Jolyne is enamored by Fujiko's non-erotic sketch of her and decides to buy it.\n\nWhat Jolyne does not realize, however, is that Fujiko is a Stand user employed by Whitesnake to retrieve Joutarou Kuujou's \"disc\" from his daughter. When Jolyne begins experiencing a strange sensation, she is none the wiser as to what—or who—caused it.\n\n[Written by MAL Rewrite]", "Fujiko no Kimyou na Shoseijutsu: Whitesnake no Gosan", null, "フジコの奇妙な処世術 -ホワイトスネイクの誤算-", 3, "https://myanimelist.net/manga/142552/Fujiko_no_Kimyou_na_Shoseijutsu__Whitesnake_no_Gosan", null },
                    { 142617, "", 15, new DateTime(1985, 4, 30, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253563.jpg", 28257, null, new DateTime(1970, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "A collection of previously uncompiled chapters of Lupin III, Shin Lupin III, and the 5-part Sexy Lupin III series.", "Lupin III: Tankoubon Mishuuroku Sakuhinshuu", null, "ルパン三世 単行本未収録作品集", 1, "https://myanimelist.net/manga/142617/Lupin_III__Tankoubon_Mishuuroku_Sakuhinshuu", 1 },
                    { 142765, "Mushoku Tensei: Isekai Ittara Honki Dasu - Shitsui no Majutsushi-hen adapts the seventh volume of the original light novel.", null, null, "https://cdn.myanimelist.net/images/manga/2/266702.jpg", 969, 7.9m, new DateTime(2021, 12, 19, 16, 0, 0, 0, DateTimeKind.Local), 4, "After separating from Eris, Rudeus falls into the depths of depression. He travels to Rozenberg, the second city of the Principality of Basherant, to search for his missing mother, Zenith. Desperate, Rudeus tries to accept a high-ranking quest alone in order to make a name for himself. However, by chance, he ends up working with a party of B-rank adventurers called the Counter Arrow. One of the party members is a girl named Sara, who reminds him of Eris...!\n\n(Source: Frontier Works, translated)", "Mushoku Tensei: Isekai Ittara Honki Dasu - Shitsui no Majutsushi-hen", null, "無職転生 ～異世界行ったら本気だす～ 失意の魔術師編", 1, "https://myanimelist.net/manga/142765/Mushoku_Tensei__Isekai_Ittara_Honki_Dasu_-_Shitsui_no_Majutsushi-hen", null },
                    { 142771, "", 12, new DateTime(2020, 4, 1, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/253803.jpg", 28276, null, new DateTime(2018, 5, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "The manga's story centers on Chinpy, a boy who aspires to take up after Luffy, the protagonist of Eiichiro Oda's One Piece manga. Like Luffy, he is able to elongate \"a certain part\" of his body to fight.\n\n(Source: ANN)", "Chin Piece", null, "CHIN PIECE", 1, "https://myanimelist.net/manga/142771/Chin_Piece", 2 },
                    { 142772, "Fischer's x One Piece: Nanatsunagi no Daihihou is simultaneously published in Saikyou Jump and broadcast in video form on the official Saikyou Jump YouTube channel.", null, null, "https://cdn.myanimelist.net/images/manga/2/253804.jpg", 28277, null, new DateTime(2018, 8, 2, 17, 0, 0, 0, DateTimeKind.Local), 4, "The members of the YouTuber group Fischer's are transported to the world of One Piece.", "Fischer's x One Piece: Nanatsunagi no Daihihou", null, "Fischer's×ONE PIECE 7つなぎの大秘宝", 1, "https://myanimelist.net/manga/142772/Fischers_x_One_Piece__Nanatsunagi_no_Daihihou", null },
                    { 142916, "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Memoria Freese - Seiya no Träumerei is an adaptation of a mobile game, titled DanMachi - Memoria Freese. It was released on June 19, 2017 for Android and iOS. The series has been published in English as Is It Wrong to Try to Pick Up Girls in a Dungeon? Memoria Freese: Holy Night Traumerei by Yen Press since June 20, 2023.", 22, new DateTime(2023, 10, 13, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/253985.jpg", 37500, null, new DateTime(2021, 10, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "The Holy Night Festival has arrived, and Bell the rest of Hestia Familia have worked hard to afford a lovely dress for their goddess to wear during the festivities, so there's only one thing left to do—celebrate! Their merriment is soon interrupted, however, by a mysterious girl from a foreign land, and it's up to Bell to help the girl evade her would-be captors! But his new friend isn't content to simply escape—she wants to enjoy the festival just like everyone else! Just who is this young lady, and why has she made the long journey to Orario...?\n\n(Source: Yen Press)", "Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka: Memoria Freese - Seiya no Träumerei", "Is It Wrong to Try to Pick Up Girls in a Dungeon? Memoria Freese: Holy Night Traumerei", "ダンジョンに出会いを求めるのは間違っているだろうか ～メモリア・フレーゼ～ 聖夜の夢想歌〈トロイメライ〉", 1, "https://myanimelist.net/manga/142916/Dungeon_ni_Deai_wo_Motomeru_no_wa_Machigatteiru_Darou_ka__Memoria_Freese_-_Seiya_no_Träumerei", 4 },
                    { 143426, "", 4, new DateTime(2022, 6, 23, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/254718.jpg", 34657, null, new DateTime(2021, 11, 4, 17, 0, 0, 0, DateTimeKind.Local), 1, "The cyberpunk metropolis Shinjuku—a massive city-state bedecked with neon signs, towering skyscrapers, and the latest cutting-edge technology. It is here, in year 2099 of the Fused Era, where the legendary Demon Lord Veltol has his second coming five centuries in the making. But this landscape is nothing like the one he conquered all those years ago, for the fusion of magic and engineering has elevated civilization to dazzling, unprecedented heights. Veltol may have been reduced to a historical footnote, but make no mistake...this brave new world will be his for the taking!\n\n(Source: Yen Press)", "Maou 2099", null, "魔王2099", 1, "https://myanimelist.net/manga/143426/Maou_2099", null },
                    { 143881, "", 54, new DateTime(2024, 3, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/269102.jpg", 28500, null, new DateTime(2019, 6, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "In Universal Century 0112, there was the Fastest Formula. They wielded the ultimate, general-purpose weapon: the F90. Seven years following the Mufti Uprising, in the surging wave of mobile suit miniaturization, there was a team operating behind the scenes. These are the records of its various operations.\n\n(Source: Zeonic Scanlations)", "Kidou Senshi Gundam F90 FF", "Mobile Suit Gundam F90: Fastest Formula", "機動戦士ガンダムF90FF 〈ファステストフォーミュラ〉", 1, "https://myanimelist.net/manga/143881/Kidou_Senshi_Gundam_F90_FF", 11 },
                    { 143972, "Rengoku Zero-wa, a.k.a. Kimetsu no Yaiba: Tokubetsu Yomikiri, was originally published in the Weekly Shounen Jump 2020 #44 issue on October 5, 2020. Later included in the Kimetsu no Yaiba Rengoku Zero-kan booklet given to people who viewed Kimetsu no Yaiba Movie: Mugen Ressha-hen in Japanese theaters, with only 4.5 Million Copies given out. The one-shot was published digitally in English as Kimetsu no Yaiba: Special One-shot through MANGA Plus. The second volume was published in English as Demon Slayer: Kimetsu no Yaiba - Corps Records by VIZ Media under the Shonen Jump imprint on September 26, 2023. Chuukou Ikkan!! Kimetsu Gakuen Monogatari was also published in that volume by VIZ Media as Junior High and High School!! Kimetsu Academy Story.", 6, new DateTime(2021, 2, 3, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/285561.jpg", 6819, 7.13m, new DateTime(2018, 1, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "Volume 1\n1. Chuukou Ikkan!! Kimetsu Gakuen Monogatari (Junior High and High School!! Kimetsu Academy Story)\n\nVolume 2\n1. Jigoku no Oni Shuzai: Sanzu no Kawa wo Koete (Interview with the Demons in Hell: Crossing the River to the Underworld)\n2. Rengoku Zero-wa (Rengoku Chapter 0)\n3. Tanjirou no Kinkyou Houkokusho (An Update from Tanjiro)\n4. Micchaku! \"Kimetsu Gakuen\" ni Kayou Tanjirou no 1-nichi (New-Year Bonus Manga)\n5. Kimetsu no Dodai (Kimetsu: Behind the Scenes)", "Kimetsu no Yaiba Koushiki Fanbook: Kisatsutai Kenbunroku", "Demon Slayer: Kimetsu no Yaiba - Corps Records", "鬼滅の刃公式ファンブック 鬼殺隊見聞録", 1, "https://myanimelist.net/manga/143972/Kimetsu_no_Yaiba_Koushiki_Fanbook__Kisatsutai_Kenbunroku", null },
                    { 144345, null, 3, new DateTime(1992, 10, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/269826.jpg", 31542, null, new DateTime(1992, 2, 29, 16, 0, 0, 0, DateTimeKind.Local), 2, null, "Kidou Senshi Gundam 0083: Stardust Memory", null, "機動戦士ガンダム0083 STARDUST MEMORY", 1, "https://myanimelist.net/manga/144345/Kidou_Senshi_Gundam_0083__Stardust_Memory", 1 },
                    { 144387, "Kono Subarashii Sekai ni Shukufuku wo!: Fantastic Days is an adaptation of Sumzap's mobile game released on February 27, 2020. The light novel was published in English as Konosuba: God's Blessing on This Wonderful World! Fantastic Days by Yen Press under the Yen On imprint on July 18, 2023.", 9, null, "https://cdn.myanimelist.net/images/manga/3/262139.jpg", 9921, 6.93m, new DateTime(2022, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), 2, "Follow Kazuma and his party as they help a team of aspiring dancers, fight a former general of the Demon King, and more in a series of adventures based on the Fantastic Days game, along with new, unique content!\n\n(Source: Yen Press)", "Kono Subarashii Sekai ni Shukufuku wo!: Fantastic Days", "Konosuba: God's Blessing on This Wonderful World! Fantastic Days", "この素晴らしい世界に祝福を! ファンタスティックデイズ", 2, "https://myanimelist.net/manga/144387/Kono_Subarashii_Sekai_ni_Shukufuku_wo__Fantastic_Days", 1 },
                    { 144695, "Blue Lock: Episode Nagi has been published digitally as an English simulpub through K Manga. The volumes have also been published by Kodansha USA since October 15, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/1/269866.jpg", 900, 7.93m, new DateTime(2022, 6, 8, 17, 0, 0, 0, DateTimeKind.Local), 4, "A spin-off series of Blue Lock focusing on Seishirou Nagi and Reo Mikage.", "Blue Lock: Episode Nagi", "Blue Lock: Episode Nagi", "ブルーロック-EPISODE 凪-", 1, "https://myanimelist.net/manga/144695/Blue_Lock__Episode_Nagi", null },
                    { 144724, "Shinmai Ossan Boukensha, Saikyou Party ni Shinu hodo Kitaerarete Muteki ni Naru. began as web novel. The first offical volume was published on December 22, 2018 by Hobby Japan under the HJ Novels label.", null, null, "https://cdn.myanimelist.net/images/manga/1/279405.jpg", 34880, null, new DateTime(2018, 12, 21, 16, 0, 0, 0, DateTimeKind.Local), 4, "It is common knowledge that it is best to become an adventurer when you are as young as possible because the magical power that is the basis of an adventurer's strength will hardly grow if you don't train it while you are young. But this man, Rick Gladiator, who became an adventurer when he was over thirty years old, had the combat power of an S-rank adventurer, the highest rank in the world. In fact, Rick has lived an unimaginable life with the members of the legendary Orihalcon Fist, a party of the continent's strongest adventurers. From dragons to vampires, Rick's fighting prowess, trained by his literally \"monster\" mentors, allows him to defeat elite adventurers one after another who try to underestimate him.\n\n(Source: MU)", "Shinmai Ossan Boukensha, Saikyou Party ni Shinu hodo Kitaerarete Muteki ni Naru.", null, "新米オッサン冒険者、最強パーティに死ぬほど鍛えられて無敵になる。", 2, "https://myanimelist.net/manga/144724/Shinmai_Ossan_Boukensha_Saikyou_Party_ni_Shinu_hodo_Kitaerarete_Muteki_ni_Naru", null },
                    { 144847, "Trinity Seven: Revision has been published in English by Yen Press since April 16, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/3/263319.jpg", 34890, null, new DateTime(2019, 9, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, "When Rinka Shinonome, a new transfer student, arrives in high schooler Mitsunari Miyazawa's class, he immediately falls for her and asks her out...only to be impaled by a grotesque monster! The next day, he awakens to find it was all a dream...or was it? As it turns out, he's been reborn with the power of the Magus of Envy, and he'll be fighting alongside Rinka from now on! Will he be able to master his new abilities and protect his little sister from the fiends that once claimed his life?\n\n(Source: Yen Press)", "Trinity Seven: Revision", "Trinity Seven Revision", "トリニティセブン‐リヴィジョン‐", 1, "https://myanimelist.net/manga/144847/Trinity_Seven__Revision", null },
                    { 145006, "Mushoku Tensei: Eris wa Honki de Kiba wo Togu was published digitally in English as Mushoku Tensei: Jobless Reincarnation - Eris Sharpens Her Fangs by Square Enix through Manga UP!", 6, new DateTime(2022, 8, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/272565.jpg", 2906, 7.5m, new DateTime(2022, 3, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "After facing a devastating defeat at the hands of Dragon God Orsted at the Red Wyrm's Lower Jaw mountain range, Eris parts ways with Rudeus and makes her way to the Sword Sanctum in order to rectify her own inexperience as a swordsman. As the \"Mad Dog\" continues to hone her sword skills under the tutelage of the Sword God, her fangs continue to grow stronger and sharper!\n\n(Source: Square Enix)", "Mushoku Tensei: Eris wa Honki de Kiba wo Togu", "Mushoku Tensei: Jobless Reincarnation - Eris Sharpens Her Fangs", "無職転生～エリスは本気で牙を砥ぐ～", 1, "https://myanimelist.net/manga/145006/Mushoku_Tensei__Eris_wa_Honki_de_Kiba_wo_Togu", 1 },
