                    { 146284, null, 1, null, "https://cdn.myanimelist.net/images/manga/3/258941.jpg", 1359, 7.78m, new DateTime(2022, 4, 24, 17, 0, 0, 0, DateTimeKind.Local), 2, null, "Haikyuu!! Tokubetsu Bangai-hen: Matsuri Futatabi", "Haikyu!! Special One-shot: A Party Reignited", "ハイキュー!! 特別番外編 祭り再び", 3, "https://myanimelist.net/manga/146284/Haikyuu_Tokubetsu_Bangai-hen__Matsuri_Futatabi", null },
                    { 146520, "", 7, new DateTime(1999, 4, 14, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/259411.jpg", 28948, null, new DateTime(1998, 10, 14, 17, 0, 0, 0, DateTimeKind.Local), 2, "The ruler of the demon world Zenon gives the order to kill the humans. One of the four heavenly demons Amon however did not view humanity to be as weak as the others believed. This caused unease within the rest of the ranks and Amon escaped them before encountering a junior high student named Kei Kamishiro. The two made an agreement to work together by fusing together as the new identity Devilman.\n\n(Source: Mangadex)", "Toushin Devilman", null, "闘神デビルマン", 1, "https://myanimelist.net/manga/146520/Toushin_Devilman", 1 },
                    { 146554, null, null, null, "https://cdn.myanimelist.net/images/manga/3/272662.jpg", 28955, null, new DateTime(2021, 8, 25, 17, 0, 0, 0, DateTimeKind.Local), 4, null, "Kidou Senshi Gundam: Pulitzer - Amuro Ray wa Kyokkou no Kanata e", "Mobile Suit Gundam: Pulitzer - Amuro Ray Beyond the Aurora", "機動戦士ガンダム　ピューリッツァー　―アムロ・レイは極光の彼方に―", 1, "https://myanimelist.net/manga/146554/Kidou_Senshi_Gundam__Pulitzer_-_Amuro_Ray_wa_Kyokkou_no_Kanata_e", null },
                    { 146643, "Jujutsu Kaisen Bangai-hen was published in the 2022 #2 issue of Weekly Shounen Jump and was later included in the Jujutsu Kaisen 0.5 booklet, which was distributed at the Jujutsu Kaisen 0 Movie premiere on December 24, 2021. It was published digitally as an English simulpub as Jujutsu Kaisen Bonus Manga through MANGA Plus service.", 1, null, "https://cdn.myanimelist.net/images/manga/2/259446.jpg", 13059, 6.72m, new DateTime(2021, 12, 12, 16, 0, 0, 0, DateTimeKind.Local), 2, "After depleting their savings, the Tokyo Jujutsu High first-years—Yuuta Okkotsu, Maki Zenin, Toge Inumaki, and Panda—search for part-time jobs. When they all start working at a cosmetics store, they are visited by Utahime Iori, who appears to have some adult skin issues that the young students cannot understand.\n\n[Written by MAL Rewrite]", "Jujutsu Kaisen Bangai-hen", "Jujutsu Kaisen Bonus Manga", "呪術廻戦 番外編", 3, "https://myanimelist.net/manga/146643/Jujutsu_Kaisen_Bangai-hen", null },
                    { 146732, "Make Heroine ga Oosugiru! @comic has been published in English as Too Many Losing Heroines! by Seven Seas Entertainment since August 20, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/3/270079.jpg", 6164, 7.18m, new DateTime(2022, 4, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "The popular girls in Kazuhiko Nukumizu's class seem to have it all—good looks, lots of friends, and the hearts of all their crushes! Except...not?! Upon witnessing the shocking turn of events where the popular Anna Yanami gets friend-zoned by the boy who has crushed on her since childhood, Kazuhiko starts noticing all the fan favorites are getting similarly turned down by the boys they like. Surrounded by heartbroken heroines, can he keep their spirits up and make sure they don't give up? Or is this a rom-com world where the girls never get their dream guy?\n\n(Source: Seven Seas Entertainment)", "Make Heroine ga Oosugiru! @comic", "Too Many Losing Heroines!", "負けヒロインが多すぎる!@comic", 1, "https://myanimelist.net/manga/146732/Make_Heroine_ga_Oosugiru_comic", null },
                    { 146846, "", 20, new DateTime(2023, 10, 3, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/288429.jpg", 38196, null, new DateTime(2022, 3, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "Warriors and fighters, from all over the space-time, gather to participate in the Space-Time Ultra Tournament. Goku and his allies will face very powerful opponents.\n\n(Source: Dragon Ball Wiki)", "Super Dragon Ball Heroes: Ultra God Mission!!!!", null, "スーパードラゴンボールヒーローズ ウルトラゴッドミッション!!!!", 1, "https://myanimelist.net/manga/146846/Super_Dragon_Ball_Heroes__Ultra_God_Mission", 4 },
                    { 147070, "", 145, new DateTime(2020, 4, 2, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/260386.jpg", 29070, null, new DateTime(2017, 5, 21, 17, 0, 0, 0, DateTimeKind.Local), 2, "A Kinnikuman spin-off where Canadianman, Puripuriman, and Specialman sit at a restaurant and discuss things about the Kinnikuman universe.\n\n(Source: Mangadex)", "The Choujin-sama", null, "THE超人様", 1, "https://myanimelist.net/manga/147070/The_Choujin-sama", 5 },
                    { 147111, "", 9, null, "https://cdn.myanimelist.net/images/manga/2/289940.jpg", 32036, null, new DateTime(2022, 5, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "After a covert mission goes wrong, Mobile Suit pilot Amuro Ray and his comrades are stranded on a remote island. The battalion was sent to a land called the Island of No Return to clear off any enemy forces, only to find a group of children and an enemy mecha attack. Now Amuro must find a way for them all to escape this mysterious land, but not before meeting a strange man—Cucuruz Doan.\n\n(Source: Crunchyroll)", "Shousetsu Kidou Senshi Gundam: Cucuruz Doan no Shima", "Mobile Suit Gundam: Cucuruz Doan's Island", "小説 機動戦士ガンダム ククルス・ドアンの島", 2, "https://myanimelist.net/manga/147111/Shousetsu_Kidou_Senshi_Gundam__Cucuruz_Doan_no_Shima", 1 },
                    { 147192, "Slime Taoshite 300-nen, Shiranai Uchi ni Level Max ni Nattemashita Spin-off: Red Dragon Jogakuin has been published in English as I've Been Killing Slimes for 300 Years and Maxed Out My Level Spin-Off: The Red Dragon Academy for Girls by Yen Press since August 22, 2023.", null, null, "https://cdn.myanimelist.net/images/manga/3/271845.jpg", 35331, null, new DateTime(2021, 3, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "Laika has settled into the role of a rather prim young lady at the house in the highlands—but was she always that way? Or was she more of a hot-blooded dragon...as red as her scales? In the second spin-off of the Killing Slimes series, the school days of Azusa's oldest companion will be revealed!\n\n(Source: Yen Press)", "Slime Taoshite 300-nen, Shiranai Uchi ni Level Max ni Nattemashita Spin-off: Red Dragon Jogakuin", "I've Been Killing Slimes for 300 Years and Maxed Out My Level Spin-Off: The Red Dragon Academy for Girls", "スライム倒して300年、知らないうちにレベルMAXになってましたスピンオフ レッドドラゴン女学院", 1, "https://myanimelist.net/manga/147192/Slime_Taoshite_300-nen_Shiranai_Uchi_ni_Level_Max_ni_Nattemashita_Spin-off__Red_Dragon_Jogakuin", null },
                    { 148250, "", 12, new DateTime(1975, 2, 28, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/298187.jpg", 35510, null, new DateTime(1974, 11, 30, 16, 0, 0, 0, DateTimeKind.Local), 2, "Yuriko Nono attends a small gathering held by the mysterious Dracula. Little does she know that this is the beginning of the never-ending battle between her and him, as every time she defeats him, he rise back from his ashes to strike again. Various other monsters and ghouls get involved in Yuriko's struggle, leading to bizarre circumstances in which Dracula always manages to prevail.\n\n(Source: MU)", "Dracula-kun", null, "どらきゅらクン", 1, "https://myanimelist.net/manga/148250/Dracula-kun", 1 },
                    { 148251, "", 9, new DateTime(2015, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/299276.jpg", 29277, null, new DateTime(2013, 7, 26, 17, 0, 0, 0, DateTimeKind.Local), 2, "Spin-off of Lupin III depicting Ishikawa Goemon XIII.", "Juusandaime Ishikawa Goemon", null, "十三代目 石川五ェ門", 1, "https://myanimelist.net/manga/148251/Juusandaime_Ishikawa_Goemon", 2 },
                    { 148473, "", 5, new DateTime(1987, 12, 31, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/297153.jpg", 29309, null, new DateTime(1987, 1, 31, 16, 0, 0, 0, DateTimeKind.Local), 2, "An alternate retelling of the events from the original Zeta Gundam series. After The One Year War against the Principality of Zeon, Sayla Mass, Char Aznable's sister, was taken hostage by the titans whose main mission is to hunt down remnants of Zeon.\n\n(Source: MU)", "Side Story of Gundam Z", null, "サイド ストーリー オブ ガンダム Z", 1, "https://myanimelist.net/manga/148473/Side_Story_of_Gundam_Z", 1 },
                    { 148724, "", 18, new DateTime(2023, 8, 31, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/263938.jpg", 7634, 7.08m, new DateTime(2021, 7, 31, 17, 0, 0, 0, DateTimeKind.Local), 2, "A retelling of the main story from the perspective of Raphtalia.", "Tate no Yuusha no Nariagari: Girl's Side Story", null, "盾の勇者の成り上がり ～ガールズサイドストーリー～", 1, "https://myanimelist.net/manga/148724/Tate_no_Yuusha_no_Nariagari__Girls_Side_Story", 3 },
                    { 148912, "", 11, new DateTime(2016, 5, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/285335.jpg", 38608, null, new DateTime(2010, 10, 25, 17, 0, 0, 0, DateTimeKind.Local), 2, "A compilation of side stories from Kidou Senshi Gundam Unicorn.", "Kidou Senshi Gundam Unicorn Testament", "Mobile Suit Gundam Unicorn Testament", "機動戦士ガンダムUC テスタメント", 1, "https://myanimelist.net/manga/148912/Kidou_Senshi_Gundam_Unicorn_Testament", 2 },
                    { 149334, "Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san has been published digitally in English as Alya Sometimes Hides Her Feelings in Russian by Kodansha USA through K Manga since June 30, 2024.", null, null, "https://cdn.myanimelist.net/images/manga/1/277856.jpg", 1494, 7.75m, new DateTime(2022, 10, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "Masachika Kuze, an unmotivated first-year student attending the prestigious Seirei Academy, mostly spends his time playing gacha games or dozing off during lectures. Despite his reputation as an undisciplined loafer, he attracts the interest of Alisa Mikhailovna \"Alya\" Kujou, the esteemed \"solitary princess\" who sits next to him in class.\n\nAlya is deeply revered by her peers, and she captivates people everywhere she goes thanks to her entrancing looks and impeccable conduct. However, the beautiful half-Russian, half-Japanese girl has an adorable secret: while she constantly berates Masachika for his lax behavior, she conceals her true feelings with affectionate and flirtatious remarks in Russian.\n\nUnbeknownst to Alya, Masachika picks up every single one of her comments—for he is fluent in Russian! Bewildered by her enigmatic actions, Masachika decides to act clueless and play along, sparking an unconventional and heartwarming relationship with the charming girl.\n\n[Written by MAL Rewrite]", "Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san", "Alya Sometimes Hides Her Feelings in Russian", "時々ボソッとロシア語でデレる隣のアーリャさん", 1, "https://myanimelist.net/manga/149334/Tokidoki_Bosotto_Russia-go_de_Dereru_Tonari_no_Alya-san", null },
                    { 149898, "Captain Velvet Meteor: Jump+ Isekai no \"Shou\" Bouken - Dounyuu-hen was simulpub digitally in English as Captain Velvet Meteor: The Jump+ Dimensions - The Beginning by Manga PLUS.", 1, null, "https://cdn.myanimelist.net/images/manga/3/265889.jpg", 19624, 5.66m, new DateTime(2022, 7, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "An introductory one-shot for the hit game \"Captain Velvet Meteor: The Jump+ Dimensions\" available now!\n\n(Source: MANGA Plus)", "Captain Velvet Meteor: Jump+ Isekai no \"Shou\" Bouken - Dounyuu-hen", "Captain Velvet Meteor: The Jump+ Dimensions - The Beginning", "キャプテン・ベルベット・メテオ ジャンプ＋異世界の\"小\"冒険～導入編～", 3, "https://myanimelist.net/manga/149898/Captain_Velvet_Meteor__Jump__Isekai_no_Shou_Bouken_-_Dounyuu-hen", null },
                    { 150042, "One Piece 1000-wa Kinen! Tokubetsu Bangai-hen was created to celebrate One Piece's 1000th chapter.", 19, null, "https://cdn.myanimelist.net/images/manga/3/266234.jpg", 15756, 6.52m, new DateTime(2021, 1, 3, 16, 0, 0, 0, DateTimeKind.Local), 2, "Collection of 19 short stories, with the theme of pirates, by various Weekly Shounen Jump mangaka that had ongoing serializations in the 2021 #5-6 issue.", "One Piece 1000-wa Kinen! Tokubetsu Bangai-hen", null, "ONE PIECE 1000話記念! 特別番外編", 1, "https://myanimelist.net/manga/150042/One_Piece_1000-wa_Kinen_Tokubetsu_Bangai-hen", null },
                    { 150511, "", null, null, "https://cdn.myanimelist.net/images/manga/2/267443.jpg", 29777, null, new DateTime(2022, 7, 28, 17, 0, 0, 0, DateTimeKind.Local), 4, "Seven hundred years ago, half of humanity perished in the Great War in the Earth Sphere. Powerful weapons called Gundams, piloted by evolved humans called Newtypes, helped bring the war to an end, and became venerated as god-like guardians. Despite this, the Earth government considered Newtypes and Gundams to be a threat. Shortly after the war, the Newtypes were rounded up and banished to the space colony Cocytus, which was then gassed to kill its 10 million inhabitants and ejected from Earth's orbit.\n\nUnknown to the Earth government, some of the inhabitants of Cocytus survived the gassing, and they and their descendants built a new civilization within the colony as it drifted through deep space. In the present day, inside Cocytus, the infamous assassin Bloody Kaoris is captured and sentenced to public execution in the Imperial City of Gun Dorado, but the authorities do not realize that this is exactly what she wants.\n\n(Source: Gundam Wiki, edited)", "Kidou Zekki Gundam Sequel", "Despair Memory Gundam Sequel", "機動絶記ガンダム SEQUEL", 1, "https://myanimelist.net/manga/150511/Kidou_Zekki_Gundam_Sequel", null },
                    { 150846, "", 4, new DateTime(2023, 12, 18, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/302868.jpg", 39031, null, new DateTime(2022, 3, 18, 17, 0, 0, 0, DateTimeKind.Local), 2, "Set between Battle Tendency and Stardust Crusaders in 1973, a  research group from the Speedwagon Foundation is dispatched to Antigua, Guatemala under Lisa Lisa's orders to investigate the identity of a serial killer with an unknown power.\n\n(Source: JoJo Wiki)", "JoJo no Kimyou na Bouken: Mugen no Ou", null, "ジョジョの奇妙な冒険 無限の王", 5, "https://myanimelist.net/manga/150846/JoJo_no_Kimyou_na_Bouken__Mugen_no_Ou", 1 },
