                    { 151044, null, null, null, "https://cdn.myanimelist.net/images/manga/1/268790.jpg", 32861, null, new DateTime(2022, 9, 21, 17, 0, 0, 0, DateTimeKind.Local), 4, null, "Inochi no Tabekata", "How to Eat Life", "いのちの食べ方", 2, "https://myanimelist.net/manga/151044/Inochi_no_Tabekata", null },
                    { 151675, "Naruto: Sasuke Retsuden - Uchiha no Matsuei to Tenkyuu no Hoshikuzu was simulpub digitally in English as Naruto: Sasuke's Story - The Uchiha and the Heavenly Stardust: The Manga through MANGA Plus. The volumes were published by VIZ Media under the Shonen Jump imprint from June 11, 2024, to September 10, 2024.", 10, new DateTime(2023, 4, 22, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/276114.jpg", 8319, 7.03m, new DateTime(2022, 10, 22, 17, 0, 0, 0, DateTimeKind.Local), 2, "Sasuke Uchiha heads for an astronomical observatory, far from the Land of Fire. There, he syncs up with Sakura, and together they dive into an undercover investigation in search of traces of the Sage of Six Paths! They discover a plan that goes beyond life and death, and a battle that will test this husband-and-wife team till death do they part.\n\n(Source: VIZ Media)", "Naruto: Sasuke Retsuden - Uchiha no Matsuei to Tenkyuu no Hoshikuzu", "Naruto: Sasuke's Story - The Uchiha and the Heavenly Stardust: The Manga", "NARUTO-ナルト-　サスケ烈伝 うちはの末裔と天球の星屑", 1, "https://myanimelist.net/manga/151675/Naruto__Sasuke_Retsuden_-_Uchiha_no_Matsuei_to_Tenkyuu_no_Hoshikuzu", 2 },
