                    { 155003, "", 6, new DateTime(2020, 5, 25, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/2/284142.jpg", 30776, null, new DateTime(2019, 11, 25, 16, 0, 0, 0, DateTimeKind.Local), 2, "An adaptation of the Shishi no Kikan script/drama CD, which takes place between the events of Gundam Unicorn and Gundam Narrative and focuses on Riddhe Marcenas.", "Kidou Senshi Gundam Unicorn Episode EX2: Shishi no Kikan", null, "機動戦士ガンダムUC episode EX2 獅子の帰還", 1, "https://myanimelist.net/manga/155003/Kidou_Senshi_Gundam_Unicorn_Episode_EX2__Shishi_no_Kikan", 1 },
