                    { 155874, "", 11, new DateTime(2022, 7, 29, 17, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/276721.jpg", 33946, null, new DateTime(2021, 10, 29, 17, 0, 0, 0, DateTimeKind.Local), 2, "Tokyo, 2120. In a society overseen by the Sibyl System, Inspectors Arata Shindou and Kei Mikhail Ignatov of the Criminal Investigation Department's Unit One clash over truth and justice. Kouichi Azusawa, the mastermind behind a string of crimes, sets his sights on the CID itself and launches an assault on the NONA Tower. Division 01 (a.k.a. Unit One) is in peril like never before—a case that will try Shindou and Ignatov's loyalties.\n\n(Source: Psycho-Pass Wiki)", "Psycho-Pass 3: First Inspector", null, "PSYCHO-PASS 3 FIRST INSPECTOR", 1, "https://myanimelist.net/manga/155874/Psycho-Pass_3__First_Inspector", 2 },
