                    { 161679, "", null, null, "https://cdn.myanimelist.net/images/manga/2/286810.jpg", 34199, null, new DateTime(2019, 8, 14, 17, 0, 0, 0, DateTimeKind.Local), 4, "I've never been able to stand the typical heroine's \"goody-two-shoes\" routine. Thankfully, all my dreams come true when I'm reincarnated as a villainess! Determined to become a woman no one can criticize, I do my best to train my body, improve my intellect, and hone my magical skills. But for some reason, the harder I try, the more everyone seems to like me! No matter—I'll betray their every expectation and become the greatest villainess the world has ever known!\n\n(Source: Yen Press)", "Rekishi ni Nokoru Akujo ni Naru zo: Akuyaku Reijou ni Naru hodo Ouji no Dekiai wa Kasoku suru you desu!", "I'll Become a Villainess Who Goes Down in History", "歴史に残る悪女になるぞ 悪役令嬢になるほど王子の溺愛は加速するようです!", 2, "https://myanimelist.net/manga/161679/Rekishi_ni_Nokoru_Akujo_ni_Naru_zo__Akuyaku_Reijou_ni_Naru_hodo_Ouji_no_Dekiai_wa_Kasoku_suru_you_desu", null },
