                    { 162007, "", null, null, "https://cdn.myanimelist.net/images/manga/2/290992.jpg", 35355, null, new DateTime(2023, 3, 21, 17, 0, 0, 0, DateTimeKind.Local), 4, "​The cyberpunk metropolis Shinjuku—a massive city-state bedecked with neon signs, towering skyscrapers, and the latest cutting-edge technology. It is here, in year 2099 of the Fused Era, where the legendary Demon Lord Veltol has his second coming five centuries in the making. But this landscape is nothing like the one he conquered all those years ago, for the fusion of magic and engineering has elevated civilization to dazzling, unprecedented heights. Veltol may have been reduced to a historical footnote, but make no mistake...this brave new world will be his for the taking!\n\n(Source: Yen Press)", "Maou 2099", "Demon Lord 2099", "魔王2099", 1, "https://myanimelist.net/manga/162007/Maou_2099", null },
