                    { 166056, "", 12, new DateTime(2011, 1, 17, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/3/294917.jpg", 27595, null, new DateTime(2010, 2, 17, 16, 0, 0, 0, DateTimeKind.Local), 2, "Kobato-kun and Osanai-san are now in their second year of high school. They are hiding their \"fox\" and \"wolf\" identities and are aiming to be regular citizens, but this summer there is a disquieting atmosphere in the air.\n\n(Source: Square Enix, translated)", "Kaki Gentei Tropical Parfait Jiken", "The Special Tropical Parfait Case", "夏期限定トロピカルパフェ事件", 1, "https://myanimelist.net/manga/166056/Kaki_Gentei_Tropical_Parfait_Jiken", 2 },
                    { 166058, "", null, null, "https://cdn.myanimelist.net/images/manga/1/294921.jpg", 39525, null, new DateTime(2004, 12, 17, 16, 0, 0, 0, DateTimeKind.Local), 4, "\"Let's help each other and aim to become perfect ordinary citizens.\"\n\nKobato, who once had a bitter experience through deduction activities known as \"wisdom work,\" was determined to become an honest and humble citizen. He secretly formed a reciprocal relationship with his classmate, Osanai, who shared the same aspiration, planning to make their high school debut as ordinary citizens and lead peaceful days. However, for some reason, mysterious incidents and misfortunes keep coming one after another into their school lives. Will Kobato and Osanai be able to achieve peaceful days as ordinary citizens?\n\n(Source: MAL News)", "Shoushimin Series", null, "小市民シリーズ", 5, "https://myanimelist.net/manga/166058/Shoushimin_Series", null },
                    { 166075, "Kidou Senshi Gundam: Battle Operation Code Fairy is an adaptation of the video game of the same title.", null, null, "https://cdn.myanimelist.net/images/manga/1/297718.jpg", 33297, null, new DateTime(2021, 12, 23, 16, 0, 0, 0, DateTimeKind.Local), 4, "With the North American front turning into a lost cause in the late stages of the One Year War, Kycillia Zabi secretly puts together an elite mobile suit squadron, later nicknamed \"Noisy Fairy\" because it only contained female members. After many battles the Fairies create a legendary reputation, form unbreakable bonds with each-other and stand against a Federation squad created to take them out: \"Witch Hunt Squadron.\"", "Kidou Senshi Gundam: Battle Operation Code Fairy", "Mobile Suit Gundam: Battle Operation Code Fairy", "機動戦士ガンダム バトルオペレーション コード・フェアリー", 1, "https://myanimelist.net/manga/166075/Kidou_Senshi_Gundam__Battle_Operation_Code_Fairy", null },
                    { 166574, "Shin no Nakama ni Narenakatta Ohimesama wa, Henkyou de Slow Life suru Koto ni Shimashita has been published digitally in English as Rejected by the Hero's Party, a Princess Decided to Live a Quiet Life in the Countryside by Yen Press since August 20, 2024.", 19, new DateTime(2024, 1, 23, 16, 0, 0, 0, DateTimeKind.Local), "https://cdn.myanimelist.net/images/manga/1/296101.jpg", 33396, null, new DateTime(2021, 10, 19, 17, 0, 0, 0, DateTimeKind.Local), 2, "Before she reunited with Red in the quiet town of Zoltan, Princess Rizlet of Loggervia was renowned not only as royalty but as the brave warrior Rit. She even enlisted as a mercenary to defend her home against the demon lord before the Hero's party stepped in! But after going their separate ways, she finds herself...suddenly thrown out of her own country?! Now Rit has no choice but to embrace her new, untethered life as an adventurer, traveling wherever the wind blows—though who knows where in Avalon she'll end up...\n\n(Source: Yen Press)", "Shin no Nakama ni Narenakatta Ohimesama wa, Henkyou de Slow Life suru Koto ni Shimashita", "Rejected by the Hero's Party, a Princess Decided to Live a Quiet Life in the Countryside", "真の仲間になれなかったお姫様は、辺境でスローライフすることにしました", 1, "https://myanimelist.net/manga/166574/Shin_no_Nakama_ni_Narenakatta_Ohimesama_wa_Henkyou_de_Slow_Life_suru_Koto_ni_Shimashita", 3 },
